(2, '{6C259339-1A07-40BC-9A97-D6BDCD986F86}', 'MCE Keyboard', 'Enables media buttons work on MCE keyboard and remote', '', 'Input', 'None', 'Freeware', 'Stable', '2007-05-14 18:30:31', '1.0', 'mike hopewell', 'meedio@mikehopewell.co.uk', '', 'Mike Hopewell', '', 'plugins/{6C259339-1A07-40BC-9A97-D6BDCD986F86}/1.0/stable/MCE_Keyboard_1.0_Stable.mpp', '35022', '', '', '', 1000000000000000000, 1, 'This is an input plugin so simply need to install.  To assign keys to commands simply learn as normal but now the extra keys should be identified', 'MCEKeyboard', '', '', '', '', '0', '1', 1204, 1204, 0, 0, 0, 0, '4b307e1e757f9ee0b66a6cbea9b9de1f', 'FALSE'),
(3, '{7638F89D-FB08-417C-A23E-FDD8C2BF866C}', 'PandoraMee', 'pandora.com Music Player', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:49', '2.02', 'Maarten Klaassen', 'maartenklaassen@gewoonthuis.nl', '', '2006, Maarten Klaassen', '', 'plugins/{7638F89D-FB08-417C-A23E-FDD8C2BF866C}/2.02/stable/PandoraMee_2.02_Stable.mpp', '539336', '', '', 'readme.htm', 2002000000000000000, 1, 'A plugin to play Pandora.com radio stations', 'PandoraMee', 'https://www.paypal.com/cgi-bin/webscr?cmd=_xclick&business=maartenklaassen%40gewoonthuis%2enl&no_shipping=0&no_note=1&tax=0&currency_code=EUR&bn=PP%2dDonationsBF&charset=UTF%2d8', '', '', '', '0', '0', 1264, 1373, 0, 0, 0, 0, '4eb2493801b8323ecb0c35042638ffa7', 'FALSE'),
(4, '{798F4DB0-7642-4669-AFED-4379CA7B5546}', 'Webscheduler Captures Importer', 'Imports Webscheduler Video Captures XML info.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 18:30:32', '1.5', 'John Calvi', 'jcalvi at lewis dot com dot au', 'Calvi', 'John Calvi, 2006', '', 'plugins/{798F4DB0-7642-4669-AFED-4379CA7B5546}/1.5/stable/Webscheduler_Captures_Importer_1.5_Stable.mpp', '348510', '', '', 'readme.txt', 1005000000000000000, 0, 'Webscheduler Captures Importer, by John Calvi, Copyright 2006.\r\n\r\nThis plug-in checks for xml files generated by Webscheduler and if they exist writes the tags into the Meedio Library. This importer should be chained after a standard importer, eg. Task Mask Importer.\r\nNo special rules are required for the Tag Mask importer and you can still use images etc. All options in the WS Captures importer complement those in the Task Mask importer.\r\n\r\n\r\nRefer Readme.txt File', 'WSCaptures', 'http://web.aanet.com.au/calvi/meedio', '', '', '', '0', '0', 88, 851, 0, 0, 0, 0, '0ca7a02491d0e717a21180a3343425c3', 'FALSE'),
(5, '{98F63347-B65D-4C8E-900C-0C0934D7EFF2}', 'WebScheduler DataFeeds', 'Publishes WebScheduler Current Capture Status as Datafeeds.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 18:30:32', '2.2', 'John Calvi', 'jcalvi at lewis dot com dot au', 'Calvi', 'John Calvi, 2005/6', '', 'plugins/{98F63347-B65D-4C8E-900C-0C0934D7EFF2}/2.2/stable/WebScheduler_DataFeeds_2.2_Stable.mpp', '147432', '', '', 'readme.txt', 2002000000000000000, 0, 'Webscheduler DataFeeds, by John Calvi, Copyright 2006.\r\n\r\nThis plugin implements Datafeeds parsed from the nowrunning.xml file generated by Webscheduler. These feeds can be used to display the current capture status of Multiple DVB cards operating under Webscheduler.\r\nEither Meedio-Helper or Import Scheduler Plugin is required to handle automatic import updating.\r\n\r\n\r\nThe datafeeds available are......\r\n\r\nname : The name of the capture\r\nstart : The start date/time of the capture\r\nstop : The stop date/time of the capture\r\nduration : The duration of the capture\r\nfilename: The filename of the capture (not the path)\r\nchannel : The channel being captured\r\npercent: The percent complete status of the capture\r\n\r\nEach feed is referenced by card number as follows, if you have 3 cards then the feeds for name are....\r\nname0, name1 & name2 for cards 1,2 & 3 Respectively.\r\n\r\nRefer Readme.txt File', 'WSDatafeeds', 'http://web.aanet.com.au/calvi/meedio', '', '', '', '0', '0', 79, 685, 0, 0, 0, 0, '4eb790aadf58d63aab494ef342d314ce', 'FALSE'),
(6, '{9BC27EB5-B3B0-4911-A744-47F2DE9E1369}', 'zCloseOnExit', 'Terminates processes and broadcasts screen size to windows on close.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 18:30:32', '1', 'reverson1', 'richardeverson@hotmail.com', 'reverson1', '2007', '', 'plugins/{9BC27EB5-B3B0-4911-A744-47F2DE9E1369}/1/beta/zCloseOnExit_1_Beta.mpp', '11476', '', '', '', 1000000000000000000, 1, 'Terminates the specified processes when Meedio closes. Also, rebroadcasts to windows the current screen size.\n\nNOTE:\nMay fix problems with errors on Meedio''s exit.', 'zCloseOnExit', '', '', '1.41', '1.41', '0', '0', 1026, 1026, 0, 0, 0, 0, '7f82bca73b603d5c22b1df6adda4a70c', 'FALSE'),
(7, '{F0CBE47A-9912-4DD1-ADB2-049A1AF03899}', 'StartMeeUp', 'Run Importers and/or Hide Meedio at Startup.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 18:30:32', '1.1', 'John Calvi', 'jcalvi at lewis dot com dot au', '', 'John Calvi, 2006', '', 'plugins/{F0CBE47A-9912-4DD1-ADB2-049A1AF03899}/1.1/stable/StartMeeUp_1.1_Stable.mpp', '3755', '', '', 'readme.txt', 1001000000000000000, 1, 'StartMeeUp, by John Calvi, Copyright 2006.\n\nThis plugin will run a series of importers at startup, after a delay and repeating, also cycles music visualizations and hide the Meedio Application if desired afterwards.\n\nThe plugin can be used in a primary Meedio instance for the visualizations and for use with a secondary meedio instance used for importer running.\n\n\n\nRefer Readme.txt File', 'StartMeeUp', 'http://web.aanet.com.au/calvi/meedio', '', '', '', '0', '0', 467, 467, 0, 0, 0, 0, 'd431525045687a35281aac644ace4b6b', 'FALSE'),
(8, '{0025B281-CE64-4453-95A4-0A9573F5BD8E}', 'TvT Importer', 'Imports data from TvTome from Tag Files import library (from your episodes on disk)', '', 'Import', 'None', 'Donationware', 'Alpha', '2007-05-14 16:35:17', '1.22', 'Jonathan Trevor', 'jonathan.trevor@gmail.com', '', '', '', 'plugins/{0025B281-CE64-4453-95A4-0A9573F5BD8E}/1.22/alpha/TvT_Importer_1.22_Alpha.mpp', '83727', '', '', '', 1022000000000000000, 1, 'Importer works in conjunction with a Tag Mask File importer. It uses various tags returned by the Tag Mask File importer to create three additional media sections:\n* TVOD-Shows\n* TVOD-Episodes\n* TVOD-People\nThese contain entries with the show, episode and person information corresponding to the information provided by the task mask importer.\nNotes on the base Tag Mask File Importer\nExtract some of the following special tags to let the TvTome importer how to look for information on TvTome corresponding to that file. Tags:\n* SeriesTitle [REQUIRED]\n* SeasonNumber [+EpisodeNumber]\n* EpisodeNumber [+SeasonNumber]\n* EpisodeTitle\n* FirstAired\n* SeriesEpisodeNumber\n* ShowId\n* EpisodeId\n* Day, Month, Year (to construct first aired dates if different from default system date layout, e.g. UK vs US)\nCommon valid combinations to get data include:\n* SeriesTitle + SeasonNumber + EpisodeNumber\n* SeriesTitle + FirstAired\n* SeriesTitle + SeriesEpisodeNumber\n* SeriesTitle + EpisodeTitle [currently an exact match is used]\n\nIf a file listed in the tag mask importer does not have an associated show or episode it gets classified as a special \\\\\\"unclassified\\\\\\" show so you can always play something.\n\nIntelligently tries to keep file data on the disk and information in the TVOD tables up-to-date.', 'TvT_Importer', '', '', '', '', '0', '1', 270, 270, 0, 0, 0, 0, '0dd7a9d2e55b3fa2dba06390ceef29b1', 'FALSE'),
(9, '{0034C3C9-A21F-449F-BB49-A8C11E4B23E0}', 'EmailMee', 'Other plugins can use this plugin to send Email messages.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:25', '2.1', 'walts81', 'joshwalters@gmail.com', 'walts81', '2006', '', 'plugins/{0034C3C9-A21F-449F-BB49-A8C11E4B23E0}/2.1/stable/EmailMee_2.1_Stable.mpp', '28084', '', '', '', 2001000000000000000, 0, 'Other plugins can use this plugin to send email messages. \nThis plugin listens for the message "emailmee.send-email"\n\n\nThat message will need a few things attached to it....\n\n\n-----Mandatory Values-----\n\nemail.subject\n\nemail.message\n\n--------------------------\n\n\n\n-----Optional Values-----\n\nemail.to-address\n\nemail.from-address\n\nemail.attachment\n\nemail.format\n\n-------------------------\n\n\n\nemail.to-address and email.attachment can optionally be added to items in an item-list attached to the message for either sending to multiple recipients or sending multiple attachments (or both).\n\n\n\nemail.from-address can be set to anything (as long as it is in standard email address format ex. "someone@someplace.com"). If nothing is entered for email.from-address, "MeediOS.Support@gmail.com" will be used as a default.\n\n\nemail.attachment should be the path to the file\n\nemail.format can be set to either "text" or "html" (default is "text").', 'EmailMee', 'http://www.MeediOS.com/maid', '', '', '', '0', '1', 240, 1622, 0, 0, 0, 0, 'b4012c76bc5c4e5d98ff56aa03984f70', 'FALSE'),
(10, '{00B92841-10AF-42B1-80FF-9CE92CE2E74E}', 'BreakingNews', 'A module that allows other modules to report breaking news.  This module requires the NewsTicker, by Dee, to be useful.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:16', '1.135', 'deria', 'deria@sourceforge.net', '', '(c) 2005 Electric Storm Software', '', 'plugins/{00B92841-10AF-42B1-80FF-9CE92CE2E74E}/1.135/stable/BreakingNews_1.135_Stable.mpp', '46036', '', '', '', 1135000000000000000, 1, 'The BreakingNews plugin is a rather simple plugin; on its own, it does nothing at all.  The purpose of this plugin is to serve the communication needs of other plugins.  It allows other plugins to send it messages and exports those messages to a file (in the XML format) that is suitable for use with Dee''s very slick scrolling NewsTicker module.  \n\nQ:  As a user, why would you want to use this module?\n\nA:  There are many events that can occur on your computer that are interesting enough that you want to know about them immediately.  If the weather forecast has been updated, and it is significantly different from the previous forecast, wouldn''t you want to know that immediately?  If one of the hard disks on your system is running low on space, wouldn''t you want ot know that immediately?  If the temperature of your CPU is rising rapidly, wouldn''t you want to know that?  The BreakingNews plugin makes it possible for plugin developers to pass important information on to you, the user.\n\nQ:  As a developer, Why would you want to use this module?\n\nThere are limitless possabilities.  If there is a message you want the user to see immediately, this is an effective and unobtrusive way of transmitting it.  It does not matter what the message is -- if you feel that it is important enough that the user should see it, you can send it!\n\nFor information on downloading, installing, and configuring BreakingNews, please refer to the readme.txt file.', 'BreakingNews', '', '', '', '', '0', '1', 1098, 1098, 0, 0, 0, 0, '70b3526ad8eb69334b280b423ee1d7cd', 'FALSE'),
(11, '{010EC394-7ED8-4FFB-81EB-2462F8C9DCB1}', 'Raydee-o-browser', 'Listen to internet radio stations. Note: Raydee-o-player plug-in is also required.', '', 'Module', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:51', '0.9.1', 'Neil Dunlop', 'raydeeo at roachmill dot plus dot com', '', '', '', 'plugins/{010EC394-7ED8-4FFB-81EB-2462F8C9DCB1}/0.9.1/beta/Raydee-o-browser_0.9.1_Beta.mpp', '119401', '', '', 'Readme.html', 9001000000000000, 1, 'Raydee-o-browser is a Meedio module used to browse a library of your favourite internet radio stations and search for new ones available from Shoutcast. Selecting an item from the module tells the Raydee-o-player plug-in to play it.\n\n=================\nSystem Requirements\n=================\nRequired:\nRaydee-o-player plug-in.\nMicrosoft .Net Framework 1.1 SP1.', 'Raydee-o', 'http://www.meedio.com/forum/viewtopic.php?t=18540&start=0&postdays=0&postorder=asc&highlight=', '', '', '', '0', '1', 730, 730, 0, 0, 0, 0, '1f5c91bda3d09de401ca5860b01e6ceb', 'FALSE'),
(12, '{01E9E9C3-A55F-4B01-B454-CB49B07E7679}', 'Smart Series Sorter', 'Smartly parses your TV episodes from your largely-unsorted archive; ready for meeTvShows.', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:59', '2.0.1', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64', '', 'plugins/{01E9E9C3-A55F-4B01-B454-CB49B07E7679}/2.0.1/stable/Smart_Series_Sorter_2.0.1_Stable.mpp', '50660', '', '', '', 2000001000000000000, 1, '1. Use this importer instead of your Tag File Importer or similar.\n2. Add some sorted directories.\n\nSo if you add "O:\\MySeries", you should also have the following sub-directories \nin it:\n\nO:\\MySeries\\Lost\\\nO:\\MySeries\\4400, The\\\netc\n\nThis adds ''Lost'' and ''4400, The'' as your "sorted" or "authorised" series. This will rename episodes such as "the.4400" into "4400, The" for example.\n\nHint: the first sorted directory will get all unauthorised series dumped into it (if that option is on.. read on).\n\n3. Add some dump dirs.\n\nThese directories will contain a whole heap of files - named in radically different formats. All files in dump dirs should be finished downloading.\n\n4. Perform Moves : NOT IMPLEMENTED. Use the upcoming win32 v2.0 for this for now.\n\n5. Only import sorted series : if enabled, only series which you have defined by creating a sub-dir inside a sorted dir, will be added to the current section. If disabled, the SeriesName''s generally become erratic and un-uniform.\n\n6. File exensions : These are files that get parsed, so it will ignore your files such as *.zip in your dump dirs..\n\nThat''s it! I included some delays before and after disk I/O in the hope that it doesn''t interuppt your Meedio viewing experiance.', 'SmartSeriesImporter', 'http://www.skyforge.net/~slug/', '', '', '', '0', '1', 1293, 3847, 0, 0, 0, 0, '498ae4c38808ed02b9abbd613db76619', 'FALSE'),
(13, '{026F5F0B-7C13-4AAC-88E3-66C04DA4A19C}', 'WeatherXtra', 'Different Weather Module Look', '', 'Module', '', 'Donationware', 'Stable', '2007-05-14 16:35:21', '1.3.1', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'Paypal - UFGrayMatter@gmail.com', '', 'plugins/{026F5F0B-7C13-4AAC-88E3-66C04DA4A19C}/1.3.1/stable/WeatherXtra_1.3.1_Stable.mpp', '1407361', '', '', '', 1003001000000000000, 0, 'Copy weatherforecast.template to your theme folder', 'WeatherXtra', 'http://www.MeediOS.com/', '', '', '', '0', '1', 135, 4054, 0, 0, 0, 0, '32dff6de21bdf9ea0a32432217a3ea8c', 'FALSE'),
(14, '{03AE46DA-FD8F-4E70-A676-7FA4541658F1}', 'Rhapsodee General Plugin', 'Allows proper playback and control of Rhapsody.', '', 'General', 'None', 'Donationware', 'Beta', '2007-05-14 16:34:54', '0.1', 'StrataG', 'stratag@gmail.com', '', 'StrataG', '', 'plugins/{03AE46DA-FD8F-4E70-A676-7FA4541658F1}/0.1/beta/Rhapsodee_General_Plugin_0.1_Beta.mpp', '24380', '', '', '', 1000000000000000, 1, 'This is a general plugin that controls the playback functions of Rhapsody.  You need to install the Rhapsody service in the RealSlim package (http://realslim.sourceforge.net).  You will also need to replace the RhapsodyHook.dll in the Rhapsody directory with my modified one in order to interact with this plugin.  This can be found in the support forums.\n\nAs of right now, you must have Rhapsody (as well as the Realslim service) running on a seperate machine than the one playing back the music.  This will be rectified in future versions.  I had a work around which got nullifed with the new version of Meedio which controls the system volume rather than player volume.  \nThe Rhapsody host must be able to accept TCP connections on port 8081, and the computers running Meedio must be able to accept UDP connections on port 8082.I chose to use UDP as this plugin''s listening port to speed up the communications until I can clean up the process.  It may eventually use TCP.  The ports on both machines will also eventually be configurable.\n\nSuggested:\nGet my UPnPEE plugin to import your playlists and/or tracks from Rhapsody.', 'Rhapsodee', '', '', '.01', '1.0', '0', '1', 526, 526, 0, 0, 0, 0, '80c4698971880579de5271b3f8ba0b48', 'FALSE'),
(15, '{04DBB9D1-E738-4A7F-8DB9-E545A9729F6E}', 'GCTV Default', 'Theme that supports GCTV Minimize.', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:29', '1.0', 'Copied From Default Theme', 'support@gotchacoveredonline.com', '', '', '', 'plugins/{04DBB9D1-E738-4A7F-8DB9-E545A9729F6E}/1.0/stable/GCTV_Default_1.0_Stable.mpp', '2437529', '', '', '', 1000000000000000000, 1, 'Install and enjoy!', 'GCTVdefault', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1261, 1261, 0, 0, 0, 0, '9022a1a8d60299313516e4a63295c8b2', 'FALSE'),
(16, '{0512EBF5-4E4B-45D6-885E-CC0A408C09D6}', 'File Browser Helper', 'Adds features to the Media module and File Browser module', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:27', '1.3', 'Anders Malmgren', 'anders.malmgren@dac.se', '', '2005 DAC Ltd', '', 'plugins/{0512EBF5-4E4B-45D6-885E-CC0A408C09D6}/1.3/stable/File_Browser_Helper_1.3_Stable.mpp', '370642', '', '', 'help.pdf', 1003000000000000000, 1, 'This is a combination of some of my other plugins and some new feature.\n\nCheck button.txt to for examples on action buttons that you can define\n\nThese are the messages you can send to it:\n*''fhelper.deleteitem'' with the keys ''section'' and ''id''\n  Deletes the item from disk and from library\n*''fhelper.import'' with the key ''section''\n  Runs the import for the section and refresh the module\n*''fhelper.emptybin''\n  Flush the Recycle Bin\n*''fhelper.unrar'' with the key ''file''\n  Unrars the selected file (check the .pdf in the plugin folder for details on this feature)\n*fhelper.sfvcheck with the key ''file''\nRuns a CRC32 check on all files in file (Use the same procedure as described in unrarmee.pdf)\n*''fhelper.delete'' with the key ''file''\n  Deletes the selected file or folder\n*''fhelper.txtview'' with the key ''file''\n  Displays the txt-file, useful for nfo''s', 'FileBrowserHelper', '', '', '', '', '0', '0', 1697, 1697, 0, 0, 0, 0, '8585ae9091882190ab266bc1aec499c1', 'FALSE'),
(17, '{051A8749-E026-40DC-A51C-4DE8386DBB56}', 'Hide Mouse And Taskbar', 'Enables meedio to hide Mouse AND/OR Taskbar.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:34', '1.0', 'CyberVillain', 'anders@dac.se', 'CyberVillain', '2005 DAC Ltd', '', 'plugins/{051A8749-E026-40DC-A51C-4DE8386DBB56}/1.0/stable/Hide_Mouse_And_Taskbar_1.0_Stable.mpp', '6642', '', '', '', 1000000000000000000, 1, 'Meedio includes mousehide, but it is still sometimes visable during video. This plugin hides the pointer global.', 'HideMTB', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1381, 1381, 0, 0, 0, 0, '3432ad0175f1a3e080a135d1338a90f4', 'FALSE'),
(18, '{054B3E51-D8E4-4364-AC4E-DE011BD36F01}', 'BeyondMCE', 'Goes beyond Windows Media Center Edition. This theme is designed for good legibility on TV. Suitable for all: widscreen and standard aspect ratio support, multiple resolutions, and touchscreen support.', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:16', '1.11', 'arman68', 'arman.rastaman@mail.com', '', '2006 arman68', '', 'plugins/{054B3E51-D8E4-4364-AC4E-DE011BD36F01}/1.11/stable/BeyondMCE_1.11_Stable.mpp', '11929997', '', '', 'BeyondMCE.txt', 1011000000000000000, 1, 'Main Features\n_ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _\n\n* General\n  + global music control: play-pause/fwd/rwd/next/prev available everywhere\n  + clock visible from all screens\n  + dynamic section title added in the background display\n  + now playing information shows song rating if available\n  + designed for good visibility on TV\n\n* Picture library\n  + use all screen width for displaying the tumbnails\n  + bigger thumbails\n\n* Movie library\n  + use all screen width for displaying the tumbnails\n  + bigger thumbails\n\n* Music library\n  + shows song rating if available\n  + song ratings can be adjusted on the fly in music library, and now playing (using keys 1,2,3,4,5)\n  + new views to show folder pictures (eg: artist, genre) with standard music library\n  + album art is shown alongside song list\n  + search results show more info (song, artist, album, year, track, rating)\n  + playlists show more info (song, artist, rating)\n\n* Weather\n  + horizontal display\n\n\nHistory\n_ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _\n\nv1.11\n+ added support for widescreen format\n+ added support for various resolutions\n+ added support for touchscreen', 'BeyondMCE', '', '', '', '', '0', '0', 8555, 8555, 0, 0, 0, 0, '250b6e8e08d6b80844935df6423ba192', 'FALSE'),
(19, '{063473A8-6DEA-4F32-8FE2-8D3D5B19B86D}', 'Meedio Helper', 'Expands Meedio with some basic functions', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:54', '2.0.4', 'Jelle Hissink', 'MeedioHelper@Onshuis.tk', '', 'Copyright 2004 Jelle Hissink. All Rights Reserved.', '', 'plugins/{063473A8-6DEA-4F32-8FE2-8D3D5B19B86D}/2.0.4/stable/Meedio_Helper_2.0.4_Stable.mpp', '72073', '', '', '', 2000004000000000000, 1, 'This plugin enables other plugins and theme-developers to access features of Meedio that did not exist ;-)\nSee the support thread for some examples and discussions.\n\nNote: this plugin should be installed if another one asks for it, it on itself is useless!', 'MeedioHelper', '', '', '', '', '0', '1', 2826, 2826, 0, 0, 0, 0, '112ef95f45f861ee7c00ae2dc31195f1', 'FALSE'),
(20, '{06AFB522-8E49-4947-975C-8DB84C6C41C1}', 'MixedCasee', 'Forces existing tag text into mixed case. First letter of everyword becomes upper case unless the entire word is uppercase. mIxeD CASE becomes: Mixed CASE', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:31', '1.11', 'Seb', 'n/a', '', '', '', 'plugins/{06AFB522-8E49-4947-975C-8DB84C6C41C1}/1.11/stable/MixedCasee_1.11_Stable.mpp', '4229', '', '', '', 1011000000000000000, 1, '', 'MixedCasee', '', '', '', '', '0', '1', 778, 778, 0, 0, 0, 0, '8f8a77719eb100bb0f308810823fe9e3', 'FALSE'),
(21, '{07D18A2A-8242-4396-8B61-A20249E8E0B2}', 'Raydee-o-player', 'Play internet radio stations. Note: Raydee-o module is also required.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:51', '0.9.1', 'Neil Dunlop', 'raydeeo at roachmill dot plus dot com', '', '', '', 'plugins/{07D18A2A-8242-4396-8B61-A20249E8E0B2}/0.9.1/beta/Raydee-o-player_0.9.1_Beta.mpp', '294680', '', '', 'Readme.html', 9001000000000000, 1, 'Raydee-o-player is a full time plug-in that can play asx, pls, rpm, ram and many more formats of internet radio streams. In order to use Raydee-o-player you will also need the Raydee-o-browser module.\n\n=================\nSystem Requirements\n=================\nRequired:\nRaydee-o-browser module.\nInternet connection.\nMicrosoft .Net Framework 1.1 SP1.\n\nOptional:\nWindows Media Player 9 (www.microsoft.com) , RealPlayer 10 (www.real.com) and / or WinAmp (www.winamp.com) in order to support your chosen radio stram formats.', 'Raydee-o-player', 'http://www.meedio.com/forum/viewtopic.php?t=18540&start=0&postdays=0&postorder=asc&highlight=', '', '', '', '0', '1', 1099, 1099, 0, 0, 0, 0, '1c9a5e92f40751cfa0f04239c9fb508b', 'FALSE'),
(22, '{089C0183-1B32-4946-91AE-EA63E6365413}', 'ScriptMee', 'ScriptMee lets you run scripts. (pascal syntax)', '', 'General', '', 'Freeware', 'Beta', '2007-05-14 16:34:57', '0.5.3', 'Michael Wisniewski', 'Goldrush@web.de', 'DocZoidberg', '2006 Michael Wisniewski', '', 'plugins/{089C0183-1B32-4946-91AE-EA63E6365413}/0.5.3/beta/ScriptMee_0.5.3_Beta.mpp', '482718', '', '', '', 5003000000000000, 0, 'This is the general plugin version of my TagManipulation importer plugin.\n\nWith this plugin you can run scripts written in pascal syntax and use some of the most useful Delphi functions, have access to the complete Meedio API, add OCX controls...  The plugin provides you with an editor to support you writing scripts.\n\nUsage:\n\nThis has changed. First activate the plugin in Meedios configuration app in the fulltime plugins tab. The plugin has only one custom property that will open the scriptsmanager window you might already know from the importer plugin.\nBut in the general plugin you can only add scripts to the list so you can easily open them again. This window has no influence on the launching of your scripts as it had in the importer version of the plugin. From this window you can open the scriptseditor with the button or by doubleclicking one of the scripts you added to the list. Your scripts now all get into ...\\Meedio\\data\\ScriptMee\\Scripts.\nYou can use the scripteditor the same way you would with the importer but as there is no IMeedioSystem  reference you would get errors if you try to run a script using any Meedio API function. (But you can debug your scripts right within Meedio) \nWith this plugin you run your scripts by sending a message in Meedio.\nThe subject has to be ''MCW.runscripts''\nThe message can have two parameters. The first is the list of script to run and the second is debug switch. Only use the scripts name as parameter (no path and no extension). You can run several scripts by separating the names with ''/''.\nThe param name is ''scripts''. The second parameter indicates if the scripteditor should be opened when the scripts run. Params name is ''debug''. (True or False.\nThe default is False)\n\nExample message parameters:\nscripts=ScriptMeeGeneralExample/A Second Script,debug=True\nscripts=ScriptMeeGeneralExample,debug=False\nscripts=ScriptMeeGeneralExample\n\nIf debug param is set to True the scripteditor will open when the scripts run.\nThe editor will be on top of Meedio and you can debug your scripts and see what happens in Meedio. (If you press backspace in the editor Meedio will also recognize the press and react)\n\nSo for testing you can add a command module sending a custom command\nwith subject set to ''MCW.runscripts'' and parameters set to ''scripts=ScriptMeeGeneralExample,debug=True''.\n\nYou can write almost everything with your scripts you could by writing a real plugin in C#/Delphi/VB... So there is a wide range of things you can accomplish with scripts but also you get the potential to damage your data by writing code that isnt doing what you intended. So if you are not exactly knowing what your doing make backups and  you can always ask me or others in the scripts discussion thread for help with your scripts, but dont blame me if you lose data,\nyour computer goes up in flames or ... :)\n\nHope you enjoy the plugin and that it will be of use for the community.\n\nNext version should get support to react to messages in your scripts.\n\n\nGreetz\nDocZoidberg', 'ScriptMee', 'http://www.michaelwisniewski.mynetcologne.de/', '', '', '', '0', '0', 121, 1556, 0, 0, 0, 0, '77eaf69a641b7e56642d0455f3189616', 'FALSE'),
(23, '{0A5F1B09-EDB2-459C-BD63-2910A997E838}', 'Modern', 'Meedio Theme', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:32', '1.0', 'Blooz (Chike)', 'Blooz17@yahoo.com', '', '2004 Meedio, LLC', '', 'plugins/{0A5F1B09-EDB2-459C-BD63-2910A997E838}/1.0/stable/Modern_1.0_Stable.mpp', '3393425', '', '', '', 1000000000000000000, 1, 'Install and enjoy!', 'Modern', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1578, 1578, 0, 0, 0, 0, 'f3e34d54312c591bd313caf4db83e6f7', 'FALSE'),
(24, '{0ACE0952-DE4C-4F01-967F-1161D249AD1E}', 'C.Mee', 'Processes datafeeds and messages to send them to LCD, network clients, themes and plugins.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:18', '1.3.4', 'Harald Wagner', 'harald.wagner@computec.de', 'HdWagner', '2006 Harald Wagner. This product is free for personal use only.', '', 'plugins/{0ACE0952-DE4C-4F01-967F-1161D249AD1E}/1.3.4/stable/C.Mee_1.3.4_Stable.mpp', '922876', '', '', '!Documentation\\C.Mee.Manual.rtf', 1003004000000000000, 1, 'This plugin creates media information, datafeeds and messages for use on LCD, with network clients, in Meedio themes and for plugin communication. A screen editor lets you define when to send which data. The defined data sets can also be sent back to Meedio as datafeeds and messages, easing theme design.', 'C.Mee', '', '', '', '', '0', '1', 1987, 1987, 0, 0, 0, 0, '5d643d6eb712f107d24103496eacf7f5', 'FALSE'),
(25, '{0B6C3256-32ED-4342-A3F4-78B653FBDCC5}', 'Menagerie', 'This is a my attempt to make the best and most stylish theme for Meedio. Enjoy!', '', 'Theme', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:26', '2.12', 'Adam Smith', 'adamjsmith_au@hotmail.com', 'adamsmith', 'A commercial licence is required for use on a commercial machine', '', 'plugins/{0B6C3256-32ED-4342-A3F4-78B653FBDCC5}/2.12/stable/Menagerie_2.12_Stable.mpp', '11417346', '', '', 'Changes_To_Theme.txt', 2012000000000000000, 1, 'Menagerie 2.12\n\nNew Customization Options\n\nChanged Set Columns in ''List'' Mode option to Set Columns in ''News Detail / List'' Mode  on RSS.screen\nChanged Set Rows in ''List'' Mode option to Set Rows in ''News Detail / List'' Mode  on RSS.screen\n\nOther Fixes, Changes and Updates\n\nNew TV screens (not quite finished but better than current)\nFixed meeTVshows.screens', 'Menagerie', '', '', '', '', '0', '0', 2858, 2858, 0, 0, 0, 0, '9a4c14791603f699fe7c87407363801b', 'FALSE'),
(26, '{0B8B9B0E-BDE6-4E4A-81E5-D313420CC9FB}', 'PSA2mee', 'Imports pictures into Meedio Library from PSA2.0, PSE3.0 or PSE4.0', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:50', '0.66', 'Dave Brown', 'drmbrown@comcast.net', 'fornold', '2004 David Brown', '', 'plugins/{0B8B9B0E-BDE6-4E4A-81E5-D313420CC9FB}/0.66/stable/PSA2mee_0.66_Stable.mpp', '10878', '', '', '', 66000000000000000, 1, 'Select the PSA2.0 or PSE3.0 catalog and run the import.\r\n\r\nLibrary can be used by PSAslideshow 1.50 or higher\r\n\r\n0.3: Added in new date db section.  Will be used by PSAslideshow 1.60\r\n0.4: Fixed bug with PSA catalog version detection\r\n0.5: Allow selected dates to be persistent\r\nAdded new code for the tag library\r\n0.6: Is required for PSAslideshow 1.80\r\n0.65: Bug fix, and speed improvements\r\n\r\nRecompiled for Meedio 1.40', 'PSA2mee', '', '', '', '', '0', '1', 731, 731, 0, 0, 0, 0, 'fef34f1b91cd9585cc44b62f874b184a', 'FALSE'),
(27, '{0BF46B88-3D92-474E-B1DF-474C7D7E4C14}', 'myBlueTouch', 'myBlueTouch theme for a more visual appearance.', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:36', '2.0', 'pjo', 'paul@theogilvies.com', '', '2006 pjo', '', 'plugins/{0BF46B88-3D92-474E-B1DF-474C7D7E4C14}/2.0/beta/myBlueTouch_2.0_Beta.mpp', '9058602', '', '', '', 2000000000000000000, 1, 'This theme was originally designed for a touch-screen system, however, it works really well for those who like a more visual appearance. Simply install theme, and check subdirectories for listed icons and background. \n\n Make changes if you wish.\n\nRequired plugins:\n- IMDBmee for movie updating\n- FeedMee feed entitled "Weather" for weather forecast feed', 'myBlueTouch', 'http://www.theogilvies.com/meedio', '', '2.0', '', '0', '0', 2740, 2740, 0, 0, 0, 0, '867270a7b3410693dfd9ed15fffe2486', 'FALSE'),
(28, '{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}', 'OpenMAID', 'An alternative, free, and open Add-in Directory', '', 'Module', '', 'Freeware', 'Stable', '2007-05-14 16:34:40', '1.5.2.1', 'binary64', 'slug@skyforge.net', 'binary64', '2006 binary64', '', 'plugins/{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}/1.5.2.1/stable/OpenMAID_1.5.2.1_Stable.mpp', '180141', '', '', '', 1005002001000000000, 0, 'Changes:\n\n1.5.2.1 (13.Apr.07)\n* Downloads now done on own thread.\n* Made the shopping basket refer by guid only\n* Fix crash when exiting prematurely\n* Allow closing of screen whilst downloading. Downloads will continue and when finished, Meedio will restart ubruptly.\n* Fixed some other bugs\n\n1.5.2 (13.Apr.07)\n* Added new config to enter multiple database locations (in order of download preference)\n* Fixed a crash on exit\n* Progress as plugins are downloaded\n* Fixed timeout issue\n* Merge databases now also merges missing meta tags to show more info\n* Now OpenMAID v2 compatible (using v2''s simple/backcompat api only)\n\n1.5.1 (17.Mar.07)\n* Plugins are now downloaded locally before installing (progress bar is now possible)\n* Support manual rollback; Old versions are now archived in [MEEDIO-DATA]\\OpenMAID\\plugins\\{guid} name (type)\\date time version (state).mpp\n* After installation, Meedio.bat gets executed instead of the .exe (so you can put custom commands in the .bat)\n* If Meedio.bat does not exist, a default one is created (runs Meedio.exe)\n\n1.5.0.1 (15.Mar.07)\n* Small bug fixes\n\n1.5 (15.Mar.07)\n* Changed from using IMeedioItem+List to C# Generics\n* Improved the threading\n* Save Defaults now saves the main view filter (actions in the openmaid.screen have changed)\n\n1.4.0.1 (10.Mar.07)\n* Fixed the assumption that Meedio was installed to C:. Location is now read from registry.\n* You can now jump to a plugin in the list by tapping the first few letters of its Name.\n* Fixed 2 Sort-by-Downloads bugs\n\n1.4 (09.Mar.07)\n* Added 2 caching layers for the views\n* Made startup text ''animated'' as it progresses\n* Added a new view: "Lost" which are plugins you have installed, that aren''t on MAID''s\n* Added a space inbetween version and state\n* Fixed error window showing when exiting module quickly\n* You can now directly Install from the list, without having to enter the Review page\n* Fixed bug if \\images folder didn''t exist\n\n1.3.3.4 (08.Mar.07)\n* Added a new view: "Older" which show plugins on MAID that are older than your installed version. An author uploads a lower version, and it will appear in this view.\n\n1.3.3.3 (08.Mar.07)\n* New and better version parsing Thanks to Darkmoor\n	  \n1.3.3.2 (08.Mar.07)\n* Fixed debug msgbox from popping up\n* Fixed small bug with alpha parsing\n	  \n1.3.3.1 (07.Mar.07)\n* Parse versions with alpha chars (thanks Darkmoor)', 'OpenMAID', '', '', '', '', '0', '1', 165, 4359, 0, 0, 0, 0, 'd04d26cc421e26446e06e4fa61355a28', 'FALSE'),
(29, '{0D560265-9C5A-42EB-B403-DC8863D49DBC}', 'Beach theme', 'Cool down and relax with this theme', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:13', '0.55', 'Ryan Jones', 'ryanjones2@yahoo.com', 'ryanjones2', '', '', 'plugins/{0D560265-9C5A-42EB-B403-DC8863D49DBC}/0.55/beta/Beach_theme_0.55_Beta.mpp', '3478459', '', '', '', 55000000000000000, 1, 'You need the feedmee plugin for the datafeeds. Install and Enjoy', 'Beach', 'www.meedio.com/maid', '', '', '', '0', '', 5536, 5536, 0, 0, 0, 0, '8e681b57c74d385eafaffed43d55bee7', 'FALSE'),
(30, '{102FE051-4FC4-47F7-9312-89F075C3834D}', 'AutoPlayVideo', 'Autoplay offline videos.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:12', '1.1', 'CyberVillain', 'anders@dac.se', 'CyberVillain', 'DAC AB 2004', '', 'plugins/{102FE051-4FC4-47F7-9312-89F075C3834D}/1.1/stable/AutoPlayVideo_1.1_Stable.mpp', '92429', '', '', '', 1001000000000000000, 1, 'Autoplay offline videos. If you want to view your offline videos create a command module and send "autoplay.screen-show" to the plugin. If no disk is inserted the plugin will ask for it.', 'AutoPlayVideo', '', '', '', '', '0', '0', 1583, 1583, 0, 0, 0, 0, 'ce351ec0aca3f0919b8a5b50e7b35145', 'FALSE'),
(31, '{11358A25-E2AB-4005-971B-ACED8B095D23}', 'MyMCEE', 'Receive WM_INPUT messages sent from MCE remote and send keyboard messages to Meedio', '', 'Input', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:37', '0.3', 'r1ver', 'per.astrand@home.se', '', '', '', 'plugins/{11358A25-E2AB-4005-971B-ACED8B095D23}/0.3/beta/MyMCEE_0.3_Beta.mpp', '40435', '', '', '', 3000000000000000, 1, 'The following key presses are sent to Meedio with the remote:\nGreen Button	Ctrl.F1 and F1\nDetails (i)		F11\nGuide		F9\nRecorded TV	Ctrl.F10\nLive TV		Ctrl.F9\nDVD Menu	F6 (Goto DVD)\nTeletext		Ctrl.F4\nRED		Ctrl.F5\nGREEN		Ctrl.F6\nYELLOW		Ctrl.F7\nBLUE		Ctrl.F8\n\nFor the green button Ctrl.F1 is mapped to FOCUS and F1 to home (as default)\n\nThe other buttons all send keypresses and are working out of the box.', 'MyMCEE', '', '', '1.37', '1.37', '0', '0', 1515, 1515, 0, 0, 0, 0, 'f4f40c503fffaac7bd45ebcb69c16b7d', 'FALSE'),
(32, '{13454C35-414A-4CA4-9E6C-399711A86281}', 'QueryImporter', 'allows you to query existing libraries and create new libraries from them.', '', 'Import', 'None', 'Freeware', 'Alpha', '2007-05-14 16:34:50', '0.5.0', 'Rick Taylor', 'taylorrx@yahoo.com', '', 'Rick Taylor', '', 'plugins/{13454C35-414A-4CA4-9E6C-399711A86281}/0.5.0/alpha/QueryImporter_0.5.0_Alpha.mpp', '370661', '', '', 'readme.txt', 5000000000000000, 1, 'allows you to write SQL queries against multiple libraries in order to create new libraries.\n\nsee the readme.txt for examples of how to use this plugin.', 'QueryImporter', '', '', '', '', '0', '1', 635, 635, 0, 0, 0, 0, '7612525e7e4e04e4ba4133878500d90c', 'FALSE'),
(33, '{135216B6-8DC7-4CDC-B8A9-849E6DAB0BE0}', 'Apple Movie Trailers Importer', 'Imports Apple iTunes Movie Trailers into a Meedio library', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:11', '2.62', 'Jonathan Bradshaw', 'jonathan@nrgup.net', '', '2005 Jonathan Bradshaw', '', 'plugins/{135216B6-8DC7-4CDC-B8A9-849E6DAB0BE0}/2.62/stable/Apple_Movie_Trailers_Importer_2.62_Stable.mpp', '278511', '', '', 'readme.html', 2062000000000000000, 1, 'The Apple Movie Trailer Import plug-in will do the following: \n\n* Let you select which types of trailers you want to import, you can select genres, studios or just the "new" section (this is the new section on iTunes, not the web site) \n\n* Connect to the iTunes Movie Trailer database and locate the selected trailers \n\n* For each trailer, grab the streaming URL for the largest available QuickTime Movie \n\n* For each trailer, download the cover art (if it does not exist) \n\nThe importer populates the Meedio database with: \n\n* Movie Title \n* Cover Art Image (locally downloaded) \n* Actors \n* Genre(s) \n* Rating (PG13 etc.) \n* Studio Name \n* Direct URL to the QuickTime preview location for streaming. You can use Seb''s file download importer to get a local copy.', 'iTrailers', 'http://workspaces.gotdotnet.com/itrailers', '', '1.0', '', '0', '1', 1546, 1546, 0, 0, 0, 0, 'b1799a6953cbc9620f7d28846234fc29', 'FALSE'),
(34, '{13D96DC8-3140-4EED-B748-BDAE6F64CE5A}', 'Spitfire Reloaded', 'Based on the Spitfire theme by Meedio and CrispyXUK with icons from FOOOD''s Icons (www.foood.net).', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:06', '0.99', 'Dee', 'barnsoft@gmail.com', '', '(c) 2004-2005 Dee. Original theme (c) 2004-2005 Meedio, LLC. Most icons (c) 2004-2005 FOOOD''s Icons (www.foood.net).', '', 'plugins/{13D96DC8-3140-4EED-B748-BDAE6F64CE5A}/0.99/stable/Spitfire_Reloaded_0.99_Stable.mpp', '5516159', '', '', 'readme.html', 99000000000000000, 1, 'FEATURES\nFeature list shows the differences from the stock Spitfire theme.\n* Integrates with various plugins for a richer media experience\n* Define rows and columns for various modules and menus\n* Most icons from FOOOD''s Icons (see note in support thread)\n* Graphics and text modified to increase contrast (better for SDTV)\n* Now Playing controls available on all screens (such as play, pause and mute)\n* Weather feed on main menu\n* Now Playing and Music Library optionally displays artist name next to song title\n* Matching bitmap wallpaper included for use as your Windows wallpaper\n* Matching bootskin for use as your Windows boot screen\n* Custom default cover icons for music, movies and videos\n* Various custom or alternate screens\n* Theme settings and parameters (requires Meedio Helper plugin and optionally Theme Settings Module) \n* Various other tweaks and changes', 'spitfire-reloaded', '', '', '1.36.1', '', '0', '0', 2414, 2414, 0, 0, 0, 0, 'bdfe328d5337b8705cdc006933c0af5a', 'FALSE'),
(35, '{1499478B-18EE-4613-9A65-16A6AE708EDE}', 'TV On Demand', 'Watch your saved TV shows.', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:35:12', '1.2', 'Dan Litwin', 'originalyellowbox@yahoo.com', '', 'Dan Litwin', '', 'plugins/{1499478B-18EE-4613-9A65-16A6AE708EDE}/1.2/stable/TV_On_Demand_1.2_Stable.mpp', '995774', '', '', '', 1002000000000000000, 1, 'New in v1.2:\n- Bug fixed that wouldn''t allow some people to open the v1.1 module\n- Recent Episodes menu, which can either list episodes that were recently added to the library, or episodes that recently aired. Comes with a bunch of properties to customize it the way you like. (The recently-added functionality requires the next version of the importer, 0.99.2, which will be released soon.)\n- Input buttons now implemented:\n   PLAY (on a series, skips the details screen; on an episode, plays the video)\n   NEXT, PREVIOUS (on the details screens, works the Next and Previous buttons)\n   INFO (on the menu only; on a series or episode, shows the details screen even if you''ve set the details to not show automatically)\n\nv1.1:\n- The big one: Now compatible with custom views in the Episodes library, including file masks for displaying images for views and tags, starting view options, "Go to Views" button, and further Media-Module-type enhancements.\n- Property for skipping single seasons\n- Property for "Series Info" button\n- Non-TVTome episodes compatible\n- Series details fixed\n- Season Image file mask fixed\n- Altered episode details screen\n- Aspect ratio-compatible\n- Playmee-compatible (should be; not quite tested)\n- Other bugfixes and minor internal changes I can''t remember\n_____________\n\nBy popular demand...\nThe TV On Demand module.\nIt is only confirmed to work with the TV On Demand importer; TvT Importer compatibility has not been tested.\n\n(Important note: I use the American lingo of referring to the show itself as "Series" and each annual season as "Season". Any Brits out there--don''t get confused.)\n\nEvery property available in Meedio Configuration has documentation in the Help Text that appears when you hover your mouse over it.\n\nFeatures:\n- Series>Season>Episode default viewing structure.\n- Custom views in the Episode library.\n- Extensive customization through properties in Meedio Configuration.\n- Screen elements designed for readability even on the most paltry displays.\n- Displays every tag imported, on multi-page screens.\n- Detailed viewing option for episodes.\n- Change viewing options for every menu directly from the toolbar.\n- Remembers your viewing options from session to session.\n- Support for:\n     special seasons (pilots, movies, etc.)\n     season-level images\n     network logos and country flags\n     offline video files\n     external video players [currently disabled; use PlayMee instead]\n     the DisplayName tag in the TVOD-Series library, imported by the TV On Demand importer\n     the SeasonRank tag (for now, add on your own to TVOD-Episodes library)\n\nFuture developments (at my leisure, folks):\n- Play a show''s theme song. (sbass is looking into it!)\n- Auto-import a person''s information when you click on their name. (in the works)\n- Search functionality.\n- Custom views with images.\n- Remember the last episode watched for a series\n   ...or automatically watch the next episode for a series.\n- Auto-suggest random episode based on its most recent watch time and how often it has been watched.\n- Browse all episodes for a series, even those you do not have.\n   ...and auto-import when you click on one you don''t have.\n- Auto-placement of specials on the Season menu using the SeasonRank tag.\n- Recognize when pilots or initial seasons are labeled as movies.\n- And a lot more that I can''t think of right now....', 'TVOD', 'http://www.meedio.com/forum/viewtopic.php?p=130742', '', '', '', '0', '1', 643, 643, 0, 0, 0, 0, '4981cb7ab37ab94b95d8596d2c37074a', 'FALSE'),
(36, '{15671903-1B7F-46CE-8E56-023849555652}', 'Replacee', 'Replaces text in existing library tags.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:53', '1.1', 'Seb', 'n/a', '', '', '', 'plugins/{15671903-1B7F-46CE-8E56-023849555652}/1.1/stable/Replacee_1.1_Stable.mpp', '4107', '', '', '', 1001000000000000000, 1, 'Replaces text in existing library tags.', 'Replacee', '', '', '', '', '0', '1', 1446, 1446, 0, 0, 0, 0, 'b413c10c38b4c75eb34495568e5405b2', 'FALSE'),
(37, '{17438B60-ECD2-4198-9B59-B3FD35299003}', 'OfflineLibrary', 'Catalog, manage, use, maintain your collection of offline media', '', 'General', 'None', 'Donationware', 'Alpha', '2007-05-14 16:34:40', '1.0', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64', 'http://www.meedios.com/forum/viewtopic.php?t=255', 'plugins/{17438B60-ECD2-4198-9B59-B3FD35299003}/1.0/alpha/OfflineLibrary_1.0_Alpha.mpp', '72757', '', '', '', 1000000000000000000, 1, '', 'OfflineLibrary', '', '', '', '', '0', '1', 775, 775, 0, 0, 0, 0, '0e68800bdd82bf4be78e26c8b4b727be', 'FALSE'),
(38, '{17BF60F8-BFA3-426D-A76F-89D7A0C2E8B2}', 'Horizontal Bop', 'Incorporates the horizontal menu system', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:36', '1.00', 'Gerry Plasky', 'gerry.plasky@gmail.com', 'gplasky', 'Copyright 2004 The Plasky Group', '', 'plugins/{17BF60F8-BFA3-426D-A76F-89D7A0C2E8B2}/1.00/beta/Horizontal_Bop_1.00_Beta.mpp', '9670987', '', '', '', 1000000000000000000, 1, 'Meedio 1.28 is needed to support this theme. The Main menus use the horizontal menu system.', 'Horizontal Bop', '', '', '', '', '0', '0', 1827, 1827, 0, 0, 0, 0, '60728773b714c61c07bc37fa189766dd', 'FALSE'),
(39, '{1BEA908D-598E-4F9E-B2AC-D9D9EE674F59}', 'iRadio', 'Play Windows Media and Real Audio streaming radio files in Meedio', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:40', '2.1', 'Alan Roberts', 'alan@statistixl.com', '', '2004 Alan Roberts', '', 'plugins/{1BEA908D-598E-4F9E-B2AC-D9D9EE674F59}/2.1/beta/iRadio_2.1_Beta.mpp', '126150', '', '', 'readme.txt', 2001000000000000000, 1, 'Please see readme.txt in your plugins folder (typically "C:\\Program Files\\Meedio\\Meedio Essentials\\plugins\\module\\iRadio")', 'iRadio', 'http://www.meedio.com/maid', '', '', '', '0', '1', 922, 922, 0, 0, 0, 0, '9b0635fca33dc0f253ca487a75f3d7fd', 'FALSE'),
(40, '{1BED0836-24DE-4320-8455-C1105441E842}', 'XMM Database Importer', 'Imports the eXtreme Movie Manager (XMM) database into a Meedio Media Library.', '', 'Import', '', 'Freeware', 'Stable', '2007-05-14 16:35:27', '2.9.2', 'M.N. Karssemeijer', 'tinus@karssemeijer.no.spam.for.me.please.com', '', '2004-2006 M.N. Karssemeijer. All rights reserved.', '', 'plugins/{1BED0836-24DE-4320-8455-C1105441E842}/2.9.2/stable/XMM_Database_Importer_2.9.2_Stable.mpp', '568761', '', '', 'Readme.html', 2009002000000000000, 0, '', 'XMM', 'http://www.meedio.com/maid', '', '', '', '0', '1', 128, 2934, 0, 0, 0, 0, '86c33e38b1c937ae3e3bb8f8eaaffb85', 'FALSE'),
(41, '{1BED0836-24DE-4320-8455-C1105441E899}', 'Run External Program', 'Executes an external program.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:55', '1.4.1', 'M.N. Karssemeijer', 'tinus@karssemeijer.no.spam.for.me.please.com', '', '2004-2005 M.N. Karssemeijer. All rights reserved.', '', 'plugins/{1BED0836-24DE-4320-8455-C1105441E899}/1.4.1/stable/Run_External_Program_1.4.1_Stable.mpp', '44484', '', '', '', 1004001000000000000, 1, 'Using this plugin you can use Meedio''s Importer as a Task Scheduler. Just add this Import plugin in a (empty) library, specify which program to execute and schedule it to run as you like.\n\nEvery time the importer is started it only executes the specified program. Usages for this plugin are:\n- Retrieve EPG data by launching the appropriate executable.\n- Update (copy) movie images from a networked computer to you Meedio system.\n- etc.', 'RunProgram', 'http://www.meedio.com/maid', '', '', '', '0', '1', 1048, 1048, 0, 0, 0, 0, '366fc72dacf337a1c13b60f80f01ba5e', 'FALSE'),
(42, '{1C7D38F8-0056-4CA6-8BA2-9D2B904C318C}', 'AmazonImport', 'Adds information and pictures from Amazon to media library items', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:10', '0.6', 'Bastian Hofmann', 'bastian.h@gmx.net', '', '', '', 'plugins/{1C7D38F8-0056-4CA6-8BA2-9D2B904C318C}/0.6/beta/AmazonImport_0.6_Beta.mpp', '370620', '', '', '', 6000000000000000, 1, 'Adds information and pictures from Amazon to media library items\nSupported Amazon platforms:\nAmazon.com\nAmazon.de\nAmazon.co.uk\nAmazon.fr\nAmazon.ca\nAdds:\nlarge image\ntitle\nauthor\npublisher\npublishingdate\neditorial reviews', 'AmazonImport', '', '', '', '', '0', '1', 1361, 1361, 0, 0, 0, 0, '1977bebb05695d5e401aa6c906490f3b', 'FALSE');
