(43, '{1CA686EC-E62D-4ACE-892A-EBB398244F91}', 'Weather Fix Importer', 'Weather Fix replaces out of date Today in Weather section with the forecast information on current day of week', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:35:20', '0.9.5', 'Cellard', 'info@cellard.spb.ru', '', '2005 Cellard', '', 'plugins/{1CA686EC-E62D-4ACE-892A-EBB398244F91}/0.9.5/beta/Weather_Fix_Importer_0.9.5_Beta.mpp', '13384', '', '', '', 9005000000000000, 1, 'If you don''t have permanent connection to the Internet maybe your Weather section is not always updated. Maybe Today doesn''t contain actualy today information and you can''t see correct weather in main screen. Weather Fix Import will replace the information in Today with the forecast information of current weekday if available. Useful for people who does not update weather every day.', 'WeatherFixImporter', '', '', '1.0', '', '0', '0', 1316, 1316, 0, 0, 0, 0, '195a715e341901fb82cc20c82ba3269f', 'FALSE'),
(44, '{1E2AA2E6-B782-4609-9169-88D996D4E71F}', 'Meedio Default Dual Display', 'The standard Meedio theme for dual display control.', '', 'Theme', 'None', 'Commercial', 'Beta', '2007-05-14 16:33:54', '1.0.1', 'Meedio, LLC', 'support@meedio.com', '', '2004 Meedio, LLC', '', 'plugins/{1E2AA2E6-B782-4609-9169-88D996D4E71F}/1.0.1/beta/Meedio_Default_Dual_Display_1.0.1_Beta.mpp', '160645', '', '', '', 1000001000000000000, 1, 'This theme is designed for computer systems with dual displays.\nBy default it is designed for displays that are equal in size, like both at 800x600 or both at 1024x768.  To use, set Meedio to span both monitors.  So for example, if both your displays are 800x600, then set Meedio''s Width to be 1600 and Meedio''s Height to be 600.', 'default-dual', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1330, 1330, 0, 0, 0, 0, 'd87035f9a8d5cbfaf4f9b317d49dc99f', 'FALSE'),
(45, '{1E43BDE4-0D56-4C38-900D-B0D805952C21}', 'last.fm', 'last.fm Online Radio', '', 'General', '', 'Freeware', 'Beta', '2007-05-14 16:33:42', '0.3.1', 'binary64', 'slug@skyforge.net', 'binary64', 'GPL', '', 'plugins/{1E43BDE4-0D56-4C38-900D-B0D805952C21}/0.3.1/beta/last.fm_0.3.1_Beta.mpp', '79222', '', '', '', 3001000000000000, 1, '.........', 'last.fm', '', '', '', '', '0', '1', 1251, 1580, 0, 0, 0, 0, '8ec2ae18d31959fcd4547dab6da967b1', 'FALSE'),
(46, '{1EC79955-B743-417D-B888-9FD69FCA570C}', 'MeEtiVoImporter', 'MeEtiVoImporter iterates EtiVo''s encoded collection and imports it into the attached library.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:22', '1.0', 'Rocky Mazzeo', 'rjmazzeo@hotmail.com', '', '', '', 'plugins/{1EC79955-B743-417D-B888-9FD69FCA570C}/1.0/stable/MeEtiVoImporter_1.0_Stable.mpp', '149104', '', '', '', 1000000000000000000, 1, 'To Install: Create a new import (MeEtiVoImporter) on your target library.\nSpecify your EtiVo server and port at the minimum.\nCustomize the import as you see fit.\n\n    Quick note about some of the more obscure options. As of 11/05 EtiVo does not retrieve genre or ratings information from your Tivo, however the information is available in the raw xml metadata for your show. ShowInfo.xml is a part of every extract from MFS_FTP. EtiVo retains this file in the same directory as your video file. If you select "Parse ShowInfo", the importer will attempt to retrive ratings and genre.\n\n    An additional note about genre. The id value is based on one of three familys: Stand-Alone, DirecTv, and Stand-Alone (UK). You can select your genre source in the importer via the ShowType filter. \n\n    The source for the importer is in the plugin folder. Mainly useful for other Tivo people that want to get the ratings/genre data in the raw format.\n\n    Finally, when something wicked this way comes: Look in the importers plugin folder. There should be a log file in there. Post the relevant section (the entries should be timestamped) in the forum and we''ll try to get it fixed.', 'MeEtiVoImporter', 'http://www.meedio.com/forum/about26783.html', '', '1.37.0.0', '', '0', '1', 615, 615, 0, 0, 0, 0, 'b2397ce21a3f65c4d0be946ad80cead6', 'FALSE'),
(47, '{20662FF9-75C0-4E82-8401-2EEFA37853AA}', 'TreeviOL - Multiplayer Trivia Online', 'Trivia / General Knowledge Games, currently multiplayer OFFline, but online coming soon.', '', 'Module', 'None', 'Donationware', 'Alpha', '2007-05-14 16:35:11', '0.1.2', 'drahcir', 'drahcir@psychonuke.com', '', 'drahcir', '', 'plugins/{20662FF9-75C0-4E82-8401-2EEFA37853AA}/0.1.2/alpha/TreeviOL_-_Multiplayer_Trivia_Online_0.1.2_Alpha.mpp', '2108250', '', '', 'readme.txt', 1002000000000000, 0, 'Please read the readme.txt file for installation instructions!', 'TreeviOL', 'http://www.meedio.com/maid', '', '', '', '0', '0', 164, 729, 0, 0, 0, 0, '2df30212b71b4dc5f01237512497e9a4', 'FALSE'),
(48, '{20CB15C4-EF5C-4131-8573-08066452E664}', 'UPnPEE Importer', 'Imports music (currently) from a UPnP media server.', '', 'Import', 'None', 'Donationware', 'Beta', '2007-05-14 16:35:18', '0.25', 'StrataG', 'stratag@gmail.com', '', 'StrataG', '', 'plugins/{20CB15C4-EF5C-4131-8573-08066452E664}/0.25/beta/UPnPEE_Importer_0.25_Beta.mpp', '128294', '', '', '', 25000000000000000, 1, 'Create a new import and select "UPnPEE Importer".\n\nOpen the custom properties dialog.  If you don''t see the desired server listed (and it''s currently running), close the dialog and try in about 30 seconds.  UPnP broadcasts announcements periodically and it may not be caught by the dialog before you load it.\n\nSelect the server from the drop down, and choose the template to use.  If you are not sure, set it to custom and leave the values as is.\n\nSelect the nodes you want to import by navigating the tree and clicking on the checkboxes for the nodes you want.\n\nHit ok and run import.', 'UPnPEE Importer', '', '', '.01', '1.0', '0', '1', 562, 562, 0, 0, 0, 0, '872b5a88492817dc76eed50bcb1f4729', 'FALSE'),
(49, '{227590E3-C8CC-4B45-8490-E67757917A10}', 'X10 Lamp Plugin', 'This plugin allows you to control you lights.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:26', '1.0', 'Ryan Jones', 'ryanjones2@yahoo.com', 'ryanjones2', '', '', 'plugins/{227590E3-C8CC-4B45-8490-E67757917A10}/1.0/stable/X10_Lamp_Plugin_1.0_Stable.mpp', '72631', '', '', '', 1000000000000000000, 1, 'General Plugin to control x10 lights. This is the full time plugin that recieves messages for Lights. You will need the cm17a x10 module for this to work. You will also probably want the X10 Module plugin as well which will allow you to control your lights as well as save macro''s. This plugin recieves a Message called x10.light, with the following parameters.\n\nhousecode - letter of the housecode you are using\nlight - lights number 1-16\nchoice - options are \n                     aln (all lights on) \n                     auf (all units off)\n                     on\n                     off\n                     bright\n                     dim', 'x10full', 'http://www.meedio.com/maid', '', '', '', '0', '', 1152, 1152, 0, 0, 0, 0, '06d704bc2045f96e4d74c131f6a43fec', 'FALSE'),
(50, '{22840F94-905C-43A3-AA19-576A3161BAAC}', 'Import CSV file', 'This importer take a CSV file and import content in a library', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:39', '1.0', 'NARI', 'mib@sacrlet.be', 'NARI', '', '', 'plugins/{22840F94-905C-43A3-AA19-576A3161BAAC}/1.0/beta/Import_CSV_file_1.0_Beta.mpp', '32229', '', '', '', 1000000000000000000, 1, 'This plugin add items in library from the CVS file you mention. If HasHeader is set at ''true'' the plugin take first line of file as header for the items tags names.You can specify an other field Separator than '';''. You can also choose the column position for tags (Name,Location,Image,ExternalID)', 'Import CVS file', '', '', '0', '9', '0', '1', 611, 611, 0, 0, 0, 0, '5e1c26c45ea65019a38179c176bacd3d', 'FALSE'),
(51, '{249EF538-53D6-46A8-ADED-B74444C9B862}', 'RelaxingTV Importer', 'Imports RelaxingTV Channels', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:53', '1.1.1', 'Jelle Hissink', 'RelaxingTVImporter@Onshuis.tk', '', 'Copyright 2004 Jelle Hissink. All Rights Reserved.', '', 'plugins/{249EF538-53D6-46A8-ADED-B74444C9B862}/1.1.1/stable/RelaxingTV_Importer_1.1.1_Stable.mpp', '25035', '', '', '', 1001001000000000000, 1, 'This importer imports channels from www.RelaxingTV.com.\n\nUsage:\n   - Make a new library named RelaxingTV.\n   - Add an importer (plugin: Relaxing TV Importer)\n       uncheck: Run at startup if scheduled time is missed !!!\n       click: Run now\n   - Create a new view named ByChannel\n      - Set Group by to Channel, sort asc to true\n   - Add a new Media module named RelaxingTV\n       set Description to: Sit back and relax...\n       set Module Properties:\n            Media library section: RelaxingTV\n            Detail screen file: Movie\n   - Sit back and relax...\n\nNote: \n     The referenced video''s are copyrighted: \n     Copyright 2000-2003 relaxingTV. All Rights Reserved.', 'RelaxingTVImporter', '', '', '', '', '0', '1', 642, 642, 0, 0, 0, 0, '130e615f714500376a9c860ad345251e', 'FALSE'),
(52, '{24CC6509-1E3A-44E0-BF5E-6D1B48CFC452}', 'Domo-Kun 1.1', 'Updated version of Domo-Kun 1.0 - now has new Domo-Kun icons!', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:24', '1.1', 'TRIGER. NZ', 'TRIGER@AuckLAN.co.nz', '', '', '', 'plugins/{24CC6509-1E3A-44E0-BF5E-6D1B48CFC452}/1.1/beta/Domo-Kun_1.1_1.1_Beta.mpp', '5660065', '', '', '', 1001000000000000000, 1, 'A recolored default meedio theme with a Domo-Kun background.\n\nFeel free to fix up any rough edges on the icons as i am not the best photoshoper in the world :|\n\nIf there are any icon that you have that you would like me to incorporate with Domo-Kun just give me a PM and i will be more than happy to make one for you.', 'Domo-Kun 1.1', 'http://www.Aucklan.co.nz', '', '', '', '0', '0', 1438, 1438, 0, 0, 0, 0, '92eae32b89f394dbfdbd764763b25b81', 'FALSE'),
(53, '{2516741C-989A-47A3-A956-1FFB1DDAB283}', 'EmptyBin', 'Empty Recycle Bin', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:25', '1.0.1', 'CyberVillain', 'anders.malmgren@dac.se', 'CyberVillain', '2004 DAC Ltd', '', 'plugins/{2516741C-989A-47A3-A956-1FFB1DDAB283}/1.0.1/stable/EmptyBin_1.0.1_Stable.mpp', '46738', '', '', '', 1000001000000000000, 1, 'Empty Recycle Bin', 'EmptyBin', '', '', '', '', '0', '0', 859, 859, 0, 0, 0, 0, 'b9fdfabd7caec99afc996f281c31136f', 'FALSE'),
(54, '{25F0FD5E-1A63-4C70-B333-BCEAB5E5F157}', 'ComicsFix', 'This plug-in was created to correct some problems with the Comics Importer.', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:21', '0.5', 'Andreas Philipson', 'andreasphilipson@hotmail.com', '', 'Copyright (C) 2004 Andreas Philipson', '', 'plugins/{25F0FD5E-1A63-4C70-B333-BCEAB5E5F157}/0.5/beta/ComicsFix_0.5_Beta.mpp', '3737', '', '', '', 5000000000000000, 1, 'This plug-in is a media library modifier which was created to fix two things with the Comics Importer and add one feature.\n\n*The "Comic" column of Penny Arcade comics does not reflect the name comic but rather the name of the current strip. This plug-in sets the "Comic" column to "Penny Arcade" in all these instances.\n*The "Date" column of Penny Arcade comics does not reflect the comic date. This plug-in parses the date from the url and replaces the Date column with this value.\n*Name modifier: Adds the date to the "Name" column, i e "2004-10-16 Dilbert" and so on.\n\nREQUIREMENT: .NET Framework (Any version)', 'ComicsFix', '', '', '', '', '0', '1', 604, 604, 0, 0, 0, 0, '0f840ff793c58bf6705f35543b75751a', 'FALSE'),
(55, '{266D0793-8D46-4F8F-8851-E35C7F63C783}', 'PlayMee', 'PlayMee is a video player enhancer. It plays media based on user-defined conditions in Meedio or external players. Includes: off-line media support with prompts; auto-play of DVD, SVCD, VCD, any file-type; automatic mounting of images; Intro/Trailer suppo', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:47', '1.5.7.4', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{266D0793-8D46-4F8F-8851-E35C7F63C783}/1.5.7.4/stable/PlayMee_1.5.7.4_Stable.mpp', '1579311', '', '', 'readme.html', 1005007004000000000, 0, 'Directions at http://playmee.hargraveusa.com\n\nPlayMee is a Meedio video player enhancer. It will play media based on user-defined conditions (e.g. file extension or library fields) in any configured player (Meedio internal player or external player). It provides: off-line media support with user-configurable prompts and automatic disc ID recording and validation; auto-play of DVD, SVCD, VCD and any user-defined file-type; automatic mounting and playing of image files using Daemon Tools, Alcohol 120%, or other image mounting software; Intro and Trailer support. \n\nPlayMee allows you to easily use an external video player with Meedio, while using the default Media.Movie.screen file.', 'PlayMee', 'http://playmee.hargraveusa.com/', '', '1.30', '', '0', '1', 706, 6842, 0, 0, 0, 0, 'e9174a40a63552aaf26a2203c3f3e454', 'FALSE'),
(56, '{268537BB-56A6-4F11-BE47-219DA982E7F5}', 'meeMusicVideos', 'A media module for playing music videos.', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:13', '1.1.1', 'Bryan Glass', 'bglass@clemson.edu', '', '2005 - Bryan Glass', '', 'plugins/{268537BB-56A6-4F11-BE47-219DA982E7F5}/1.1.1/stable/meeMusicVideos_1.1.1_Stable.mpp', '164528', '', '', '', 1001001000000000000, 1, 'This module plugin allows you to create, play, save, and load playlists for video files.  Also included are functions to generate a playlist of random videos, etc.\n\nView the support thread for detailed installation instructions.', 'meeMusicVideos', '', '', '', '', '0', '1', 1499, 1499, 0, 0, 0, 0, '5ac92b3717b0fa47c4411b0a7649d9dc', 'FALSE'),
(57, '{26E11CFC-633C-4801-920A-6C9A87A0A32B}', 'News Ticker', 'A flash news ticker for theme makers to incorporate into their themes.', '', 'General', 'None', 'Donationware', 'Beta', '2007-05-14 16:34:39', '1.5', 'Dee', 'barnsoft@gmail.com', '', '2005 Dee. All rights reserved.', '', 'plugins/{26E11CFC-633C-4801-920A-6C9A87A0A32B}/1.5/beta/News_Ticker_1.5_Beta.mpp', '52768', '', '', 'readme.html', 1005000000000000000, 1, 'FEATURES\n* Smooth headline scrolling \n* Customizable from the Meedio Configuration program \n* Updates news at a defined interval \n* Definable news seperator (image or text) \n* Display channel and optionally have it "stick" to the side of the screen\n\nSee README.HTML file for installation and configuration.', 'NewsTicker', '', '', '', '', '0', '1', 6399, 6399, 0, 0, 0, 0, 'c1e6f61fbbeb82c412bffc65fa41be92', 'FALSE'),
(58, '{26E4F8AE-51E8-42EC-9FB7-267322E832CD}', 'Removable Disk Insert Notification', 'Notify other plugins when a removable disk is inserted', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:53', '1.2.0', 'CyberVillain', 'anders@dac.se', 'CyberVillain', '2005 DAC Ltd', '', 'plugins/{26E4F8AE-51E8-42EC-9FB7-267322E832CD}/1.2.0/stable/Removable_Disk_Insert_Notification_1.2.0_Stable.mpp', '15882', '', '', 'messages.txt', 1002000000000000000, 1, 'Notify other plugins when a removable disk is inserted. This plugin is useless on its own. However a plugin can use it to automate digitalcamera downloads, etc.', 'RemovableInsert', 'http://www.meedio.com/maid', '', '', '', '0', '0', 718, 718, 0, 0, 0, 0, '1ecc5d913fcb3ef202ae41f223433232', 'FALSE'),
(59, '{27B5A829-ABA6-4317-9599-C5F0770AF3A3}', 'SunriseSunset', 'Download Sunrise/Sunset Times', '', 'Import', '', 'Freeware', 'Stable', '2007-05-14 16:35:08', '1.5.1', 'Joshua C. Walters', 'joshwalters@gmail.com', 'walts81', 'Copyright JCSoftware, Inc. 2004-2005', '', 'plugins/{27B5A829-ABA6-4317-9599-C5F0770AF3A3}/1.5.1/stable/SunriseSunset_1.5.1_Stable.mpp', '26567', '', '', '', 1005001000000000000, 0, 'Add Import to your weather section. \nAdd the location # from your weather library\nSelect location-specific options\nRun the import', 'SunriseSunset', 'http://www.meedio.com/maid', '', '', '', '0', '1', 84, 671, 0, 0, 0, 0, '625afc8a1e79695e9d2510e5b656e736', 'FALSE'),
(60, '{286E8118-57FE-4DDA-872A-0BBBFDE417B6}', 'Gray Wave', 'Theme based on the Meedio website', '', 'Theme', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:32', '1.0', 'Christopher Clark', 'Chris@28seven.com', '', '', '', 'plugins/{286E8118-57FE-4DDA-872A-0BBBFDE417B6}/1.0/stable/Gray_Wave_1.0_Stable.mpp', '2674516', '', '', '', 1000000000000000000, 1, 'Icons for the main screen can be found in the Gray Wave theme folder under \\"my icons.\\"  apply these icons in Meedio Configuration for each item on the menu to the "Icon Image" dialog box.  Without applying the icons this theme is un useable.', 'Gray Wave', '', '', '', '', '0', '0', 1333, 1333, 0, 0, 0, 0, 'fa6c486e5e4ee7c686b27fd66a04b6dc', 'FALSE'),
(61, '{288BBA36-0437-4E95-99B5-1D3AA94972D9}', 'NetFlix Module', 'Browser to Add/Remove movies to/from your Neflix queue', '', 'Module', 'None', 'Donationware', 'Beta', '2007-05-14 16:34:38', '0.5.3', 'Michael Melendez', 'NA', 'Kairos', '2004', '', 'plugins/{288BBA36-0437-4E95-99B5-1D3AA94972D9}/0.5.3/beta/NetFlix_Module_0.5.3_Beta.mpp', '317242', '', '', '', 5003000000000000, 1, 'The NetFlix Module is part of the NetFlix Plugin Pack that consist of two items, a module and importer. With these two plugins you can download the rss feeds from netflix and view them in meedio. You can add, remove and move items in your queue.\n\nHow to use the new features:\n\nBatch mode - This feature allows movement in the queue in 3 ways. At fist you have the option to delete the selected movies or move them. Once you move them, the delete button dissapears and the apply changes button appears. If you do not apply your changes they will not be saved to netflix. If you change modes, for exaple go to search or switch to the other queue mode or library mode, then all changes you made to the queue are discarded unless you hit the apply changes button. You have the option to send the selected items to top/end, group them to the first/last selected item or move them up 1 position.\n\nNokia-style quick jump - This allows user navigate large lists using the number keys. It has two modes.\n\nThe first mode is when items are sorted by int, like in your queue or top 25 videos, then pressing any number will jump to the item at that number. So hit 33 and it will jump to the 33rd movie in your queue. Hit 1 and wait for the delay to end and it jumps you to the first movie in your queue.\n\nThe second mode is when movies are sorted alphabetically, then the number keys respond like phone letters. Hit 2 and it jumps to the first movie starting with ''a''. Hit it again and jump to the first movie starting with ''b''. This is usefull to view all your movies in one giant view.\n\nUsing these functions together will give you a very powerful way to move items in your queue.\n\nWarning - I have tested this plugin as much as possible, but even I have found sometimes the queue doesn\\''t update right when moving items around. If this happens simply click the update queue button and it will update the queue with the correct info.', 'NetFlix', '', '', '', '', '0', '1', 578, 578, 0, 0, 0, 0, '2eb0911350ade0ebf43802a7ec96dffc', 'FALSE'),
(62, '{2BF0DA04-28F2-45AD-B3AC-EE899021512B}', 'MeeVo', 'This theme is partially based off the Tivo Personal Video Recorder. http://www.tivo.com This theme was tested @ 1280x720 and is now in beta testing for lower resolution support. Various icons by http://mattahan.deviantart.com/ are used throughout.', '', 'Theme', 'None', 'Donationware', 'Alpha', '2007-05-14 16:34:25', '0.7.1.3', 'BigNoseJr', 'bignosejr@nosenet.net', 'bignosejr', '', '', 'plugins/{2BF0DA04-28F2-45AD-B3AC-EE899021512B}/0.7.1.3/alpha/MeeVo_0.7.1.3_Alpha.mpp', '10322914', '', '', 'readme.txt', 7001003000000000, 1, 'Documentation is a work in progress. Read "readme.txt" for changelog.', 'MeeVo', '', '', '', '', '0', '0', 1490, 1490, 0, 0, 0, 0, '82138f9e565feee1d7fd66255bc9d06b', 'FALSE'),
