(64, '{2E15CE71-CE2D-4B0A-B1FC-98CB94E3CD33}', 'JASC2mee', 'Import keyword information from JASC Photo Album db.', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:41', '0.82', 'David Brown', 'drmbrown@comcast.net', '', '2004 Dave Brown', '', 'plugins/{2E15CE71-CE2D-4B0A-B1FC-98CB94E3CD33}/0.82/stable/JASC2mee_0.82_Stable.mpp', '9414', '', '', '', 82000000000000000, 1, 'Setup a library and start the importer.  Need to this before running PSAslideshow.\n\nNeeds at least Ver. 1.32 of PSAslideshow\n\n\n\n0.60: Added import of Title field\n0.61: set externalID field now\n\n0.62: Correction to externalID setting\nAlso, if import is set to update, it will delete images from the Meedio library that are no longer in the JASC db.\n0.63: Fixed a bug in the update routine\n0.70: Added in new date section.  Will be used by PSAslideshow 1.60\n0.71: Added selected to dates library\n0.81: Bug Fix, speed improvements\n\nRecompiled for Meedio 1.40', 'JASC2mee', '', '', '', '', '0', '1', 667, 667, 0, 0, 0, 0, 'e8cb3c221b746cf0bec9cd3655b55f13', 'FALSE'),
