(66, '{32D6EE50-98FA-4516-B888-BEC212364745}', 'GrabVis', 'Imports, downloads and installs about a hundred visualisations for the built in music player.', '', 'Import', '', 'Freeware', 'Alpha', '2007-05-14 16:33:31', '1.1', 'binary64', 'slug@skyforge.net', 'binary64', '2007', 'http://www.meedios.com/forum/viewtopic.php?t=643', 'plugins/{32D6EE50-98FA-4516-B888-BEC212364745}/1.1/alpha/GrabVis_1.1_Alpha.mpp', '363511', '', '', '', 1001000000000000000, 1, 'Kudos to the excellent http://support.xmplay.com/ website. You could run this module using Module Browser. This only requires running once. Running it again will re-download all the visualisations, wasting bandwidth.\r\n		\r\n		Now, can anyone write some code so I can select and launch a visualisation (in full screen) from a simple media module?', 'GrabVis', '', '', '', '', '0', '1', 1742, 1873, 0, 0, 0, 0, '3e8e864ebe2f23c00e191b14145b8e94', 'FALSE'),
(67, '{3442DFFE-DCDD-4710-A480-5B2DD61B007D}', 'DeleteMissing', 'Meedio import plugin that deletes library items where the files have been deleted.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:23', '1.0', 'Seb', 'n/a', '', '', '', 'plugins/{3442DFFE-DCDD-4710-A480-5B2DD61B007D}/1.0/stable/DeleteMissing_1.0_Stable.mpp', '3610', '', '', '', 1000000000000000000, 1, 'Add this import plug-in in update mode and it will delete all the library items where the files have been deleted. This allows you to remove deleted items without deleting the information saved in the rest of the items. Only use this in libraries where the files in all the location tags exist on the local computer or in the local network.', 'DeleteMissing', '', '', '', '', '0', '1', 1266, 1266, 0, 0, 0, 0, '47c34c2122c1ae5a9ec847e4baca1fa7', 'FALSE'),
(68, '{357A37C9-F92A-4E70-91C2-10F026E5D68D}', 'Hollywoodmee', 'Grab Movie Data from Hollywood.com', '', 'Import', 'None', 'Donationware', 'Beta', '2007-05-14 16:33:35', '.2', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', '@paypal.com :)', '', 'plugins/{357A37C9-F92A-4E70-91C2-10F026E5D68D}/.2/beta/Hollywoodmee_.2_Beta.mpp', '76534', '', '', '', 2000000000000000, 1, 'This will just grab a trailer main page, not individual trailers', 'Hollywoodmee', '', '', '', '', '0', '1', 1533, 1533, 0, 0, 0, 0, '35e9b63176a7fce9c36cb244209f30b7', 'FALSE'),
(69, '{361D9FC4-8DF5-4593-8A90-296FC9BEB8F3}', 'Karaoke File Importer', 'Import and Play Karaoke Files with Meedio.', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:42', '1.4.0.2', 'Anks', 'Ian at ANXSolutions dot Com', '', '2005 Anks', '', 'plugins/{361D9FC4-8DF5-4593-8A90-296FC9BEB8F3}/1.4.0.2/beta/Karaoke_File_Importer_1.4.0.2_Beta.mpp', '897050', '', '', 'README.HTM', 1004000002000000000, 1, 'This importer adds Karaoke Playback to Meedio (via Karaoke-DX) and Imports files to a media library.  The importer is targeted towards the MP3+G format and compressed files in ZIP format are also supported. Song information is based on filename and either a local or remote song database is used to acquire Title, Artist, Track and Description. MP3 Tag information is also updated and files can be renamed based on a configurable mask.  For a further information please see the README.HTM file.', 'KaraokeImport', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1121, 1121, 0, 0, 0, 0, 'cb367641c3c9b62d97715a7e298cf721', 'FALSE'),
(70, '{370A601C-19B9-4EEA-9BFC-14868F830272}', 'ExternalVariables2C', 'Publishes a datafeed containing variables set by files and webpages.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:26', '1.0.4', 'Harald Wagner', 'harald.wagner@computec.de', 'HdWagner', '2004 Harald Wagner. This product is free for personal use only.', '', 'plugins/{370A601C-19B9-4EEA-9BFC-14868F830272}/1.0.4/stable/ExternalVariables2C_1.0.4_Stable.mpp', '5492', '', '', 'ExternalVariables2C.txt', 1000004000000000000, 1, 'ExternalVariables2C\n\nThis plugin sends a datafeed containing variables set by files and webpages.\n\nAt this time the plugin reads files which use the jaLCDs naming conventions. For useful URLs see the jaLCDs forum at \n\nwww.jalcdsforum.de.', 'ExternalVariables2C', '', '', '', '', '0', '1', 892, 892, 0, 0, 0, 0, '8fade7e070d5e12d84a04a739607d9e6', 'FALSE'),
(71, '{387CD5F5-2EFD-4288-8113-CDF74B857425}', 'Offline Media Import', 'Imports Offline Media into the library, including the DiscID.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:40', '1.0', 'Bastian Hofmann', 'mail@bastianhofmann.de', '', 'Bastian Hofmann', '', 'plugins/{387CD5F5-2EFD-4288-8113-CDF74B857425}/1.0/stable/Offline_Media_Import_1.0_Stable.mpp', '23652', '', '', '', 1000000000000000000, 1, 'This importer is designed to import media files from removable locations, which is mostly a CD/DVD or USB drive. Next to the library name, which consists of the volumename and the filename, and the file''s path, it also imports the volume''s disc id, so that in connection with the OfflinePlaymee plugin Meedio prompts you to i.e. insert the right DVD.', 'OfflineMedia', '', '', '', '', '0', '1', 1302, 1302, 0, 0, 0, 0, '6f533ec6b04a75aec750229674324030', 'FALSE'),
(72, '{3D11CA7C-8302-4F11-BE83-8B1432187167}', 'catdna slimserver module', 'catdna slimserver module', '', 'Module', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:19', '1.0', 'Chris Eastwood', 'catdna@hotmail.com', '', 'Chris Eastwood, 2006 / SQLite.Net / SlimDevices.com', '', 'plugins/{3D11CA7C-8302-4F11-BE83-8B1432187167}/1.0/beta/catdna_slimserver_module_1.0_Beta.mpp', '1588944', '', '', '', 1000000000000000000, 1, 'This SlimServer plugin works on SlimServer version 6.2.1 - it has not been tested on earlier / later versions (and will probably not work with them).\n\nIf you don''t have a SqueezeBox, you can still play music from SlimServer by using  winamp / foobar to open up :\n\nhttp://your slim server machine:9000/stream.mp3\n\n- you can have players on different computers (and the Meedio Computer) and manage them from this SlimServer plugin.\n\nThe plugin will also interact with the Amazon Shopping Module available on MAID - simply enable the Amazon Module (full-time-plugins) and you can then search for other albums by the currently selected artist on Amazon).', 'catdnaSlimServer', 'http://www.catdna.co.uk', '', '', '', '0', '1', 962, 962, 0, 0, 0, 0, '74ae325ad92ef53533a751d847dc41ee', 'FALSE'),
(73, '{3D813328-613C-49AF-924C-AC2C75AC8FAE}', 'MeeChartsExport', 'The Meedio Top 20 Charts. MeeCharts is a set of Meedio Plugins which interact between Meedio and the MeeCharts System in order to deliver a variety of music based "popularity" charts. Think of MeeCharts as the Meedio Top 20 or Billboard 100.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:50', '1.2', 'Jason Hyland', 'jason@hylandfamily.org', '', '2005 Jason Hyland', '', 'plugins/{3D813328-613C-49AF-924C-AC2C75AC8FAE}/1.2/stable/MeeChartsExport_1.2_Stable.mpp', '790855', '', '', 'readme.htm', 1002000000000000000, 1, '', 'MeeChartsExport', 'http://jason.hylandfamily.org/', '', '', '', '0', '1', 737, 737, 0, 0, 0, 0, '25433bfcccc8cdb9ef23eeac06667e1c', 'FALSE'),
(74, '{3E616CE3-AA94-452F-80FF-0ABB05B52829}', 'UIRT_TX2', 'Send Ir Codes with USB_UIRT via Meedio Messages', '', 'Input', 'None', 'Donationware', 'Beta', '2007-05-14 16:35:18', '1.03', 'marc', 'marc-cohn@cox.net', '', '', '', 'plugins/{3E616CE3-AA94-452F-80FF-0ABB05B52829}/1.03/beta/UIRT_TX2_1.03_Beta.mpp', '260771', '', '', 'UIRT_TX.rtf', 1003000000000000000, 1, '', 'USB_UIRT', '', '', '', '', '0', '1', 570, 570, 0, 0, 0, 0, '178687445cfb189226cf2bf23fd5c1b0', 'FALSE'),
