(76, '{40D24A4F-A19B-48CF-A2CB-9AC2156C64FC}', 'MpgII2DVD', 'Burn Mpg2 to DVD', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:35', '1.1', 'CyberVillain', 'anders.malmgren@dac.se', 'CyberVillain', '2004 DAC Ltd', '', 'plugins/{40D24A4F-A19B-48CF-A2CB-9AC2156C64FC}/1.1/stable/MpgII2DVD_1.1_Stable.mpp', '5280490', '', '', '', 1001000000000000000, 1, 'Burn Mpg2 to DVD.\nSelect a MpegII library, choose a tempfolder. Set the path to your burnerprogram. If the burnerprogram burns from isos use <DVDiso> or if it burns from a DVD structured folder, use <dvdpath>. Ex c:\\Program Files/Burner/burner.exe <dvdiso>.\nIf you want Edit your clips you need to install cuttermaran and supply the path in the config\n\nAll programs included in this package are freeware for personal use only.', 'MpgII2DVD', '', '', '', '', '0', '0', 1152, 1152, 0, 0, 0, 0, '2e9b48917087e0dd81773f01f6dc9dcb', 'FALSE'),
(77, '{41165554-3331-41E8-8BAA-CF0F9D781A9A}', 'SageTV Recordings XML Importer', 'Loads the TV Recordings found in the SageTV Webserver Recordings XML file', '', 'Import', '', 'Freeware', 'Beta', '2007-05-14 16:34:56', '1.9', 'Robert G. Faulkner', 'robgfaulkner@sbcglobal.net', 'robgfaulkner', '2006 RGF Software Design', '', 'plugins/{41165554-3331-41E8-8BAA-CF0F9D781A9A}/1.9/beta/SageTV_Recordings_XML_Importer_1.9_Beta.mpp', '453686', '', '', '', 1009000000000000000, 0, 'This importer uses the SageTV Webserver to get information about your recorded SageTV shows.', 'Import_SageRecordings', 'www.rgfweb.com', '', '', '', '0', '0', 99, 1332, 0, 0, 0, 0, 'c4d41b93347b773f20f1d14246005b6d', 'FALSE'),
(78, '{42C9F222-2C91-42CD-B3B7-D4C5E03E4268}', 'CallerID+', 'Displays Caller ID information via a skinnable overlay from a TAPI v3.0 modem or a YAC server.  Supports pictures, call logging, phone number formatting, name/picture changing, and message playing.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:19', '2.3.3', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{42C9F222-2C91-42CD-B3B7-D4C5E03E4268}/2.3.3/stable/CallerID~_2.3.3_Stable.mpp', '1811027', '', '', 'readme.html', 2003003000000000000, 0, 'Directions at http://callerid.hargraveusa.com', 'CallerID', 'http://callerid.hargraveusa.com/', '', '1.0', '', '0', '1', 184, 1482, 0, 0, 0, 0, 'fe4939815490d95706b2d4e561bddd46', 'FALSE'),
(79, '{43182194-AB9C-43C2-A17A-8911E94B89D9}', 'meeFileRenamer', 'Rename your files based on their library attributes', '', 'Import', '', 'Freeware', 'Beta', '2007-05-14 16:34:00', '0.9b', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{43182194-AB9C-43C2-A17A-8911E94B89D9}/0.9b/beta/meeFileRenamer_0.9b_Beta.mpp', '10714', '', '', '', 9000000000002000, 1, 'Installation Instructions: \nâ€¢ Download and run meeFileRenamer.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the Imports tab for the library you wish to rename \nâ€¢ Add a new import \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select meeFileRenamer in Choose the plugin to perform the import \nâ€¢ Add each root path you want meeFileRenamer to move files into in Root folders (e.g. D:\\Archive\\Shows\\,E:\\Archive\\Shows2) \nâ€¢ (optional) Set an amount of free space (in GB) to maintain on all roots (e.g. 2) \nâ€¢ (optional) Set Folder name mask to the format you want to use in moving your files (e.g. <SeriesName>\\Season <SeasonNumber|L02>\\) \nâ€¢ Set File name mask to the format you want to use in renaming your files (e.g. <SeriesName> -- Season <SeasonNumber|L02>, Episode <EpisodeNumber|L02> -- <EpisodeName>) \nâ€¢ (optional) Set Find & Replace as needed (e.g. The Office (US)|The Office) \nâ€¢ (optional) Enable debug logging by checking Write debug log?', 'meeFileRenamer', 'http://www.meedios.com/forum/viewtopic.php?t=628', 'http://www.meedios.com/maid/dl.php?plugin_id={43182194-AB9C-43C2-A17A-8911E94B89D9}', '', '', '0', '1', 1130, 1950, 0, 0, 0, 0, '2c00947ff62694ada7f8ca7c8242dc54', 'FALSE'),
(80, '{431EED7E-79A4-460F-BD40-B142083A9E9D}', 'ExtendedJukebox', 'Play your music albums using a LCD display.', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:26', '1.0.7', 'CyberVillain', 'anders.malmgren@dac.se', 'CyberVillain', '2005 DAC Ltd', '', 'plugins/{431EED7E-79A4-460F-BD40-B142083A9E9D}/1.0.7/stable/ExtendedJukebox_1.0.7_Stable.mpp', '77077', '', '', 'readme.nfo', 1000007000000000000, 1, 'Play your music albums. See the supplied .nfo', 'ExtendedJukebox', '', '', '', '', '0', '0', 1466, 1466, 0, 0, 0, 0, '41f8f8d906f0e519b82131816403ad56', 'FALSE'),
(81, '{4386289E-B70A-4BA7-81BA-BCA89745D213}', 'Mee-2-BTV', 'Seamlessly move between Beyond TV 3.5 and Meedio.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:45', '0.1.0', 'Neil Layne', 'KXMage@adelphia.net', '', 'None', '', 'plugins/{4386289E-B70A-4BA7-81BA-BCA89745D213}/0.1.0/beta/Mee-2-BTV_0.1.0_Beta.mpp', '119315', '', '', 'README.htm', 1000000000000000, 1, '=0.1.0\n- No longer requires BTEWin!!!\n- Removed ''endless loop'' \n- Added M2B.ini\n-- You can now set the start screen for BTV. See notes. \n-- You can now add ANY parameters you want to launch with Meedio. \n- Now works no matter where BTV or Meedio are installed.', 'M2B', '', '', '', '', '0', '1', 866, 866, 0, 0, 0, 0, '7f1a15336057be1e2b0cc31a4815888f', 'FALSE'),
(82, '{43AE4C33-BAFF-4CC1-92C6-F1C1FC445941}', 'NVColorCtrl', 'NVidia Color Controls for Meedio/TVCentral', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:39', '1.1', 'Pitti', 'trude_v2@yahoo.com', '', '2005 Pitti', '', 'plugins/{43AE4C33-BAFF-4CC1-92C6-F1C1FC445941}/1.1/stable/NVColorCtrl_1.1_Stable.mpp', '52982', '', '', '', 1001000000000000000, 1, 'Allows you to Control the Colorsettings for your NVidia Graphicscard from inside\nMeedio/TVCentral\n\nSupports: \n* Brightness, Contrast, Gamma and DigitalVib Settings\n* Stores and Restores different Settings for :\n           Meedio/TVC Desktop\n           VideoPlayer\n           TVC LiveTV (separate for each Tuner)\n\nUsage:\nJust send a nvcolorctrl.show message from a Command Module to set the Colors for Meedio/TVC Desktop and add actions with this message to your VideoPanel.screen and LiveTV-Full.screen files to set the COlors for the Videoplayer or LiveTV', 'NVColorCtrl', '', '', '', '', '0', '0', 1123, 1123, 0, 0, 0, 0, '1d9477b8f6de36eee8af0956f6e8f126', 'FALSE'),
(83, '{446C1581-E434-4712-8B5D-C8A23FBC94EB}', 'TVRecordTrayIcon', 'Adds icon to system tray when Meedio is recording, Executes a file at start/stop recording event.', '', 'General', 'None', 'Freeware', 'Alpha', '2007-05-14 16:35:17', '1.0.0.0', 'Michel Plante', 'darknessfalls@videotron.ca', '', 'Copyright 2006 © Michel Plante', '', 'plugins/{446C1581-E434-4712-8B5D-C8A23FBC94EB}/1.0.0.0/alpha/TVRecordTrayIcon_1.0.0.0_Alpha.mpp', '131812', '', '', '', 1000000000000000000, 1, 'This plugin will add a record icon in the system tray when meedio is recording. You can click on this icon to have a popup showing  what Meedio is recording. Two tuners are currently supported but I don''t have a second tuner, so I will need your help to know if there are any bugs.\n\nThis plugin can execute a program or open a file of your choice (any registered file type in Windows, like .exe, .bat, .txt, url, etc...) when Meedio starts recording, and another one when Meedio stops recording.\n\nIf you want to change the icon displayed, or the popup background image, look in your Meedio\\plugins\\general\\TVRecordTrayIcon directory and change the record.ico or the background.jpg there. The background image can be a .jpg or .bmp file and must be the same size (width and height) as the one supplied with the plugin.\n\nOnce the plugin is installed, run Meedio config, and enable the plugin in the Full-time plugins tab.\n\nEvery plugin option is pretty self-explanatory. You can place your mouse over the option and wait for a popup with more information.\n\n{tunerid} can be use as a parameter in the start and stop parameter field if your external program needs to know which tuner is recording. \n\n{file} can also be used but only in the stop parameter field. It can be useful when your program needs to know the name and path of the recorded file.\n\nYou can contact me for any help on the Meedio forum, my nickname is Mikymike.', 'TVRecordTrayIcon', '', '', '', '', '0', '0', 360, 360, 0, 0, 0, 0, 'c18af1739d1525472d8cc2791506ae0f', 'FALSE'),
(84, '{44D891E4-BF6A-4B25-AFC2-4E47287B559E}', 'Mouse Restricter', 'Limits the mouse cursor so you can use computer and Meedio at the same time', '', 'General', 'None', 'Donationware', 'Beta', '2007-05-14 16:34:32', '1.0.1', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64', '', 'plugins/{44D891E4-BF6A-4B25-AFC2-4E47287B559E}/1.0.1/beta/Mouse_Restricter_1.0.1_Beta.mpp', '23569', '', '', '', 1000001000000000000, 1, '1. In Windows, you must position your computer monitor at 0,0 and your Meedio monitor in the negative. As this plugin just restricts mouse cursor to x>=0 and y>=0.', 'MouseRestricter', 'http://www.skyforge.net/~slug/', '', '', '', '0', '1', 902, 902, 0, 0, 0, 0, '658eb3bab0a38d9a5107634c1d5485bb', 'FALSE'),
(85, '{451B63AD-C18D-4D77-9C6B-E35BF8D64FA0}', 'Peek-a-Boo', 'Peek A Boo', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:47', '1.4', 'BobG', 'r.goodfellow@btinternet.com', 'BobG', '2006', '', 'plugins/{451B63AD-C18D-4D77-9C6B-E35BF8D64FA0}/1.4/stable/Peek-a-Boo_1.4_Stable.mpp', '34204688', '', '', '', 1004000000000000000, 1, 'Hope you like.\nIf something went wrong try running the ResourceGen.vbs file in the folder to rebuild icon.resources.\n\nTTFN\nBobG', '..\\images\\icons\\Peek-a-Boo', '', '', '', '', '0', '0', 1498, 1498, 0, 0, 0, 0, 'dca67efa71941c42ff17732ae7738d1a', 'FALSE'),
(86, '{49354769-EAF6-400A-B624-6EE8E914A2F5}', 'Sudoku', 'Play Sudoku. Check www.wikipedia.org/wiki/Sudoku for rules and details', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:35:08', '1.1', 'Volkmar Rigo', 'volkmar@rigo.bz', '', 'Volkmar Rigo', '', 'plugins/{49354769-EAF6-400A-B624-6EE8E914A2F5}/1.1/stable/Sudoku_1.1_Stable.mpp', '92868', '', '', '', 1001000000000000000, 1, 'Play Sudoku-Puzzles in Meedio.\nThe goal is to fill in the empty cells, one number in each, so that each column, row, and region contains the numbers 1 - 9 exactly once. Check www.wikipedia.org/wiki/Sudoku for details.', 'Sudoku', 'http://www.meedio.com/maid', '', '', '', '0', '0', 882, 882, 0, 0, 0, 0, '37287fc830ac275dae4123cef390a27a', 'FALSE'),
(87, '{4A4B3420-9359-492C-AAAB-B5F394B38A23}', 'WMP10Player', 'This plugin replaces the integrated Music and Video player with Windows Media Player 10.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:35:25', '0.3.1', 'Harald Wagner, with modifications by Rick Taylor', 'harald.wagner@computec.de', 'HdWagner', '2005 Harald Wagner. This product is free for personal use only.', '', 'plugins/{4A4B3420-9359-492C-AAAB-B5F394B38A23}/0.3.1/beta/WMP10Player_0.3.1_Beta.mpp', '282447', '', '', 'readme.txt', 3001000000000000, 1, 'Changes 11 Nov 05\nChanges to allow Yahoo! Launch Videos plugin to work with wmp10player\n\nChanges 2 Nov 05\nfixed the now playing screen time elapsed bug \n\nChanges 13 oct 05\n* some minor bug fixes, a little more internal refactoring.\n\n* added a setting to respond to or ignore radio.play messages\n\n* added a setting to launch alternate programs based on file names. See the ''Launch List'' setting for an example of this. Quicktime files do not play right in wmp10 on any of my systems -- sound/video sync problems, jerkiness, etc. However, they do play fine in quicktime alternative/media player classic. Because of this, and to allow this player alternative to be open ended, I added the launch list -- a list of regular expressions and what they will launch when they have a match.\n\nEnter in a regex pattern and launch information in order to launch a file in an alternate player, or to ignore the file.\n\nChanges in previous version\n\n* Drive letter setting for DVD drive (some users could not play DVDs, this should fix that issue)\n\n* removed the timer that was re-setting focus to the meedio main window continually. Changed so that it re-sets focus on specific meedio messages instead\n\n* changed so that some messages in the OSD are more verbose\n\n* added support for radio.play message, which allows this player to play shoutcast streams from messages sent from the raydee-o-browser plugin. \n\nfixed various minor bugs, refactored the code, added exception handling. Loffing and trace coming at some future daye, WMI support if someone twists my arm for it\n\n=================================\n\nThis plugin uses Windows Media Player 10 to replace the integrated Music and Video player.\n\n\nThe WMP10Player enables you to use WMP visualizations and playlists.\n\nYou should deactivate Meedios integrated Music Player (the Full-time plug-in) if you use the WMP10Player - otherwise you could hear some very funny effects ;-)', 'WMP10Player', 'http://www.meedio.com/forum/about22734.html&highlight=wmp10player', '', '', '', '0', '1', 4604, 4604, 0, 0, 0, 0, '307c02720531a156e94eaa73e6446eac', 'FALSE'),
(88, '{4A68E1D2-918A-49D6-9723-8735461A398B}', 'ResMee', 'Maintains Meedio''s resolution', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:54', '1.103', 'reverson1', 'noemail@noemail.com', 'reverson1', '2005 GetmyGames', '', 'plugins/{4A68E1D2-918A-49D6-9723-8735461A398B}/1.103/beta/ResMee_1.103_Beta.mpp', '13431', '', '', '', 1103000000000000000, 0, 'This plugin will automatically reset the size and position of Meedio to their original settings.', 'ResMee', '', '', '', '', '0', '0', 504, 1039, 0, 0, 0, 0, 'c71a90bfacea01128b74de951aa938f2', 'FALSE'),
(89, '{4B271EC5-0BC1-43AD-8E16-776C06F22838}', 'MovieTimes VBNET Importer', 'This plug-in retrieves upcoming movie show times for your local theaters. Also downloads associated movie details, posters, and trailers. Currently supports Australia, Belgium, Canada, France, Germany, Netherlands, UK, and the US.', '', 'Import', '', 'Donationware', 'Stable', '2007-05-14 16:34:34', '3.8.1', 'key master', 'movietimes@comcast.net', 'key master', '', '', 'plugins/{4B271EC5-0BC1-43AD-8E16-776C06F22838}/3.8.1/stable/MovieTimes_VBNET_Importer_3.8.1_Stable.mpp', '519357', '', '', 'Instructions.rtf', 3008001000000000000, 0, '', 'MovieTimesVBNET', 'http://home.comcast.net/~movietimes/index.html', '', '', '', '0', '1', 131, 1854, 0, 0, 0, 0, '735ace5bae297a9c7c974d45330f3e66', 'FALSE'),
(90, '{4B37581C-4455-45A3-A5F6-A79793CB65F2}', 'Beta Twist Pro', 'The new and improved Beta Twist theme with more advanced features.', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:15', '0.86', 'Jason Verhagen (aka robogeek)', 'jlverhagen@tfo.net', 'robogeek', '', '', 'plugins/{4B37581C-4455-45A3-A5F6-A79793CB65F2}/0.86/beta/Beta_Twist_Pro_0.86_Beta.mpp', '9628276', '', '', '', 86000000000000000, 1, 'August 18, 2005\r\nBetaTwistPro v.86 beta\r\n******************************\r\nThe Beta Twist Pro theme is an updated version of the Beta Twist theme and includes many adjustable theme settings.  This is a beta version and some screens need some tweaking and there are additional theme settings I would like to add, so please report any bugs and feedback in the official support thread and I''ll get things fixed and added ASAP.\r\n\r\nBeing a beta version, I don''t have documentation ready yet for this theme... sorry :(  If you have any questions, I''d be happy to help out if you post a message in the official support thread or PM me (robogeek) on the Meedio forums.\r\n******************************\r\nHere is a link to the official support thread for the Beta Twist Pro theme.  Use this thread to also report bugs, request help, or make comments and suggestions:\r\n\r\nhttp://meedio.com/forum/viewtopic.php?p=168865\r\n\r\nEnjoy!', 'BetaTwistPro', '', '', '1.36', '', '0', '0', 3424, 3424, 0, 0, 0, 0, '80add941ae753475a6b70138b7a895f4', 'FALSE'),
(91, '{4BED6607-9F25-40E3-84D7-A60A9DA21AF3}', 'JRMC Importer', 'Imports JRMC library items into a Meedio library section.for use with the JRMC Media Player general plug-in. The Importer comes with a 30 day free trail (During trial period the importer will only import every other file).', '', 'Import', 'None', 'Shareware', 'Stable', '2007-05-14 16:33:42', '2.0.6', 'Donald Hill', 'plugins@theaterwave.com', 'dhill', '2004 TheaterWave.', '', 'plugins/{4BED6607-9F25-40E3-84D7-A60A9DA21AF3}/2.0.6/stable/JRMC_Importer_2.0.6_Stable.mpp', '213214', '', '', 'Readme.txt', 2000006000000000000, 1, 'The Importer comes with a 30 day free trail.\nThe importer imports JRMC library items into a Meedio library section.\nIt can import Audio, Image, Video, TV, Data and Unknown media types. You may select any of the default 59 JRMC or user added fields to be imported.\nImport mode: ''Update existing items and add new items'' will only add new items and remove old ones. To update items use ''Delete all items and re-import''.\nPlease see JRMC Media Player folder for documentation.', 'JRMC', 'http://www.theaterwave.com/tw/software_info.php?id=3', '', '1.36', '', '0', '1', 444, 444, 0, 0, 0, 0, '4426ffd58216122bb8d47bcc1ad4681d', 'FALSE'),
(92, '{4C0910D7-A5CC-4BD8-8C6E-5EAF460C05E4}', 'MAME Import', 'MAME Import', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:45', '0.2', 'Dan Carter, Dan Nilsson', 'meedio@recycledkarma.com', '', '2004 Dan Carter, Dan Nilsson', '', 'plugins/{4C0910D7-A5CC-4BD8-8C6E-5EAF460C05E4}/0.2/beta/MAME_Import_0.2_Beta.mpp', '24331', '', '', 'documentation.txt', 2000000000000000, 1, 'This plugin needs game information from MAME. You can generate this with the "-listxml" command with MAME. See documentation.txt for further information.', 'MameImport', '', '', '', '', '0', '1', 1105, 1105, 0, 0, 0, 0, 'be3f37636ce6b8c82c54e0f8c9e37b32', 'FALSE');
