(93, '{4C4396D5-EBF2-4BD0-A7D3-D1999018BFE9}', 'PictureShow', 'Slideshow of pictures.', '', 'General', 'None', 'Donationware', 'Beta', '2007-05-14 16:34:47', '0.52', 'Dave Brown', 'drmbrown@comcast.net', 'fornold', '2004 Dave Brown', '', 'plugins/{4C4396D5-EBF2-4BD0-A7D3-D1999018BFE9}/0.52/beta/PictureShow_0.52_Beta.mpp', '34531', '', '', 'Readme.doc', 52000000000000000, 1, 'PictureShow is an alternative picture slideshow routine that supports some simple transitions.  If config''d as such it will intercept the Meedio slideshow messages.\n\nPSAslidshow 1.40 has been set up to send message directly to PictureShow is so configured.  The options screen allows for the transition to be set.\n\n\n0.40: Much improved performance.  \nResponse to input commands much improved\nIncluded a couple more transitions (PSA 1.42 supports)\n0.43: Minor bug fix with Meedio exit\nAdded option to not display the filename\n0.46: Bug Fix for when in Random mode\nAdded option to disabel Previous/Next buttons except when paused.\n0.47: Bug fix for no pictures in the message\nBug fix for when message contains \ndirectories not pictures\n0.50: Fixed autorotation\nFixed Previous/Next when paused from restarting the slideshow\n0.52: fixed support for start-file option in slideshow.start message', 'PictureShow', '', '', '', '', '0', '1', 1416, 1416, 0, 0, 0, 0, '22e03d05a2ebfbf317acd44f7086999f', 'FALSE'),
(94, '{4E45D19D-6D90-4BCA-A1E9-D7463D42F244}', 'File Download Importer', 'Downloads online files in your media library to a local folder.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:27', '1.1', 'Seb', 'n/a', '', '', '', 'plugins/{4E45D19D-6D90-4BCA-A1E9-D7463D42F244}/1.1/stable/File_Download_Importer_1.1_Stable.mpp', '4020', '', '', '', 1001000000000000000, 1, 'Downloads online files in your media library to a local folder.\n\nCan download QuickTime video files such as those imported by New Apple Trailers Importer and Apple Movie Trailers Importer.\n\nNew in v1.1:\nOption to re-download file every time the import is ran.', 'DownloadFile', '', '', '', '', '0', '1', 1550, 1550, 0, 0, 0, 0, '9358f36cd61ada0fe88364a523b6a54d', 'FALSE'),
(95, '{4E86DA20-0CFC-4053-9918-79B3B7556ED8}', 'meeNorway', 'Module for norwegians enabling primarly the NRK WebTV interface to be accessible from inside Meedio.', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:13', '1.800', 'Kosh', 'tamyk@online.no', 'kosh', 'Kosh', '', 'plugins/{4E86DA20-0CFC-4053-9918-79B3B7556ED8}/1.800/stable/meeNorway_1.800_Stable.mpp', '246769', '', '', '', 1800000000000000000, 1, 'Plugin for browsing and playing audio/videostreams from www.nrk.no, www.vg.no, www.tv2.no, www.p4.no, www.kanal24.no, Norsk Tipping', 'meeNorway', 'www.meedio.com', '', '1.38', '', '0', '1', 466, 466, 0, 0, 0, 0, '111cc6e95de8a7b6ebba0458449b914d', 'FALSE'),
(96, '{4E9C0181-5B0C-40EE-A3EE-1B484FCC0776}', 'BTVmee', 'This theme is based on Snapstream''s BeyondTV', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:17', '1.0', 'Joshua C. Walters', 'joshwalters@gmail.com', 'walts81', '2004 - 2005 JCSoftware, Inc.   all rights reserved', '', 'plugins/{4E9C0181-5B0C-40EE-A3EE-1B484FCC0776}/1.0/stable/BTVmee_1.0_Stable.mpp', '9071508', '', '', '', 1000000000000000000, 1, 'This theme is based on DigitalOldSchool''s Snappy! theme. I updated most of the screens, added some icons, and changed the graphics to resemble BeyondTV 4.', 'BTVmee', 'http://www.meedio.com/maid', '', '', '', '0', '0', 3233, 3233, 0, 0, 0, 0, 'e652b8d11196b0d1c726efe019b021d7', 'FALSE'),
(97, '{4E9D3A67-D79A-4BC9-B1A5-4B0AB3108D07}', 'Meedio 1280', 'Meedio 1280', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:52', '1.0.4', 'Jim Beasley', 'beasleyx@hotmail.com', '', '', '', 'plugins/{4E9D3A67-D79A-4BC9-B1A5-4B0AB3108D07}/1.0.4/stable/Meedio_1280_1.0.4_Stable.mpp', '10222061', '', '', '', 1000004000000000000, 1, 'Theme created for 1280x720 resolution.', 'Meedio_1280', 'http://www.meedio.com/maid', '', '', '', '0', '0', 3864, 3864, 0, 0, 0, 0, '61d8f9a16b9e804d2ee31ce405f08e3e', 'FALSE'),
(98, '{5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC}', 'ControlMee', 'ControlMee allows you to use your Meedio remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.  Supports a keyboard hook and numeric keyboard.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:21', '2.2', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC}/2.2/stable/ControlMee_2.2_Stable.mpp', '188702', '', '', 'readme.html', 2002000000000000000, 0, 'ControlMee allows you to use your Meedio remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.\n\nDirections at: http://controlmee.hargraveusa.com/\n\n*New for v2.1: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before resetting the key to its initial numeric value.', 'ControlMee', 'http://controlmee.hargraveusa.com/', '', '1.15.24', '', '0', '1', 259, 1733, 0, 0, 0, 0, 'aa26e9d8640746fe35347171ea048a57', 'FALSE'),
(99, '{52853D5A-8A47-43FA-AE08-FF1AA389C0DF}', 'FrameShots Importer', 'Use FrameShots to generate video thumbnails', '', 'Import', '', 'Freeware', 'Beta', '2007-05-14 16:33:27', '0.3c', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{52853D5A-8A47-43FA-AE08-FF1AA389C0DF}/0.3c/beta/FrameShots_Importer_0.3c_Beta.mpp', '1210163', '', '', '', 3000000000003000, 0, 'Installation Instructions: \nâ€¢ Download and install FrameShots_Importer.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the Imports tab for the library you wish to thumbnail \nâ€¢ Add a new import \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select FrameShots Importer in Choose the plugin to perform the import \nâ€¢ Select whether you want the thumbnails saved In place (in the same folder as the video) or To another folder (in a different folder as the video) in Save image: \nâ€¢ If you selected To another folder in Save image:, select your thumbnail folder in To another folder: \nâ€¢ (optional) Select Overwrite existing thumbanils? to replace already extant thumbnails (overrides Check image location tag? and Check whether image file exists?) \nâ€¢ (optional) Select Check image location tag? to skip library items that have a populated image tag \nâ€¢ (optional) Select Check whether image file exists? to check whether the populated image tag points to a valid file (does nothing without Check image location tag? selected) \nâ€¢ (optional) Specify the time (in milliseconds) to ignore at the beginning of a video in Front Skip (ms): \nâ€¢ (optional) Specify the time (in milliseconds) to ignore at the end of a video in Back Skip (ms): \nâ€¢ (optional) Select Resize thumbnail? to resize the generated thumbnail \nâ€¢ (optional) Specify the resized thumbnail width in Resized width: (does nothing without Resize thumbnail? selected) \nâ€¢ (optional) Specify the resized thumbnail heightin Resized height: (does nothing without Resize thumbnail? selected) \nâ€¢ (optional) Select Trim black borders? to remove black borders commonly found around videos \nâ€¢ (optional) Select Crop to exact dimensions? to ignore video aspect ratio when resizing the thumbnail (does nothing without Resize thumbnail? selected) \nâ€¢ (optional) Specify brightness adjustment (-100 to 100) in Brightness: \nâ€¢ (optional) Specify contrast adjustment (-100 to 100) in Contrast: \nâ€¢ (optional) Select a time to run FrameShots Importer automatically in Schedule this import to run automatically', 'FrameShots_Importer', 'http://www.meedios.com/forum/viewtopic.php?t=392', 'http://www.meedios.com/maid/dl.php?plugin_id={52853D5A-8A47-43FA-AE08-FF1AA389C0DF}', '0.01', '1.41', '0', '1', 286, 1996, 0, 0, 0, 0, '8bce60411036e2e6c85229fb33e2a618', 'FALSE'),
(100, '{529CB2FF-F480-49FD-89BC-803D662E2A68}', 'PSASlideshow', 'Uses Image tags to generate a slideshow.', '', 'Module', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:50', '1.82', 'Dave Brown', 'drmbrown@comcast.net', 'fornold', '2004 David Brown', '', 'plugins/{529CB2FF-F480-49FD-89BC-803D662E2A68}/1.82/stable/PSASlideshow_1.82_Stable.mpp', '414422', '', '', 'readme.pdf', 1082000000000000000, 1, 'Setup a new module using the PSASlideshow plugin.\r\n\r\nNote: One of the importers must now be used.\r\n\r\nRecompiled for Meedio 1.40', 'PSASlideshow', '', '', '', '', '0', '1', 895, 895, 0, 0, 0, 0, '226b1773d37be02ebd69aeb5fe288f92', 'FALSE'),
(101, '{554A0919-D007-4057-8832-13EC21DEBBC0}', 'Phonee Book', 'Search for addresses and phone #''s', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:47', '1.8', 'Joshua C. Walters', 'joshwalters@gmail.com', 'walts81', 'Â© 2004-2005 JCSoftware, Inc.  all rights reserved', '', 'plugins/{554A0919-D007-4057-8832-13EC21DEBBC0}/1.8/beta/Phonee_Book_1.8_Beta.mpp', '146620', '', '', '', 1008000000000000000, 1, 'Using Meedio Configuration...\n\n1) Enable the plugin under the ''Full-time plug-ins'' tab\n2) Add a ''Command Module'' under the ''Menu'' tab\n3) Select the Module Properties tab\n4) Choose ''Send custom Command'' from the ''Command to send'' drop-down\n5) Type ''phoneebook.display-window'' in the ''Custom command to send'' box \n\nThat''s It!', 'PhoneeBook', 'http://www.meedio.com/maid', '', '', '', '0', '1', 1011, 1011, 0, 0, 0, 0, 'f028991108cde9dcb5869f00251f1adf', 'FALSE'),
(102, '{557F59AD-00AC-4FAF-ABFB-13DAED331B5E}', 'USB_UIRT_TX', 'Send Ir Codes with USB_UIRT', '', 'Module', 'None', 'Donationware', 'Beta', '2007-05-14 16:35:18', '1.0', 'marc', 'marc-cohn@cox.net', '', '', '', 'plugins/{557F59AD-00AC-4FAF-ABFB-13DAED331B5E}/1.0/beta/USB_UIRT_TX_1.0_Beta.mpp', '129609', '', '', '', 1000000000000000000, 1, 'Plugin is single group module that sends the IR code entered in the properties when selected.\n\nPlugin properties:\n\nIR Code Format:  Select one of the three choices.  (Pronto - Raw works good for me)\n\nRepeat Count, The number of times the code is sent.\n\nIR Code: To learn the IR code  use the include utility, "trydrv.exe".  Copy and paste the  learned codes from the utility into the IR Code plugin property.  Not, make sure the learned code format matches the selected IR Code Format property.\n\nIR Code Test:  Not used yet.  When implemented, an integrated learning window will pop up upon [...].  So the trdrv.exe will no longer be needed.', 'UIRT_TX', '', '', '', '', '0', '1', 715, 715, 0, 0, 0, 0, '6c7451a7f24974c8254f75c08aec37f3', 'FALSE'),
(103, '{57820A09-419D-4666-9E99-E1309284B952}', 'NumToKey', 'This plugin will convert numeric input to simulated alpha keypresses.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:39', '1.072', 'reverson1', 'reverson1@getmygames.com', 'reverson1', '', '', 'plugins/{57820A09-419D-4666-9E99-E1309284B952}/1.072/stable/NumToKey_1.072_Stable.mpp', '14734', '', '', '', 1072000000000000000, 1, 'When enabled NumToKey will convert numeric input in the following manner:\n\n0 - 0\n1 - 1\n2 - 2, A, B, C\n3 - 3, D, E, F\n4 - 4, G, H, I\n5 - 5, J, K, L\n6 - 6, M, N, O\n7 - 7, P, Q, R, S\n8 - 8, T, U, V\n9 - 9, W, X, Y, Z', 'NumToKey', 'http://www.getmygames.com', '', '1.38', '', '0', '0', 683, 683, 0, 0, 0, 0, '34dce494a912073b0677a5db91fcc440', 'FALSE'),
(104, '{585D0286-D623-4632-8D72-55BFD0F6FE3B}', 'ClientImport', 'Run an Importer on another Meedio PC', '', 'Module', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:20', '1.0.1', 'walts81', 'joshwalters@gmail.com', 'walts81', '2007', '', 'plugins/{585D0286-D623-4632-8D72-55BFD0F6FE3B}/1.0.1/stable/ClientImport_1.0.1_Stable.mpp', '29377', '', '', '', 1000001000000000000, 1, 'No documentation.', 'ClientImport', 'http://www.meedios.com/maid', '', '', '', '0', '1', 1341, 1341, 0, 0, 0, 0, '5faf6f210361e75e572ab36eb4ae13cd', 'FALSE'),
(105, '{58EDF673-8327-4D06-95AC-29814B6EB994}', 'XM Radio Online', 'XM Radio Online Player', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:35:26', '1.0', 'Mike DePalma', 'mikedepalma@gmail.com', '', '2005 Mike DePallma', '', 'plugins/{58EDF673-8327-4D06-95AC-29814B6EB994}/1.0/beta/XM_Radio_Online_1.0_Beta.mpp', '422176', '', '', '', 1000000000000000000, 1, 'Get an XM Radio Online account from http://xmro.xmradio.com/\nInstall XaMpD 1.2.3 from http://xampd.imomo.net/download/\nPut account information in XaMpD.\n\nRun importer and click on stream to play!\n\nTO DO:\n\nImplement stop/pause on streams\nAdd custom screen file\nGrab detailed descriptions\nAdd channels which do not fit regex\nchange stream speed: high or low\ntimeshifting???', 'XMRO', '', '', '', '', '0', '1', 669, 669, 0, 0, 0, 0, '006bc070acf263639444e12e26a4d01c', 'FALSE'),
(106, '{5ABBD57B-92A1-49EA-8336-B1D27C1875C5}', 'MetaGeta2Meedio', 'Imports a MetaGeta set into a section of the Meedio media library', '', 'Import', 'None', 'Freeware', 'Alpha', '2007-05-14 16:34:30', '1.2', 'Will Thomas', 'indortas@yahoo.com', '', 'Will Thomas', '', 'plugins/{5ABBD57B-92A1-49EA-8336-B1D27C1875C5}/1.2/alpha/MetaGeta2Meedio_1.2_Alpha.mpp', '36394', '', '', '', 1002000000000000000, 1, 'This plugin requires MetaGeta v1.2. After you''ve run MetaGeta and created a set, MetaGeta will create a "MetaGetaSetData.xml" file in its directory. Simply point MetaGeta2Meedio to that file and give the name of the set you wish to import from MetaGeta. See http://www.personal.psu.edu/users/w/b/wbt102/metageta/ for more information.', 'MetaGeta2Meedio', 'http://www.personal.psu.edu/users/w/b/wbt102/metageta/', '', '', '', '0', '1', 553, 553, 0, 0, 0, 0, '49da852fd22cbff3015fdead1f8e4ebf', 'FALSE'),
(107, '{5AD775D5-8F15-4C39-944B-9072C3DE03FA}', 'MyLists', 'Create Shopping and To Do Lists', '', 'Module', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:36', '1.1.6', 'Joshua C. Walters', 'joshwalters@gmail.com', 'walts81', '2004 - 2005 JCSoftware, Inc.   all rights reserved', '', 'plugins/{5AD775D5-8F15-4C39-944B-9072C3DE03FA}/1.1.6/stable/MyLists_1.1.6_Stable.mpp', '229169', '', '', '', 1001006000000000000, 1, '1) Open Meedio Configuration\n2) Add MyLists module\n3) Select your ''Lists'' section under the ''Module Properties'' tab (you''ll probably need to create the ''Lists'' section first)', 'MyLists', 'http://www.meedio.com/maid', '', '', '', '0', '1', 995, 995, 0, 0, 0, 0, '7ec8dd2243e92efee5c1a406599a4193', 'FALSE'),
(108, '{5B86F572-B15D-4DE1-8589-A900490ED4C8}', 'RS232', 'Control devices via RS232.  You can send a single command or a macro containing many commands.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:54', '1.1.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{5B86F572-B15D-4DE1-8589-A900490ED4C8}/1.1.1/stable/RS232_1.1.1_Stable.mpp', '296107', '', '', 'readme.html', 1001001000000000000, 0, 'Control devices via RS232.  You can send a single command or a macro containing many commands.\n\nSee http://rs232.hargraveusa.com for directions.', 'RS232', 'http://rs232.hargraveusa.com/', '', '1.15.24', '', '0', '1', 123, 1105, 0, 0, 0, 0, 'ac112494b3db0ac912922a9f18608e6d', 'FALSE'),
(109, '{5BEDC0AC-9BDD-4049-8768-02F760629818}', 'TvT Browser', 'Browse episodes, shows and people from your TvTome media libraries', '', 'Module', 'None', 'Donationware', 'Alpha', '2007-05-14 16:35:17', '1.21', 'Jonathan Trevor', 'jonathan.trevor@gmail.com', '', 'Jonathan Trevor', '', 'plugins/{5BEDC0AC-9BDD-4049-8768-02F760629818}/1.21/alpha/TvT_Browser_1.21_Alpha.mpp', '34464', '', '', '', 1021000000000000000, 1, 'Works in conjunction with TvT Importer plugin http://www.meedio.com/maid/detail.php?mode=detail&plugin_id={0025B281-CE64-4453-95A4-0A9573F5BD8E}\n\nProvides detailed series/episode/person browser for all information retrieved from TvTome about your episodes/file on disk.\n\nDifferent information about a series / person / episode can be reached through the bottom menu item in the relevant screens.\n\nUncategorised episodes (from the importer) can be found in a "unclassified" series.', 'TvT_Browser', '', '', '', '', '0', '1', 260, 260, 0, 0, 0, 0, '482b40add2a646b84e8e3b2a137a1f62', 'FALSE'),
(110, '{5BFD66FB-75E2-4F6D-BF48-7F6A82F995D8}', 'Favorites', 'Manages Favorites and Recent items in a media module.', '', 'General', 'None', 'Freeware', 'Alpha', '2007-05-14 16:33:27', '2', 'Bobothehobo', 'rotos@earthlink.net', '', 'Bobothehobo', '', 'plugins/{5BFD66FB-75E2-4F6D-BF48-7F6A82F995D8}/2/alpha/Favorites_2_Alpha.mpp', '27252', '', '', '', 2000000000000000000, 1, 'Configuring the plugin:\n  Enable the ''Favorites'' plugin in the full-time plugins section of the configuration utility.  In the ''Sections'' filed, add, one per line, the name of the sections you want the plugin to monitor.  In the ''Recent Messages'' field, add one per line the name of the messages you want to update the recent list, or simply use the defaults. For ''Recent Item Count'' enter the number of items you want in the recent list before the old ones start being deleted.\n\nConfiguring the media module:\n  For media modules go to the module''s properties page.  Change the ''Detail Screen File'' setting to the ''media.movie.favorite.screen'' file provided in the plugin''s directory.  \n\nChange the item launching options with ''Command'' set to play, and ''Function'' Set to start your media. After you setup the play command add the text "section={section},externalid={external-id}" after the command name. So that the function field looks something like:\n\n"Play Video File",section={section},externalid={external-id},file={file}"\nto play a video, or:\n\n"Launch Program",section={section},externalid={external-id}, ..\nto launch a program.\n\n\nConfiguring the Media library:\n  Double click any item in the library. Under ''Tags'' add a tag named ''favRecentTime''.  Goto the views section and add a setup the view for favorites, and set the filter rule to "{favorite}=''favorite''" (no double quotes in the box}. Then sutup a view for recents, with the filter set to "{favRecent}=''recent''".\n\nA good view for the recent list would look like,\n  Group By: <name>\n  Function: blank\n  Mode: Whichever you like\n  Sort By: favRecentTime\n  Sort Type: date\n  Sort asc: false\n\nThis will give a list of the recent items with the most recent at the top.', 'Favorites', '', '', '', '', '0', '1', 907, 907, 0, 0, 0, 0, '19fd33bd1669f7c4bcab3c8bfcf03add', 'FALSE'),
(111, '{5C077000-0000-0000-0000-00050EE2E3EE}', 'SqueezeMee', 'Re-encodes MPG2 files into WMV', '', 'General', 'None', 'Commercial', 'Beta', '2007-05-14 16:35:07', '0.8', 'CuulStuff Labs - Scott Medynski', 'thatcuulguy@telus.net', '', '2004 CuulStuff Labs - Scott Medynski', '', 'plugins/{5C077000-0000-0000-0000-00050EE2E3EE}/0.8/beta/SqueezeMee_0.8_Beta.mpp', '100590', '', '', 'SqueezeMee.txt', 8000000000000000, 1, '', 'SqueezeMee', 'http://www.cuulstufflabs.com', '', '1.15.25', '', '0', '1', 526, 526, 0, 0, 0, 0, '87644047620cb50439d496a7ca06c408', 'FALSE'),
(112, '{5C077000-0000-1111-0000-3A7C3EE5BEE7}', 'WatchMeeSpeak', 'Interacts with Speak2Mee and Listen2Mee Speech plugins', '', 'Module', 'None', 'Commercial', 'Stable', '2007-05-14 16:35:20', '1.0.3', 'CuulStuff Labs - Scott Medynski', 'thatcuulguy@telus.net', '', '2004 CuulStuff Labs - Scott Medynski', '', 'plugins/{5C077000-0000-1111-0000-3A7C3EE5BEE7}/1.0.3/stable/WatchMeeSpeak_1.0.3_Stable.mpp', '33176', '', '', '', 1000003000000000000, 1, 'Prerequisites:\nFor Text-to-Speech:\n     On-Screen Keyboard plugin\n     Speak2Mee\n1) Download Speak2Mee - the text-to-speech plugin \nSpeak2Mee is not necessary to load the WatchMeeSpeak plugin, but it will but it will have no functionality - showing only an empty screen.  \nThe OnScreenKeyboard is also required for input to the TTS portion of the screen.\n2) Register your Speak2Mee plugin to enable it to interact with other plugins.\n3) Add a WatchMeeSpeak module to your menu in Configure.exe\n4) Try out all the features of the Speech suite of plugins!', 'WatchMeeSpeak', 'http://www.cuulstufflabs.com', '', '', '', '0', '1', 619, 619, 0, 0, 0, 0, '70b5c637269d4495617eb596fc631e6f', 'FALSE'),
(113, '{5C077000-1111-0000-1111-0005BEA723EE}', 'Speak2Mee', 'Text To Speech Output', '', 'General', 'None', 'Commercial', 'Stable', '2007-05-14 16:35:00', '1.2', 'CuulStuff Labs - Scott Medynski', 'thatcuulguy@telus.net', '', '2004 CuulStuff Labs - Scott Medynski', '', 'plugins/{5C077000-1111-0000-1111-0005BEA723EE}/1.2/stable/Speak2Mee_1.2_Stable.mpp', '3816503', '', '', 'Speak2Mee-Help.chm', 1002000000000000000, 1, 'Use Speak2Mee to let your PC speak to you!  This is a text-top-speech application plugin.\nSpeak2Mee allows you to configure greetings for when you start and stop Meedio.  Configure it to speak fast, slow, spell, loud, quiet, or speak the text from a file.\n\nFor Windows XP users, use the included installer to get two extra voices - Mike and Mary. \n\nUpgrade to Speak2Mee Pro to enable reading email with the Email plugin, receive verbal updates on any datafeed you have access to with the C.Mee plugin, or listen to news updates with the Meedio Pro theme.  \nGo to www.cuulstufflabs.com to find out how to upgrade to Speak2Mee Pro.\n\nUse the WatchMeeSpeak plugin to test out settings and various text combinations.\nFor more details, see the included compiled help module, Speak2Mee-Help.chm', 'Speak2Mee', 'http://www.cuulstufflabs.com', '', '', '', '0', '1', 679, 679, 0, 0, 0, 0, '97b768e4393cef57a74743984903445a', 'FALSE'),
(114, '{5C077000-FB33-D157-5BCE-000FBEE5BACE}', 'MeeFreeSpace', 'Displays system disk usage and available space', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:01', '1.2.2', 'Scott Medynski', 'thatcuulguy@telus.net', '', '2004 CuulStuff Labs - Scott Medynski', '', 'plugins/{5C077000-FB33-D157-5BCE-000FBEE5BACE}/1.2.2/stable/MeeFreeSpace_1.2.2_Stable.mpp', '297966', '', '', 'MeeFreeSpace_ReadMe.htm', 1002002000000000000, 1, 'Displays system disk usage and available space.  Instead of wondering how much free space is available on your system, just place a meeFreeSpace module in your menu and you''ll be able to see how much space is available on each drive.  \nYou can see how much space is left in bytes (kB, MB, GB) or in time (hours left).', 'meeFreeSpace', 'http://www.cuulstufflabs.com', '', '', '', '0', '1', 1564, 1564, 0, 0, 0, 0, '4344ecee562b7100a50b530fba256723', 'FALSE'),
(115, '{5C3D691D-EC3F-4963-B95E-0A975C381C7D}', 'Spitfire Mk II', 'CrispyXUK''s Theme', '', 'Theme', 'None', 'Donationware', 'Stable', '2007-05-14 16:35:02', '0.9', 'CrispyXUK', 'realityinfo@btopenworld.com', '', '2004 CrispyXUK', '', 'plugins/{5C3D691D-EC3F-4963-B95E-0A975C381C7D}/0.9/stable/Spitfire_Mk_II_0.9_Stable.mpp', '4553066', '', '', '', 9000000000000000, 1, 'Play controls removed should work better with the back button now', 'spitfire-mkII', 'crispyxuk.deviantart.com', '', '', '', '0', '0', 1082, 1082, 0, 0, 0, 0, '0de1b720c59d8458eac0ff5860d7665d', 'FALSE'),
(116, '{5CE6A3D7-5A2E-4871-BA76-F07C534D37E3}', 'JRMC Media Player', 'Use J. River Media Center for Media Playback in Meedio.', '', 'General', 'None', 'Shareware', 'Stable', '2007-05-14 16:33:42', '2.0.6', 'Donald Hill', 'plugins@theaterwave.com', 'dhill', '2004 TheaterWave.', '', 'plugins/{5CE6A3D7-5A2E-4871-BA76-F07C534D37E3}/2.0.6/stable/JRMC_Media_Player_2.0.6_Stable.mpp', '1196683', '', '', 'Doc\\JRMC Media Player.htm', 2000006000000000000, 1, 'A totally seamless integration of J. River Media Center and Meedio.\r\n\r\nCombine the power of J River Media Center to manage your media collection and for its excellent playback abilities. With Meedio and its customizable television interface and your remote control or touchscreen you can turn your existing PC into a powerful home media solution. The JRMC Media Player is used to playback media from the JRMC Importer section, but it will also play media from other library sections as well. \r\nThe JRMC Media Player comes with a 30 day free trail.\r\nRequires JRMC Importer plug-in and J. River Media Center Version 11.0.310.', 'JRMC_Player', 'http://www.theaterwave.com/tw/software_info.php?id=4', 'http://www.theaterwave.com/tw/software/Downloads/JRMC_Player.mpp', '1.36.1', '', '0', '1', 568, 568, 0, 0, 0, 0, '035ef0b15bfade19f435177fb13009ab', 'FALSE'),
(117, '{5CE6FBC8-445D-43D5-9C34-04308CFE6962}', 'Decompress', 'Decompresses archives within a directory, using 7-zip', '', 'Import', 'None', 'Freeware', 'Alpha', '2007-05-14 16:33:23', '1.0', 'binary64', 'slug@skyforge.net', 'binary64', '2007', '', 'plugins/{5CE6FBC8-445D-43D5-9C34-04308CFE6962}/1.0/alpha/Decompress_1.0_Alpha.mpp', '410930', '', '', '', 1000000000000000000, 1, 'Requires .Net 2.0 and Meedio 1.41.\r\n\r\nThis release only processes .rar archives (split-archives work). If you''ve installed 7-zip, this plugin will use your version, otherwise it uses 7-zip 4.42 that comes packaged with this plugin.\r\n\r\nYou can run this plugin in many ways that suits you:\r\n1. As a Meedio Import.\r\n2. Run DecompressCore.exe direct\r\n2a. Using Meedio ''Run Program'' command/importer\r\n2b. Using Windows Task Scheduler\r\n2c. Using your BitTorrent clients execute-on-finished feature', 'Decompress', '', '', '', '', '0', '1', 845, 845, 0, 0, 0, 0, 'f301234f39ecf7b4e24b27d2a282fd13', 'FALSE'),
(118, '{5DEF8E91-C850-4D10-82A1-359B35B77574}', 'Bundesligaportal', 'Shows news, scores, tables and team infos of Germany''s 1st and 2nd Soccer Bundesliga.', '', 'Module', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:17', '0.91', 'Bastian Hofmann', 'bastian.h@gmx.net', '', '', '', 'plugins/{5DEF8E91-C850-4D10-82A1-359B35B77574}/0.91/stable/Bundesligaportal_0.91_Stable.mpp', '112150', '', '', '', 91000000000000000, 1, 'Shows news, scores, tables and team infos of Germany''s 1st and 2nd Soccer Bundesliga.\nThe Plugin grabs the data directly from Yahoo Germany und Sport1.de when launched, so an internet connection is necessary.', 'Bundesligaportal', '', '', '', '', '0', '1', 833, 833, 0, 0, 0, 0, 'e72e317817f17e12432e7331d99db0a8', 'FALSE'),
(119, '{5EDCF973-D17D-41FF-9AF0-B286D41F9D5B}', 'Hauppauge Remotes', 'Controls the IR port of Hauppauge PVR boards', '', 'Input', 'None', 'Commercial', 'Stable', '2007-05-14 16:33:32', '2.0', 'Meedio, LLC', 'plugins@meedio.com', '', '2004, 2005 Meedio, LLC.', '', 'plugins/{5EDCF973-D17D-41FF-9AF0-B286D41F9D5B}/2.0/stable/Hauppauge_Remotes_2.0_Stable.mpp', '30856', '', '', '', 2000000000000000000, 1, 'Controls the Infrared receiver present in Hauppauge PVR boards. It supports the 20, 34 and 45 key remotes.\n\nVersion 2.45 or greater of Hauppauge''s IR Remote Control software needs to be installed. The plugin will automatically locate the needed files and stop Hauppauge''s software if needed.', 'Hauppauge', 'http://www.meedio.com/plugins', '', '', '', '0', '0', 1180, 1180, 0, 0, 0, 0, 'e4dbf05fe2733f73d5a73a1470221469', 'FALSE'),
(120, '{5F0777EB-533B-4DAC-9783-7CE7F90B54D3}', 'AmpMusicPlayer', 'Winamp Music Player for Meedio', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:10', '1.42', 'Pitti', 'trude_v2@yahoo.com', '', '2005 Pitti, *free for private use.', '', 'plugins/{5F0777EB-533B-4DAC-9783-7CE7F90B54D3}/1.42/stable/AmpMusicPlayer_1.42_Stable.mpp', '706458', '', '', 'readme.rtf', 1042000000000000000, 1, 'About:\nReplaces default Meedio Musicplayer, and uses WinAmp 2 or 5 for music playback.\n\nFeatures:\n* Plays all your music files through WinAMP instead the normal meedio music player\n* Supports Winamp Visualizations in Fullscreen mode\n* Selecting Winamp Visualization from the NPL Screen \n* Auto stops Visualization if STOP is pressed\n* Auto starts Visualization if you press PLAY again while music is playing (switchable in configuration)\n* Playlist Support is now implemented (".playlist" and ".m3u" files)\n* Full Shoutcast Radio support\n* Searching and bookmarking Shoutcaststations\n* Shoutcast NowPlaying Screen with Shoutcast details and full titleinformation if provided by station\n* Playback of Windows Media radio stations (at the moment with the help of "Playlist Loader" winamp plugin, until .asx file support is implemented) \n* Full meedio Sound-Player support \n* Full audio cd support with FREEDB querys via cd-info plugin\n* Configuratable Volume and Mute OSD\n* Keyboard hook for users without remote control\n* Automatic Playlist loading and playing when starting a picture slideshow\n* Master Volume Controller, with options to steer Waveout Volume parallel to Master Volume (gives smoother volumeslides, Fixes spdif problems)\n* Provides graphical Volume OSD for all plugins using the master-volume or music.volume messages (Videoplayer, LiveTV,...)\n* Feature requests are welcome :-) (Post them to the official thread in meedio forum)', 'AmpMusicPlayer', 'http://www.meedio.com/maid/detail.php?mode=detail&plugin_id={5F0777EB-533B-4DAC-9783-7CE7F90B54D3}', '', '1.30', '', '0', '0', 3779, 3779, 0, 0, 0, 0, '1f7ef6ad08206ef2c1ad9bac7cd62c7d', 'FALSE'),
(121, '{5F121DD5-F341-49B8-A738-FEA4BB8D5FC0}', 'dasoft-i', 'theme interactif', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:22', '1.03', 'da-soft', 'dasoft13@hotmail.com', '', 'da-soft 2006', '', 'plugins/{5F121DD5-F341-49B8-A738-FEA4BB8D5FC0}/1.03/stable/dasoft-i_1.03_Stable.mpp', '8894742', '', '', '', 1003000000000000000, 1, 'http://www.meedio-france.com/forums/index.php?showtopic=491', 'dasoft-i', 'http://www.meedio-france.com', 'http://www.meedio-france.com/themes-10-Dasoft-i.html', '0.5', '2.0', '0', '0', 2412, 2412, 0, 0, 0, 0, '990ec5889ed578fd8d779db5cb7f9b70', 'FALSE'),
(122, '{60AA6E17-AB4D-4D87-BBD0-FAA066D9C13C}', 'AllMovieSynopsis', 'Reviews/Synopsis/Flags/Moods/Themes', '', 'Import', '', 'Donationware', 'Stable', '2007-05-14 16:33:10', '.5', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', '@paypal.com :)', '', 'plugins/{60AA6E17-AB4D-4D87-BBD0-FAA066D9C13C}/.5/stable/AllMovieSynopsis_.5_Stable.mpp', '8931', '', '', '', 5000000000000000, 0, '', 'AllMovieSynopsis', '', '', '', '', '0', '1', 214, 5329, 0, 0, 0, 0, '01c050a0997971edf6cc6dc81b4ec873', 'FALSE'),
(123, '{60B40D5D-BC03-4228-8A9B-FDF0004A230B}', 'ItsMeedio', 'ItsMeedio theme', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:41', '0.04', 'its_me', '@', '', '', '', 'plugins/{60B40D5D-BC03-4228-8A9B-FDF0004A230B}/0.04/beta/ItsMeedio_0.04_Beta.mpp', '3833382', '', '', '', 4000000000000000, 1, 'Inspired on HDeeTV.\nDesigned with 800x600 resolution in mind.\n\nVery much alpha, still have to add the weather (where it says "Het weer"), Now playing and perhaps the button discription.\nAlso the next previous and other buttons need restyling.\n\nThis theme will be a basic theme, so not much feeds etc ...\n\nIcons are totally copied from HDeeTV all credits go there.\n\nBackground made by me, free to use if someone wants to.', 'ItsMeedio', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1456, 1456, 0, 0, 0, 0, '7ae1c7135578535cb60566473953ef58', 'FALSE'),
(124, '{60F1DEA0-5AA2-44A4-8863-EAE11170395E}', 'Radio Tuner', 'Allows you to control your FM-radio device', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:51', '1.2.1', 'Jelle Hissink', 'RadioTuner@Onshuis.tk', '', 'Copyright 2004 Jelle Hissink. All Rights Reserved.', '', 'plugins/{60F1DEA0-5AA2-44A4-8863-EAE11170395E}/1.2.1/stable/Radio_Tuner_1.2.1_Stable.mpp', '130690', '', '', 'Readme.txt', 1002001000000000000, 1, 'This plugin controls your AM/FM-radio card.\nAlso it allows you to tune in to TV and Dss channels using your TV-card.\n\nIt uses DirectShow or a number of external applications to control your hardware.\n\nPlease also install the Radio Module (different plugin) and follow the instructions in the readme.txt', 'RadioTuner', '', '', '', '', '0', '1', 1207, 1207, 0, 0, 0, 0, '37f863a59d6af7d6bc0154aa65564f82', 'FALSE'),
(125, '{616749FB-8B74-4ADE-A808-77D0289AACFE}', 'Time In Collection', 'This import module adds an extra tag to a library to identify how long an item has been in colllection.  (eg. Less than 1 week, Less than 1 month etc)', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:10', '1.0', 'mike hopewell', 'meedio@mikehopewell.co.uk', 'jameson_uk', 'Mike Hopewell', '', 'plugins/{616749FB-8B74-4ADE-A808-77D0289AACFE}/1.0/stable/Time_In_Collection_1.0_Stable.mpp', '34761', '', '', '', 1000000000000000000, 1, 'This Plugin adds an extra tags to the library the import runs against called DateFilter and DateFilterOrder.\n  \nIt creates date ranges (based on import module setting) such as "Less Than 1 Day", "Less Than 1 Month" etc which can be used in custom view\n\nIt also has an optional tag of DateAdded which is simply that date an item was added to the collection stored as a string which again can be used on custom views', 'DateFilteImport', '', '', '', '', '0', '1', 7340, 7340, 0, 0, 0, 0, 'fe963bd8f41ce6ddcfa2e7390f3ad888', 'FALSE'),
(126, '{62472ABB-0000-47BA-BDDA-D56B6978EDEC}', 'Icon Manager', 'Change icons and icon sets from inside of meedio', '', 'Module', '', 'Donationware', 'Stable', '2007-05-14 16:33:36', '1.2', 'Michael Melendez', 'NA', 'Kairos', '2006', '', 'plugins/{62472ABB-0000-47BA-BDDA-D56B6978EDEC}/1.2/stable/Icon_Manager_1.2_Stable.mpp', '605356', '', '', 'readme.rtf', 1002000000000000000, 0, 'This is a simple plugin to change the icons associated with each module while inside of meedio. Simply add the module to the configuration, it has no settings.', 'IconManager', '', '', '', '', '0', '1', 247, 3642, 0, 0, 0, 0, 'd63507a3a9cb8a41b9e79bc63415e08a', 'FALSE'),
(127, '{654F8C28-C370-4BF9-A095-05260BBEA5B5}', 'White Spitfire', 'With global vol controls, new weather and photo album screens white text and changed images', '', 'Theme', 'None', 'Commercial', 'Stable', '2007-05-14 16:35:22', '1.61', 'Meedio, LLC and CrispyXUK modified by Jon Gardner', 'jong@blueyonder.co.uk', '', '2004 Meedio, LLC.', '', 'plugins/{654F8C28-C370-4BF9-A095-05260BBEA5B5}/1.61/stable/White_Spitfire_1.61_Stable.mpp', '3715218', '', '', '', 1061000000000000000, 1, 'This theme, heavily based on the original Spitfire theme (version 1.0.7), has the following major changes:\n\n- white text\n\n- global music volume controls: Mute, volume up, volume down, next track, previous track, FFW, REW, Pause and Stop now all work from anywhere, including slideshows.\n\n- A new weather screen with images and forecast visible at the same time\n\n- Photo album view changed to hide left menu bar and gain a fourth photo column. The menu bar can be toggled into/out of view using the ''display'' key\n\n- the original default images for major modules\n\n- Improved formatting of the now-playing indicator and this indicator is also now visible on the main menu screen\n\n- a new 4-button alternate subgroup module screen (use by defining as an alternate screen in Meedio Configuration)\n\n- hitting ''display'' in the ''now playing'' screen shows the playlist instead of visualisations\n\n- other minor cosmetic changes\n\nIt hopefully retains the essential bright, breeziness of the original and, for me, the main benefit over the bundled themes of a 2 row thumbnail image view and wrapped image titles. These give much more room for thumbnails and image titles which is great for the photo album.\n\nChanges in 1.61:\n-------------------\n\n- Small ''maintenance'' update to incorporate the new visualizations into the Now playing screen\n\nChanges in 1.51:\n-------------------\n\n- Now with a new "Videos" screen file which has the same 4-column format as the Photo Album. Also as in the Photo Album, the left menu bar is hidden and may be toggled using the ''Display'' key. This new screen file also has thumbnail buttons with a 4:3 aspect ratio to better suit thumbnail snapshots of video footage. To use, this screen file needs to be manually specified as an alternate screen. \n\n- A "videos_with_back_button" screen file has also been added for those using this feature.\n\nChanges in 1.41:\n-------------------\n\n- By request, a new "Pictures_with_back_button" screen file has also been added. To use follow the instructions below for the "Weather_with_back_button" screen. Also a new ThemeChooser screen file has been added which fixes what I would consider a bug in the Meedio-supplied default. The default does not have any visible scroll buttons, which can make life difficult for some users (including one of mine!)\n\nChanges in 1.32:\n-------------------\n\n- Bug fix to new Weather screen. Also fixes a long standing bug in "back" functionality in the new weather and picture screens, so "back" will now close the module at the top level.\n\nChanges in 1.31:\n-------------------\n\n- A new "Weather_with_back_button" screen file has been added. This will allow the White Spitfire default weather screen to be used by those without a back button on their remote.To use this screen simply rename the current "Weather.screen" to "Weather_old.screen" and rename "Weather_with_back_button.screen" to "Weather.screen" in the White Spitfire theme folder.\n\nChanges in 1.2:\n-------------------\n\n- Photo album view changed as described above\n\n- Improved formatting of the now-playing indicator\n\nChanges in 1.1:\n------------------\n\n- New weather screen based on the one from HDeeTV (thanks to Kelmk for his permission to reuse this). The old weather screen (The Meedio default with added ability to switch to images with the display key) is still available. Simply delete ''weather.screen'' in the White Spitfire theme directory and rename "Weather - Default style.screen" to"weather.screen"\n\n- The issue with default Music Library views in the first version has been resolved', 'White spitfire', '', '', '', '', '0', '0', 1007, 1007, 0, 0, 0, 0, '558e28639071b39dcef97b58b67359a2', 'FALSE'),
(128, '{655379F0-C845-45B4-82ED-CA171832E82D}', 'CNN Reader', 'News Reader', '', 'Module', '', 'Freeware', 'Stable', '2007-05-14 16:33:21', '1.0.5', 'Joshua C. Walters', 'joshwalters@gmail.com', 'walts81', '2004-2005 JCSoftware, Inc.  all rights reserved', '', 'plugins/{655379F0-C845-45B4-82ED-CA171832E82D}/1.0.5/stable/CNN_Reader_1.0.5_Stable.mpp', '31019', '', '', '', 1000005000000000000, 0, 'For use with the CNN Importer plugin', 'CNN_Reader', 'http://www.meedio.com/maid', '', '', '', '0', '1', 220, 1073, 0, 0, 0, 0, '4130659a1285bdae2ba008fde0cb9827', 'FALSE'),
(129, '{65C356AC-F3DA-4FF3-BCFE-C89228D39390}', 'Creative Remotes and MIDI SysEx', 'Controls the Creative RM-900, RM-1000 and iR2000 remotes or any MIDI device capable of sending MIDI SysEx commands', '', 'Input', 'None', 'Commercial', 'Beta', '2007-05-14 16:33:22', '1.0', 'Meedio, LLC', 'plugins@meedio.com', '', '2003 Meedio, LLC.', '', 'plugins/{65C356AC-F3DA-4FF3-BCFE-C89228D39390}/1.0/beta/Creative_Remotes_and_MIDI_SysEx_1.0_Beta.mpp', '20351', '', '', '', 1000000000000000000, 1, 'Controls the Creative RM-900, RM-1000 and iR2000 remotes or any MIDI device capable of sending MIDI SysEx commands.', 'Creative', 'http://www.meedio.com/plugins', '', '', '', '0', '', 866, 866, 0, 0, 0, 0, '3adfa7dc807bf24f02ea848485cc0212', 'FALSE'),
(130, '{669DA236-C83D-4BDB-B849-9068FD178F31}', 'HDeeTV', 'The one theme to rule them all', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:34', '2.07', 'Kevin Kelm', 'kevinkelm@rogers.com', '', '', '', 'plugins/{669DA236-C83D-4BDB-B849-9068FD178F31}/2.07/stable/HDeeTV_2.07_Stable.mpp', '12261022', '', '', '', 2007000000000000000, 1, 'This is a general purpose theme with many many configuration options.', 'HDeeTV', '', '', '', '', '0', '0', 6424, 6424, 0, 0, 0, 0, '382094868c6c080895ffe955171d04d5', 'FALSE'),
(131, '{66B1DAE7-69F1-4BC2-BFB2-A87C414CDF7E}', 'MeeCam', 'Enables meedio to automaticly download pictures from a digitalcamera', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:47', '1.7.1', 'CyberVillain', 'anders@dac.se', 'CyberVillain', '2005 DAC Ltd', '', 'plugins/{66B1DAE7-69F1-4BC2-BFB2-A87C414CDF7E}/1.7.1/stable/MeeCam_1.7.1_Stable.mpp', '249439', '', '', '', 1007001000000000000, 1, 'Lets you transfer pictures from your digitalcamera to your Picturemodule.\n\nIf you want to force meeCam to show use a command module with the message "meecam.screen-show".\n\n4 datafeeds to use with C.Mee.\nmeecam.caption\nmeecam.file\nmeecam.elapsed\nmeecam.total\n\nNotes:\n* while viewing a thumbnail, [play] goes to fullscreen preview; you\ncan exit fullscreen with the [back] or [exit].\n\n* it is possible to navigate between menus with the [menu] action,\nwhich is by default mapped to F10; this allows you to rename a\nthumbnail which is not in the right hand column.\n\n* when selecting the directory location, the [channelup] and\n[channeldn] actions allows you to navigate between directories; by\ndefault this is mapped to PAGE UP and PAGE DOWN.\n\n* to select or unselect a range of images, execute the [record]\naction, both at the start and end of the range; by default this is\nmapped to the DIVIDE (/) key on the numeric keypad; the selected or\nunselected status is based on the first thumbnail that was picked.', 'MeeCam', 'http://www.meedio.com/maid', '', '', '', '0', '0', 864, 864, 0, 0, 0, 0, 'e4557c9c937c55cedd3ea85ba14091af', 'FALSE'),
(132, '{68FFD1DE-E4ED-465C-A9DC-E8186720016D}', 'meeMovieTunes - Quiz Pack 2', 'meeMovieTunes - Quiz Pack 2', '', 'Misc', 'None', 'Donationware', 'Alpha', '2007-05-14 16:35:35', '0.1', 'Simon Stocks', 'simon@ai-support.co.uk', 'foolycooly', '', '', 'plugins/{68FFD1DE-E4ED-465C-A9DC-E8186720016D}/0.1/alpha/meeMovieTunes_-_Quiz_Pack_2_0.1_Alpha.mpp', '25627607', '', '', '', 1000000000000000, 1, '', '..\\images\\meeMovieTunes\\Temp', '', '', '', '', '0', '0', 1532, 1532, 0, 0, 0, 0, '3f77245c380ee92e6c14320c2092c9f0', 'FALSE'),
(133, '{698A4C72-00C7-4FFB-9817-FD1CA1B9A880}', 'SilenceMee', 'SilenceMee will pause/resume the Meedio music player when you launch selected executables via the Program Module or launch the internal video player.  New feature allows you to restore the music play-state when restarting Meedio.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:58', '5.5', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{698A4C72-00C7-4FFB-9817-FD1CA1B9A880}/5.5/stable/SilenceMee_5.5_Stable.mpp', '41444', '', '', '', 5005000000000000000, 0, 'SilenceMee will pause/resume the Meedio music player when you use the internal video player or launch any executable via the Program Module (as long as the name of the executable is in the property list).  You do not need to add the path, just the simple name "program.exe" followed by the optional "|#" where # can be 0 (don''t pause music), 1 (pause music before starting program), or 2 (pause music before and resume after).  If you don''t include the optional setting, then it defaults to "2".  List one name per line.\n\nExample:\n\nprogram1.exe|0\nprogram2.com|2\nprogram3.bat|1\nprogram4.exe\n\nNOTE: Program Modules must check off "Wait until program completes" to support resuming of music.\n\nNew to v3.0:\n-You can now choose the Action to perform (pause/stop/clear playlist).\n-SilenceMee can restore the music play-state when restarting Meedio.  Listen to music while playing with themes!\n\nNew to v3.2:\n\n-other plugins can utilize SilenceMee with the following messages, as long as "program" is contained in the SilenceMee list.\n\nsilencemee.activate\n     "program" = value: specifies the program to look for in the SilenceMee list\n\nsilencemee.deactivate   (performs restore action)\n     "program"=value: optional value (not used at this time)\n\n\n\nSilenceMee now shuts down the music player instead of just pausing it.  This should fix problems with audio when using external programs. You must not use the Video Screen setting "Shutdown the music player" if you want to use the resume feature.\n\nNew to v5.0: SilenceMee now uses the internal Meedio save/load playlist commands to store the current music queue in the "SilenceMee.playlist" file (located in the default playlist folder).  The SilenceMee.ini file is now stored in the SilenceMee data directory.\n\nNew to v5.3: added "silencemee.rating" datafeed that can be used to rate songs on any screen with global actions.  See the forum support thread for more info.', 'SilenceMee', '', '', '1.30', '', '0', '1', 303, 3531, 0, 0, 0, 0, 'b477114ee16374902ef187f02bdc7f31', 'FALSE'),
(134, '{69ED165A-7E39-4363-A8A8-6BA57728905D}', 'Horoscope', 'Downloads daily horoscope', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:36', '0.3', 'Scott Zsori', 'scott-meedio [at] zsori.com', '', 'szsori', '', 'plugins/{69ED165A-7E39-4363-A8A8-6BA57728905D}/0.3/beta/Horoscope_0.3_Beta.mpp', '865368', '', '', '', 3000000000000000, 1, 'Requires: .NET framework 1.1\n\nTo use:\n1. Create a new media library section called "Horoscope".\n2. Create a new import in that section.\n3. Select "Delete all items and re-import".\n4. Select "Horoscope" as the import type.\n5. Schedule it.  More than once per day isn''t necessary.  Just schedule it early in the day.\n6. Run it.\n7. Go to the menu section and create a new Media Module.\n8. Name it and give it whatever description you want.\n9. Go to Module Properties and select the "Horoscope" media library section.\n10. Browse to Media.Horoscope.screen (included with the plugin) for the detail screen file.\n11. Clear the subtitle tag field.\n12. Press OK and you''re all set.', 'Horoscope', '', '', '', '', '0', '1', 1192, 1192, 0, 0, 0, 0, '96d21df66036ec368e091631ac2ffaa1', 'FALSE'),
(135, '{6A63EFB4-AAD6-44D7-98C4-788509E77B8F}', 'Meediograbber', '******* New Version 0.7 Beta ( 2006-05-02 ) ******* Grabs videolinks off certain sites (flurl.com, collegehumor.com, break.com, metacafe.com, pinkbabes.net, Vidilife.com, etc...) into your media library. By easily assigning these media libraries to your M', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:56', '0.7', 'Benedikt Schlueter', 'ben_kenobi@gmx.net', '', '', '', 'plugins/{6A63EFB4-AAD6-44D7-98C4-788509E77B8F}/0.7/beta/Meediograbber_0.7_Beta.mpp', '422335', '', '', 'readme.txt', 7000000000000000, 1, 'You can choose between many different sites and sections. There''s funny, extreme and some adult stuff.\n\nMeedio-Configuration:\nbest way is to create media-libraries for the sections you want to import. Then choose this plugin and select site or section and number of files to import. Select "delete all and reimport".\n\nCause it takes up to 30 seconds to import all the clips, I recommend creating different Importer-Modules in your Menu, one for each section for example. Then you can import them while running Meedio.\n\n.. see readme.txt', 'Meediograbber', 'http://meediograbber.benkenobi.de', '', '1.37', '1.38', '0', '1', 1023, 1023, 0, 0, 0, 0, '34cbad3a7cb3f5a908d38af321a59b5f', 'FALSE'),
(136, '{6AB3C33C-1F28-4724-81FD-9755EE27D92C}', 'HideTaskbar', 'Hides the Windows taskbar', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:34', '1', 'reverson1', 'support@getmygames.com', 'reverson1', '2004 GetmyGames', '', 'plugins/{6AB3C33C-1F28-4724-81FD-9755EE27D92C}/1/stable/HideTaskbar_1_Stable.mpp', '12270', '', '', 'http://www.getmygames.com/help/taskbar.shtml', 1000000000000000000, 1, '', 'HideTaskbar', 'http://www.getmygames.com', 'http://www.getmygames.com/files/hidetaskbar/hidetaskbar.mpp', '', '', '0', '0', 1876, 1876, 0, 0, 0, 0, '91bbb13a540fc35a9b0a557d7022fa6f', 'FALSE'),
(137, '{6B07B7F5-34BE-406D-887D-CED18B9731BF}', 'meeCalculator', 'Calculator', '', 'Module', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:47', '1.1', 'Joshua C. Walters', 'joshwalters@gmail.com', 'walts81', '2004 - 2005 JCSoftware, Inc. all rights reserved', '', 'plugins/{6B07B7F5-34BE-406D-887D-CED18B9731BF}/1.1/stable/meeCalculator_1.1_Stable.mpp', '201343', '', '', '', 1001000000000000000, 1, '1) Open Meedio Configuration\n2) Add the meeCalculator module\n\nThat''s it!', 'meeCalculator', 'http://www.meedio.com/maid', '', '', '', '0', '1', 1436, 1436, 0, 0, 0, 0, 'ca95d39bb3f9469ec3c1511c1bad54d6', 'FALSE');
