(138, '{6B8AC830-458E-427D-B2EA-6E031518E1FC}', 'RSS Importer', 'Imports rss-feeds', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:55', '1.0', 'Torstein Auensen', 'rabbagazz@hotmail.com', '', '2004', '', 'plugins/{6B8AC830-458E-427D-B2EA-6E031518E1FC}/1.0/stable/RSS_Importer_1.0_Stable.mpp', '308097', '', '', '', 1000000000000000000, 1, 'This plugin imports rss feeds, which can be displayed using the screen that comes with the plugin. \n1. Set up the import plugin. ( http://news.yahoo.com/rss got some good feeds ). You should set it to "Delete all items and re-import". \n2. Add a new Media Module\n3. Set the "Detail screen" to the Rss.screen file that comes with this plugin. ( <meedio installation>\\plugins\\import\\rss\\rss.screen )\n4. Set the Media Library Section to the section you just imported.\n5. You''re good to go', 'Rss', 'https://www.paypal.com/xclick/business=rabbagazz%40hotmail.com&item_name=GetMy&no_note=1&tax=0&currency_code=USD', '', '', '', '0', '1', 1488, 1488, 0, 0, 0, 0, 'fd4a57b06305c68e920018a63a7f8e3c', 'FALSE'),
(139, '{6BAE0834-F9D5-4331-ADC7-FABE7DD0D56F}', 'TagMee', 'Tags artist and album info for your music', '', 'General', 'None', 'Donationware', 'Beta', '2007-05-14 16:35:09', '1.0.2', 'Michael Melendez', 'NA', 'Kairos', '2005', '', 'plugins/{6BAE0834-F9D5-4331-ADC7-FABE7DD0D56F}/1.0.2/beta/TagMee_1.0.2_Beta.mpp', '801379', '', '', '', 1000002000000000000, 1, 'Description:\n\nTagMee is a General Plugin designed to automatically download album and artist info for your music. It allows downloading information from multiple websites (currently allmusic.com and mp3.com) and then importing that into your music library. TagMee also goes a step further allowing you to manually search for and albums that might not have been tagged properly, parsing disc numbers from the album name of your music, and running your imports all from its interface.\n\nInstallation:\n\n1) Enable the plugin under the ''Full-time plug-ins'' tab\n2) Set you options\n3) Add a ''Command Module'' under the ''Menu'' tab\n4) Select the Module Properties tab\n5) Choose ''Send custom Command'' from the ''Command to send'' drop-down\n6) Type ''tagmee.start'' in the ''Custom command to send'' box\n\nOptional:\n7) Select ''Music Player'' under the ''Full-time plug-ins'' tab\n8) In ''Music Player Parameters'' Select an ''Alternate Now Playing Screenâ€ called ''TagMee.NowPlaying'' from the TagMee plugin folder usually located at \\Meedio\\Meedio Essentials\\plugins\\general\\TagMee.\n\nIncluded is an alternate music library screen. It can also be used to replace the default. This will place a button on it to launch TagMee. To use this screen:\n1) Select your ''Music Library'' under the ''Menu'' Tab\n2) Select the ''Module Properties'' tab\n3) Select an ''Alternate screen'' called ''TagMee.MusicLibrary'' from the TagMee plugin folder usually located at \\Meedio\\Meedio Essentials\\plugins\\general\\TagMee.\n\n\nYou can tag the currently playing album with a message tagmee.tag-current, or select the option to ''Auto-tag Currently Playing Tracks''. Please let me know of any other needed messages as they are easy to make.\n\nFor more information read the ReadMe.txt and visit the support thread.', 'TagMee', '', '', '', '', '0', '1', 363, 363, 0, 0, 0, 0, '090dc0593f52f89af0422632b853dd78', 'FALSE'),
(140, '{6C8305C8-263F-4196-99F4-8DDE21CE5623}', 'AlarmMee', 'Mp3 Alarmclock', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:10', '1.2.1', 'CyberVillain', 'anders.malmgren@dac.se', 'CyberVillain', '2005 Dac Ltd', '', 'plugins/{6C8305C8-263F-4196-99F4-8DDE21CE5623}/1.2.1/stable/AlarmMee_1.2.1_Stable.mpp', '65326', '', '', '', 1002001000000000000, 1, 'Mp3 Alarmclock.\nMake a command module and set it to send the message "alarmmee.show-screen". The plugin will publush a datafeed called alarmmee.timeleft containing the minutes left until alarm\n\nThe plugin can now execute other programs, check execute.txt\n\nnote! Music player messages are removed and are now found in the "Alarm on messages(s)"-selection in the setup. You will need to reload the default settings if you have old settings. Check messages.txt for details on messages in alarmmee', 'AlarmClock', '', '', '', '', '0', '0', 1702, 1702, 0, 0, 0, 0, 'c1682d92cca1e975c76d0f97c59df7a0', 'FALSE'),
(141, '{6E7CFAED-7580-4E76-8E6D-93BFDB39D872}', 'New Apple Trailers Importer', 'Imports the newest trailers from Apple.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:39', '1.32', 'Seb', 'n/a', '', '', '', 'plugins/{6E7CFAED-7580-4E76-8E6D-93BFDB39D872}/1.32/stable/New_Apple_Trailers_Importer_1.32_Stable.mpp', '6898', '', '', '', 1032000000000000000, 1, 'Imports only the newest trailers from Apple to a library section. Select the number of days you wish to store the trailers and the old trailers are deleted to keep your library up-to-date.\n\nIt does not support additional movie info like the Apple Movie Trailers Importer by bradsjm but is faster and more effective. This importer can be used in conjunction with the Apple Movie Trailers Importer though.\n\nUse in conjunction with File Download Importer to download the video files locally.\n\nNew in v1.1:\nPrefer not to download "fullscreen" trailers.\n\nNew in v1.3:\nDoesn''t display trailer type (trailer, international trailer, featurette etc.) in the name field to make it more compatible with the Movie Detailer importer. Fixed a bug making 2004 december trailers show up as 2005 december trailers.\n\nNew in v1.32:\nDownloading new trailers again since Apple changed their front page.', 'NewAppleTrailers', '', '', '', '', '0', '1', 437, 437, 0, 0, 0, 0, '535c8cb0c214a7d36b6cbe1889a9223a', 'FALSE'),
(142, '{6F21D402-E9B7-4D9C-8D3C-F40054239ECA}', 'Horizons', 'Explore new horizons', '', 'Theme', 'None', 'Commercial', 'Stable', '2007-05-14 16:33:35', '1.2', 'Meedio, LLC', 'support@meedio.com', '', '2005 Meedio, LLC', '', 'plugins/{6F21D402-E9B7-4D9C-8D3C-F40054239ECA}/1.2/stable/Horizons_1.2_Stable.mpp', '8139416', '', '', '', 1002000000000000000, 1, 'Should have Meedio 1.33 or above installed to enjoy all its features.  Based on Sunrise theme image set, with a different overall template and new screens.\n \n               \nVersion 1.2 changes:\n         \n- Changed selection image for dark blue color scheme\n         \n- Updated screens for latest Meedio release.\n         \n- Added new color scheme to have a brighter blue background and green selection images\n         \n- Added an extra color scheme if you wish to have a red selection image for the regular darkblue color scheme\n\n      \nVersion 1.1 changes:\n                  - Changed some things around for Meedio Tv screens\n                  - Added updated lime green background from David Ross (thanks David!)\n                  - SubGroup screen now looks like the regular Group screen.\n                  - Added a Widescreen option that will make the weather, EPG, and screens that use the thumbnail view better for widescreens\n                  - Added actions for music player to main template so they are accessible everywhere\n                  - Other fixes I''ve forgotten now', 'Horizons', 'http://www.meedio.com/maid', '', '', '', '0', '0', 8849, 8849, 0, 0, 0, 0, '9bfc34fb1d69ad4eb6be6fd53eec5abd', 'FALSE'),
(143, '{7018318B-EFEB-45E7-84E7-1F6C49152209}', 'TagManipulation Importer', 'Runs pascal like scripts. Edit your libraries with the scripts.', '', 'Import', '', 'Freeware', 'Beta', '2007-05-14 16:35:09', '0.9.0', 'Michael Wisniewski', 'Goldrush@web.de', 'DocZoidberg', '2006 Michael Wisniewski', '', 'plugins/{7018318B-EFEB-45E7-84E7-1F6C49152209}/0.9.0/beta/TagManipulation_Importer_0.9.0_Beta.mpp', '856173', '', '', 'ReadMe.txt', 9000000000000000, 0, '', 'TagManipulation', 'http://www.michaelwisniewski.mynetcologne.de/', '', '', '', '0', '0', 146, 1844, 0, 0, 0, 0, '7150fa26d61318976bff800818408094', 'FALSE'),
(144, '{71D11797-B946-46DD-9181-AA388761455D}', 'Module Browser', 'Launch downloaded module plugins ad-hoc within Meedio', '', 'Module', 'None', 'Freeware', 'Alpha', '2007-05-14 16:34:32', '1.0', 'binary64', 'slug@skyforge.net', 'binary64', '2006', '', 'plugins/{71D11797-B946-46DD-9181-AA388761455D}/1.0/alpha/Module_Browser_1.0_Alpha.mpp', '4176', '', '', '', 1000000000000000000, 1, '', 'ModuleBrowser', 'http://www.meedios.com/binary64/', '', '', '', '0', '1', 1072, 1072, 0, 0, 0, 0, 'a9b75a0deeea6a5c0d2be7b69139ae0e', 'FALSE'),
(145, '{729B6AEE-3E52-46D9-8F50-6CE746B66B82}', 'Message Sender', 'MessageSender (formerly Autoexec plugin) sends Meedio messages at system startup, shutdown and when the messagesender.execute is received', '', 'General', 'None', 'Commercial', 'Stable', '2007-05-14 16:34:30', '1.0', 'Meedio, LLC', 'plugins@meedio.com', '', '2004 Meedio LLC', '', 'plugins/{729B6AEE-3E52-46D9-8F50-6CE746B66B82}/1.0/stable/Message_Sender_1.0_Stable.mpp', '16583', '', '', 'messagesender.html', 1000000000000000000, 1, 'This plugin sends Meedio messages at startup, shutdown and when the messagesender.execute message is received. It allows you to execute any number of messages when an action is selected.', 'Autoexec', 'http://www.meedio.com/maid', '', '', '', '0', '0', 728, 728, 0, 0, 0, 0, '4049bbcb99d994ce87c917e116edb15b', 'FALSE'),
