(148, '{79011064-74B0-4EEB-B110-06BB164FA8CD}', 'MSN Instant Message', 'MSN Instant Message client.', '', 'General', 'None', 'Commercial', 'Stable', '2007-05-14 16:34:35', '1.1', 'Meedio, LLC', 'support@meedio.com', '', '2004 Meedio, LLC.', '', 'plugins/{79011064-74B0-4EEB-B110-06BB164FA8CD}/1.1/stable/MSN_Instant_Message_1.1_Stable.mpp', '490182', '', '', '', 1001000000000000000, 1, 'Changes for 1.1:\n  -  Better looking icons - Thanks FloatingFatMan!\n  -  Added ability to use multiple users\n  -  Now sorting the contacts\n  -  Added ability for Enter key to Send the message\n  -  Added option to choose whether it should automatically login a user\n\nAllows you to use the MSN Instant Message service from Meedio using a remote control or mouse.\nFirst thing to do is to enter your MSN name and password.  Go to Meedio Configuration->Full-time plugins->Instant Message and enter your username and password for MSN and choose whether you want the window to come up when a new message is received from a contact.\n\nNow, to call this plugin from a menu item, add a Command Module from the Menu tab in Meedio Configuration.\nNow with this menu item selected, select the Module Properties tab and for the Command to Send choose ''Send custom Command''.\nNow in the box below it type instantmessage.display-window.  Now this menu item will launch the MSN window.', 'MSNClient', 'http://www.meedio.com/maid', '', '', '', '0', '1', 667, 667, 0, 0, 0, 0, 'fd5e2fbbfd436878d482042cd8bb3de7', 'FALSE'),
