(150, '{7A862F51-897D-4C36-A592-4B461E0C4994}', 'On-screen Keyboard', 'Displays an on-screen keyboard for data input', '', 'General', 'None', 'Commercial', 'Stable', '2007-05-14 16:34:40', '1.1', 'Meedio LLC', 'plugins@meedio.com', '', '2004 Meedio LLC', '', 'plugins/{7A862F51-897D-4C36-A592-4B461E0C4994}/1.1/stable/On-screen_Keyboard_1.1_Stable.mpp', '149675', '', '', 'osk.html', 1001000000000000000, 1, 'Displays an on-screen keyboard for data input. This plugin is only useful for developers.', 'OSK', 'http://www.meedio.com/maid', '', '', '', '0', '0', 924, 924, 0, 0, 0, 0, 'b11d7cc0a0ccb7fab705548347af078c', 'FALSE'),
