(153, '{7DBA5C93-7CE9-4343-B8E2-01FD755F00B0}', 'Weether (full-time plugin)', 'An alternative weather module with large, easy-to-read displays.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:35:22', '1.600', 'deria', 'deria@sourceforge.net', '', '(c) 2005 Electric Storm Software', '', 'plugins/{7DBA5C93-7CE9-4343-B8E2-01FD755F00B0}/1.600/stable/Weether_(full-time_plugin)_1.600_Stable.mpp', '1688173', '', '', '', 1600000000000000000, 1, 'The Weether module is an enhanced weather module for Meedio, featuring:\n\n* large, easy-to-read displays\n* a unified five day forecast (divided into day/night segments)\n* a detailed current conditions display\n* an optional second (completely customizeable) current conditions display allowing you to report up to 10 of the following fields: atmospheric pressure, atmospheric pressure status (rising/steady/falling), wind speed, wind gusts, wind direction, relative humidity, visibility, UV index, UV index description, dew-point, observation site, observation date/time, temperature, feels-like temperature, sky description \n* a detailed view for each segment shown on the forecast\n* the ability to display weather images from the Internet (radar, satellite, etc.)\n* automatic updating of weather conditions every two hours\n* the ability to open your internet browser (or the internal Meedio Internet browser) to show pollen reports, airport conditions, or special events (useful in the US only)\n* the ability to publish a datafeed so that your theme of choice can display the weather information too (in a popup panel, for example) -- the entire weather report is available!\n* the ability to automatically remember your last viewed page of the forecast, or automatically default to any of the following pages:  forecast, current conditions, today (morning), today (evening), tomorrow (morning), tomorrow (evening), or images.\n* full (optional) support for the BreakingNews module\n* a much higher degree of customizeability.\n\nNOTE:  If you have been using version 1.520 or lower, you should delete the "x:\\program files\\meedio\\meedio essentials\\plugins\\module\\weether" directory.  If you do not, very strange things will happen when you next reinstall or update Meedio (because it rescans for all plugins, and it will find both the old standalone-module based version of Weether and the new full-time-plugin version of Weether, and having two versions of the same package will prevent either from working).', 'Weether', '', '', '', '', '0', '1', 954, 954, 0, 0, 0, 0, '48374833e828989e0afb6b8872d9110e', 'FALSE'),
(154, '{7DE6EBE8-FE45-410C-8CB7-ECDBF6A297DA}', 'PictureShowX', 'DirectX Slideshow', '', 'General', '', 'Donationware', 'Beta', '2007-05-14 16:34:47', '0.60', 'Dave Brown', 'drmbrown@comcast.net', 'fornold', '2005 Dave Brown', '', 'plugins/{7DE6EBE8-FE45-410C-8CB7-ECDBF6A297DA}/0.60/beta/PictureShowX_0.60_Beta.mpp', '38988', '', '', 'Readme.doc', 60000000000000000, 0, 'Must have .NET installed.\r\n\r\nMust have Feb 06 Managed DirectX installed.', 'PictureShowX', '', '', '', '', '0', '1', 193, 1735, 0, 0, 0, 0, 'e09e710736aed7bf2226913da8614efa', 'FALSE'),
(155, '{7E48E416-0BF5-4611-9B86-03C53A32F371}', 'MeeCharts', 'The Meedio Top 20 Charts. MeeCharts is a set of Meedio Plugins which interact between Meedio and the MeeCharts System in order to deliver a variety of music based "popularity" charts. Think of MeeCharts as the Meedio Top 20 or Billboard 100.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:50', '1.3', 'Jason Hyland', 'jason@hylandfamily.org', '', '2005 Jason Hyland', '', 'plugins/{7E48E416-0BF5-4611-9B86-03C53A32F371}/1.3/stable/MeeCharts_1.3_Stable.mpp', '680154', '', '', 'readme.htm', 1003000000000000000, 1, 'MeeCharts - Meedio Charts. See readme.htm for docs', 'MeeCharts', 'http://jason.hylandfamily.org/', '', '', '', '0', '1', 512, 512, 0, 0, 0, 0, 'db003fa740ed3bd0ee920767769c978f', 'FALSE'),
(156, '{7E6CC2F3-0B56-4940-9AF5-1312C15385FA}', 'MediaInfoPlugin', 'Imports Media Info (codecs, bitrates, etc) into your libraries', '', 'Import', 'None', 'Freeware', 'Alpha', '2007-05-14 16:33:45', '1.1', 'Shawn Bass', 'sbass2@yahoo.com', 'Shawn Bass', 'Your ad here for only $20/month', '', 'plugins/{7E6CC2F3-0B56-4940-9AF5-1312C15385FA}/1.1/alpha/MediaInfoPlugin_1.1_Alpha.mpp', '1094702', '', '', 'MediaInfoPlugin.mht', 1001000000000000000, 1, 'Imports MediaInfo to your libraries for your Audio/Video files - things like Codecs, Bitrates, Framerate, channels, sampling rates, etc.', 'MediaInfoPlugin', 'http://www.meedio.com/maid', '', '2', '', '0', '1', 2299, 2299, 0, 0, 0, 0, 'b410583f7cb5a9214d3d15970ebd697b', 'FALSE'),
(157, '{7EC5B20D-5D2E-4E7A-B72C-9F59A83745F4}', 'Recipe Manager', 'Manages your recipes, allowing printing and exporting to PDF or HTML', '', 'General', 'None', 'Commercial', 'Stable', '2007-05-14 16:34:52', '1.0', 'Meedio, LLC', 'plugins@meedio.com', '', '2004 Meedio LLC', '', 'plugins/{7EC5B20D-5D2E-4E7A-B72C-9F59A83745F4}/1.0/stable/Recipe_Manager_1.0_Stable.mpp', '314113', '', '', 'RecipeManager.html', 1000000000000000000, 1, 'This plugin (formerly Recipe Print) manages your recipes, allowing you to add favorites, print and export them to PDF or HTML', 'RecipePrint', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1056, 1056, 0, 0, 0, 0, '0316b6fd92603771bd8765450f530b1d', 'FALSE'),
