(159, '{7F17E0E6-C209-4F5F-85D0-E7E3EE6DFBE6}', 'MoveesToHTML', 'Generate web pages for your movie collection.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:33', '1.2.1', 'Joshua C. Walters', 'joshwalters@gmail.com', 'walts81', 'Â© 2004-2005 JCSoftware, Inc.  all rights reserved', '', 'plugins/{7F17E0E6-C209-4F5F-85D0-E7E3EE6DFBE6}/1.2.1/stable/MoveesToHTML_1.2.1_Stable.mpp', '34878', '', '', '', 1002001000000000000, 1, 'This plugin generates web pages for your existing movie collection. \n\nTo setup:\n\n1) Add this importer to your ''Movies'' section\n2) Set the folder to store the HTML files\n3) Set the page title\n3) Set text and background colors\n4) Set meedio field names (runtime, overview, etc.)\n5) Run the importer.\n\nThat''s It!', 'MoveesToHTML', 'http://www.meedio.com/maid', '', '', '', '0', '1', 1071, 1071, 0, 0, 0, 0, 'ebd6f86e2b3a2f9ebb12f3c916d09ede', 'FALSE'),
(160, '{7FF481D3-DB89-4FB8-86C4-64FBCF9D7632}', 'NetworkPipe', 'A bi-directional network bridge for Meedio Messages', '', 'General', '', 'Donationware', 'Alpha', '2007-05-14 16:34:39', '0.1.2', 'binary64', 'slug@skyforge.net', 'binary64', '2007', 'http://www.meedios.com/forum/viewtopic.php?t=856', 'plugins/{7FF481D3-DB89-4FB8-86C4-64FBCF9D7632}/0.1.2/alpha/NetworkPipe_0.1.2_Alpha.mpp', '23878', '', '', '', 1002000000000000, 0, 'Config format: [send|receive]|[host[:port]]|[meedio.message.mask[.*]]\r\n\r\n			Examples:\r\n\r\n			send|htpc|lastfm.play\r\n			receive|htpc|music.playing\r\n			send|htpc|imports.*\r\n			receive|htpc|meedio-helper.*', 'NetworkPipe', '', '', '', '', '0', '1', 121, 1236, 0, 0, 0, 0, '4a675e061b307d91e6f96af1b3309435', 'FALSE'),
(161, '{8079274D-9B7B-4712-A268-3AEC8D668CCE}', 'Neet Seend', 'Neet Seend allows you to send short messages to Meedio from remote computer', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:38', '0.9.3', 'Cellard', 'info@cellard.spb.ru', '', '2005 Cellard', '', 'plugins/{8079274D-9B7B-4712-A268-3AEC8D668CCE}/0.9.3/beta/Neet_Seend_0.9.3_Beta.mpp', '94439', '', '', '', 9003000000000000, 1, 'Plugin consists of two parts: server (plugin itself) and client (program to send messages). When composing message you can define up to three possible answers that will be shown at popup screen. Meedio user may give you one of these answers.', 'NeetSeend', '', '', '1.0', '', '0', '0', 608, 608, 0, 0, 0, 0, '1b27d6f7e969fc8fdb8f7d29f99c7bc9', 'FALSE'),
