(166, '{842BF913-B771-47F3-B7EB-F1EB7D4C06AD}', 'Pop3 Importer', 'Allows import E-Mail via Pop3', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:48', '2.4.2', 'Jelle Hissink', 'Pop3Importer@Onshuis.tk', '', 'Copyright 2004 Jelle Hissink. All Rights Reserved.', '', 'plugins/{842BF913-B771-47F3-B7EB-F1EB7D4C06AD}/2.4.2/stable/Pop3_Importer_2.4.2_Stable.mpp', '79091', '', '', '', 2004002000000000000, 1, 'This importer allows you to synchronize a library with your E-Mail Pop3 account.\n\nSteps:\n\n1) Create a new library (named Mail)\n2) Add a new importer (type Pop3 Importer)\n3) Set the importer properties\n4) Run it ;-)\n\nNote: Also download the E-mail Module plugin for reading the e-mail.', 'Pop3Importer', '', '', '', '', '0', '1', 7158, 7158, 0, 0, 0, 0, '4ce3edd2bd63b1be8a09a9adbcaefce4', 'FALSE'),
