(170, '{8A3F60A8-43B1-45B9-BEB2-F0E588562282}', 'meeRunImporters', 'This importer can run multiple importers defined for a section in order', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:16', '0.16', 'Kosh', 'tamyk@online.no', 'kosh', 'Kosh', '', 'plugins/{8A3F60A8-43B1-45B9-BEB2-F0E588562282}/0.16/beta/meeRunImporters_0.16_Beta.mpp', '29122', '', '', '', 16000000000000000, 0, 'This importer can run multiple importers defined for a section in order. If the importer is configured to run the importers with ID 15,16,18 it will run these in the order defined. If one of the importers fails, the following ones will not be run.\n\nUseful if you got importers which are dependant on another importer successfully update the library first and for importers like the meeTVShows importer.\n\nConfigure it by giving it a list of the ID of the importers to run.', 'meeRunImporters', 'www.meedio.com', '', '', '', '0', '1', 521, 1479, 0, 0, 0, 0, 'c341da4dec2047e4bd26ec032838c420', 'FALSE'),
