(174, '{8D7780DF-5108-48E3-8578-FEB4FF078FC9}', 'MeeDisplays', 'Change displays in a dual monitor setup', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:57', '1.3', 'Anders Malmgren', 'anders.malmgren@dac.se', '', '2006 DAC Ltd', '', 'plugins/{8D7780DF-5108-48E3-8578-FEB4FF078FC9}/1.3/stable/MeeDisplays_1.3_Stable.mpp', '105095', '', '', '', 1003000000000000000, 1, 'This plug-in enables the user to change displays in a dual monitor setup. You choose to bring up the plug-in''s user interface from a meedio message or execute the display change directly from a meedio message.\nIf you choose to bring up the userinterface you can select which  display to use from the keypad (1-9), this way you dont even need to turn on the current display.\n\nMessages:\nmeedisplays.show-screen\nmeedisplays.execute preset=MyPresetName', 'MeeDisplays', '', '', '', '', '0', '1', 1048, 1048, 0, 0, 0, 0, '9c8f52b1357989cc3e42bb7026325825', 'FALSE'),
