(177, '{91E2DE7A-C331-4EAF-920A-D39B606FC2B2}', 'TicTacToe', 'Play TicTacToe', '', 'Module', 'None', 'Freeware', 'Alpha', '2007-05-14 16:35:10', '1.0', 'Pablo Pissanetzky', 'pablo@meedio.com', 'pablo', '2004 Meedio LLC', '', 'plugins/{91E2DE7A-C331-4EAF-920A-D39B606FC2B2}/1.0/alpha/TicTacToe_1.0_Alpha.mpp', '65684', '', '', '', 1000000000000000000, 1, 'Simply add to your menu!\r\n\r\nThis plugin is part of a plugin tutorial located in MDN. \r\nPlease see http://meedio.com/mdn/index.php?title=TicTacToe_Tutorial', 'TicTacToe', 'www.meedio.com', '', '', '', '0', '0', 629, 629, 0, 0, 0, 0, '3048d59b6947bdde1156ad1c505abacb', 'FALSE'),
(178, '{92A222A0-5DA3-4DC2-B73E-5C2E66992670}', 'Veeno', 'Veeno lets you maintain a catalog of your wine collection', '', 'Module', 'None', 'Donationware', 'Beta', '2007-05-14 16:35:19', '1.01', 'Chris Pravetz', 'support@dimeentertainment.com', '', 'Copyright 2004, Dime Entertainment.', '', 'plugins/{92A222A0-5DA3-4DC2-B73E-5C2E66992670}/1.01/beta/Veeno_1.01_Beta.mpp', '373213', '', '', '', 1001000000000000000, 1, 'Veeno is a Wine database manager for Meedio.  \n\n\n\n\nBefore using Veeno for the first time, move the Wines.mlf file to your library folder.  This is a sample file, you do not need to overwrite when updating Veeno.\n\nUnzip the pictures wherever you like, but change the image fields to match.\n\n\nYou must have the On-screen Keyboard plug-in for Veeno to be able to add wines!\n\n\n\n\nComing versions will be able to import wine data from our databases.  Database contributions gladly accepted! E-mail me your wines library and/or labels!\n\nVeeno now includes a web search for label images!', 'Veeno', 'www.dimeentertainment.com', '', '0', '', '0', '1', 330, 330, 0, 0, 0, 0, 'adcffa70e38f117ace156e8cd9b77c55', 'FALSE'),
(179, '{9394677F-FA32-46DB-9FC8-D9C47179BBD2}', 'BarBack Importer', 'BarBack importer', '', 'Import', 'None', 'Commercial', 'Stable', '2007-05-14 16:33:13', '1.5', 'Meedio, LLC', 'plugins@meedio.com', '', '2004 Meedio LLC', '', 'plugins/{9394677F-FA32-46DB-9FC8-D9C47179BBD2}/1.5/stable/BarBack_Importer_1.5_Stable.mpp', '13824', '', '', 'BarBack.html', 1005000000000000000, 1, 'This plugin imports drinks in BarBack 6.0 format. You''ll need the Drinks.mdb file that comes with it.', 'BarBack', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1157, 1157, 0, 0, 0, 0, '235063751895d0c7e0f73b92999e90dc', 'FALSE'),
(180, '{944F0DF0-D980-44C0-8EA7-A244DC624CE3}', 'Electrify', 'A dark, but well defined, Rock Jukebox Theme!', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:25', '1.08', 'Andy Taylor', 'ap.taylor@blueyonder.co.uk', '', '2004 Andy Taylor (Wishi)', '', 'plugins/{944F0DF0-D980-44C0-8EA7-A244DC624CE3}/1.08/stable/Electrify_1.08_Stable.mpp', '5325884', '', '', '', 1008000000000000000, 1, 'Electrify! (v.1.08)\n\nMeedio v1.28 and above reuired.\n\nOriginally designed as the front end for a rock jukebox, but still works fine for general htpc use ...\n\nAlthough a darker theme than most, all text still has good definition and is easily readable.\n\nDesigned primarily for 1024x768. Will still function in other resolutions. \n\nThe theme has been kept simple with no special plugins or requirements, so that new users can be up and running immediately. \n\nIncludes 2 Icon Sets.\n\nPlease see the ''read_me.txt'' in the themes folder for further information on the icons, the no cover art image, and changing the jukebox screen if required.\n\nThe default installation path is:\n\nc://Program Files/Meedio Esentials/themes/Electrify/read_me.txt\n\n\nBass Player Screen addition.', 'Electrify', 'http://www.meedio.com/', '', '', '', '0', '0', 1468, 1468, 0, 0, 0, 0, 'b01d8020fd5b8e6f707ca02f73c38ca8', 'FALSE'),
(181, '{947FEE22-EED5-4728-AF59-6F2CEDADA4D1}', 'MeeMCETV', 'Import Media Centre 2005 DVR-MS media files (Recorded TV)', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:02', '1.0', 'Jason Hyland', 'jason@hylandfamily.org', '', '2005 Jason Hyland', '', 'plugins/{947FEE22-EED5-4728-AF59-6F2CEDADA4D1}/1.0/stable/MeeMCETV_1.0_Stable.mpp', '107371', '', '', '', 1000000000000000000, 1, 'Import Media Centre 2005 DVR-MS media files (Recorded TV)', 'MeeMCETV', 'http://jason.hylandfamily.org/', '', '', '', '0', '1', 719, 719, 0, 0, 0, 0, '46d3d33aaa55fdcea6a4cd12a3ddb596', 'FALSE'),
(182, '{94AA7DFC-FF20-42EE-B3E2-8CFED85D54A0}', 'PlayTrailers', 'Plays random trailers from a media library before the feature file. Makes it possible to launch online trailers.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:48', '1.01', 'Seb', 'na', '', '', '', 'plugins/{94AA7DFC-FF20-42EE-B3E2-8CFED85D54A0}/1.01/stable/PlayTrailers_1.01_Stable.mpp', '4737', '', '', '', 1001000000000000000, 1, 'In the configuration, select which section to play trailers from and which message subject to relay the play-file message to.\n\nSend the play-file message to playtrailers.play-file instead of playmee.play-file or video.play-file. You can add a "play with trailers"-action to your details screen like this:\n\n<action name="playwtrailers" global="true">\n     <state name="playwtrailers" caption="Play w/ trailers" message="playtrailers.play-file" file="{file}" image="play-img" section="{section}" externalid="{external-id}" id="{id}" />\n</action>\n\nDon''t forget to add it to your toolbox aswell.', 'PlayTrailers', '', '', '', '', '0', '1', 858, 858, 0, 0, 0, 0, 'c32ed56a29018557f5d0d26f2bcbd0cf', 'FALSE'),
