(184, '{966511F0-CB9F-4BD2-9B03-6E6A2D6C70E0}', 'MeeChartsImport', 'The Meedio Top 20 Charts. MeeCharts is a set of Meedio Plugins which interact between Meedio and the MeeCharts System in order to deliver a variety of music based "popularity" charts. Think of MeeCharts as the Meedio Top 20 or Billboard 100.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:50', '1.2', 'Jason Hyland', 'jason@hylandfamily.org', '', '2005 Jason Hyland', '', 'plugins/{966511F0-CB9F-4BD2-9B03-6E6A2D6C70E0}/1.2/stable/MeeChartsImport_1.2_Stable.mpp', '935705', '', '', 'readme.htm', 1002000000000000000, 1, '', 'MeeChartsImport', 'http://jason.hylandfamily.org/', '', '', '', '0', '1', 737, 737, 0, 0, 0, 0, '31e974449c7746c20107ee4d484f6f70', 'FALSE'),
(185, '{9747F408-647A-4949-832B-6E1BF3997EA7}', 'TV On Demand importer', 'Download info about TV episodes from TVTome.com', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:35:12', '0.99.4', 'Dan Litwin + Shawn Bass', 'danlitwin@gmail.com', '', 'Dan Litwin + Shawn Bass', '', 'plugins/{9747F408-647A-4949-832B-6E1BF3997EA7}/0.99.4/stable/TV_On_Demand_importer_0.99.4_Stable.mpp', '30767', '', '', '', 99004000000000000, 1, 'New in v0.99.4:\n- Now compatible with many more shows! Uses TV Tome search to find many shows that are not listed on the All Series page, especially international shows or shows with no TV Tome editor. (Many thanks go out to jotter, who sent me his TvT code!)\n- Fixed long-standing bug (yay!) that caused some people to have repeated trouble importing certain episodes.\n- Property for "Don''t duplicate episodes", which, if unchecked, will add a duplicate episode entry if the filename is different than the existing one. (For episodes that have more than one file.)\n- Fixed bug that caused episodes or shows to fail to import every tag.\n- Fixed "Pre-defined DisplayNames" property.\n\nv0.99.3:\n- Property for download delay time, which waits the specified number of seconds between downloading files. This is very important, since TV Tome crashes have led to users getting their IP addresses permanently blocked from accessing tvtome.com. Set this value as high as you can bear, for your sake and everyone else''s.\n- Property for browse-only episodes. This will allow you to add episodes for which you don''t have video files at all and browse them in the module, i.e. store-bought DVDs sitting on your shelf, or a show for which you don''t have all the episodes.  Automatically adds the episodes to the "raw" file library before importing. (Browse-only episodes will NOT be deleted by the "Remove offline episodes" property.)\n- Property for predefined series DisplayNames, in case you reimport your series with every import.\n- Property for predefined offline tags to set when you are importing from removable media and wish to manually store a value like the DiskID for use with the Offline Prompt.\n- Fixed "Remove series with no episodes" and "Remove offline episodes".\n- Fixed bug with "Series not found", where it imported duplicates into the Series library.\n- Added the internal TimeStamp (aka FirstAdded) values to episodes, marking when they were imported, for use in the Recent Episodes menu of the TV On Demand module.\n\nv0.99.2:\n[Unreleased]\n\nv0.99.1:\nCRITICAL UPDATE! 0.99 CRASHED\n\nv0.99:\n- Property to refresh episode lists after X hours\n- Property to only check recently-added items\n- Property to delete offline episodes\n- Property to delete series with no imported episodes\n- Property for "Series not found" action\n- Works on some shows that did not previously work (Buffy, Angel, etc.)\n- Brings over non-TVOD tags into the Episodes library (e.g. "extension")\n- Other fixes, most of which should make it much much faster.\n\nThe TV On Demand importer imports information about TV episodes from TVTome.com, and parses them into the suitable format and structure for display using the TV On Demand module. This data is not guaranteed to be compatible with the Media Module or any other display module, and such use will not be supported.\n\nTo setup import:\n\n1) Create a new library.\n \n2) Add a Tag Mask Importer\n \n3) In the tag mask, you need a SeriesName tag.\n   Any one of the following tags should match an episode on its own:\nEpisodeName, ProductionNumber, FirstAired\n   The rest must be used in combination with any other tag (not including SeriesName): SeasonNumber, EpisodeNumber, ProductionCode.\n   For example, FirstAired alone will match, so will SeasonNumber + EpisodeNumber, and so will EpisodeNumber + FirstAired. But EpisodeNumber alone will not. Got it?\n   And Month, Date and Year should also match without any other tags, but you must use all 3 together.\n \n4) Add the TVOD Importer.\n \n5) In the settings for the importer, set a directory for cached files.\n   There is also a setting for alternate names for series (e.g. if your files are labeled "Simpsons" instead of "The Simpsons", "The Office" instead of "The Office (2001)", etc.). They should be in the format: "My series name=TVTome name"\n   Further descriptions of the settings are found in the Help Tips that appear when you hover your mouse over a setting.\n \n6) Run the Tag Mask Importer.\n \n7) Run the TVOD Importer.\n \n8) Close and reopen Meedio Configuration to see the new libraries.\n \nIt''s as "simple" as that. Remember, though, that if you enable the downloading of people information in the importer settings, it takes double or triple the time to import. If not more. (The Browser module, in a future version, will do the people imports as-needed.)\n\nHappy trails!\n\n- Dan & Shawn', 'TVODImporter', 'http://www.meedio.com/forum/viewtopic.php?p=130213', '', '', '', '0', '1', 518, 518, 0, 0, 0, 0, 'b7f3b58d3c1b1a9050f3e01346e8b097', 'FALSE'),
(186, '{97970EDE-15CE-4C95-9171-37D7F9850EF9}', 'USB-UIRT', 'Use the USB-UIRT with Meedio.  Supports receive only at this time.', '', 'Input', '', 'Donationware', 'Stable', '2007-05-14 16:35:18', '2.7.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{97970EDE-15CE-4C95-9171-37D7F9850EF9}/2.7.1/stable/USB-UIRT_2.7.1_Stable.mpp', '41858', '', '', '', 2007001000000000000, 0, 'Set the delay, and then use the Learn button (in Configuration...Input) to map IR codes to Meedio commands.', 'USB-UIRT', '', '', '1.0', '', '0', '1', 139, 1171, 0, 0, 0, 0, 'bd76c74644cc20a02326bcc07e6210d3', 'FALSE'),
(187, '{98F894D0-0482-4E3C-8943-8804AB6AAC43}', 'NameMee', 'NameMee - Name that Tune Game', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:37', '1.08', 'Chris Pravetz', 'support@dimeentertainment.com', '', 'Copyright 2005. Dime Entertainment, All rights reserved.', '', 'plugins/{98F894D0-0482-4E3C-8943-8804AB6AAC43}/1.08/stable/NameMee_1.08_Stable.mpp', '691154', '', '', '', 1008000000000000000, 1, 'NameMee is a name that tune type game.  Add the module using your configuration program, and set it''s Section property to your Music section.\n\n\n\nThis release has multi-player support, a scores page, plus some housekeeping on the focus.\n\nHave fun!', 'NameMee', 'http://www.dimeentertainment.com', '', '0', '99', '0', '1', 791, 791, 0, 0, 0, 0, 'f1f44d6af9187ecbc141ad4c402cf4db', 'FALSE'),
(188, '{997DF6F3-B69C-47C6-A005-92E26A7A7717}', 'Sleeptimer', 'Sleeptimer to shutdown/hibernate your PC after a specified time (with many other features)', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:59', '4.1.0', 'Messiahs', 'Messiahs72@yahoo.de', '', '2004 Messiahs', '', 'plugins/{997DF6F3-B69C-47C6-A005-92E26A7A7717}/4.1.0/stable/Sleeptimer_4.1.0_Stable.mpp', '323163', '', '', 'Sleeptimer.txt', 4001000000000000000, 1, 'Sleeptimer allows you to shutdown, reboot, standby or hibernate your PC after a specified time.', 'Sleeptimer', '', '', '1.0', '', '0', '0', 1335, 1335, 0, 0, 0, 0, '4ed508511d7cea1ae85347cfcf3f60ec', 'FALSE'),
