(193, '{9CC856B5-52BF-4545-A101-6D1492E09C05}', 'Export CSV file', 'This import take the content of meedio library and export it into a CSV file.', '', 'Import', '', 'Freeware', 'Beta', '2007-05-14 16:33:26', '0.9', 'NARI', 'mib@sacrlet.be', 'NARI', '', '', 'plugins/{9CC856B5-52BF-4545-A101-6D1492E09C05}/0.9/beta/Export_CSV_file_0.9_Beta.mpp', '29760', '', '', '', 9000000000000000, 0, 'This plugin create a CSV file from the content of a meedio library. If AddHeader is set at ''true'' the plugin take the items tags names as header lines in the file. You can specify an other field Separator than '';''. You can also choose the alternate header line for column in export file.', 'Export CVS file', '', 'http://home.scarlet.be/mi.be/meedio/FileImporter.mpp', '0', '9', '0', '1', 110, 1102, 0, 0, 0, 0, 'f8805504a11047bcdfd8118a0a32bdc5', 'FALSE'),
