(202, '{A291A2F0-711F-4F34-9A0A-7E11D2C5303F}', 'Meedio Ceenter Eedition', 'Theme based on Windows XP Media Center Edition', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:54', '1.2', 'DigitalOldschool', 'meedio@gmail.com', '', '2004 DigitalOldschool', '', 'plugins/{A291A2F0-711F-4F34-9A0A-7E11D2C5303F}/1.2/stable/Meedio_Ceenter_Eedition_1.2_Stable.mpp', '5237704', '', '', '', 1002000000000000000, 1, 'This theme is based on Microsoft XP''s Media Center Edition (http://www.microsoft.com/windowsxp/mediacenter/default.mspx)\n\nIt is designed for the remote user in mind and looks best at 800x600 resolution.\nI have only created screens for the basic components of a fresh install of Meedio Essentials, but it uses the "main.template" format so if you use plugins that utilize that, you should be fine.\n\nYou should also make sure that the included ''Trebuchet MS'' font is installed to get the proper look I intended.\n\nTo get the look and feel that I have intended, you''ll have to make use of the background option in the configuration tool.  I have included several backgrounds for both groups and modules.  Simply put the name of the image you''d like to use (see default.resources for proper formatting or direct link them) and they should appear properly.  I also provided the PSDs to make custom backgrounds if necessary.\n\nUPDATED: Added the necessary actions to provide music control from anywhere. Thanks to arman68 for this tip.\n\nThis theme is now in stable condition and will not receive any more updates to it.  Thanks to all who have downloaded it so far and anyone who cares to edit it, have at it!  Just give me my props in your liner notes.', 'MeeCeeEee', 'http://www.digitaloldschool.com', '', '', '', '0', '0', 4762, 4762, 0, 0, 0, 0, '4bab8e84e6aaf0a8e9dadcb1e85bad86', 'FALSE'),
(203, '{A44E43FE-3822-4CE1-99DA-220DC0BA89F0}', 'SmartMovieSorter', 'Filters out unneccessary garbage in movie file names ready for imdbmee', '', 'Import', '', 'Donationware', 'Beta', '2007-05-14 16:34:59', '1.1', 'binary64', 'slug@skyforge.net', 'binary64', '(c) 2006 binary64. Commerical usage requires prior authorization.', 'http://www.meedios.com/forum/viewtopic.php?t=812', 'plugins/{A44E43FE-3822-4CE1-99DA-220DC0BA89F0}/1.1/beta/SmartMovieSorter_1.1_Beta.mpp', '132618', '', '', '', 1001000000000000000, 0, 'This importer is for the lazy man.', 'SmartMovieSorter', 'http://www.MeediOS.com/', '', '', '', '0', '1', 211, 4005, 0, 0, 0, 0, 'ba6725f32bf7a2e2133e0e091ff97c75', 'FALSE'),
(204, '{A4D1A115-7D4E-4868-95D8-53976B59CDD7}', 'WakeMee', 'Adds a meedio alarm clock.', '', 'Module', 'None', 'Freeware', 'Beta', '2007-05-14 16:35:20', '0.3.1', 'Neil Layne', 'n.layne@gmail.com', '', '', '', 'plugins/{A4D1A115-7D4E-4868-95D8-53976B59CDD7}/0.3.1/beta/WakeMee_0.3.1_Beta.mpp', '391450', '', '', 'readme.htm', 3001000000000000, 1, '==========================================================\nRequirements:\n-A Computer\n-Meedio [v1.15.27.0]\n-Meedio Helper [v2.0.0] \n-FeedMee [v1.3]\n-Girder Event Client plugin [v1.5]\n-- Only needed if you use Girder \n\nTested with:\n-Mod In Effect\n-SaveMee\n-SilenceMee\n\n===========================================================\nInstall:\n\n1. Create a screen tester module to:\n    \\\\plugins\\\\module\\\\WakeMee\\\\alarm.screen\n    IMPORTANT: Give it a jump target name of: alarm \n\n2. Open meedio configuration:\n   General>> Network plugin server settings >> \n   Network plugin server enabled: check\n   Port: 7501\n   Password: leave blank\n   Log net events: check\n\n3. Open Meedio, go to the Screen Tester module, and select setup.\n    Run through the setup\n\n4. Place four *COPIED* mp3''s in\n    C:\\WakeMee\\\n    NAME them: Song1.mp3 through Song4.mp3\n    NOTE: YOU MUST HAVE FOUR SONGS! \n\n5. Open Meedio Configuration, go to the Media Library tab\n-- Find the Library named WakeMee go to the Imports tab \n-- Create a new Tag Mask File import name it anything you like.\n-- Set as follows:\nImport mode: Delete and re-import\nRoot folder: C:\\WakeMee\\\nTag mask: <time> - <frequency> - <command>.<>\nImage file mask: leave blank\nFile mask to include: *.wmst\nFile mask to include: leave blank\nImport date as tag: check \n\n6. Open Meedio, go to the Screen Tester module, and set the alarm.\n\n===========================================================\nHistory:\n=0.3.1 Beta 3\n     - Fixed ''install'' bug.\n     - Added screen shots to illustrate the difference between Bottom/Side buttons.', 'WakeMee', '', '', '', '', '0', '1', 923, 923, 0, 0, 0, 0, 'deb803cfb24c3bd1e643894ae4ea5a14', 'FALSE'),
(205, '{A60E9443-10B8-4564-BC24-6C48C8E0371B}', 'Movie Detailer', 'Imports detailed movie information from IMDB.com, and finds movie cover images.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:33', '1.3', 'Bryan Glass', 'bglass@clemson.edu', '', '2005 - Bryan Glass', '', 'plugins/{A60E9443-10B8-4564-BC24-6C48C8E0371B}/1.3/stable/Movie_Detailer_1.3_Stable.mpp', '8295', '', '', '', 1003000000000000000, 1, 'This plugin will download data from IMDB.com for the movies in your library.  In addition, it will search DVDEmpire.com and IMPAwards.com for the movie covers.\n\nNew in v1.3:\n- To re-download an existing movie, erase the "Retry" tag for that item\n- Fixed bug that occurs with different versions of .NET framework\nNew in v1.1:\n- Added total number of votes for each user rating\n- Searches and saves cover art\n- Ability to set the ''TitleID'' tag to set the source of data, in case of a mis-match', 'MovieDetailer', '', '', '', '', '0', '1', 2491, 2491, 0, 0, 0, 0, '8ac35454cf24d711627445e896dbcafc', 'FALSE'),
(206, '{A6C9CB18-03AA-47F3-B6EF-BD5CCC6DEC94}', 'meeTVtoHTML', 'Export an HTML version of your MeedioTVRecordings library.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:24', '1.0.2', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', '', '', 'plugins/{A6C9CB18-03AA-47F3-B6EF-BD5CCC6DEC94}/1.0.2/beta/meeTVtoHTML_1.0.2_Beta.mpp', '14801', '', '', '', 1000002000000000000, 1, '', 'meeTVtoHTML', 'http://www.meedios.com/forum/viewtopic.php?t=379', 'http://www.meedios.com/maid/dl.php?plugin={A6C9CB18-03AA-47F3-B6EF-BD5CCC6DEC94}', '', '', '0', '1', 1155, 1155, 0, 0, 0, 0, '0e9ae420428a8d0ee60c5367e6e293e7', 'FALSE'),
(207, '{A6FD6A4A-1BCD-4D7F-ADE7-C84C6E2F43F8}', 'Gutenberg Importer', 'Imports information from Project Gutenberg', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:32', '0.9.3.3', 'Rick Taylor', 'taylorrx@yahoo.com', '', '', '', 'plugins/{A6FD6A4A-1BCD-4D7F-ADE7-C84C6E2F43F8}/0.9.3.3/beta/Gutenberg_Importer_0.9.3.3_Beta.mpp', '100049', '', '', 'readme.txt', 9003003000000000, 1, 'The Gutenberg Importer allows you to find and read books from Project Gutenberg. Books are available from Project Gutenberg  in a variety of formats, including plain text, HTML (some with some full color scans of the book and its artwork), and Audio files of the books being read, both machine generated files and human-read books.\n\nChanges 03 Nov 05\nadded a link on the detail screen to look up a work in Google Print, google''s new search engine for printed works (http://print.google.com).\nThe import is the same -- you will not need to re-run the import.\n\n\n\n\n\n\nChanges 24 Oct 05 :\n\n* support for audio books\n* accurate file locations, more and more accurate metadata about the books\n* new default views (by language, media type, subject, author, illustrator)\n\nsee the readme for more info and for system requirements.\n\nChanges 26 Oct 05\n* updated the books.screen file to be more readable and to show what media the work is available in (audio, HTML, Plain Text)\n\nThe import process remains the same in this version -- you will not need to reimport anything.', 'ProjectGutenberg', '', '', '', '', '0', '1', 726, 726, 0, 0, 0, 0, 'e3c01e5ab5c234b94d835bc01f318589', 'FALSE'),
(208, '{A8344652-F273-4A21-A0D0-E643090B5D4A}', 'Regex Importer', 'Import files using regular expressions', '', 'Import', '', 'Freeware', 'Beta', '2007-05-14 16:34:52', '0.8', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{A8344652-F273-4A21-A0D0-E643090B5D4A}/0.8/beta/Regex_Importer_0.8_Beta.mpp', '18318', '', '', '', 8000000000000000, 1, 'Installation Instructions: \nâ€¢ Download and run Regex_Importer.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the Imports tab for the library you wish to populate \nâ€¢ Add a new import \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select Regex Importer in Choose the plugin to perform the import \nâ€¢ Add one or more root folders in Root folders \nâ€¢ Add one or more regular expressions for use in parsing filenames in Regular expressions \nâ€¢ (optional) Define image filename masks in Image file masks \nâ€¢ (optional) Define filename masks to include in File masks to include \nâ€¢ (optional) Define filename masks to exclude in File masks to exclude \nâ€¢ (optional) Check Include system and hidden files to find and import any system and/or hidden files \nâ€¢ (optional) Enter a minimum file size (in kilobytes) in Exclude files smaller than this value (in KB) \nâ€¢ (optional) Uncheck Use same image for all files in directory to attempt to find image files with the same filename as the imported file (leaving this option checked will use the defined image file masks in finding an image file) \nâ€¢ (optional) Check Group/chain files in each directory together? to define each folder as a single item rather than each file \nâ€¢ (optional) Uncheck Follow shortcuts to parse the shortcut file itself rather than the target of the shortcut \nâ€¢ (optional) Enter one or more characters to be replaced with spaces in Space replacement characters (e.g. . or _) (n.b. characters will only be replaced if no spaces exist in the filename) \nâ€¢ (optional) Set a time for this import to run automatically in Schedule this import to run automatically', 'Regex_Importer', 'http://www.meedios.com/forum/viewtopic.php?t=787', 'http://www.meedios.com/maid/dl.php?plugin_id={A8344652-F273-4A21-A0D0-E643090B5D4A}', '', '', '0', '1', 1489, 2385, 0, 0, 0, 0, 'e8eafe5999a996f8a98d522a609ef620', 'FALSE'),
