(217, '{AE694EDB-1223-49DE-AC3D-AAD08E4690F3}', 'DialMee', 'A Meedio plugin that dials communications devices (Vonage only for this release!)', '', 'General', 'None', 'Freeware', 'Alpha', '2007-05-14 16:33:23', '1.0', 'Shawn Bass', 'sbass2@yahoo.com', 'Shawn Bass', 'Your ad here for only $20/month', '', 'plugins/{AE694EDB-1223-49DE-AC3D-AAD08E4690F3}/1.0/alpha/DialMee_1.0_Alpha.mpp', '140012', '', '', 'DialMee.mht', 1000000000000000000, 0, 'DialMee is a fulltime Meedio plugin.  It awaits messages from other plugins or screen files to dial a phone number on their behalf.  In the 1.0 Alpha release, the only supported message is DialMee.VonageDial and as such Vonage is the only conduit in which this plugin will dial your telephone.  If you do NOT have Vonage, don''t bother downloading this plugin at this time.  Future versions will include additional dialing conduits based upon demand.  \n\nAdditional notes:  This plugin is currently only parsing telephone numbers that match US phone number standards.  When I can find an appropriate way of parsing international numbers (and assuming the required conduits support International dialing, I will add it).  Sorry to my friends across the pond :(', 'DialMee', 'http://www.meedio.com/maid', '', '2', '', '0', '1', 223, 1664, 0, 0, 0, 0, '3d8043f72465aedebb5c926806a01bba', 'FALSE'),
(218, '{AF6CC3BD-8DB6-47FE-B8EC-8B9C0C78706B}', 'Audio Tag Importer', 'Import FLAC, M4A, MPC, OGG, WMA, MP3 and many other audio format tags.', '', 'Import', '', 'Freeware', 'Stable', '2007-05-14 16:33:11', '1.1.75.474', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{AF6CC3BD-8DB6-47FE-B8EC-8B9C0C78706B}/1.1.75.474/stable/Audio_Tag_Importer_1.1.75.474_Stable.mpp', '98700', '', '', '', 1001075474000000000, 0, 'Installation Instructions: \nâ€¢ Download and run AudioTagImporter.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the Imports tab for the library you wish to populate \nâ€¢ Add a new import \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select Audio Tag Importer in Choose the plugin to perform the import \nâ€¢ Add one or more folders to scan for audio files to Root folders \nâ€¢ (optional) Configure other options \nâ€¢ (optional) Select a time to run Audio Tag Importer automatically in Schedule this import to run automatically', 'AudioTagImporter', 'http://www.meedios.com/forum/viewtopic.php?t=542', 'http://www.meedios.com/maid/dl.php?plugin={AF6CC3BD-8DB6-47FE-B8EC-8B9C0C78706B}', '', '', '0', '1', 363, 3715, 0, 0, 0, 0, '8211090f36ce95914ab818ef75a26111', 'FALSE'),
