(222, '{B1E55640-49AC-459E-B8C7-48DE53C30240}', 'Radio Module', 'Allows you to control your FM-radio device', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:50', '1.2.0', 'Jelle Hissink', 'RadioTuner@Onshuis.tk', '', 'Copyright 2004 Jelle Hissink. All Rights Reserved.', '', 'plugins/{B1E55640-49AC-459E-B8C7-48DE53C30240}/1.2.0/stable/Radio_Module_1.2.0_Stable.mpp', '80490', '', '', 'Readme.txt', 1002000000000000000, 1, 'This plugin allows you to control the Radio Tuner plugin (not only radio, but also TV and Dss in audio-only mode)', 'RadioModule', '', '', '', '', '0', '1', 1233, 1233, 0, 0, 0, 0, '33e6b0c594edc2a4dcc1935e16bec7f1', 'FALSE'),
