(224, '{B286D9C4-270B-4280-B134-45CECEFD7B69}', 'MetaMeedia', 'Add video and audio information for videofiles', '', 'Import', 'None', 'Donationware', 'Beta', '2007-05-14 16:34:30', '1.0', 'binary64', 'binary64@MeediOS.com', 'binary64', '(c) 2006 binary64 @ MeediOS. Please donate! For commerical usage contact author.', 'http://www.meedios.com/forum/viewtopic.php?t=264', 'plugins/{B286D9C4-270B-4280-B134-45CECEFD7B69}/1.0/beta/MetaMeedia_1.0_Beta.mpp', '10804', '', '', '', 1000000000000000000, 0, 'Requires .NET 2.0 and Mencoder installed.\r\n\r\nCurrently grabs the following tags for video files that mencoder recognises:-\r\n\r\nvideo_Codec (string)\r\nvideo_Resolution (pixels)\r\nvideo_ColorDepth (bpp)\r\nvideo_FrameRate (fps)\r\nvideo_DataRate (kbps)\r\naudio_Codec (string)\r\naudio_SampleRate (hz)\r\naudio_Channels (double)\r\naudio_Profile (string)\r\naudio_DataRate (kbps)\r\n\r\nCurrently grabs the following tags for audio files:-\r\nNONE YET', 'MetaMeedia', 'http://www.MeediOS.com/', '', '', '', '0', '1', 152, 1588, 0, 0, 0, 0, 'bcc7dcf388e915c09a5cd0a50c1e13d7', 'FALSE'),
(225, '{B39F5A62-C149-4D8B-8A99-893A954D9A08}', 'meeTVshowsModule', 'Watch TV Shows', '', 'Module', '', 'Freeware', 'Stable', '2007-05-14 16:34:23', '3.0.2.2', 'walts81', 'joshwalters@gmail.com', 'walts81', '2006', '', 'plugins/{B39F5A62-C149-4D8B-8A99-893A954D9A08}/3.0.2.2/stable/meeTVshowsModule_3.0.2.2_Stable.mpp', '64563', '', '', '', 3000002002000000000, 0, '1) Add module to menu in Meedio config\n\n2) Set episodes section\n\n3) Set Field Names (according to your episodes section field names)\n\n4) Set screen preferences', 'meeTVshowsModule', 'http://www.meedios.com/maid', '', '', '', '0', '1', 489, 8909, 0, 0, 0, 0, 'f26010bc182ad2d159c9bf9b288757a7', 'FALSE'),
(226, '{B499D2A7-6D3A-4A34-8F78-8210FAA1E2C4}', 'Meedio Pro', 'A clean and consistent theme with a Default and Alternate Main Menus.', '', 'Theme', 'None', 'Freeware', 'Alpha', '2007-05-14 16:33:55', '0.1.9', 'Gerry Plasky (Big Gerr)', 'gplasky223900MI@comcast.net', 'gplasky', 'Copyright 2004 The Plasky Group', '', 'plugins/{B499D2A7-6D3A-4A34-8F78-8210FAA1E2C4}/0.1.9/alpha/Meedio_Pro_0.1.9_Alpha.mpp', '12420229', '', '', 'readme.txt.', 1009000000000000, 1, 'A clean and consistent theme with a Default Main Menu for Music lovers and an Alternate Main Menu for Icon lovers. You will need the Feedme plugin for datafeeds. In this version you will need a library named "Weather", "Email" and "News" for the datafeeds to work. This will be configurable in the next version. You can also use the Themes module "Customize" button to make changes to the theme within Meedio. This theme now uses Century Gothic font so you won''t have to copy any fonts to the system folder. See the support thread for the default names for the included icons.', 'Pro', '', '', '', '', '0', '0', 3319, 3319, 0, 0, 0, 0, '2a44c4e9a63c46f80f91f4a1560d9306', 'FALSE'),
(227, '{B4A25F69-1055-4096-84B3-7E23A7C3837B}', 'MeeMaps', 'MeeMaps provides locations searches and directions via US and Canada streetmaps from Google, and US aerial imagery from TerraServer', '', 'Module', 'None', 'Donationware', 'Beta', '2007-05-14 16:34:02', '1.1', 'Jason Hyland', 'jason@hylandfamily.org', '', '2005 Jason Hyland', '', 'plugins/{B4A25F69-1055-4096-84B3-7E23A7C3837B}/1.1/beta/MeeMaps_1.1_Beta.mpp', '324809', '', '', 'readme.htm', 1001000000000000000, 1, 'MeeMaps provides locations searches and directions via US and Canada streetmaps from Google, and US aerial imagery from TerraServer. See Readme.htm for more info.', 'MeeMaps', 'http://jason.hylandfamily.org/', '', '1.28', '', '0', '1', 637, 637, 0, 0, 0, 0, '3c09bee3e95db206d43b14a61939264e', 'FALSE'),
(228, '{B4CCB4B2-59F9-4497-BB30-8FBCB41EAF71}', 'ToothControlMee', 'ToothControlMee and the associated client allows Meedio to be remote controlled over TCP/IP or Bluetooth using a PDA or Windows PC.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:35:11', '2.988', 'Kosh', 'tamyk@online.no', 'kosh', 'Kosh 2006', '', 'plugins/{B4CCB4B2-59F9-4497-BB30-8FBCB41EAF71}/2.988/stable/ToothControlMee_2.988_Stable.mpp', '348219', '', '', '', 2988000000000000000, 1, '-The Meediolibrary can be browsed using the views defined. Individiual songs, movies, an artist or an album can be selected and added to the playlist of the Meedio instance the client is connected to. \n-The items on the music or video playlist can then be played, deleted, stopped, paused, restarted or changed position of current playing song/movie. \n-The volume of Meedio, the weather forecast and album cover of current playing song can also be seen.', 'ToothControlMee', 'http://www.meedio.com/forum/post-183963.html', '', '1.41', '2.0', '0', '1', 1190, 1190, 0, 0, 0, 0, '8666824e182d498fbd6b49594bb63339', 'FALSE'),
(229, '{B5A1027D-3FDA-4B1B-8E09-B9829C2E5980}', 'LucidTheme', 'This is a "skinned" version of DigitalOldSchool''s "Meedio Ceenter Eedition" theme.', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:45', '0.93', 'Jon Reberry', 'jonshallmark@hotmail.com', '', '2004 Jon Reberry', '', 'plugins/{B5A1027D-3FDA-4B1B-8E09-B9829C2E5980}/0.93/beta/LucidTheme_0.93_Beta.mpp', '7805533', '', '', '', 93000000000000000, 1, 'v0.93 This should fix the white background problem.   \nv0.92 Update: New icons and background images have been added for internal drives, network drives, external drives, i-pod, playlist, phone, and caller id. I had to erase the "group" images in order to make space for the new graphics. Let me know if this causes any problems for people. I also made some minor changes to the firefox icon.  If you have a request for any other images please post in the forum and I''ll see what I can do. Thanks for the help KXM.  --Jon-\n\nv0.91 This theme is a skinned version of DigitalOldSchool''s -Meedio Ceenter Eedition- theme. My goal was to make it very simple, interesting, functional, and wife/girlfriend/company friendly. You will need to assign background images to each group and module using the Meedio Configuration utility. It''s very simple and should not take more than a few minutes. Background images are included for admin, blank, contacts, dvd, files, gaming, login, movies, music, online, pictures, radio, satellite, settings, shopping, start, television, themes, tvshows, update, utilities, videos, and weather. I''ve added a new icon for Firefox users (this should be everybody!). The background image I modified to make this skin is called "Gradient Red" and was created by Shawn Taylor at www.wstaylor.net, and it is used with his permission. \n\nNOTE: Also included with this theme are two files to allow Meedio to switch to Snapstream''s Beyond TV "seamlessly". Directions on how to do this are included in the "Meedio Essentials-themes-LucidTheme-images-backgrounds-Use these with Beyond TV" folder. Again, this is very simple. I''ve included two screenshots of BTV after the change so you can see how it looks. I love it because now I can switch between the two with no visual difference. I should mention that this only changes the LOOK of BTV to match Meedio, it is not a plugin to bridge the two programs. To bridge the twp programs create a module to launch an external program and then add whatever command line switches you use. More info about creating this type of module can be found in the forums.\n\nALSO NOTE: Feel free to modify and redistribute this theme. If you make modifications please include me in your props. Thanks, send comments, and enjoy!  --Jon', 'LucidTheme', 'http://www.meedio.com/forum/viewtopic.php?p=139269#139269', '', '', '', '0', '0', 1220, 1220, 0, 0, 0, 0, 'b8e4dedd4412a9fc81f1fb7b94dfe3ee', 'FALSE'),
(230, '{B65C9182-1A28-4D73-A2EB-DE9DE806C706}', 'Menagerie SE', 'Enjoy the best and most stylish theme for Meedio.', '', 'Theme', '', 'Donationware', 'Stable', '2007-05-14 16:34:27', '1.8', 'Adam Smith', 'adam@adamsmith.ws', 'adamsmith', 'A commercial licence is required for use on a commercial machine', '', 'plugins/{B65C9182-1A28-4D73-A2EB-DE9DE806C706}/1.8/stable/Menagerie_SE_1.8_Stable.mpp', '10923747', '', '', 'Changes_To_Theme.txt', 1008000000000000000, 1, 'Menagerie SE 1.8\n\nChanges:\nAdjusted - TV Guide, TV program and TV.timeshift screens slightly to allow better display of information.\nAdjusted - Media.screen to fix movie time length.\nAdjusted - TV Recording screens to match rest of theme.', 'Menagerie SE', 'http://www.meedios.com/menagerie', '', '', '', '0', '0', 5667, 5929, 0, 0, 0, 0, 'b77b22161dfb1839ae4d20afae4bde60', 'FALSE'),
(231, '{B6D3B945-A708-45E8-8022-F82D9D1130E8}', 'meeTVshowsImporter', 'Import TV Series and Episode Information', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:23', '3.0.1.8', 'walts81', 'joshwalters@gmail.com', 'walts81', '2006', '', 'plugins/{B6D3B945-A708-45E8-8022-F82D9D1130E8}/3.0.1.8/beta/meeTVshowsImporter_3.0.1.8_Beta.mpp', '496048', '', '', '', 3000001008000000000, 0, '1) Add importer to your TV Shows library\n\n2) Set custom settings\n\n3) Run the importer\n\n**NOTE**----------------------------------------------------------------------------------------------------------------\nThis plugin creates 1 new library, "meeTVshows-Series" \nIf running this importer for the first time, this new library will NOT appear until Meedio Config has been closed and re-started. All Episode data will be added to the library that this import is run from.', 'meeTVshowsImporter', 'http://www.meedios.com/maid', '', '', '', '0', '1', 431, 9128, 0, 0, 0, 0, '398ada318865e701f45aa9d19d2e90a4', 'FALSE'),
(232, '{B6DD1760-6587-4790-9E95-6DB60CC31D6E}', 'Movie Thumbnailer', 'Make thumbnails of your video files', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:33', '1.0.8', 'Espen RÃ¸vik Larsen', 'meedio@kjollefjord.net', '', 'Larsen Consulting', '', 'plugins/{B6DD1760-6587-4790-9E95-6DB60CC31D6E}/1.0.8/stable/Movie_Thumbnailer_1.0.8_Stable.mpp', '163171', '', '', '', 1000008000000000000, 1, 'The default settings is just fine as they are, but there is doucmentation online at http://meedio.kjollefjord.net/wiki/index.php?title=LarsenConsulting:MovieThumbnailer', 'MovieThumbnailer', 'http://meedio.kjollefjord.net', '', '', '', '0', '1', 1201, 1201, 0, 0, 0, 0, 'cc320dbc826ac286de928683bd143149', 'FALSE'),
(233, '{BA67452D-89B5-4A73-B202-18E9BAFA1319}', 'Screensaver+', 'Screensaver+ is a screensaver and slideshow enhancer (randomize it!).  Screensavers can be picture slideshows, datafeed screen files, music visualizations, or external programs.  Automatic slideshows with any media insertion!', '', 'General', '', 'Donationware', 'Stable', '2007-05-14 16:34:56', '5.5.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{BA67452D-89B5-4A73-B202-18E9BAFA1319}/5.5.1/stable/Screensaver~_5.5.1_Stable.mpp', '481481', '', '', '', 5005001000000000000, 0, '***If you were using SaveMee, then you need to delete that folder from the plugins/general folder before installing this new version.  Also, you should reselect the screen file folders.***\n\nScreensaver+ is a screensaver and slideshow enhancer (it fully randomizes the slideshow).  Screensavers can be picture slideshows, rotating datafeed screen files, music visualizations, or external programs.  You can cycle or randomize between them.    Automatic slideshows with any media insertion!  Simply insert any type of media (USB key, compact flash card, CD/DVD, etc) and Screensaver+ will start a slideshow if any image files are found on the media.  Automatically run imports with the screensaver.  Set the system screensaver to 1 minute longer than Screensaver+ to provide out-of-Meedio protection.  Run an external program before and/or after the screensaver, or AS the screensaver.\n\nYou can enable/disable Screensaver+ using the Meedio messages:\n\nscreensaver.enable and screensaver.disable\n\nYou can also activate/deactivate Screensaver+ using the Meedio messages:\n\nscreensaver.activate and screensaver.deactivate\n\nscreensaver.full-screen to launch the music visualization in full screen\n\nscreensaver.randomize with random=true,false,toggle to change the current manual picture slideshow mode.\n\nThere is also a screensaver.randomize datafeed that will send two values- order and random.  Use these values to show the currect setting in screen files.\n\nBig thanks to Mattman (-= M@ =-) for the Movies, MoviesWeatherNews, and Showtimes screen file sets!\n\nBig thanks to Dee for the Info screen file set (and 3D flash clock)!\n\nBig thanks to MisterMoonlight for the MovieTimes VBNET screen file set!\n\nYou can make your own .screen files for the screen saver.  Just place them in a separate folder and modify the appropriate "Screen File Folder" property.\n\nExample of using the External Screensaver Program Settings:\n\n1). 3D Flash Clock screensaver played by ZoomPlayer\nProgram: C:\\Program Files\\Zoom Player\\zplayer.exe\nParameters: /F /Q /LOCKFS "{screensaver+}3DClock\\3dc.swf"\n\n2). Windows screensaver\nProgram: C:\\WINDOWS\\system32\\scrnsave.scr\nParameters:\n\n3). Play random music videos (make sure to set the Library Section to the correct location)\nProgram: C:\\Program Files\\Zoom Player\\zplayer.exe\nParameters:/F /Q /LOCKFS "{item_location}"\nThis will cause one random music video to be queued and played.  When Zoom Player finishes playing it and closes, another random music video will be picked and played.  This cycle will continue until the screensaver is deactivated.\n\nIf "Run before screensaver activation?" is checked, then the Program will NOT be used as a screensaver.  It will be used as a pre-screensaver program.\n\nEnable "Run imports while screensaver is active?" if you would like your imports to run when the screensaver activates.  All imports that are scheduled will be run (regardless of how they are scheduled).  All imports set to "Never" will be ignored.  By scheduling your imports to run only during off-hours, you can prevent being disrupted by imports while actively using the system, and still have imports run regularly during "idle" time.', 'Screensaver+', '', '', '1.30', '', '0', '1', 107, 2046, 0, 0, 0, 0, '45dfb2aead6b2b6dbaf47f21aaa9b21f', 'FALSE'),
(234, '{BB3BFA2D-A8AC-4B3B-BE61-5D32B0B377A2}', 'Comic RSS Importer', 'Imports different Comic RSS feeds.', '', 'Import', 'None', 'Donationware', 'Alpha', '2007-05-14 16:33:21', '0.1.3', 'drahcir', 'drahcir@psychonuke.com', '', 'drahcir', '', 'plugins/{BB3BFA2D-A8AC-4B3B-BE61-5D32B0B377A2}/0.1.3/alpha/Comic_RSS_Importer_0.1.3_Alpha.mpp', '35681', '', '', 'readme.txt', 1003000000000000, 1, '', 'ComicRSS', 'http://www.meedio.com/maid', '', '', '', '0', '0', 696, 696, 0, 0, 0, 0, '13471d7c0e7b60c648a1ac14abfa82ed', 'FALSE'),
