(236, '{BCEA34C1-B387-4837-B9A0-4D77AA50A26C}', 'ShutdownMee', 'Shutdown Timer', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:58', '2.1.5', 'thomas hajek', 'thomas.hajek@medv.at', '', '2004 medv', '', 'plugins/{BCEA34C1-B387-4837-B9A0-4D77AA50A26C}/2.1.5/beta/ShutdownMee_2.1.5_Beta.mpp', '417787', '', '', 'readme.txt', 2001005000000000000, 1, 'ShutdownMee V2.0 Readme\n\nShutdownMee is a general Plugin for Meedio/TVCentral to set a shutdowntimer.\n\nThe timer can be set via a configuration screen or using a keyboard shortcut.\n\nYou can set the timer to do the desired action in a couple of minutes, or at a given Date/Time.This is useful to shutdown after a recording.\n\nIf the Timer is set, a datafeed is published, to show the remaining time in different screens.\n\nThe last minute before shutdown, a countdown is shown. While the countdown is shown, the user can increase the timer or cancel it.\n\nThe plugin is configured via the Meedio/TVCentral configuration tool. There you can set the message and datafeed texts, the size, position, color, textstyle, and opacity of the message window.\nEven there can be selected to hibernate, shutdown, restart or go to standby when the timer elapses.\n\n\nPlease read the Documentation.txt file to learn how to configure the Plugin.\n\nFor further questions feel free to send a mail to thomas.hajek@medv.at\n\n------------------------------------------------------------------------------------------------------------\n\n\nShutdownMee V2.0 Liesmich\n\nShutdownMee ist ein general Plugin fuer Meedio/TVCentral, um einen Ausschalttimer zu setzen.\n\nDer Timer kann ueber einen eigenen Konfigurations Screen, oder mittels eines Tastaturshortcuts gesetzt werden.\n\nDer Timer kann programmiert werden, die gewuenschte Aktion nach einer Zeitspanne, oder zu einer bestimmten Zeit auszufuehren. Dies ist zum Beispiel fuer den Shutdown nach Aufnahmen nuetzlich\n\nWenn der Timer aktiviert ist, wird ein Datafeed gesendet, um die Zeitspanne bis zum Shutdown in anderen Screens anzuzeigen.\n\nEine Minute vor dem Ausschalten wird ein Countdown angezeigt. Hier besteht die Moeglichkeit den Timer zu verlaengern, oder zu loeschen.\n\nDas Plugin kann ueber die Meedio/TVCentral Konfiguration angepasst werden. Hier ist es moeglich, die Meldungstexte, sowie Groesse, Position, Farbe, Transparenz und Schriftart des Meldungsfensters einzustellen.\nEbenso kann hier ausgewaehlt werden, ob der PC nach Ablauf des Timers, Herunterfahren, Neu starten, oder in Ruhezustand oder Standbymodus gehen soll.\n\nBitte zuerst die Datei "Dokumentation.txt" lesen um mehr ueber die Konfiguration des Plugins zu erfahren.\n\n\nBei weiteren Fragen, Mail an thomas.hajek@medv.at', 'ShutdownMee', 'http://www.medv.at', 'http://www.medv.at/downloads/ShutdownMee.mpp', '', '', '0', '1', 979, 979, 0, 0, 0, 0, '6f6980898c8a600a90e01936c2ad3aa1', 'FALSE'),
(237, '{BD056463-42FB-4863-B638-450F9C9B6E7B}', 'meeTorrent', 'For controlling ABC, Azureus and XBT Bittorrent clients from inside Meedio', '', 'Module', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:22', '0.99', 'Kosh', 'tamyk@online.no', 'kosh', 'Kosh', '', 'plugins/{BD056463-42FB-4863-B638-450F9C9B6E7B}/0.99/beta/meeTorrent_0.99_Beta.mpp', '151277', '', '', '', 99000000000000000, 1, 'Watch the status of your current torrents, add new torrents by browsing torrentsites or search for the torrents you are interested in and add them to the downloadqueue.', 'meeTorrent', 'www.meedio.com', '', '1.38', '', '0', '1', 608, 608, 0, 0, 0, 0, 'a037096dda75aa547bec577d4f5d35db', 'FALSE'),
(238, '{BD494F2F-9239-4EAD-865F-11B4E368B7ED}', 'White Spitfire Widescreen', 'With global vol controls, new weather, photo album and video screens', '', 'Theme', 'None', 'Commercial', 'Stable', '2007-05-14 16:35:23', '2.11', 'Jon Gardner, Meedio, LLC and CrispyXUK', 'jong@blueyonder.co.uk', '', '2004 Meedio, LLC.', '', 'plugins/{BD494F2F-9239-4EAD-865F-11B4E368B7ED}/2.11/stable/White_Spitfire_Widescreen_2.11_Stable.mpp', '3633100', '', '', '', 2011000000000000000, 1, 'This theme is a widescreen (848x480) version of the White Spitfire theme, iself based on the original Spitfire theme. Its key features are:\n\n- global music volume controls: Mute, volume up, volume down, next track, previous track, FFW, REW, Pause and Stop now all work from anywhere, including slideshows.\n\n- A new weather screen with images and forecast visible at the same time\n\n- Photo album view changed to hide left menu bar and display five thumbails per row. The menu bar can be toggled into/out of view using the ''display'' key\n\n- Optional new "Videos" screen file that has thumbnail buttons with a 4:3 aspect ratio to better suit thumbnail snapshots of video footage. Like the Photo Album, it hides the left menu bar which gains space for four thumbnails per row. . This new screen file may be selected as an alternate screen file for any media module menu item.\n\n- Improved formatting of the now-playing indicator and this indicator is also now visible on the main menu screen\n\n- a new 4-button alternate subgroup module screen (use by defining as an alternate screen in Meedio Configuration)\n\n- hitting ''display'' in the ''now playing'' screen shows the playlist instead of visualisations\n\n- the original default images for major modules.\n\nNote this is a widescreen theme (848x480) NOT a High Definition theme. It is probably not suitable for large plasma/LCD displays.\n\nChanges in 2.11:\n-------------------\n\n- Small ''maintenance'' update to incorporate the new visualizations into the Now playing screen', 'White Spitfire widescreen', '', '', '', '', '0', '0', 1141, 1141, 0, 0, 0, 0, '38ddc69fed601ae1e38b8e619aefc206', 'FALSE'),
