(244, '{C02A5ABA-184B-4254-8CA3-4F1708B9C524}', 'WinMessenger2C', 'Publishes messages and datafeeds when Windows Messenger events occur.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:35:24', '0.0.2', 'Harald Wagner', 'harald.wagner@computec.de', 'HdWagner', '2004 Harald Wagner. This product is free for personal use only.', '', 'plugins/{C02A5ABA-184B-4254-8CA3-4F1708B9C524}/0.0.2/beta/WinMessenger2C_0.0.2_Beta.mpp', '47692', '', '', 'WinMessenger2C.txt', 2000000000000, 1, 'Publishes messages and datafeeds when Windows Messenger events occur. It is not meant to be a message reader by itself.', 'WinMessenger2C', '', '', '', '', '0', '1', 327, 327, 0, 0, 0, 0, '9c293c4f92d5eb6e4b8f784ca379dad7', 'FALSE'),
(245, '{C11FF8D8-D08B-486D-99B5-39297D78E278}', 'Global Keyboard', 'Provides global keyboard events as Meedio inputs.', '', 'Input', 'None', 'Donationware', 'Beta', '2007-05-14 16:33:30', '0.1.0.0', 'Thomas A. Bennedum', 'tab@bennedum.org', '', '2005 by Thomas A. Bennedum. Free for personal use. Commercial use requires licensing.', '', 'plugins/{C11FF8D8-D08B-486D-99B5-39297D78E278}/0.1.0.0/beta/Global_Keyboard_0.1.0.0_Beta.mpp', '253715', '', '', 'docs/index.htm', 1000000000000000, 1, 'Global Keyboard\nAn Input Plugin for Meedio\n\nCopyright 2005 by Thomas A. Bennedum <tab@bennedum.org>\n\nGlobal Keyboard is a Meedio input plugin that allows Meedio to respond\nto keyboard events even when it doesn''t have input focus. It allows\nusers to create "pattern lists" which use regular expressions to match\nkeyboard events and only pass the desired events on to Meedio.\n\nGlobal Keyboard is donationware and is free for personal use.\nCommercial use requires a commercial license. Contact the author for\ncommercial licensing information. You can find the license for\nGlobal Keyboard in the plugin directory, displayed in the About box,\nand in the help documents.\n\nIf you like the software and use it, please donate any amount you feel\nappropriate. Your donation will help feed my family and allow me to\ncontinue to support the software. To make a donation, click the\nHelp->Donate menu item in the configuration window, click the\n"Donate" button in the About dialog box, or the "Donate" button in the\nhelp documents.\n\nGlobal Keyboard contains components that were developed by others. For more\nlicensing information see the various license files included in the plugin\ndirectory and displayed in the About box.', 'GlobalKeyboard', 'http://www.meedio.com/maid/detail.php?mode=detail&plugin_id={C11FF8D8-D08B-486D-99B5-39297D78E278}', 'http://www.meedio.com/maid/dl.php?plugin_id={C11FF8D8-D08B-486D-99B5-39297D78E278}', '', '', '0', '1', 972, 972, 0, 0, 0, 0, '4696152c53f686a78804b6e1b6203feb', 'FALSE'),
(246, '{C151C4BF-ABD8-4570-B5AA-C63D939C37F6}', 'TheMovieInsider', 'Grab Trailer Names and Locations', '', 'Import', 'None', 'Donationware', 'Beta', '2007-05-14 16:35:10', '.62', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', '@paypal.com :)', '', 'plugins/{C151C4BF-ABD8-4570-B5AA-C63D939C37F6}/.62/beta/TheMovieInsider_.62_Beta.mpp', '83774', '', '', '', 62000000000000000, 0, 'This will just grab a trailer main page, not individual trailers', 'TheMovieInsider', '', '', '', '', '0', '1', 157, 1261, 0, 0, 0, 0, '4517088cd7e518a7191a725180977925', 'FALSE'),
(247, '{C1E865EA-28E3-4ABC-9A5D-0E197782CF3F}', 'Suntimes Importer', 'Download Sunrise/Sunset Times', '', 'Import', '', 'Freeware', 'Beta', '2007-05-14 16:35:08', '0.3', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{C1E865EA-28E3-4ABC-9A5D-0E197782CF3F}/0.3/beta/Suntimes_Importer_0.3_Beta.mpp', '22471', '', '', '', 3000000000000000, 1, 'Installation Instructions: \nâ€¢ Download and run Suntimes_Imporer.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the Imports tab for the library you wish to populate \nâ€¢ Add a new import \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select Suntimes Importer in Choose the plugin to perform the import \nâ€¢ Configure other options \nâ€¢ (optional) Select a time to run Suntimes Importer automatically in Schedule this import to run automatically', 'Suntimes_Importer', 'http://www.meedios.com/forum/viewtopic.php?t=686', 'http://www.meedios.com/maid/dl.php?plugin_id={C1E865EA-28E3-4ABC-9A5D-0E197782CF3F}', '', '', '0', '1', 673, 790, 0, 0, 0, 0, 'bcc051a8b6665acb1d23be54478893b4', 'FALSE'),
(248, '{C21FA7CE-897B-4A90-A530-7D61254B6C51}', 'Girder Event Server', 'Girder compatible internet event server', '', 'General', 'None', 'Commercial', 'Stable', '2007-05-14 16:33:30', '1.0', 'Meedio, LLC', 'plugins@meedio.com', '', '2004 Meedio LLC', '', 'plugins/{C21FA7CE-897B-4A90-A530-7D61254B6C51}/1.0/stable/Girder_Event_Server_1.0_Stable.mpp', '78877', '', '', 'girdereventserver.html', 1000000000000000000, 1, 'Allows Meedio to receive messages via Girder''s internet event client. The format of the message should be message|parameter=value|parameter=value', 'GirderEventServer', 'http://www.meedio.com/maid', '', '', '', '0', '0', 977, 977, 0, 0, 0, 0, '18b7479c5ca09334c170aaeeb22c6a77', 'FALSE'),
(249, '{C337493C-105D-4B94-8BC3-C0EECA357195}', 'GotTV Importer', 'Imports the .my file and the .mpg (or .mpeg, .avi or .wmv) file and (optionally) the thumbnail graphic created by the GotTV application.  Also imports the .tvrinf file created by the GotTVPVR/GotAllMedia program.', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:31', '1.1.3', 'Scott Libert', 'scottlibert@comcast.net', '', '2004 (c) Scott Libert', '', 'plugins/{C337493C-105D-4B94-8BC3-C0EECA357195}/1.1.3/stable/GotTV_Importer_1.1.3_Stable.mpp', '23981', '', '', 'GotTVImporter_ReadMe.htm', 1001003000000000000, 1, 'For help, look in the directory plugins\\module\\GotTVImporter\\GotTVImporter_ReadMe.htm', 'GotTVImporter', '', '', '', '', '0', '1', 805, 805, 0, 0, 0, 0, '020fc76cfac2b687857688d343ae0323', 'FALSE'),
(250, '{C4814F9D-9FB0-49B2-BE98-198F3E7292DD}', 'E-mail Module', 'Allows access to E-Mail library', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:24', '2.5.2', 'Jelle Hissink', 'EMailModule@Onshuis.tk', '', 'Copyright 2004 Jelle Hissink. All Rights Reserved.', '', 'plugins/{C4814F9D-9FB0-49B2-BE98-198F3E7292DD}/2.5.2/stable/E-mail_Module_2.5.2_Stable.mpp', '452869', '', '', '', 2005002000000000000, 1, 'Allows you to access and send mail.\n\nSteps:\n1) Setup a new Library using the Pop3 Importer\n2) Add a new module (E-mail Module) to the menu\n3) Set the module property ''Mail Library'' to the name used for the Pop3 Importer\n\nAnd behold, e-mail is there.... \n\nNote: You need the Pop3 Importer and the Meedio Helper plugin...', 'EMailModule', '', '', '', '', '0', '1', 8744, 8744, 0, 0, 0, 0, '3a40d0edef0500be0dbc5221c5284125', 'FALSE'),
(251, '{C4A20AD3-6819-4BA5-8616-5E6CBCC4222A}', 'Weather_Icons', 'Weather icon set', '', 'Misc', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:36', '1.0', 'walts81', 'N/A', 'walts81', '2007', '', 'plugins/{C4A20AD3-6819-4BA5-8616-5E6CBCC4222A}/1.0/stable/Weather_Icons_1.0_Stable.mpp', '2968725', '', '', '', 1000000000000000000, 1, 'Install and enjoy!', '..\\images\\Weather', '', '', '', '', '0', '0', 1449, 1449, 0, 0, 0, 0, '56f00ba9b02574f0d00c7620200ad360', 'FALSE'),
(252, '{C4EEF53B-4B35-4B3E-B20A-2B8B8107769F}', 'POP3 Feed', 'Feeds how many e-mails there are on your POP3 account to your screen files.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:48', '1.00', 'Seb', 'na', '', '', '', 'plugins/{C4EEF53B-4B35-4B3E-B20A-2B8B8107769F}/1.00/stable/POP3_Feed_1.00_Stable.mpp', '4887', '', '', '', 1000000000000000000, 1, 'This plug-in is useful if you''re using a different e-mail program to read your e-mail and just want a small notification if you have recieved an e-mail.\n\nSet up your account information, how often you want the plug-in to check your account and what you want it to display.\n\nSet your themes to recieve the subject "pop3feed" and the source to "count" to get only the number or "message" to get the message that you have specified for that number of e-mails waiting.', 'POP3Feed', '', '', '', '', '0', '1', 873, 873, 0, 0, 0, 0, '78b25603ccd68ee3c9916d8d2f736318', 'FALSE'),
(253, '{C5F0CEB1-0F9E-472E-89C5-10714B768A8B}', 'Beta Twist', 'Retro beta theme updated to work with the Meedio gold release.', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:14', '2.30', 'Jason Verhagen (aka robogeek)', 'jlverhagen@tfo.net', 'robogeek', '', '', 'plugins/{C5F0CEB1-0F9E-472E-89C5-10714B768A8B}/2.30/stable/Beta_Twist_2.30_Stable.mpp', '5507977', '', '', '', 2030000000000000000, 1, 'UPDATED March 13, 2005\r\nBetaTwist v2.30\r\n******************************\r\nMusic Library screen is now updated to work with new BASS music engine visualizations.  Removed the theme setting option to allow Play All in music library to jump automatically to Now Playing screen...this option is now available in the Meedio Config app (Menu tab--> Music Library --> Module Properties tab --> Jump to the Now Playing Screen).\r\n\r\nSee the BetaTwist official theme thread for additional notes.\r\n******************************\r\nEnjoy more screen real estate by using a toolbar button at the top of the screen instead of a bulky menu.  This theme may be confusing to new users and may not be suitable for those who are new to Meedio or use the keyboard and mouse exclusively.  This theme is essentially...pun intended :) ...a modified version of the old beta theme.\r\n\r\nA readme.txt is included and will contain notes regarding the theme.  You can also view these notes and updates as the theme is upgraded in the BetaTwist Theme Official Thread.  Use this thread to also report bugs, request help, or make suggestions:\r\n\r\nhttp://www.meedio.com/forum/viewtopic.php?p=115251\r\n\r\nEnjoy!', 'BetaTwist', '', '', '1.28', '', '0', '0', 2066, 2066, 0, 0, 0, 0, 'b894f20d8eb5bba54bf1c607e8cb73e3', 'FALSE'),
(254, '{C6A4086C-C3BD-46B8-B08B-A362FA8B8443}', 'WTC Tribute', 'Tribute to the World Trade Center', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:26', '1.1', 'AHX', 'AsSh0leX@2pissedguys.com', '', '', '', 'plugins/{C6A4086C-C3BD-46B8-B08B-A362FA8B8443}/1.1/stable/WTC_Tribute_1.1_Stable.mpp', '2921684', '', '', '', 1001000000000000000, 1, 'This is a modified verson of Beach.  Thanks to RyanJone2, DidigtalOldSchool and Kelmk The original creators.', 'WTC Tribute', '', '', '', '', '0', '0', 904, 904, 0, 0, 0, 0, '9f453d77d7b5c570fc91b3f53a43c314', 'FALSE'),
(255, '{C83D041C-1E60-42C7-A521-0056ED50DE8A}', 'DIS2mee', 'Load Picture Data with Digital Image Suite Keywords', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:23', '0.82', 'Dave Brown', 'drmbrown@comcast.net', 'fornold', '2004 Dave Brown', '', 'plugins/{C83D041C-1E60-42C7-A521-0056ED50DE8A}/0.82/stable/DIS2mee_0.82_Stable.mpp', '14729', '', '', '', 82000000000000000, 1, 'Choose folders and run.\n\nThe importer will traverse the folders and load the DateTime stamp from the EXIF data.  It also reads the keywords added to the EXIF data by Microsoft''s Digital Image Library.\n\nThe choose xml file dialog will display a view of the current tag list as a tree.  You can modify the xml file to catagorize the tags.  Then load into this to make sure it looks like you want it.  An example file is included.\n\nThe PSAslideshow plugin now suports this file and this import library.\n\n\n\nNow imports title information.\n\n0.72: Imports title information now\n0.73: sets externalID to be used by PSAslideshow\n0.75: Added new support that will be used by PSAslidehow 1.60 and higher\n0.76: Added selected to dates ibrary\n0.81: Bug Fix\n\nRecompiled for Meedio 1.40', 'DIS2mee', '', '', '', '', '0', '1', 1003, 1003, 0, 0, 0, 0, 'b23bce23aa4e9c4fa7143c76da7043e7', 'FALSE'),
(256, '{C8ACB8D3-456E-411F-BF2C-DBB80E866F48}', 'meeMovieTunes', 'pre-Movie Manager by walts81', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:02', '1.0.4.1', 'walts81', 'joshwalters@gmail.com', 'walts81', '2007', '', 'plugins/{C8ACB8D3-456E-411F-BF2C-DBB80E866F48}/1.0.4.1/stable/meeMovieTunes_1.0.4.1_Stable.mpp', '304853', '', '', 'readme.doc', 1000004001000000000, 0, 'Enable plugin under "Full-time plug-ins" in Meedio Configuration\n\nSet custom properties\n\nAdd action to screen file to send the following message...\nmessage="meeMovieTunes.start" file="{file}" id="{id}" externalid="{external-id}" section="{section}" rating="{rating}"\n\nRun Meedio!', 'meeMovieTunes', 'http://www.meedios.com/maid', '', '', '', '0', '1', 288, 1779, 0, 0, 0, 0, '425d4c64af8f66e7eceb861482c0501a', 'FALSE'),
(257, '{C94AB881-82A8-4DF5-BAC7-02AC440EADEB}', 'Beyond TV Recording Status', 'Plugin which monitors Beyond TV''s recording status and informs of title, channel, and start/end times', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:15', '0.55', 'Sebastian Bordon', 'sebastian@sbsoft.com.ar', '', '2004 Sbsoft', '', 'plugins/{C94AB881-82A8-4DF5-BAC7-02AC440EADEB}/0.55/beta/Beyond_TV_Recording_Status_0.55_Beta.mpp', '28301', '', '', '', 55000000000000000, 1, 'This Plugin monitors Beyond TV running on the same computer as Meedio and publishes a datafeed with the title, channel, and start/end time of Beyond TV''s actual recording.\nSee attached btvstatus.screen for datafeed sample\nIt publishes the feed "btv.recording.status" with the following items\nrecording = true or false\ntitle = Actual show being recorded (retuns "No Active Recordings" if none running)\nchannel = Recording channel\nstarttime = When recording started\nendtime = When recording will end', 'BTV.RecordingStatus', 'www.meedio.com/maid', '', '', '', '0', '1', 585, 585, 0, 0, 0, 0, '20ab89f82e43fca8f66cd7eb8c118f9b', 'FALSE'),
(258, '{C971086A-2E7F-49C7-BB99-BC75B2278C4D}', 'Screenshot Quiz Pack 2', 'Screenshot Quiz Pack 2', '', 'Misc', 'None', 'Donationware', 'Alpha', '2007-05-14 16:35:31', '0.2', 'Simon Stocs', 'simon@ai-support.co.uk', 'foolycooly', '', '', 'plugins/{C971086A-2E7F-49C7-BB99-BC75B2278C4D}/0.2/alpha/Screenshot_Quiz_Pack_2_0.2_Alpha.mpp', '33517073', '', '', '', 2000000000000000, 1, '', '..\\images\\meeMovieTunes\\Temp', '', '', '', '', '0', '0', 1101, 1101, 0, 0, 0, 0, '3e55ff8fbeed6fa99c45ebf8a7d771d4', 'FALSE'),
(259, '{CA04F194-21A6-4D44-9DD3-D373313111BF}', 'FreeeeeeSpace (full-time plugin)', 'A disk space monitoring tool with large, easy to read displays.  FreeeeeeSpace also exports a standard datafeed, and a BreakingNews datafeed.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:29', '1.205', 'deria', 'deria@sourceforge.net', '', '(c) 2005 Electric Storm Software', '', 'plugins/{CA04F194-21A6-4D44-9DD3-D373313111BF}/1.205/stable/FreeeeeeSpace_(full-time_plugin)_1.205_Stable.mpp', '196920', '', '', '', 1205000000000000000, 1, 'The FreeeeeeSpace module is an extremely useful tool for monitoring the amount of free disk space on your system.  It features:\n\n* large, easy to read displays with a color coded legend (green = abundant free space, yellow = marginal free space, red = extremely low free space)\n\n* the ability to exclude specific hard disks from monitoring\n\n* the ability to raise an alarm (through the BreakingNews module) when disk space used on one or more drives exceeds a user-defined limit\n\n* the ability to export a standard datafeed (for use by theme designers)\n\n* full support for the BreakingNews module to allow (when used with Dee''s NewsTicker) a scrolling disk space status report to appear at the bottom of your screen -- complete with warning when free space is low\n\n* a high degree of customizability\n\nFor more information, refer to the readme.txt file included in the download package.', 'FreeeeeeSpace', '', '', '', '', '0', '1', 1077, 1077, 0, 0, 0, 0, '4ba62797077579bd36ff916e0bdc6088', 'FALSE'),
(260, '{CB23072B-8C5B-4987-AA71-F6CD8A38C8EA}', 'meeMusicVideosII', 'A media module for playing music videos.', '', 'Module', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:13', '0.0.2', 'dncenter', 'support@meedio.com', 'dncenter', '', '', 'plugins/{CB23072B-8C5B-4987-AA71-F6CD8A38C8EA}/0.0.2/beta/meeMusicVideosII_0.0.2_Beta.mpp', '85826', '', '', 'meeMusicVideosII.htm', 2000000000000, 0, 'This module plugin allows you to create, play, save, and load playlists for video files.  Also included are functions to generate a playlist of random videos, etc.', 'meeMusicVideosII', '', '', '', '', '0', '1', 182, 2199, 0, 0, 0, 0, '33a99b40f56af4a4dd1a74fa3e19adf0', 'FALSE'),
(261, '{CB617265-D200-42C6-A953-64419B470D3A}', 'Respond', 'Respond is an event driven plugin that offers functionality similar to a lite scripting language.  The plugin will listen for user-defined events (such as a video starting to play) and answer with user-defined responses.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:54', '1.5.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{CB617265-D200-42C6-A953-64419B470D3A}/1.5.1/stable/Respond_1.5.1_Stable.mpp', '287300', '', '', '', 1005001000000000000, 0, 'Respond is an event driven plugin that offers functionality similar to a lite scripting language.  The plugin will listen for user-defined events (such as a video starting to play) and answer with user-defined responses.\n\nIncludes two example scripts.  One as a basic replacement for SilenceMee and the other demonstrating volume control within Meedio (lower volume for music and raise volume for video).', 'Respond', 'http://respond.hargraveusa.com/', '', '1.15.31', '', '0', '1', 137, 1206, 0, 0, 0, 0, '50e231719c6b5dd1d71f6051c38d1dc5', 'FALSE'),
(262, '{CBB9A920-6241-4938-A0B1-0C9FB228E0CF}', 'StartupETA', 'Overlays an ETA on the Meedio splash screen. Learns over time how long your Meedio takes to boot up.', '', 'General', '', 'Freeware', 'Beta', '2007-05-14 16:35:07', '1.0.1', 'binary64', 'slug@skyforge.net', 'binary64', '2007', 'http://www.meedios.com/forum/viewtopic.php?t=642', 'plugins/{CBB9A920-6241-4938-A0B1-0C9FB228E0CF}/1.0.1/beta/StartupETA_1.0.1_Beta.mpp', '7806', '', '', '', 1000001000000000000, 0, 'Requires .Net 2.0.\r\n\r\n			To use:\r\n			1. In the moment just before Meedio.exe is launched on your system, launch ''C:\\Program Files\\Meedio\\Meedio Essentials\\plugins\\general\\StartupETA\\StartupETACore.exe''. Start this process with High priority as it self-terminates when Meedio is loaded.\r\n			2. Enable the StartupETA general plugin in Meedio Configuration.', 'StartupETA', '', '', '', '', '0', '1', 102, 999, 0, 0, 0, 0, '9fdc646a05bd332152337c233439c931', 'FALSE'),
(263, '{CD9183EA-02F5-4EB2-8624-EB84BCE599CA}', 'Video Thumbnailer', 'Import plugin to create thumbnails for your video files.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:19', '1.1', 'Bryan Glass', 'bglass@clemson.edu', '', '2005 - Bryan Glass', '', 'plugins/{CD9183EA-02F5-4EB2-8624-EB84BCE599CA}/1.1/stable/Video_Thumbnailer_1.1_Stable.mpp', '3979388', '', '', '', 1001000000000000000, 1, 'This import plugin creates JPEG thumbnails from video files stored on your computer.  It can be used to create a thumbnail for each file in a media library, and it will update the image location for each item in the library.  It can also scan a directory and create a thumbnail for every video matching an extension you give.\n\nThumbnails are created in the same directory as the video, and they have the same name as the original video file, but with a .jpg extension.\n\nThe thumbnail size is the same as the original video by default.  However, the plugin can also resize the image to a set size or percentage.  Images can only be made smaller than the video.', 'VideoThumbnailer', '', '', '', '', '0', '1', 1858, 1858, 0, 0, 0, 0, '02fb2ebf524242582d5ea3c3b3c9916c', 'FALSE'),
(264, '{CE821BA3-2E32-47DB-AC84-B6A3F18223FE}', 'Clock2C', 'Publishes a datafeed with current date and time.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:20', '1.2.6', 'Harald Wagner', 'harald.wagner@computec.de', 'HdWagner', '2004 Harald Wagner. This product is free for personal use only.', '', 'plugins/{CE821BA3-2E32-47DB-AC84-B6A3F18223FE}/1.2.6/stable/Clock2C_1.2.6_Stable.mpp', '21481', '', '', 'Clock2C.txt', 1002006000000000000, 1, 'Another release of the great ''reinvent the wheel'' series: This plugin publishes a datafeed with current date and time.\nThis is only useful for datafeed processors like C.Mee; for Meedio themes it might be faster (but less convenient) to use Meedios'' built in date and time functions.', 'Clock2C', '', '', '', '', '0', '1', 1351, 1351, 0, 0, 0, 0, 'cbdf69464cc52b50a9cdfa00315b7d97', 'FALSE'),
(265, '{CEF474EE-81CE-4621-AEBB-778235A98AB3}', 'LaunchVideoRedirect', 'Redirects Launch Video ID to get mms link.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:43', '0.0.5', 'dncenter', 'support@meedio.com', 'dncenter', '2004 Meedio, LLC', '', 'plugins/{CEF474EE-81CE-4621-AEBB-778235A98AB3}/0.0.5/beta/LaunchVideoRedirect_0.0.5_Beta.mpp', '239109', '', '', 'launchvideoredirect.htm', 5000000000000, 0, 'Required Plugin to play LaunchVideos', 'LaunchVideoRedirect', 'http://www.meedio.com/maid', '', '', '', '0', '1', 162, 1424, 0, 0, 0, 0, '6cc20e1c3436dc80983de4c38f72ad13', 'FALSE'),
