(267, '{D1107F41-E9D5-4CE4-888C-004099E88390}', 'Girder Event Client', 'Sends Girder events and datafeed', '', 'General', 'None', 'Commercial', 'Stable', '2007-05-14 16:33:30', '1.5', 'Meedio, LLC', 'plugins@meedio.com', '', '2004 Meedio LLC', '', 'plugins/{D1107F41-E9D5-4CE4-888C-004099E88390}/1.5/stable/Girder_Event_Client_1.5_Stable.mpp', '15491', '', '', 'girdereventclient.html', 1005000000000000000, 1, 'This plugin sends a Girder event when the Meedio message girder.event is sent. It can also send the specified datafeeds.', 'GirderEvent', 'http://www.meedio.com/plugins', '', '', '', '0', '0', 975, 975, 0, 0, 0, 0, '72a75ae8892a5e6557f24218325c8cb1', 'FALSE'),
(268, '{D14C1AF7-2C82-4192-A1C3-A8B7314D7B5C}', 'FeedMee', 'Sends out a datafeed based on a library', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:27', '1.3', 'Torstein Auensen', 'rabbagazz@hotmail.com', '', '2004', '', 'plugins/{D14C1AF7-2C82-4192-A1C3-A8B7314D7B5C}/1.3/stable/FeedMee_1.3_Stable.mpp', '199364', '', '', 'FeedMee.txt', 1003000000000000000, 1, 'See the supplied documentation file and screen files', 'FeedMee', '', '', '', '', '0', '1', 1234, 1234, 0, 0, 0, 0, '3f0275fe98f01bb732d076d80254054e', 'FALSE'),
(269, '{D17F677E-CFB6-49B5-AA5F-30658DD8276B}', 'Triveea', 'Meedio Triveea Module', '', 'Module', 'None', 'Donationware', 'Beta', '2007-05-14 16:35:12', '1.02', 'Chris Pravetz', 'support@dimeentertainment.com', '', 'Copyright 2004. Dime Entertainment. All rights reserved.', '', 'plugins/{D17F677E-CFB6-49B5-AA5F-30658DD8276B}/1.02/beta/Triveea_1.02_Beta.mpp', '348138', '', '', '', 1002000000000000000, 1, 'Triveea is a Meedio Trivia game.  Add a Triveea module to your configuration.\n\nSet the following properties:\n\nSeconds until answer: How long to pause between showing the question and the answer.\n\nTrivia Screen File: The name of the screen file for this module\n\nTrivia Questions Folder: The path to your question files.  Triveea uses ''.TRV'' files for questions and answers.  The name of the file is used as the name of the category.  These files are initially installed into the ..\\plugin\\module\\Triveea folder.\n\nCategory to use...:The category to use when first launching Triveea.  "Random"  picks questions from all categories.', 'Triveea', 'www.dimeentertainment.com', '', '', '', '0', '1', 695, 695, 0, 0, 0, 0, 'f0766f3b47ae2d071d732b6bb1d705f2', 'FALSE'),
(270, '{D2FA2796-2FD0-4A88-B4D9-622277DE2F37}', 'Light-Blue-Who 2', 'Modification of Light-Blue-Who', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:44', '2.3', 'David Roos', 'droo008@gmail.com', '', '', '', 'plugins/{D2FA2796-2FD0-4A88-B4D9-622277DE2F37}/2.3/stable/Light-Blue-Who_2_2.3_Stable.mpp', '8885434', '', '', '', 2003000000000000000, 1, 'Light-Blue-Who 2.2\n==================\n\nNew in this version:\n	* artist-view, shows ''[artist] - [track title]'' as you browse through a library (useful for compilation/multiple artist albums).\n	* More info is displayable in the bottom left hand corner (album art, track info). Can choose either, both or none under theme customization.\n	* Can choose between using transparent png files or meedio`s renderer for drawing highlights. THe PNG`s look a little nicer (to me) but the performance is a fair bit worse.\n	* Movie/video player OSD (bottom) is skinned. I would like some feedback before I go any further with it - included a font (in the extras folder) which need to be installed for the video OSD effect to be complete.\n	* e.TIme plugin not included yet. The author has not replied to my request.\n	* New Icons: music5-module-icon (Jukebox), mp3-module-icon, mp32-module-icon, mp33-module-icon (iRIver mp3 players), phone-module-icon, phone2-module-icon (some phones which I`m not terribly happy with).\n	* Included missing folder images', 'Light-Blue-Who 2.0', '', '', '', '', '0', '0', 1516, 1516, 0, 0, 0, 0, 'db40c022863907aff8f6aa8f059badb5', 'FALSE'),
(271, '{D3A4A01D-849B-481D-88F4-661130EC64B1}', 'SETI@meedio', 'Shows SETI@home status', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:57', '1.0.34', 'Cellard', 'info@cellard.spb.ru', '', '2005 Cellard', '', 'plugins/{D3A4A01D-849B-481D-88F4-661130EC64B1}/1.0.34/stable/SETI@meedio_1.0.34_Stable.mpp', '402936', '', '', '', 1000034000000000000, 1, 'Sends datafeeds with SETI@home information as Now Playing datafeeds. When music is playing SETI@meedio stops sending datafeeds. So, when music is stopped you can see SETI@home client current status information in Meedio screens (see screenshot).\n\nFor developers: SETI@meedio is publishing datafeeds music.now-playing and music.time while noone else are publishing these datafeeds. SETI@meedio also publish in these datafeeds key "sender" with value "SETI@meedio" so you may determine whether SETI@meedio or another plugin sends datafeeds.', 'SETI@meedio', '', '', '1.0', '', '0', '0', 530, 530, 0, 0, 0, 0, 'cca1767fdef838f234d204176b2aee54', 'FALSE'),
(272, '{D3D8F148-937C-4FE5-9A8B-BDD984C3694D}', 'MeePlay2Sage', 'Play TV Shows From Meedio Through Sage', '', 'General', 'None', 'Donationware', 'Alpha', '2007-05-14 16:34:14', '.13', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'paypal.com', '', 'plugins/{D3D8F148-937C-4FE5-9A8B-BDD984C3694D}/.13/alpha/MeePlay2Sage_.13_Alpha.mpp', '4649', '', '', '', 13000000000000000, 0, '', 'MeePlay2Sage', '', '', '', '', '0', '1', 191, 1708, 0, 0, 0, 0, '232c44cff48b579ad5c2022160fbdb17', 'FALSE'),
(273, '{D40761C5-93DC-480A-B8A7-FD6B8B7FF197}', 'ShowAnalyzer Cleanup', 'Clean up orphaned ShowAnalyzer files.', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:57', '1.0', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{D40761C5-93DC-480A-B8A7-FD6B8B7FF197}/1.0/beta/ShowAnalyzer_Cleanup_1.0_Beta.mpp', '5833', '', '', '', 1000000000000000000, 1, 'Installation Instructions: \nâ€¢ Download and install ShowAnalyzer_Cleanup.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the MeedioTVRecordings library''s Imports tab \nâ€¢ Add a new import \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select ShowAnalyzer Cleanup in Choose the plugin to perform the import \nâ€¢ Select your recordings folder(s) in MeedioTV recordings folders: \nâ€¢ (recommended) Select BeyondTV/Meedio (.chapters.xml) \nâ€¢ (optional) Select additional ShowAnalyzer output formats you want to clean \nâ€¢ (optional) Select a time to run ShowAnalyzer Cleanup automatically in Schedule this import to run automatically', 'ShowAnalyzer_Cleanup', 'http://www.meedios.com/forum/viewtopic.php?t=390', 'http://www.meedios.com/maid/dl.php?plugin_id={D40761C5-93DC-480A-B8A7-FD6B8B7FF197}', '', '', '0', '1', 606, 606, 0, 0, 0, 0, '4fab82ce4c9be172bb73f983f236b2f7', 'FALSE'),
