(276, '{D5A18D59-C886-4978-B065-DF98EB96C083}', 'SystemCheck', 'A community-driven plugin to help keep your HTPC up to date and in check', '', 'Module', '', 'Freeware', 'Beta', '2007-05-14 16:35:09', '0.3.1', 'binary64', 'slug@skyforge.net', 'binary64', '2007 MeediOS', 'http://www.meedios.com/forum/viewtopic.php?t=662', 'plugins/{D5A18D59-C886-4978-B065-DF98EB96C083}/0.3.1/beta/SystemCheck_0.3.1_Beta.mpp', '98091', '', '', '', 3001000000000000, 0, 'It is advised to run this module at least once after every time SystemCheck plugin is updated and installed on your system.\r\n\r\nTo suggest extra checks/tests/functions, head over to http://www.meedios.com/forum/viewtopic.php?t=662', 'SystemCheck', '', '', '', '', '0', '1', 120, 1696, 0, 0, 0, 0, '772b9be476523e5ab55f5303ea9ae33c', 'FALSE'),
