(278, '{D7423842-22AB-493B-9BBF-A489FA04DF4C}', 'Importer Watcher', 'Allows you to notice any problems with importers', '', 'Module', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:39', '1.2.1', 'Jelle Hissink', 'ImporterWatcher@Onshuis.tk', '', 'Copyright 2004 Jelle Hissink. All Rights Reserved.', '', 'plugins/{D7423842-22AB-493B-9BBF-A489FA04DF4C}/1.2.1/stable/Importer_Watcher_1.2.1_Stable.mpp', '183900', '', '', '', 1002001000000000000, 1, 'Allows you to keep informed if all importers are still running...\nSteps:\n1) Open the configuration tool\n2) Add a new module to the menu (Importer Watcher)\n3) Save and start Meedio...\n\nNote: If you have the Meedio Helper plugin installed and active the list will automatically refresh...', 'ImporterWatcher', '', '', '', '', '0', '1', 1063, 1063, 0, 0, 0, 0, 'a6a132d4ba983e75be05b71a3ae25cff', 'FALSE'),
(279, '{D7888271-C6A1-4247-AD30-6C7A44B2B24F}', 'MIE-Mod-In-Effect', 'Clean, easy to use and navigate screens. Full time hidable player, menu(s) and details by keys or clicks. Create your own scheme using any background you own or choose from 7 preset color choices and 6 menu choices! Individual Screen file Mods! Check the ', '', 'Theme', 'None', 'Shareware', 'Stable', '2007-05-14 16:34:31', '5.2', 'psybertech', 'root@psybertech.net', 'psybertech', 'psybertech - JWB', '', 'plugins/{D7888271-C6A1-4247-AD30-6C7A44B2B24F}/5.2/stable/MIE-Mod-In-Effect_5.2_Stable.mpp', '5612158', '', '', '__SETUP_MIE_THEME.txt', 5002000000000000000, 1, 'For personal use only. Contact root@psybertech.net for more details.\nPlease read the enclosed SETUP FILE in the theme directory named "__SETUP_MIE_THEME.txt" for detailed information.\n\n------------------------------\n** THEME HIGHLIGHTS **\n------------------------------\n1) Full-Time Toggling/Hiding MENU, MUSIC PLAYER, myINFO and HEADER INFO inside any screen.\n\n2) A MAIN MENU on the TOP of the screen toggles the HIDING/SHOWING controls (good for TOUCHSCREEN users) (command name="menu2")(small thin clickable toggle control also good for touchscreen users)\n\n3) MYINFO PANEL with NEWS feeds, weather, current time and your own custom RANDOM SLIDESHOW displayed on the myINFO panel!\n\n4) TOO MANY USER CHANGEABLE preset color choices along with the ability for you to mix-n-match and add YOUR OWN image as the background at anytime you want! \nWith TV friendly (large crisp fonts and decent contrast) and SIX !!! DIFFERENT MAIN MENU LAYOUTS!\n\n5) NEW SLIDESHOW STYLE - use ANY feed containing images (music, art, movie posters, your family/friends or just a 1000 of your favorite images collected on the net) and watch a FULL SCREEN RANDOM slideshow with a mini-player to control your tunes while you do your thing. \n \n6) SET RESOLUTION FOR YOUR SETUP! - one click sets the theme to your resolution pre-set. \nThere are eight presets including 4:3 and 16:9 resoultions.\nUsing this feature, you can also fake the system by selecting a slightly HIGHER or LOWER resoultion which will increase or decreaase the font at will.\n\nThe theme is based mostly on percentages when scaling up/down, so all resolutions should work good or perfect once you find a perfect resolution for you.\nThere is no ''best resolution'', but I constantly test on 640x480, 800x600*, 1024x768,1280x1024 and 1280x800. \n*800x600 is my personal main HTPC setup\n\n6) MODIFY SCREEN FILES!! Simply add a screen file into MIE''s theme directory and follow a simple wizard like screen with graphical helpers to automatically hide or show a specific panel in MIE.\n\nIf you like the myINFO panel and the Music Player to always show, do it. \nIf you want to hide all panels for triveea, then do that too. \nAnd if you want to show the main left menu only on 3 of the screens you use out of 72 and 12 of them to also hide the player, then do that to those... any screen can be setup anyway! \nGreat for NEW screens when they are updated so you don''t have to wait for an update from MIE to add it. Simply copy the file in, walk through the wizard and enjoy the latest and greatest from our plugin developers!\n\n*!*!*!NOW YOU CAN EVEN ADD YOUR OWN BACKGROUND AND SETUP YOUR OWN COLOR SCHEME!!!!!!!\nDrop your favorite image the MIE directory and use a wizard like interface to assist you.\n\n7) REMOTE CONTROL friendly concept. Tries to use as few clicks as possible and many commands in the theme so you can map a remote control button or keyboard key to the toggle controls.\n\n8) Ability to add ANY content to the myINFO panel. Add your STOCK Quotes or sports tickers via RSS or admire one of your media libraries as they flash by.\n\n9) One undefined datafeed for users to choose any content and add it to the myINFO panel * see setup file for more\n\n10) If you use the GC Internet radio, I have modified the layout to assist navigation and included a control to toggle the EQ''s visibility (DEFAULT is hidden) ** See note found in setup file to make this work properly!\n\nREAD THE FILE NAMED "_SETUP_MIE_THEME.txt" FOUND IN THE MODINEFFECT THEME DIRECTORY FOR DETAILED STEPS TO SET THIS THEME UP PROPERLY! \n\n-- IT''S NOT HARD AT ALL! This is just in case you need assistance or have a question about something.', 'ModInEffect', '', '', '', '', '0', '0', 2507, 2507, 0, 0, 0, 0, '9098f607ac08c77b60741f8d410a9bb3', 'FALSE'),
(280, '{D8D66BAB-0934-479A-9104-6CD3C8BAC644}', 'e.TIme', 'Conversion du temps passÃ© et total', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:24', '1.0', 'Tintolo', 'tintolo@free.fr', '', '', '', 'plugins/{D8D66BAB-0934-479A-9104-6CD3C8BAC644}/1.0/stable/e.TIme_1.0_Stable.mpp', '3709', '', '', '', 1000000000000000000, 1, 'Petit plugin permettant un affichage plus "stylisÃ©" du temps ecoulÃ© et total d''une chanson par exemple ... les donnÃ©es sont accessibles par datafeed : blibli.elapsed et blibli.total :)', 'e.TIme', 'http://www.meedio-france.com', '', '', '', '0', '1', 791, 791, 0, 0, 0, 0, '2092fa446cf088b381ab4ba739ef17d3', 'FALSE'),
