(283, '{DB03D5BF-AA2D-4F5F-B1AE-5B693F6DE810}', 'NetFlix Importer', 'Imports RSS feeds, cover art, trailers, and movie info from NetFlix', '', 'Import', 'None', 'Donationware', 'Beta', '2007-05-14 16:34:38', '0.5.3', 'Michael Melendez', 'NA', 'Kairos', '2004', '', 'plugins/{DB03D5BF-AA2D-4F5F-B1AE-5B693F6DE810}/0.5.3/beta/NetFlix_Importer_0.5.3_Beta.mpp', '289430', '', '', '', 5003000000000000, 1, 'To install: Create a new media library and create new import.  Select Delete all and re-import from the first drop box.  Then select NetFlix Impoter from the second drop box..  Pick a directory to place the cover art.  Enter you Email and Password to Download movie details and trailers from netflix.  Enter your NetFlix ID (located at the end of your personalized netflix rss feeds.  It usually begins with a letter right after the equals sign) yo import th personalized feeds.  Views will be created for you.  Use with the NetFlix Module.', 'NetFlix', '', '', '', '', '0', '1', 982, 982, 0, 0, 0, 0, '9ef93957356513ce9ef423863ed0947e', 'FALSE'),
(284, '{DBD28314-FE86-4DDA-AC23-BC3B8A1230DA}', 'Snappy!', 'This theme is based on Snapstream''s BeyondTV', '', 'Theme', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:00', '1.1', 'DigitalOldschool', 'meedio@gmail.com', '', '2004 DigitalOldschool', '', 'plugins/{DBD28314-FE86-4DDA-AC23-BC3B8A1230DA}/1.1/stable/Snappy!_1.1_Stable.mpp', '3006502', '', '', '', 1001000000000000000, 1, 'This theme is based on SnapStream''s BeyondTV (http://www.snapstream.com)\n\nIt is designed for the remote user in mind and looks best at 800x600 resolution.\nI have only created screens for the basic components of a fresh install of Meedio Essentials, but it uses the "main.template" format so if you use plugins that utilize that, you should be fine.\n\nYou should also make sure that the included ''qhytsdakx'' font is installed to get the proper look I intended.', 'Snappy!', 'http://www.digitaloldschool.com', '', '', '', '0', '0', 2404, 2404, 0, 0, 0, 0, '5d300493b3c94ffa1bda9db207f5d9c6', 'FALSE');
