(286, '{DC1554A1-490B-4455-A85A-7FF4D371401D}', 'wia Removable Device Insert Notification', 'Notify other plugins when a  wia device is inserted', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:35:23', '1.2', 'Anders Malmgren', 'anders.malmgren@dac.se', '', '2005 Dac Ltd', '', 'plugins/{DC1554A1-490B-4455-A85A-7FF4D371401D}/1.2/stable/wia_Removable_Device_Insert_Notification_1.2_Stable.mpp', '147317', '', '', '', 1002000000000000000, 1, 'Notify other plugins when a wia device is inserted. This plugin is useless on its own. However a plugin can use it to automate digitalcamera downloads, etc.', 'wiaRemovableInsert', 'http://www.meedio.com/maid', '', '', '', '0', '0', 771, 771, 0, 0, 0, 0, '28b5acf1fad46e36608a0c18e993096f', 'FALSE'),
