(289, '{DD0FDB2D-4342-46D7-A06D-9EBBB827627C}', 'BackMeeUp', 'This plugin is basically a Meedio front end for DVD backup', '', 'General', 'None', 'Freeware', 'Alpha', '2007-05-14 16:33:12', '0.6.2', 'Brian Woodworth', 'bwoodworth@gmail.com', 'binary64', '', '', 'plugins/{DD0FDB2D-4342-46D7-A06D-9EBBB827627C}/0.6.2/alpha/BackMeeUp_0.6.2_Alpha.mpp', '155757', '', '', '', 6002000000000000, 1, '1. Create a comand module in the Meedio configuration.\n2. Select ''send custom command'' for Command to Send field\n3. Enter ''backmeeup.display-window'' in the Custom command to send field\n4. Be sure to select BackMeeUp in the Full-time plugins tab and fill out all of the properties.', 'BackMeeUp', '', '', '', '', '0', '1', 1432, 1432, 0, 0, 0, 0, '0c1818862cbd84eecdbe24347dc00d1f', 'FALSE'),
