(293, '{E00A982B-236F-4720-8DBF-36ABB081B838}', 'ExtremeBurnMeeLight', 'Burns cd''s and dvd''s from media module.', '', 'Module', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:26', '1.3', 'Extreme Solutions', 'mattias@extremesolutions.se', '', '(c) Extreme Solutions 2005. Not for commercial use.', '', 'plugins/{E00A982B-236F-4720-8DBF-36ABB081B838}/1.3/stable/ExtremeBurnMeeLight_1.3_Stable.mpp', '275117', '', '', '', 1003000000000000000, 1, 'Burns cd''s from any Meedio media module. \nRequires Nero version 6 or better.\n\nFull licensed version supports burning My Pictures and burning to DVD.', 'ExtremeBurnMeeLight', 'http://www.extremesolutions.se', '', '', '', '0', '1', 1239, 1239, 0, 0, 0, 0, '5074dfa8fd81152602869d0652f39c9c', 'FALSE'),
(294, '{E03A042B-0B28-44C5-8449-B18F6ED6F22D}', 'Enhanced Media Module', 'Allows you to browse, play, play random files, delete and import media.', '', 'Module', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:25', '1.34', 'Seb', 'na', '', '', '', 'plugins/{E03A042B-0B28-44C5-8449-B18F6ED6F22D}/1.34/stable/Enhanced_Media_Module_1.34_Stable.mpp', '58287', '', '', '', 1034000000000000000, 1, 'New features include:\n\n- "Skip single choices" now also skips the last choice if there''s only one item in a view and jumps directly to the details screen (or starts playing it if "Selecting an items plays it" is checked).\n\n- Play button can be used on views to play all the items in a view. (Limited feature. Only works with internal Meedio players, PlayMee or similar.)\n\n- You can delete library items and also delete the items'' files permanently or moving them to the recycle bin by using the Delete/Clear button on your remote or selecting the delete button on the details screen.\n\n- Run all the imports for the media section by using the Update button.\n\nNew in v1.2:\n\n- Now playing an item outside the details screen doesn''t launch the details screen afterwards.\n\n- Play all items, the next unplayed item or a random item in the current view. (Keeps track of played items which adds more functionality.)\n\nNew in v1.3:\n- Compatible with Raydee-o-player. Recommended settings:\nAlternate screen: Radio\nDetail screen file: Media.Radio.screen\nSelecting an item plays it: Checked\nPlay-view Message: radio.play\nPlay-view Action: Play random\nPlay random includes played items: Checked\n- Fixed problem using the skip single choices and selecting an item plays it.\n\nNew in v.1.31:\n- Compatible with latest Meedio version.\n\nNote: Update your themes to include the new buttons. For more info look for forum posts on the Meedio website.\n\nNew in v1.34:\n- Compatible with Meedio 1.30.', 'EnhancedMedia', '', '', '1.30', '', '0', '1', 2462, 2462, 0, 0, 0, 0, 'fb68dbc77fcbe693eb993296e886d464', 'FALSE'),
(295, '{E0DF9F5F-1689-410A-B886-92B648F64E0B}', 'MeeDestinator3', 'This Plugin integrates the Destinator3 SDK into Meedio', '', 'Module', 'None', 'Shareware', 'Stable', '2007-05-14 16:33:51', '1.2', 'Bjoern Teichmann', 'webmaster@derflash.de', '', '2006 Bjoern Teichmann(webmaster@derflash.de)', '', 'plugins/{E0DF9F5F-1689-410A-B886-92B648F64E0B}/1.2/stable/MeeDestinator3_1.2_Stable.mpp', '2184124', '', '', 'DOCUMENTATION.html', 1002000000000000000, 1, '', 'MeeDestinator3', 'http://meedestinator.derflash.de', '', '', '', '0', '1', 735, 735, 0, 0, 0, 0, '8e108ebd7988b942d6ca9a11ee0ffbfe', 'FALSE'),
(296, '{E168B307-4306-4790-A6D3-83F923A194E6}', 'AAC-LC Renamer Importer', 'Renames MOV files that are AAC-LC 5.1 to MOV-AACLC', '', 'Import', 'None', 'Donationware', 'Beta', '2007-05-14 16:33:09', '1.1.1', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64', '', 'plugins/{E168B307-4306-4790-A6D3-83F923A194E6}/1.1.1/beta/AAC-LC_Renamer_Importer_1.1.1_Beta.mpp', '538821', '', '', '', 1001001000000000000, 1, 'Why use this plugin you ask? Well if you use Nero + QT to watch .mov files, and you get a 5.1 ch sound type of .mov, Nero has a bug playing surround sound. Haali doesn''t. But you can''t pick and choose whether to use Nero or Haali''s DirectShow splitter, apart from using different file extensions.\n\nAlso install http://meedio.com/forum/about28369.html', 'AAC-LC Renamer Importer', 'http://www.skyforge.net/~slug/', '', '', '', '0', '1', 2274, 2274, 0, 0, 0, 0, '259c9820971b1a10664eb74060f91037', 'FALSE'),
(297, '{E17FAE2E-05DB-477C-BABC-65AEC0622A51}', 'ZoomPlayer2C', 'Publishes datafeeds with Zoom Player information', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:28', '1.1.3', 'Harald Wagner', 'harald.wagner@computec.de', 'HdWagner', '2004 Harald Wagner. This product is free for personal use only.', '', 'plugins/{E17FAE2E-05DB-477C-BABC-65AEC0622A51}/1.1.3/stable/ZoomPlayer2C_1.1.3_Stable.mpp', '8021', '', '', 'ZoomPlayer2C.txt', 1001003000000000000, 1, 'Another release of the great ''what others should have done'' series: This plugin publishes datafeeds with information coming from Zoom Player.', 'ZoomPlayer2C', '', '', '', '', '0', '1', 839, 839, 0, 0, 0, 0, 'b08bf5513188321f8103291d93c0b562', 'FALSE'),
(298, '{E3F689BC-F2BF-4D8C-A4FF-826B05B87F6C}', 'IRTransPlugin', 'Plugin for the IRTrans System with Display && Send Support', '', 'Input', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:40', '3.2.1', 'IRTrans', 'marcus@itrans.com', '', '2004,2005 IRTrans Marcus Mueller', '', 'plugins/{E3F689BC-F2BF-4D8C-A4FF-826B05B87F6C}/3.2.1/stable/IRTransPlugin_3.2.1_Stable.mpp', '30013', '', '', '', 3002001000000000000, 1, 'This plugin connects Meedio Essentials to the IRTrans IR System.\nAls always the irserver has to be running when you want to connect.\n\nThe IR Commands have to be learned using one of the IRTrans\nclients before they are added to Meedio.\n\nIr Commands can be associated with Meedio actions using the\nMeedio Configuration application. IR Codes can be sent by using the action "irtrans.send" with the parameters remote and command.\n\n\nFor details about the IRTrans system see www.irtrans.com', 'IRTrans', 'http://www.irtrans.com', '', '', '', '0', '1', 865, 865, 0, 0, 0, 0, '3e7017e2501107d7c852dda38a97a633', 'FALSE'),
(299, '{E68D5E11-14B4-4AF7-B284-7B23E5D862D2}', 'SmartRecap', 'Rewinds video/tv after pause so you can recap', '', 'General', '', 'Donationware', 'Alpha', '2007-05-14 16:34:59', '0.1.1', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64 2007', '', 'plugins/{E68D5E11-14B4-4AF7-B284-7B23E5D862D2}/0.1.1/alpha/SmartRecap_0.1.1_Alpha.mpp', '13157', '', '', '', 1001000000000000, 0, '..', 'SmartRecap', '', '', '', '', '0', '1', 110, 1472, 0, 0, 0, 0, 'edb46ac92596aa1255e3c5d8cb0fa87b', 'FALSE'),
(300, '{E6A94223-9096-4BE2-8078-DC8F552D9FC9}', 'Internet Browser (Full-time plugin)', 'Surf the internet.', '', 'General', 'None', 'Commercial', 'Stable', '2007-05-14 16:33:40', '1.5', 'Meedio, LLC', 'support@meedio.com', '', '2005 Meedio, LLC.', '', 'plugins/{E6A94223-9096-4BE2-8078-DC8F552D9FC9}/1.5/stable/Internet_Browser_(Full-time_plugin)_1.5_Stable.mpp', '2095286', '', '', '', 1005000000000000000, 1, '-  This Internet Browser is now a general(full-time plugin) so that it can be called from a Meedio message.  Because\nof this, to call the Internet Browser from a menu item do this:\n1.) Open up Meedio Configuration, then on the Menu tab, make sure the second Meedio in the treeview is highlighted. Click the Add button\nand select the ''Command module'' to add it to your menu structure.  Name it whatever you like.\n2.) On the Module properties tab with it selected, for Command to Send, select ''Send custom command''.\n    For the Custom command to send box, type:  webbrowser.url\n    For the Custom parameters to send, type:  url=www.meedio.com   (or whatever url you want instead of meedio.com)\n    The url can also point to a local file, for example:    url=file://C:\\mylocalpage.htm\n\n\n\n-  This plugin requires that the .NET 1.1 runtime be installed on your computer.\nChanges in 1.5:\n-Fixed a problem with the browser not launching on startup sometimes\n-Fixed a problem with the link navigation not working after closing the browser and opening back up again\n-Removed unnecessary catching of other Meedio messages\n\nChanges in 1.4:\n-Fixed problem with navigation link circle still showing up even when browser closed\n-Fixed problem with error accessing the Log file\n-Added a message webbrowser.close to hide the webbrowser\n-Fixed a problem when calling a jump-target from the browser, it would not close the browser screen\n\nChanges in 1.3:\n-Fixed problem if you have Meedio setup to always be ontop\n-When the browser screen is hidden, it will load a blank page so that streaming video/audio files won''t continue to run in the background\n\nChanges in 1.2:\n-Fixed problem with Backspace and Space bar when entering text in a textbox.\n-Added the DISPLAY command (by default the INSERT key) to toggle between the link navigation mode and regular mode\n-Added option to specify your own screen file\n-Changed the Zoom option so that you specify a zoom increment, then each time zoom is pressed it will zoom in or out that amount.  Allows for larger zoom values now\n\nAllows you to surf the internet using a remote control or mouse.\nThe keys that it responds to are as follows:\nPlay button:        Refreshes the webpage\nNext/Previous:      Zoom in/out\nChannelUp/Down:     Page Up/Down\nUp/Down/Left/Right: Navigate around the webpage\nRew/FastForward:    Go back/forward in history', 'Internet', 'http://www.meedio.com/maid', '', '', '', '0', '1', 4122, 4122, 0, 0, 0, 0, '82e6993b6613052e4994485a1415c494', 'FALSE'),
(301, '{E820BB82-BAB5-4645-9928-9DF4A2C12747}', 'Spitfire', 'A Meedio theme with images supplied from CrispyXUK.', '', 'Theme', 'None', 'Commercial', 'Stable', '2007-05-14 16:35:00', '1.2', 'Meedio, LLC and CrispyXUK', 'support@meedio.com', '', '2004 Meedio, LLC.', '', 'plugins/{E820BB82-BAB5-4645-9928-9DF4A2C12747}/1.2/stable/Spitfire_1.2_Stable.mpp', '5597330', '', '', '', 1002000000000000000, 1, 'Changes in 1.2:\n  - Supports the new music player.\n  - Added a bunch of settings that use the new customization for themes in the Theme Chooser.  Settings include changing background image,\n    selection images, font sizes, # rows and columns for image view, and # of rows for normal menus.  \nInstall and enjoy!', 'spitfire', 'http://www.meedio.com/maid', '', '', '', '0', '0', 1037, 1037, 0, 0, 0, 0, '70c923097090e71800728ec250dd1246', 'FALSE'),
(302, '{E942463C-5A24-447B-B965-C09762B89D27}', 'MeeShoutcast Importer', 'Imports Shoutcast Channels', '', 'Import', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:21', '1.1.1', 'dfy and Jelle Hissink', 'Meedio@Onshuis.tk', '', 'Copyright 2004 dfy, Jelle Hissink. All Rights Reserved.', 'http://www.meedio.com/forum/about18651.html', 'plugins/{E942463C-5A24-447B-B965-C09762B89D27}/1.1.1/stable/MeeShoutcast_Importer_1.1.1_Stable.mpp', '7167', '', '', '', 1001001000000000000, 1, 'This importer imports Shoutcast channels from www.Shoutcast.com...\r\nJust add a library and attach the importer.\r\nThe Raydee-o plugin by Neil Dunlop (Northernmost) is able to play shoutcast channels.\r\n\r\nSpecial thanks goes to dfy and his collegue who provided the first version using a kix-script.', 'MeeShoutcastImporter', '', '', '', '', '0', '1', 6745, 6745, 0, 0, 0, 0, 'd1052f3c68242bece2e807bd04299634', 'FALSE'),
(303, '{E96F625E-0407-4D61-B053-B8AC7151AF44}', 'MeVo', 'TivoWebPlus Streaming Access Plugin', '', 'Module', 'None', 'Freeware', 'Alpha', '2007-05-14 16:34:31', '0.1.4', 'Scott Lynn', 'sllynn2020@yahoo.com', '', '2005 Scott Lynn', '', 'plugins/{E96F625E-0407-4D61-B053-B8AC7151AF44}/0.1.4/alpha/MeVo_0.1.4_Alpha.mpp', '1876482', '', '', 'Release Notes.txt', 1004000000000000, 1, 'Module Plugin for displaying and playing streams from yourTiVO.  To use, just install, and confiure the IP Address of your TiVo and the port it''s listening on.', 'MeVo', '', '', '', '', '0', '1', 668, 668, 0, 0, 0, 0, '0fb995ea02dbfcb4a0ccdf5e231ec02b', 'FALSE'),
(304, '{E99B028B-4A73-435E-B79D-DA92FC30E39D}', 'Torpopup', 'Checks the scores of Germany''s Bundesliga and shows a popup if the score changes.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:35:11', '0.7', 'Bastian Hofmann', 'bastian.h@gmx.net', '', '', '', 'plugins/{E99B028B-4A73-435E-B79D-DA92FC30E39D}/0.7/beta/Torpopup_0.7_Beta.mpp', '38760', '', '', '', 7000000000000000, 1, 'To activate you have to add a new input command in the configuration called "TOR" and assign a key to it. If you press this key now the plugin first shows you all scores and then checks every 3 minutes, if the score of one game changed and shows a popup if it changed.\nTo stop this plugin you just have to press the assigned key again.', 'Torpopup', '', '', '', '', '0', '1', 842, 842, 0, 0, 0, 0, '3bf07294fbdf2b9d48434fad2fdd3d54', 'FALSE'),
(305, '{ECD70B5D-63FE-483D-AC0A-2C0EB35C6143}', 'ListeningPost', 'A module that allows you to listen to messages for a specied set of subject masks.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:44', '1.110', 'deria', 'deria@sourceforge.net', '', '(c) 2005 Electric Storm Software', '', 'plugins/{ECD70B5D-63FE-483D-AC0A-2C0EB35C6143}/1.110/stable/ListeningPost_1.110_Stable.mpp', '28660', '', '', '', 1110000000000000000, 1, 'The ListeningPost module is a simple (but extremely useful) development tool for theme designers and plugin developers.  It allows you to specify a series of datafeeds and message subject masks that you would like to monitor.  The advantages of using this tool are:\r\n\r\na) you do not need to run Meedio in debug mode\r\n\r\nb) you can listen only for messages related to the message subject masks that you care about (no message spam)\r\n\r\nc) you can easily monitor the content of datafeeds without needing to create a custom testing screen\r\n\r\nd) you can change your monitoring requirements at any time\r\n\r\ne) messages are output using the trace subsystem, so any standard Trace Listener can be used to examine the messages (such as DebugView, freely available from http://www.microsoft.com/technet/sysinternals/utilities/debugview.mspx).', 'ListeningPost', '', '', '', '', '0', '1', 669, 669, 0, 0, 0, 0, '3b55f3e190b505099cd19b9142702630', 'FALSE'),
(306, '{ED760EAF-8521-463F-A72A-B03C1EA4C66D}', 'AmazeMee Importer', 'Import music, movie cover art from Amazon.com', '', 'Import', 'None', 'Freeware', 'Stable', '2007-05-14 16:33:10', '0.4.3', 'GameGod', 'game_programer@hotmail.com', 'GameGod', '', '', 'plugins/{ED760EAF-8521-463F-A72A-B03C1EA4C66D}/0.4.3/stable/AmazeMee_Importer_0.4.3_Stable.mpp', '14976', '', '', 'AmazeMee.txt', 4003000000000000, 0, '', 'AmazeMee', '', '', '1.37', '', '0', '1', 2203, 2629, 0, 0, 0, 0, '9d2a9e112ac510963d7580c874f94fc0', 'FALSE'),
(307, '{EDC25767-1014-41DC-8E74-64809BA2EF1B}', 'MotherboardMonitor2C', 'Publishes a datafeed when Motherboard Monitor sensors are out of range.', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:32', '0.0.2', 'Harald Wagner', 'harald.wagner@computec.de', 'HdWagner', '2004 Harald Wagner. This product is free for personal use only.', '', 'plugins/{EDC25767-1014-41DC-8E74-64809BA2EF1B}/0.0.2/beta/MotherboardMonitor2C_0.0.2_Beta.mpp', '7444', '', '', 'MBM2C.txt', 2000000000000, 1, 'This plugin sends a datafeed when Motherboard Monitor sensors are out of range.\n\nThis is most useful for datafeed processors like C.Mee. This plugin is not meant to be a sensor viewer, it only checks for alarming sensor values.', 'MBM2C', '', '', '', '', '0', '1', 956, 956, 0, 0, 0, 0, 'be34a34b141e3f951bc678b53ab4eaed', 'FALSE'),
(308, '{EDFEF417-038F-42D5-9933-9E871DD9DF85}', 'SkypeMee VoIP', 'SkypeMee is a plugin to allow Meedio to integrate with Skype (www.skype.com). Skype allows great quality free P2P voice calls over IP (VoIP) and paid for calls to  any other telephone number - all from your Meedio system. Please see readme.htm for install', '', 'General', 'None', 'Freeware', 'Beta', '2007-05-14 16:34:58', '0.5', 'Jason Hyland', 'jason@hylandfamily.org', '', '2005 Jason Hyland', '', 'plugins/{EDFEF417-038F-42D5-9933-9E871DD9DF85}/0.5/beta/SkypeMee_VoIP_0.5_Beta.mpp', '739866', '', '', 'readme.htm', 5000000000000000, 1, 'SkypeMee is a plugin to allow Meedio to integrate with Skype (www.skype.com). Skype allows great quality free P2P voice calls over IP (VoIP) and paid for calls to  any other telephone number - all from your Meedio system\r\n\r\nThis plugin requires that Skype is installed and running', 'SkypeMee', 'http://jason.hylandfamily.org/', '', '', '', '0', '1', 1076, 1076, 0, 0, 0, 0, '56623661d9873941be1a810401ea4a02', 'FALSE'),
(309, '{EE136671-AB87-4476-99B3-22293894E694}', 'Outlook XP/2003 data import', 'Import plugin used to import data from Outlook.', '', 'Import', 'None', 'Commercial', 'Stable', '2007-05-14 16:34:41', '1.1', 'Meedio, LLC', 'plugins@meedio.com', '', '2004 Meedio, LLC.', '', 'plugins/{EE136671-AB87-4476-99B3-22293894E694}/1.1/stable/Outlook_XP~2003_data_import_1.1_Stable.mpp', '73695', '', '', '', 1001000000000000000, 1, 'This import plugin is used to import data from Outlook XP or 2003 into the Meedio library.  You can import tasks, contacts, email, appointments, and notes.\nChanges for 1.1:\n - Should work for all languages now.\n - Added some new tags for contacts and apointments as requested in the forum.  You will want to delete the old items before runing this version as the contacts method now use the FileAs Outlook attribute to reference contacts.\n\nTo use:\n1.)  Go to the Meedio Config->Media Library tab.  Then add a new library section.  Then with this library selected click the Import tab.  Create a new import and for the plugin to perform the import select the Outlook XP/2003 data import.  Then select which items you want to import.  Run the import.\n\n2.)  After running the import, copy the .screen files from the <meedio>\\plugins\\import\\OutlookImport directory and copy them to the <meedio>\\plugins\\module\\Media directory. \n\n3.)  Now in the Meedio config->Menu tab, create a new Media module and for the library choose whatever library you just created.  Then for the Detail screen file just type in Contact, Appoinements, or Taks depending on which one you are using.', 'OutlookImport', 'http://www.meedio.com/plugins', '', '', '', '0', '0', 788, 788, 0, 0, 0, 0, 'b5ec9c93f1a84e2afd93d9c033150256', 'FALSE'),
(310, '{EEB202BC-6B84-422A-AA6E-6AE1F8BD87C2}', 'Padio', 'Control Meedio with your joystick/gamepad', '', 'Input', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:42', '1.101', 'reverson1', 'support@getmygames.com', 'reverson1', '2004 - 2005 GetmyGames', '', 'plugins/{EEB202BC-6B84-422A-AA6E-6AE1F8BD87C2}/1.101/stable/Padio_1.101_Stable.mpp', '16136', '', '', '', 1101000000000000000, 1, 'Control Meedio and close emulators using your joystick/gamepad.\n\nChanges:\n6.2.2005\n***********************************************************\nCorrected some issues with the repeat delay setting\n\nMultiple buttons can now be mapped to commands in Meedio Configure\n\nThis version adds additional support for closing ePSXe.\n\nAdded the following messages to Padio:\npadio.sleep\npadio.wakeup\n\n\n11.4.2004\n***********************************************************\nWill now write the current status to the system log when attempting to close an application.\n\nThis version handles Znes a little bit differently. If you''re having problems closing this program than grab this update.\n\n11.3.2004\n***********************************************************\nThis version adds additional support for closing JNES.\n\n9.26.2004\n***********************************************************\nThis version adds a Check Status property.\n\n\nNotes:\n***********************************************************\nIf you can not get this plugin to work please \nmake sure that you have properly mapped your gamepad''s \nbuttons in the Meedio configuration app.\n\nPlease rate this plugin in MAID.\n\nAll feedback good or bad is always welcome.\n\nDo you like this plugin? Feel free to donate!\n\nHave a feature request? Ask and you shall receive!\n\nFound a bug? Let me know and I''ll fix it!', 'Padio', 'http://www.getmygames.com', '', '', '', '0', '0', 880, 880, 0, 0, 0, 0, 'cbb13fc8a0f4af3974d38d0e4c4bdd5e', 'FALSE'),
(311, '{EEE94E5A-9B01-42BA-A6D5-A5B18AD811CD}', 'Meediograbber-v0.2b-www.flurl.com', 'grabs the newest vids off flurl.com - choose between 5 sections (humor, sexy, 18+, shocking, other) and number of vids ( up to 90! )', '', 'Import', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:57', '0.3', 'Benedikt Schlueter', 'ben_kenobi@gmx.net', '', '', '', 'plugins/{EEE94E5A-9B01-42BA-A6D5-A5B18AD811CD}/0.3/beta/Meediograbber-v0.2b-www.flurl.com_0.3_Beta.mpp', '471995', '', '', 'readme.txt', 3000000000000000, 1, 'You can choose between sections "humor, shocking, sexy, 18+, other"\n\nMeedio-Configuration:\nbest way is to create media-libraries for the sections you want to import. Then choose this plugin and select flurl-section and number of files to import. Select "delete all and reimport".\n\nCause it takes up to 30 seconds to import all the clips, I recommend creating different Importer-Modules in your Menu, one for each section for example. Then you can import them while running Meedio.\n\n.. see readme.txt', 'Meediograbber-www.flurl.com', 'http://meediograbber.benkenobi.de', '', '1.37', '', '0', '1', 791, 791, 0, 0, 0, 0, '249bd44e86220fce9d684acceec71322', 'FALSE'),
(312, '{EF7D57F0-372A-4A59-AF38-66505E756280}', 'IMDBmee', 'Download movie descriptions and cover art', '', 'General', '', 'Freeware', 'Stable', '2007-05-14 16:33:37', '5.2.1.0', 'walts81', 'joshwalters@gmail.com', 'walts81', '2007', '', 'plugins/{EF7D57F0-372A-4A59-AF38-66505E756280}/5.2.1.0/stable/IMDBmee_5.2.1.0_Stable.mpp', '1318509', '', '', '', 5002001000000000000, 0, 'Using Meedio Configuration...\n\n1) Enable the plugin under the ''Full-time plug-ins'' tab\n2) Choose # of actors to download\n3) Set country ratings\n4) Set your movies section\n5) Set custom field names\n6) Set how you want cover art stored\n7) Add a ''Command Module'' under the ''Menu'' tab\n8) Select the Module Properties tab\n9) Choose ''Send custom Command'' from the ''Command to send'' drop-down\n10) Type ''IMDBmee.display-window'' in the ''Custom command to send'' box\n\nThat''s It!\n\nNote: You can also call this plugin from a screen file using...\nimdbmee.find-movie title={title} id={id} section={section}\n\nOR if you''re a plugin developer, you can call...\nimdbmee.find-movie title={title}\n\nwhich will send a list of movies to choose from and after choosing one, it will return the message...\n\nimdbmee.event.movie-info\nwith the parameters...\n\ntitle\nsubtitle\ndirector\nwriter\nactors\ngenre\nrating\nreview\nruntime\nproduced\ncountry\nlanguage\noverview\n\nOR you can call the plugin with...\n\nimdbmee.get-description imdbid={imdbid}\nand it will return...\n\nimdbmee.event.movie-info\nwith all the parameters from above', 'IMDBmee', 'http://www.meedio.com/maid', '', '1.41', '1.41', '0', '1', 80, 8332, 0, 0, 0, 0, '07b2e0cf669b09882a98d50f7e758be5', 'FALSE'),
(313, '{EFAF69DF-DA08-4674-A404-D165004C3762}', 'Plugin Settings', 'PluginSettings will allow you to configure your plugins (and General Meedio settings) from within Meedio. All settings are configured using the new Theme Settings feature of Meedio. Developers will also appreciate the ability to modify plugin settings via', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:48', '1.3', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{EFAF69DF-DA08-4674-A404-D165004C3762}/1.3/stable/Plugin_Settings_1.3_Stable.mpp', '252224', '', '', '', 1003000000000000000, 1, 'Directions at: http://pluginsettings.hargraveusa.com\n\nPluginSettings will allow you to configure your plugins (and General Meedio settings) from within Meedio. All settings are configured using the new Theme Settings feature of Meedio. Developers will also appreciate the ability to modify plugin settings via Meedio messages (for ANY Full-time plugin).', 'PluginSettings', 'http://pluginsettings.hargraveusa.com', '', '1.30', '', '0', '1', 2975, 2975, 0, 0, 0, 0, '3fcf0c94fcdb7f1e67abfa1aaa9a523c', 'FALSE'),
(314, '{F0346B62-D9D6-4C22-BC4E-B802462196EA}', 'MeedioBackup', 'Backup your critical Meedio configuration every load', '', 'General', 'None', 'Donationware', 'Beta', '2007-05-14 16:33:56', '1.0', 'binary64', 'slug@skyforge.net', 'binary64', '(c) Copyright 2006 binary64 @ MeediOS. All rights reserved. Commerical usage requires prior authorization from author in writing.', 'http://www.meedios.com/forum/viewtopic.php?t=286', 'plugins/{F0346B62-D9D6-4C22-BC4E-B802462196EA}/1.0/beta/MeedioBackup_1.0_Beta.mpp', '3414', '', '', '', 1000000000000000000, 1, 'Imagine loosing your Configuration.xml Meedio file to corruption. It could happen. This plugin, when activated, backs up your configuration.xml every time you load Meedio (and does nothing whilst Meedio is running). Your past 20 changed configuration''s are kept. This plugin has zero config.', 'MeedioBackup', 'http://www.MeediOS.com', '', '', '', '0', '1', 885, 885, 0, 0, 0, 0, '2d089d876ea526d047c1bedd5a9ea061', 'FALSE'),
(315, '{F0F0305C-AFDF-4729-9E56-D1B3AD2C5C5A}', 'Bee-Tee-Vee Monitor (full-time plugin)', 'A module that provides detailed information about the past, current and future activity of Beyond TV.', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:33:13', '1.410', 'deria', 'deria@sourceforge.net', '', '(c) 2005 Electric Storm Software', '', 'plugins/{F0F0305C-AFDF-4729-9E56-D1B3AD2C5C5A}/1.410/stable/Bee-Tee-Vee_Monitor_(full-time_plugin)_1.410_Stable.mpp', '1515433', '', '', '', 1410000000000000000, 1, 'The Bee-Tee-Vee Monitor module is a tool used to monitor the status of Beyond TV 3.5+.  It features:\n\n1.  real-time updates to the monitoring display\n2.  complete multi-tuner support\n3.  a detailed textual indicator of how many recordings are in progress\n4.  a detailed textual description of each recording (channel, title, duration)\n5.  a detailed textual description of the next upcoming recording  (configurable to show whats scheduled next, whats scheduled today, or whats scheduled today and tomorrow)\n6.  a detailed textual description of the most recent guide update\n7.  a detailed textual description of when the next guide update will occur\n8.  a large graphical indication shown when recordings are in progress\n9.  a large graphical indication shown when a guide update is in progress\n10. the ability to select exactly what information you want to see on the monitor display\n11. the ability to publish a complex datafeed so that other themes and screens can easily display the past, current, and future activity of Beyond TV\n12. full support for the BreakingNews module, which gives you the ability to display highly customizeable information about the past, current, and future activity of Beyond TV using the NewsTicker module (by Dee)\n\nFor information on downloading, installing, and configuring Bee-Tee-Vee Monitor, please refer to the readme.txt file.\n\nNOTE FOR EXISTING USERS USING 1.306 OR LOWER: This plugin has changed from a standalone module to a full-time plugin. Accordingly, you must delete the x:\\program files\\meedio\\meedio essentials\\plugins\\module\\bee_tee_vee_monitor directory from your hard-disk or Meedio will detect and attempt to use both plugins the next time you update or reinstall Meedio.\n\nFor information on downloading, installing, and configuring Bee-Tee-Vee Monitor, please refer to the readme.txt file.', 'Bee_Tee_Vee_Monitor', '', '', '', '', '0', '1', 588, 588, 0, 0, 0, 0, '075158fb7ed0dfaf930e57bc6d4c1584', 'FALSE'),
