(323, '{F485919B-2E0D-47F3-B5A6-BE168D831047}', 'MyShowtimes', 'Import Movie Listings', '', 'Import', '', 'Freeware', 'Stable', '2007-05-14 16:34:37', '1.0.3.0', 'walts81', 'joshwalters@gmail.com', 'walts81', '2007', '', 'plugins/{F485919B-2E0D-47F3-B5A6-BE168D831047}/1.0.3.0/stable/MyShowtimes_1.0.3.0_Stable.mpp', '39391', '', '', '', 1000003000000000000, 1, 'Create a library for movie showtimes\nAdd the importer\nEnter your state and zip code in the properties\nSelect a folder to store movie posters\nRun the importer\n\nAdd a media module to your menu\nPoint it to your movie showtimes library\nPoint the "Detail Screen" to "C:\\Program Files\\Meedio\\Meedio Essentials\\plugins\\import\\MyShowtimes\\Media.MyShowimes.screen"', 'MyShowtimes', 'http://www.meedios.com/maid', '', '1.41', '1.41', '0', '1', 1233, 1535, 0, 0, 0, 0, '322be8716ed3956bf3276ad5f0d85299', 'FALSE'),
