(328, '{F992B6A1-9E0E-43E6-B657-F5CFB8C0E51B}', 'RateMee', 'Music/Video Rating tool', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:34:51', '1.00', 'Chris Pravetz', 'support@dimeentertainment.com', '', 'Copyright 2004. DIME Entertainment, all rights reserved.', '', 'plugins/{F992B6A1-9E0E-43E6-B657-F5CFB8C0E51B}/1.00/stable/RateMee_1.00_Stable.mpp', '56116', '', '', '', 1000000000000000000, 1, 'RateMee implements a real-time rating feature for Meedio.  Create two Input Commands, RATEMEE-UP and RATEMEE-DOWN using the Input Tab of the configuration program - then assign these commands to keys or remote buttons.\n\nSet the name of your ratings tag in RateMee''s properties.  That''s it.  You can now use the ratings tag in views, filters etc.\n\nWhen you press the RateMee-Up or RateMee-Down keys, the plug-in will update the rating for the currently playing song or video.  You can also trigger these events by sending RateMee a message:\n\nratemee.up (or ratemee.down)\nSection= The library section of the item\nID= The library ID of the item', 'RateMee', '', '', '0', '', '0', '1', 912, 912, 0, 0, 0, 0, 'd08ee525b9609491f3da1a1978fff6a4', 'FALSE'),
(329, '{F9F95086-896B-440B-904A-1932FE354F73}', 'VirtualCdTitles', 'Displays on screen the song titles and the cover of a music album (.nrg file - nero image file))', '', 'General', 'None', 'Donationware', 'Stable', '2007-05-14 16:35:20', '2.0', 'GSTAIK', 'ghmail2000@yahoo.com', '', 'Gstaik 2005', '', 'plugins/{F9F95086-896B-440B-904A-1932FE354F73}/2.0/stable/VirtualCdTitles_2.0_Stable.mpp', '23971', '', '', '', 2000000000000000000, 1, 'Displays on screen the song titles and the cover of a music album (.nrg file - nero image file).When the user choose to play an album, the plugin finds and displays the song titles and the cover, with the help of other plugins like CDInfo.\nSetup Instructions:\nMake folder  ...\\meedio\\meedio essentials\\plugins\\general\\VirtualCdTitles \nMove the plugin there (all the files except the .screen files)\nMove screen files to   ...\\Meedio\\Meedio Essentials\\plugins\\module\\Media \nclick Yes to replace existing file (Media.Album.screen)', 'VirtualCdTitles', '', '', '', '', '0', '1', 3354, 3354, 0, 0, 0, 0, '5b5a84ea36c78dfc2171fcb8752839e4', 'FALSE'),
(330, '{FA84629D-7C2E-4369-836C-90F4A93848BA}', 'Boinc2Mee', 'Stats from your SETI@BOINC account.', '', 'Module', 'None', 'Freeware', 'Beta', '2007-05-14 16:33:16', '0.3.0', 'paran0id', 'henrik.olsen@kisel.org', '', 'Â©2004 paran0id', '', 'plugins/{FA84629D-7C2E-4369-836C-90F4A93848BA}/0.3.0/beta/Boinc2Mee_0.3.0_Beta.mpp', '17101', '', '', 'boinc2mee.rtf', 3000000000000000, 1, 'Stats from your SETI@BOINC account. See boinc2mee.rtf for more information.', 'Boinc2Mee', '', '', '', '', '0', '0', 1133, 1133, 0, 0, 0, 0, '384debfb1ffdf1906d1bb31368227ebc', 'FALSE'),
(331, '{FB5DACAD-C9D5-4AC1-9969-B383A1E99E5D}', 'X10 module', 'This plugin allows you to control you lights as well as set up macros.', '', 'Module', 'None', 'Freeware', 'Stable', '2007-05-14 16:35:26', '1.71', 'Ryan Jones', 'ryanjones2@yahoo.com', 'ryanjones2', '2003 Ryan Jones', '', 'plugins/{FB5DACAD-C9D5-4AC1-9969-B383A1E99E5D}/1.71/stable/X10_module_1.71_Stable.mpp', '113035', '', '', '', 1071000000000000000, 1, 'Plugin Module to control lights using the x10 Full time plugin.\r\n\r\nNOTE: You need to also install the full time plugin for this to work.\r\n\r\nThis module will allow you to turn on ligts as well as record macros and use them later. \r\n\r\nTo turn a light on or off or to dim or brighten, select the light and then select the action. \r\n\r\nTo record a macro, click record macro then select the lights and actions you want to happen, then click save macro. Next enter a name for the macro and click the Enter button.\r\n\r\nTo Load a macro, select Load Macro, select the macro, then select run macro.', 'x10', 'http://www.meedio.com/plugins', '', '', '', '0', '', 1190, 1190, 0, 0, 0, 0, 'a3effe90ccc60b853a21c76a6b08ea3d', 'FALSE'),
(332, '{FBCD9D60-523E-4E74-AC5A-7C19DE9B58B2}', 'Sleep', 'Enables the user to auto shutdown the HTPC after a specified time.', '', 'General', 'None', 'Freeware', 'Stable', '2007-05-14 16:34:58', '1.1', 'CyberVillain', 'anders@dac.se', 'CyberVillain', '2004 DAC Ltd', '', 'plugins/{FBCD9D60-523E-4E74-AC5A-7C19DE9B58B2}/1.1/stable/Sleep_1.1_Stable.mpp', '31585', '', '', '', 1001000000000000000, 1, 'Create a command module and use the custom command "sleep.screen-show"\nUse the next/prev buttons to set a time when you want the computer to auto shutdown. If you want to cancel the auto shutdown press stop. If you want the data feed the data feed subject is "sleep.time" and data feed source is "timeleft"', 'Sleep', '', '', '', '', '0', '0', 3645, 3645, 0, 0, 0, 0, 'be3fc33c181b26da695adb0855cd8313', 'FALSE'),
(333, '{FEED1E77-568B-443D-9AB8-7E329F4469EB}', 'WMP9 Media Library import', 'Import plugin used to import data from WMP9.', '', 'Import', 'None', 'Commercial', 'Stable', '2007-05-14 16:35:25', '1.2', 'Meedio, LLC', 'support@meedio.com', '', '2004 Meedio, LLC.', '', 'plugins/{FEED1E77-568B-443D-9AB8-7E329F4469EB}/1.2/stable/WMP9_Media_Library_import_1.2_Stable.mpp', '49134', '', '', '', 1002000000000000000, 1, 'This import plugin is used to import data from the Windows Media Player 9 media library into the Meedio library.\nChanges:\n  1.2 - Added Album-Artist tag from the library \n      - Fixed a couple other bugs\n  1.1 - Added a check for a folder.jpg file in the album directory before it assumes there is an embedded cover art.\n      - Added about 12 additional new tags for music. \nTo use, Go to the Meedio Configuration->Media Library tab. Add a new media library section on the left.  Then on the right select the Imports tab and click the ''New import'' button.  For the plugin choose WMP9 Media Library Import. Then select which items you want to import and click the Run Now button to run it.  Then if you wish, you can create some Views to look at your data in various ways.', 'WMP9Import', 'http://www.meedio.com/maid', '', '', '', '0', '0', 682, 682, 0, 0, 0, 0, 'a613e3a404ed62049aacf0d51a93e54f', 'FALSE'),
