(379, '{798F4DB0-7642-4669-AFED-4379CA7B5546}', 'Webscheduler Captures Importer', 'Imports Webscheduler Video Captures XML info.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-06-11 00:12:52', '2.0', 'John Calvi', 'jcalvi at lewis dot com dot au', 'Calvi', 'John Calvi, 2006', '', 'plugins/{798F4DB0-7642-4669-AFED-4379CA7B5546}/2.0/stable/Webscheduler_Captures_Importer_2.0_Stable.mpp', '349283', '', '', 'readme.txt', 2000000000000000000, 0, 'Webscheduler Captures Importer, by John Calvi, Copyright 2006.\r\n\r\nThis plug-in checks for xml files generated by Webscheduler and if they exist writes the tags into the Meedio Library. This importer should be chained after a standard importer, eg. Task Mask Importer.\r\nNo special rules are required for the Tag Mask importer and you can still use images etc. All options in the WS Captures importer complement those in the Task Mask importer.\r\n\r\n\r\nRefer Readme.txt File', 'WSCaptures', 'http://web.aanet.com.au/calvi/meedio', '', '', '', '0', '0', 129, 851, 0, 0, 0, 0, '9dff0a042dd3364d11387b54bd61e9e3', 'FALSE'),
