(408, '{DEEB1BEB-538D-418C-AFE4-9839876DF0E6}', 'Command Module II', 'Allows you to send commands, with bug fixes.', '', 'Module', 'None', 'Donationware', 'Alpha', '2007-07-08 14:59:38', '1.0', 'binary64', 'slug@skyforge.net', 'binary64', '2007', 'http://www.meedios.com/forum/viewtopic.php?t=1092', 'plugins/{DEEB1BEB-538D-418C-AFE4-9839876DF0E6}/1.0/alpha/Command_Module_II_1.0_Alpha.mpp', '7294', '', '', '', 1000000000000000000, 0, 'Alows you to send commands like shutting down Windows, going into standby, and shutting down the application.\n\n      Most usefully is the ability to send custom Meedio messages as a module.\n\n      Also includes 1 bug fix compared to Meedio''s own Command Module:\n      1. Allow send spaces in message param values', 'CommandModuleII', 'http://www.MeediOS.com/', '', '', '', '0', '1', 180, 1448, 0, 0, 0, 0, 'a79f19a8a77983a7a299b8679ce7ff63', 'FALSE'),
(409, '{DEEB1BEB-538D-418C-AFE4-9839876DF0E6}', 'Command Module II', 'Allows you to send commands, with bug fixes.', '', 'Module', 'None', 'Donationware', 'Alpha', '2007-07-08 16:34:09', '1.0.0.1', 'binary64', 'slug@skyforge.net', 'binary64', '2007', '', 'plugins/{DEEB1BEB-538D-418C-AFE4-9839876DF0E6}/1.0.0.1/alpha/Command_Module_II_1.0.0.1_Alpha.mpp', '4466', '', '', '', 1000000001000000000, 0, 'Alows you to send commands like shutting down Windows, going into standby, and shutting down the application.\n\n      Most usefully is the ability to send custom Meedio messages as a module.\n\n      Also includes 1 bug fix compared to Meedio''s own Command Module:\n      1. Allow send spaces in message param values', 'CommandModuleII', 'http://www.MeediOS.com/', '', '', '', '0', '1', 185, 1448, 0, 0, 0, 0, 'f196c208449d5814f443abf95d96f675', 'FALSE'),
(410, '{089C0183-1B32-4946-91AE-EA63E6365413}', 'ScriptMee', 'ScriptMee lets you run scripts. (pascal syntax)', '', 'General', 'None', 'Freeware', 'Beta', '2007-07-08 14:08:16', '0.9.1', 'Michael Wisniewski', 'Goldrush@web.de', 'DocZoidberg', '2006 Michael Wisniewski', '', 'plugins/{089C0183-1B32-4946-91AE-EA63E6365413}/0.9.1/beta/ScriptMee_0.9.1_Beta.mpp', '586227', '', '', '', 9001000000000000, 0, 'This is the general plugin version of my TagManipulation importer plugin.\n\nWith this plugin you can run scripts written in pascal syntax and use some of the most useful Delphi functions, have access to the complete Meedio API, add OCX controls...  The plugin provides you with an editor to support you writing scripts.\n\nUsage:\n\nThis has changed. First activate the plugin in Meedios configuration app in the fulltime plugins tab.  Your scripts now all get into ...\\Meedio\\data\\ScriptMee\\Scripts.\nYou can debug your scripts right within Meedio \nWith this plugin you run your scripts by sending a message in Meedio.\nThe subject has to be ''MCW.runscripts''\nThe message can have two parameters. The first is the list of script to run and the second is debug switch. Only use the scripts name as parameter (no path and no extension). You can run several scripts by separating the names with ''/''.\nThe param name is ''scripts''. The second parameter indicates if the scripteditor should be opened when the scripts run. Params name is ''debug''. (True or False.\nThe default is False)\n\nExample message parameters:\nscripts=ScriptMeeGeneralExample/A Second Script,debug=True\nscripts=ScriptMeeGeneralExample,debug=False\nscripts=ScriptMeeGeneralExample\n\nIf debug param is set to True the scripteditor will open when the scripts run.\nThe editor will be on top of Meedio and you can debug your scripts and see what happens in Meedio. (If you press backspace in the editor Meedio will also recognize the press and react)\n\nSo for testing you can add a command module sending a custom command\nwith subject set to ''MCW.runscripts'' and parameters set to ''scripts=ScriptMeeGeneralExample,debug=True''.\n\nYou can write almost everything with your scripts you could by writing a real plugin in C#/Delphi/VB... So there is a wide range of things you can accomplish with scripts but also you get the potential to damage your data by writing code that isnt doing what you intended. So if you are not exactly knowing what your doing make backups and  you can always ask me or others in the scripts discussion thread for help with your scripts, but dont blame me if you lose data,\nyour computer goes up in flames or ... :)\n\nHope you enjoy the plugin and that it will be of use for the community.\n\nNext version should get support to react to messages in your scripts.\n\n\nGreetz\nDocZoidberg', 'ScriptMee', 'http://www.michaelwisniewski.mynetcologne.de/', '', '', '', '0', '0', 114, 1556, 0, 0, 0, 0, '0a01e11f0b03b3978f91b384f13b6d69', 'FALSE'),
(411, '{97970EDE-15CE-4C95-9171-37D7F9850EF9}', 'USB-UIRT', 'Use the USB-UIRT with Meedio.  Supports receive only at this time.', '', 'Input', 'None', 'Donationware', 'Stable', '2007-07-08 14:08:17', '3.0', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{97970EDE-15CE-4C95-9171-37D7F9850EF9}/3.0/stable/USB-UIRT_3.0_Stable.mpp', '42795', '', '', '', 3000000000000000000, 0, 'Set the delay, and then use the Learn button (in Configuration...Input) to map IR codes to Meedio commands.', 'USB-UIRT', '', '', '1.0', '', '0', '1', 161, 1171, 0, 0, 0, 0, '0b160fb3fa547e549d202105daa617db', 'FALSE'),
