(413, '{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}', 'OpenMAID', 'An alternative, free, and open Add-in Directory', '', 'Module', 'None', 'Freeware', 'Stable', '2007-07-08 14:08:04', '1.5.0.1', 'binary64', 'slug@skyforge.net', 'binary64', '2006 binary64', '', 'plugins/{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}/1.5.0.1/stable/OpenMAID_1.5.0.1_Stable.mpp', '160889', '', '', '', 1005000001000000000, 0, 'Changes:\n\n1.4.0.1 (10.Mar.07)\n* Fixed the assumption that Meedio was installed to C:. Location is now read from registry.\n* You can now jump to a plugin in the list by tapping the first few letters of its Name.\n* Fixed 2 Sort-by-Downloads bugs\n\n1.4 (09.Mar.07)\n* Added 2 caching layers for the views\n* Made startup text ''animated'' as it progresses\n* Added a new view: "Lost" which are plugins you have installed, that aren''t on MAID''s\n* Added a space inbetween version and state\n* Fixed error window showing when exiting module quickly\n* You can now directly Install from the list, without having to enter the Review page\n* Fixed bug if \\images folder didn''t exist\n\n1.3.3.4 (08.Mar.07)\n* Added a new view: "Older" which show plugins on MAID that are older than your installed version. An author uploads a lower version, and it will appear in this view.\n\n1.3.3.3 (08.Mar.07)\n* New and better version parsing Thanks to Darkmoor\n	  \n1.3.3.2 (08.Mar.07)\n* Fixed debug msgbox from popping up\n* Fixed small bug with alpha parsing\n	  \n1.3.3.1 (07.Mar.07)\n* Parse versions with alpha chars (thanks Darkmoor)', 'OpenMAID', '', '', '', '', '0', '1', 64, 4359, 0, 0, 0, 0, '61ea630b9aeb53cc909967c1a2b27b03', 'FALSE'),
(414, '{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}', 'OpenMAID', 'An alternative, free, and open Add-in Directory', '', 'Module', 'None', 'Freeware', 'Stable', '2007-07-08 14:08:04', '1.5.1', 'binary64', 'slug@skyforge.net', 'binary64', '2006 binary64', '', 'plugins/{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}/1.5.1/stable/OpenMAID_1.5.1_Stable.mpp', '150708', '', '', '', 1005001000000000000, 0, 'Changes:\n\n1.5.1 (17.Mar.07)\n* Plugins are now downloaded locally before installing (progress bar is now possible)\n* Support manual rollback; Old versions are now archived in [MEEDIO-DATA]\\OpenMAID\\plugins\\{guid} name (type)\\date time version (state).mpp\n* After installation, Meedio.bat gets executed instead of the .exe (so you can put custom commands in the .bat)\n* If Meedio.bat does not exist, a default one is created (runs Meedio.exe)\n\n1.5.0.1 (15.Mar.07)\n* Small bug fixes\n\n1.5 (15.Mar.07)\n* Changed from using IMeedioItem+List to C# Generics\n* Improved the threading\n* Save Defaults now saves the main view filter (actions in the openmaid.screen have changed)\n\n1.4.0.1 (10.Mar.07)\n* Fixed the assumption that Meedio was installed to C:. Location is now read from registry.\n* You can now jump to a plugin in the list by tapping the first few letters of its Name.\n* Fixed 2 Sort-by-Downloads bugs\n\n1.4 (09.Mar.07)\n* Added 2 caching layers for the views\n* Made startup text ''animated'' as it progresses\n* Added a new view: "Lost" which are plugins you have installed, that aren''t on MAID''s\n* Added a space inbetween version and state\n* Fixed error window showing when exiting module quickly\n* You can now directly Install from the list, without having to enter the Review page\n* Fixed bug if \\images folder didn''t exist\n\n1.3.3.4 (08.Mar.07)\n* Added a new view: "Older" which show plugins on MAID that are older than your installed version. An author uploads a lower version, and it will appear in this view.\n\n1.3.3.3 (08.Mar.07)\n* New and better version parsing Thanks to Darkmoor\n	  \n1.3.3.2 (08.Mar.07)\n* Fixed debug msgbox from popping up\n* Fixed small bug with alpha parsing\n	  \n1.3.3.1 (07.Mar.07)\n* Parse versions with alpha chars (thanks Darkmoor)', 'OpenMAID', '', '', '', '', '0', '1', 73, 4359, 0, 0, 0, 0, '073041060cc7b6ed6df0479f7fb021d3', 'FALSE'),
(415, '{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}', 'OpenMAID', 'An alternative, free, and open Add-in Directory', '', 'Module', 'None', 'Freeware', 'Stable', '2007-07-08 14:08:04', '1.5.2', 'binary64', 'slug@skyforge.net', 'binary64', '2006 binary64', '', 'plugins/{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}/1.5.2/stable/OpenMAID_1.5.2_Stable.mpp', '177162', '', '', '', 1005002000000000000, 0, 'Changes:\n\n1.5.2 (13.Apr.07)\n* Added new config to enter multiple database locations (in order of download preference)\n* Fixed a crash on exit\n* Progress as plugins are downloaded\n* Fixed timeout issue\n* Merge databases now also merges missing meta tags to show more info\n* Now OpenMAID v2 compatible (using v2''s simple/backcompat api only)\n\n1.5.1 (17.Mar.07)\n* Plugins are now downloaded locally before installing (progress bar is now possible)\n* Support manual rollback; Old versions are now archived in [MEEDIO-DATA]\\OpenMAID\\plugins\\{guid} name (type)\\date time version (state).mpp\n* After installation, Meedio.bat gets executed instead of the .exe (so you can put custom commands in the .bat)\n* If Meedio.bat does not exist, a default one is created (runs Meedio.exe)\n\n1.5.0.1 (15.Mar.07)\n* Small bug fixes\n\n1.5 (15.Mar.07)\n* Changed from using IMeedioItem+List to C# Generics\n* Improved the threading\n* Save Defaults now saves the main view filter (actions in the openmaid.screen have changed)\n\n1.4.0.1 (10.Mar.07)\n* Fixed the assumption that Meedio was installed to C:. Location is now read from registry.\n* You can now jump to a plugin in the list by tapping the first few letters of its Name.\n* Fixed 2 Sort-by-Downloads bugs\n\n1.4 (09.Mar.07)\n* Added 2 caching layers for the views\n* Made startup text ''animated'' as it progresses\n* Added a new view: "Lost" which are plugins you have installed, that aren''t on MAID''s\n* Added a space inbetween version and state\n* Fixed error window showing when exiting module quickly\n* You can now directly Install from the list, without having to enter the Review page\n* Fixed bug if \\images folder didn''t exist\n\n1.3.3.4 (08.Mar.07)\n* Added a new view: "Older" which show plugins on MAID that are older than your installed version. An author uploads a lower version, and it will appear in this view.\n\n1.3.3.3 (08.Mar.07)\n* New and better version parsing Thanks to Darkmoor\n	  \n1.3.3.2 (08.Mar.07)\n* Fixed debug msgbox from popping up\n* Fixed small bug with alpha parsing\n	  \n1.3.3.1 (07.Mar.07)\n* Parse versions with alpha chars (thanks Darkmoor)', 'OpenMAID', '', '', '', '', '0', '1', 90, 4359, 0, 0, 0, 0, 'e35c707dcde2339898df43fbbcbd8bbf', 'FALSE'),
