(436, '{52853D5A-8A47-43FA-AE08-FF1AA389C0DF}', 'FrameShots Importer', 'Use FrameShots to generate video thumbnails', '', 'Import', 'None', 'Freeware', 'Beta', '2007-07-08 14:07:37', '0.3b', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{52853D5A-8A47-43FA-AE08-FF1AA389C0DF}/0.3b/beta/FrameShots_Importer_0.3b_Beta.mpp', '1209878', '', '', '', 3000000000002000, 0, 'Installation Instructions: \nâ€¢ Download and install FrameShots_Importer.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the Imports tab for the library you wish to thumbnail \nâ€¢ Add a new import \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select FrameShots Importer in Choose the plugin to perform the import \nâ€¢ Select whether you want the thumbnails saved In place (in the same folder as the video) or To another folder (in a different folder as the video) in Save image: \nâ€¢ If you selected To another folder in Save image:, select your thumbnail folder in To another folder: \nâ€¢ (optional) Select Overwrite existing thumbanils? to replace already extant thumbnails (overrides Check image location tag? and Check whether image file exists?) \nâ€¢ (optional) Select Check image location tag? to skip library items that have a populated image tag \nâ€¢ (optional) Select Check whether image file exists? to check whether the populated image tag points to a valid file (does nothing without Check image location tag? selected) \nâ€¢ (optional) Specify the time (in milliseconds) to ignore at the beginning of a video in Front Skip (ms): \nâ€¢ (optional) Specify the time (in milliseconds) to ignore at the end of a video in Back Skip (ms): \nâ€¢ (optional) Select Resize thumbnail? to resize the generated thumbnail \nâ€¢ (optional) Specify the resized thumbnail width in Resized width: (does nothing without Resize thumbnail? selected) \nâ€¢ (optional) Specify the resized thumbnail heightin Resized height: (does nothing without Resize thumbnail? selected) \nâ€¢ (optional) Select Trim black borders? to remove black borders commonly found around videos \nâ€¢ (optional) Select Crop to exact dimensions? to ignore video aspect ratio when resizing the thumbnail (does nothing without Resize thumbnail? selected) \nâ€¢ (optional) Specify brightness adjustment (-100 to 100) in Brightness: \nâ€¢ (optional) Specify contrast adjustment (-100 to 100) in Contrast: \nâ€¢ (optional) Select a time to run FrameShots Importer automatically in Schedule this import to run automatically', 'FrameShots_Importer', 'http://www.meedios.com/forum/viewtopic.php?t=392', 'http://www.meedios.com/maid/dl.php?plugin_id={52853D5A-8A47-43FA-AE08-FF1AA389C0DF}', '0.01', '1.41', '0', '1', 181, 1996, 0, 0, 0, 0, '5a73a993f39758a4818468df973802c2', 'FALSE'),
