(484, '{AC028438-1569-467E-AA2F-0019EBC33142}', 'meeBusy', 'Shows a ''busy'' animation when Meedio is, er, busy', '', 'General', 'None', 'Donationware', 'Beta', '2007-07-08 14:07:42', '1.3.1.1', 'binary64', 'slug@skyforge.net', 'binary64', 'Please dontate', '', 'plugins/{AC028438-1569-467E-AA2F-0019EBC33142}/1.3.1.1/beta/meeBusy_1.3.1.1_Beta.mpp', '2743078', '', '', '', 1003001001000000000, 0, 'Requires .Net 2.0\n\nChanges:-\n\n1.3.1 (14 Mar 07)\n* Much more efficient code - far less slows the meedio system down now\n* Removed meedio logging (this caused problems calling it from another thread!)\n* Added meebusy.show and meebusy.hide commands for other plugins to perhaps use?\n\n1.3 (12 Mar 07)\n* Added config option to define which messages to listen for (and test for busyness after receiving any)\n* Updated default values\n* Added meedio log debugging\n* Added some more error checking/handling', 'meeBusy', '', '', '', '', '0', '1', 46, 5463, 0, 0, 0, 0, '943b7005b6f5087729e9e1df8eae2e40', 'FALSE');
