(497, '{B65C9182-1A28-4D73-A2EB-DE9DE806C706}', 'Menagerie SE', 'Enjoy the best and most stylish theme for Meedio.', '', 'Theme', 'None', 'Donationware', 'Stable', '2007-07-08 14:08:02', '1.4', 'Adam Smith', 'adam@adamsmith.ws', 'adamsmith', 'A commercial licence is required for use on a commercial machine', '', 'plugins/{B65C9182-1A28-4D73-A2EB-DE9DE806C706}/1.4/stable/Menagerie_SE_1.4_Stable.mpp', '9342987', '', '', 'Changes_To_Theme.txt', 1004000000000000000, 0, 'Menagerie SE 1.4\n\nChanges:\nAdded - Support for Icon Manager 2.0\nAdded - Lyrics screen back into Now PLaying Screen (thanks to UFGrayMatter for screen)\nAdded - Removed button to remove items from playlists\nAdded - 1280 x 1024 screen resolution\nAdjusted - First page on Now Playing screen\nFixed - Issue opening ''full story'' in Internet Explorer (thanks Kricker)\nFixed - Font shrink for Weather description (thanks Kricker)\nFixed - Season Images disappearing on meeTVshows screens (thanks Walts81) \nRemoved - Some backgrounds (These will be re-released as backgrounds supported by IM2)', 'Menagerie SE', 'http://www.meedios.com/menagerie', '', '', '', '0', '0', 86, 5929, 0, 0, 0, 0, '948d6b10950f8e85be1cda83ff3cfce4', 'FALSE'),
