(499, '{B65C9182-1A28-4D73-A2EB-DE9DE806C706}', 'Menagerie SE', 'Enjoy the best and most stylish theme for Meedio.', '', 'Theme', 'None', 'Donationware', 'Stable', '2007-07-08 14:08:00', '1.7', 'Adam Smith', 'adam@adamsmith.ws', 'adamsmith', 'A commercial licence is required for use on a commercial machine', '', 'plugins/{B65C9182-1A28-4D73-A2EB-DE9DE806C706}/1.7/stable/Menagerie_SE_1.7_Stable.mpp', '9438174', '', '', 'Changes_To_Theme.txt', 1007000000000000000, 0, 'Menagerie SE 1.4\n\nChanges:\nAdded - Support for Icon Manager 2.0\nAdded - Lyrics screen back into Now PLaying Screen (thanks to UFGrayMatter for screen)\nAdded - Removed button to remove items from playlists\nAdded - 1280 x 1024 screen resolution\nAdjusted - First page on Now Playing screen\nFixed - Issue opening ''full story'' in Internet Explorer (thanks Kricker)\nFixed - Font shrink for Weather description (thanks Kricker)\nFixed - Season Images disappearing on meeTVshows screens (thanks Walts81) \nRemoved - Some backgrounds (These will be re-released as backgrounds supported by IM2)', 'Menagerie SE', 'http://www.meedios.com/menagerie', '', '', '', '0', '0', 97, 5929, 0, 0, 0, 0, '4bb645cc801767d0d6ed66b6c0087f91', 'FALSE'),
(500, '{BA67452D-89B5-4A73-B202-18E9BAFA1319}', 'Screensaver+', 'Screensaver+ is a screensaver and slideshow enhancer (randomize it!).  Screensavers can be picture slideshows, datafeed screen files, music visualizations, or external programs.  Automatic slideshows with any media insertion!', '', 'General', 'None', 'Donationware', 'Stable', '2007-07-08 14:08:07', '5.5.2', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{BA67452D-89B5-4A73-B202-18E9BAFA1319}/5.5.2/stable/Screensaver~_5.5.2_Stable.mpp', '481618', '', '', '', 5005002000000000000, 0, '***If you were using SaveMee, then you need to delete that folder from the plugins/general folder before installing this new version.  Also, you should reselect the screen file folders.***\n\nScreensaver+ is a screensaver and slideshow enhancer (it fully randomizes the slideshow).  Screensavers can be picture slideshows, rotating datafeed screen files, music visualizations, or external programs.  You can cycle or randomize between them.    Automatic slideshows with any media insertion!  Simply insert any type of media (USB key, compact flash card, CD/DVD, etc) and Screensaver+ will start a slideshow if any image files are found on the media.  Automatically run imports with the screensaver.  Set the system screensaver to 1 minute longer than Screensaver+ to provide out-of-Meedio protection.  Run an external program before and/or after the screensaver, or AS the screensaver.\n\nYou can enable/disable Screensaver+ using the Meedio messages:\n\nscreensaver.enable and screensaver.disable\n\nYou can also activate/deactivate Screensaver+ using the Meedio messages:\n\nscreensaver.activate and screensaver.deactivate\n\nscreensaver.full-screen to launch the music visualization in full screen\n\nscreensaver.randomize with random=true,false,toggle to change the current manual picture slideshow mode.\n\nThere is also a screensaver.randomize datafeed that will send two values- order and random.  Use these values to show the currect setting in screen files.\n\nBig thanks to Mattman (-= M@ =-) for the Movies, MoviesWeatherNews, and Showtimes screen file sets!\n\nBig thanks to Dee for the Info screen file set (and 3D flash clock)!\n\nBig thanks to MisterMoonlight for the MovieTimes VBNET screen file set!\n\nYou can make your own .screen files for the screen saver.  Just place them in a separate folder and modify the appropriate "Screen File Folder" property.\n\nExample of using the External Screensaver Program Settings:\n\n1). 3D Flash Clock screensaver played by ZoomPlayer\nProgram: C:\\Program Files\\Zoom Player\\zplayer.exe\nParameters: /F /Q /LOCKFS "{screensaver+}3DClock\\3dc.swf"\n\n2). Windows screensaver\nProgram: C:\\WINDOWS\\system32\\scrnsave.scr\nParameters:\n\n3). Play random music videos (make sure to set the Library Section to the correct location)\nProgram: C:\\Program Files\\Zoom Player\\zplayer.exe\nParameters:/F /Q /LOCKFS "{item_location}"\nThis will cause one random music video to be queued and played.  When Zoom Player finishes playing it and closes, another random music video will be picked and played.  This cycle will continue until the screensaver is deactivated.\n\nIf "Run before screensaver activation?" is checked, then the Program will NOT be used as a screensaver.  It will be used as a pre-screensaver program.\n\nEnable "Run imports while screensaver is active?" if you would like your imports to run when the screensaver activates.  All imports that are scheduled will be run (regardless of how they are scheduled).  All imports set to "Never" will be ignored.  By scheduling your imports to run only during off-hours, you can prevent being disrupted by imports while actively using the system, and still have imports run regularly during "idle" time.', 'Screensaver+', '', '', '1.30', '', '0', '1', 125, 2046, 0, 0, 0, 0, '482bb30074060390c6319fd2dcbba425', 'FALSE'),
