(502, '{CBB9A920-6241-4938-A0B1-0C9FB228E0CF}', 'StartupETA', 'Overlays an ETA on the Meedio splash screen. Learns over time how long your Meedio takes to boot up.', '', 'General', 'None', 'Freeware', 'Stable', '2007-07-08 14:08:08', '1.1.0', 'binary64', 'slug@skyforge.net', 'binary64', '2007', '', 'plugins/{CBB9A920-6241-4938-A0B1-0C9FB228E0CF}/1.1.0/stable/StartupETA_1.1.0_Stable.mpp', '8283', '', '', '', 1001000000000000000, 1, 'Requires .Net 2.0.\n\n			To use:\n			1. In the moment just before Meedio.exe is launched on your system, launch ''C:\\Program Files\\Meedio\\Meedio Essentials\\plugins\\general\\StartupETA\\StartupETACore.exe''. Start this process with High priority as it self-terminates when Meedio is loaded.\n			2. Enable the StartupETA general plugin in Meedio Configuration.\n			3. Don''t allow imports to be run on startup, there are much better ways to do this. My favourite is a seperate meedio instance just for imports.', 'StartupETA', '', '', '', '', '0', '1', 897, 999, 0, 0, 0, 0, 'c745c4325c29e690c3babe88f03c748c', 'FALSE'),
