(508, '{DE04F700-31D0-4723-81C1-1CA8F1794EB0}', 'MeediuTube', 'UPDATED 0.5 beta ( 25.10.2006 ) ------- gets videos from YouTube --------  now you can save your searches as favourites! Displays latest25 at module start now.', '', 'Module', 'None', 'Freeware', 'Beta', '2007-07-08 14:07:45', '0.5', 'Benedikt Schlueter', 'ben_kenobi@gmx.net', 'UFGrayMatter', '', '', 'plugins/{DE04F700-31D0-4723-81C1-1CA8F1794EB0}/0.5/beta/MeediuTube_0.5_Beta.mpp', '36565', '', '', '', 5000000000000000, 0, 'get yourself a YouTube Developer ID @ http://www.youtube.com/signup?next=my_profile_dev\n\nNext install plugin and add MediuTube Module to your Main Menu. Then fill in your Dev-ID into Property field. Apply, Run!\n\nYou can do a custom search or get the latest 25 Items from YouTube''s Main Site.\n\nYou can also save your best searches as favourites, so you can easily get the newest results of your custom searches. Be sure to try "Game Trailer", "Movie Trailer" etc to get some nice results.\n\nHave fun!', 'MeediuTube', 'http://www.benkenobi.de', '', '1.41', '1.41', '0', '1', 50, 5866, 0, 0, 0, 0, '85dad262f0b1845c5033a8d686731922', 'FALSE'),
