(523, '{EF7D57F0-372A-4A59-AF38-66505E756280}', 'IMDBmee', 'Download movie descriptions and cover art', '', 'General', 'None', 'Freeware', 'Stable', '2007-07-08 14:07:38', '5.1.4.5', 'walts81', 'joshwalters@gmail.com', 'walts81', '2005-2006   JCSoftware, Inc.  all rights reversed   ;-)', '', 'plugins/{EF7D57F0-372A-4A59-AF38-66505E756280}/5.1.4.5/stable/IMDBmee_5.1.4.5_Stable.mpp', '1314712', '', '', '', 5001004005000000000, 0, 'Using Meedio Configuration...\n\n1) Enable the plugin under the ''Full-time plug-ins'' tab\n2) Choose # of actors to download\n3) Set country ratings\n4) Set your movies section\n5) Set custom field names\n6) Set how you want cover art stored\n7) Add a ''Command Module'' under the ''Menu'' tab\n8) Select the Module Properties tab\n9) Choose ''Send custom Command'' from the ''Command to send'' drop-down\n10) Type ''IMDBmee.display-window'' in the ''Custom command to send'' box\n\nThat''s It!\n\nNote: You can also call this plugin from a screen file using...\nimdbmee.find-movie title={title} id={id} section={section}\n\nOR if you''re a plugin developer, you can call...\nimdbmee.find-movie title={title}\n\nwhich will send a list of movies to choose from and after choosing one, it will return the message...\n\nimdbmee.event.movie-info\nwith the parameters...\n\ntitle\nsubtitle\ndirector\nwriter\nactors\ngenre\nrating\nreview\nruntime\nproduced\ncountry\nlanguage\noverview\n\nOR you can call the plugin with...\n\nimdbmee.get-description imdbid={imdbid}\nand it will return...\n\nimdbmee.event.movie-info\nwith all the parameters from above', 'IMDBmee', 'http://www.meedio.com/maid', '', '', '', '0', '1', 54, 8332, 0, 0, 0, 0, '9a781ecf76fc928eebf4bd116e07cb9b', 'FALSE'),
(524, '{EF7D57F0-372A-4A59-AF38-66505E756280}', 'IMDBmee', 'Download movie descriptions and cover art', '', 'General', 'None', 'Freeware', 'Stable', '2007-07-08 14:07:39', '5.1.4.8', 'walts81', 'joshwalters@gmail.com', 'walts81', '2007', '', 'plugins/{EF7D57F0-372A-4A59-AF38-66505E756280}/5.1.4.8/stable/IMDBmee_5.1.4.8_Stable.mpp', '1315075', '', '', '', 5001004008000000000, 0, 'Using Meedio Configuration...\n\n1) Enable the plugin under the ''Full-time plug-ins'' tab\n2) Choose # of actors to download\n3) Set country ratings\n4) Set your movies section\n5) Set custom field names\n6) Set how you want cover art stored\n7) Add a ''Command Module'' under the ''Menu'' tab\n8) Select the Module Properties tab\n9) Choose ''Send custom Command'' from the ''Command to send'' drop-down\n10) Type ''IMDBmee.display-window'' in the ''Custom command to send'' box\n\nThat''s It!\n\nNote: You can also call this plugin from a screen file using...\nimdbmee.find-movie title={title} id={id} section={section}\n\nOR if you''re a plugin developer, you can call...\nimdbmee.find-movie title={title}\n\nwhich will send a list of movies to choose from and after choosing one, it will return the message...\n\nimdbmee.event.movie-info\nwith the parameters...\n\ntitle\nsubtitle\ndirector\nwriter\nactors\ngenre\nrating\nreview\nruntime\nproduced\ncountry\nlanguage\noverview\n\nOR you can call the plugin with...\n\nimdbmee.get-description imdbid={imdbid}\nand it will return...\n\nimdbmee.event.movie-info\nwith all the parameters from above', 'IMDBmee', 'http://www.meedio.com/maid', '', '1.41', '1.41', '0', '1', 51, 8332, 0, 0, 0, 0, '8ad761ec79a8f5d92245b75a5c38bc6e', 'FALSE'),
