(533, '{F4788B91-3EC8-4A6E-8904-E0CBE000469C}', 'TriggerMee', 'Monitor folders for new files, and instantly trigger an importer (or anything)', '', 'General', 'None', 'Donationware', 'Beta', '2007-07-08 14:08:09', '0.2', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64 2007', '', 'plugins/{F4788B91-3EC8-4A6E-8904-E0CBE000469C}/0.2/beta/TriggerMee_0.2_Beta.mpp', '10893', '', '', '', 2000000000000000, 0, 'Set the config stringlist.. format is: folder|message|filemask|notlocked|runonconnect\nfolder (string) = mandatory. a single folder to listen in. subdirectories included. can be unc.\nmessage (string) = mandatory. a meedio message to send when new file found. example: "meedio.message-subject,tag1=value1,tag2=value2" without quotes.\nfilemask (string) = mandatory. file mask(s) to listen for. seperate with a space. example: "*.avi .mpg mpeg" without quotes will listen for avi''s, mpg''s and mpeg''s.\nnotlocked (bool) = mandatory. if true, only executes the message when file first becomes unlocked. if false, the message is executed without delay.\nrunonconnect (bool) = optional. default=true. if true, when the watcher is connected or reconnected to a folder, the message will be executed.\n\n--Which means: folder(to listen in),meedio message to send when new file found (eg: meedio.message,tag=value,tag2=value2),file masks to listen for seperated with a space (if this field is empty default to *.*),if true only execute when file becomes unlocked\n----Example: C:\\Series|meedio-helper.run-imports,id=1|*.avi *.mkv|true\n----Example: c:\\temp|imports.run,import-id=14|*.mpg *.avi|true\n----Example: \\\\nas\\share|imports.run,import-id=15||true|true\n----Example: \\\\nas\\share|imports.run,import-id=15|*.*|false\n\nChanges:\n\n0.2\n* Implemented the file mask filter (i forgot to do this)\n* Added a 5th param RunOnConnect, optional, default = true. If true, the message is executed every time the file watcher succesfully connects to the directory. This is useful if your connection server was temporarily disconnected - to recap on any missed new files.\n* Added support for being disconnected from a watched folder\n\n0.1\n* Monitors a folder recursivly for new files and sends a specified Meedio Message when it does', 'TriggerMee', '', '', '', '', '0', '1', 49, 3386, 0, 0, 0, 0, '6b187f59d99e540e6be788362b1b755c', 'FALSE'),
(534, '{F4788B91-3EC8-4A6E-8904-E0CBE000469C}', 'TriggerMee', 'Monitor folders for new files, and instantly trigger an importer (or anything)', '', 'General', 'None', 'Donationware', 'Beta', '2007-07-08 14:08:09', '0.4', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64 2007', '', 'plugins/{F4788B91-3EC8-4A6E-8904-E0CBE000469C}/0.4/beta/TriggerMee_0.4_Beta.mpp', '74635', '', '', 'Readme.txt', 4000000000000000, 0, '', 'TriggerMee', '', '', '', '', '0', '1', 52, 3386, 0, 0, 0, 0, 'af69bd9451b6561c167c6fa225095ad3', 'FALSE'),
