(564, '{5539724A-BF84-4F76-A099-C0E29B5EA83D}', 'Beyond Menagerie', 'Menagerie Goes MCE', '', 'Theme', 'None', 'Donationware', 'Beta', '2007-07-16 07:25:15', '0.5', 'Adam Smith', 'adam@adamsmith.ws', 'adamsmith', '2007 Adam Smith', '', 'plugins/{5539724A-BF84-4F76-A099-C0E29B5EA83D}/0.5/beta/Beyond_Menagerie_0.5_Beta.mpp', '6429589', '', '', 'Changes To Theme.txt', 5000000000000000, 0, 'Beyond Menagerie\n\nversion: 0.5b\nauthor: Adam Smith\ndate: 16/07/2007\n\nThis theme is based around Vista MCE / MCE with a bit of Menagerie SE thrown in.\nI resently tried the new Vista version and liked the big screen more simple look, so\nI thought I would take some inspiration from it and develop a bigger and simpler\nlooking theme than the show as much as you can sort of screens in Menegerie/SE\n\nThis theme uses Beyond MCE as a base. Thanks to arman68 for his fantastic work\nand for allowing me to benifit from his efforts.\n\nI found this in BeyondMCE''s help file, so I hope arman68 doesn''t mind:\n\n''As I benefited from their work, I would like others to do so, and as such\nyou are free to reuse or modify any portion of this theme'' - Arman68\n\nv0.5b\nChanged: Group and Subgroup screens\nChanged: Media, VBNet, News, Music Library and Now Playing Screens.\nChanged: EPG, TV and OSD screeens\n\nAdded: Support for Icon Manager\nAdded: New options in Customization Manager.\nAdded: New Fonts, Buttons and Background\nAdded: New Sounds', 'Beyond Menagerie', '', '', '', '', '0', '0', 519, 5394, 0, 0, 0, 0, '1aca66706000c1b4c8fb151e3d23e07f', 'FALSE'),
