(589, '{0034C3C9-A21F-449F-BB49-A8C11E4B23E0}', 'EmailMee', 'Other plugins can use this plugin to send Email messages.', '', 'General', 'None', 'Freeware', 'Stable', '2007-07-23 13:34:42', '2.1.0.1', 'walts81', 'joshwalters@gmail.com', 'walts81', '2007', '', 'plugins/{0034C3C9-A21F-449F-BB49-A8C11E4B23E0}/2.1.0.1/stable/EmailMee_2.1.0.1_Stable.mpp', '30050', '', '', '', 2001000001000000000, 1, 'Other plugins can use this plugin to send email messages. \nThis plugin listens for the message "emailmee.send-email"\n\n\nThat message will need a few things attached to it....\n\n\n-----Mandatory Values-----\n\nemail.subject\n\nemail.message\n\n--------------------------\n\n\n\n-----Optional Values-----\n\nemail.to-address\n\nemail.from-address\n\nemail.attachment\n\nemail.format\n\n-------------------------\n\n\n\nemail.to-address and email.attachment can optionally be added to items in an item-list attached to the message for either sending to multiple recipients or sending multiple attachments (or both).\n\n\n\nemail.from-address can be set to anything (as long as it is in standard email address format ex. "someone@someplace.com"). If nothing is entered for email.from-address, "MeediOS.Support@gmail.com" will be used as a default.\n\n\nemail.attachment should be the path to the file\n\nemail.format can be set to either "text" or "html" (default is "text").', 'EmailMee', 'http://www.MeediOS.com/OpenMAID', '', '1.41', '1.41', '0', '1', 1382, 1622, 0, 0, 0, 0, 'dc0331ea820e72f6f3755f4cf5cb94c9', 'FALSE'),
