(670, '{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}', 'WakeMee', 'WOL', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-10 17:14:41', '1.0.0.2', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'paypal.com', '', 'plugins/{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}/1.0.0.2/stable/WakeMee_1.0.0.2_Stable.mpp', '9194', '', '', '', 1000000002000000000, 0, 'For Command Module\nCommand to send  - "Send Custom Command"\nCustom command to send - "wakeme.wol"\nCustom parameters to send - "mac=XX:XX:XX:XX:XX:XX,file=\\\\Server\\FileOnServer.xxx"\n\nThe file is a file on your server to check to see if it''s awake\nmac = the mac address of the server.\n\nThis setup allows you to have multiple command modules to wake up different servers.  This setup doesn''t follow the mac addresses you enter in the full-time plugins settings', 'WakeMee', 'http://www.meedios.com/forum/viewtopic.php?t=1415', '', '', '', '0', '1', 60, 2404, 0, 0, 0, 0, 'abbd33c9ee7de2656b723402ca05626c', 'FALSE'),
(671, '{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}', 'WakeMee', 'WOL', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-10 18:59:44', '1.0.0.3', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'paypal.com', '', 'plugins/{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}/1.0.0.3/stable/WakeMee_1.0.0.3_Stable.mpp', '10949', '', '', '', 1000000003000000000, 0, 'For Command Module\n\nCommand to send  - "Send Custom Command"\n\nCustom command to send - "wakeme.wol"\n\nCustom parameters to send - "mac=XX:XX:XX:XX:XX:XX,file=\\\\Server\\FileOnServer.xxx"\n\nThe file is a file on your server to check to see if it''s awake\nmac = the mac address of the server.\n\nThis setup allows you to have multiple command modules to wake up different servers.  This setup doesn''t follow the mac addresses you enter in the full-time plugins settings\n\nFor the plugin settings - enter as the Server|Mac address - it has to be entered "SERVER|MAC" - for the server name - don''t put any "\\" - just the name', 'WakeMee', 'http://www.meedios.com/forum/viewtopic.php?t=1415', '', '', '', '0', '1', 60, 2404, 0, 0, 0, 0, 'e28e314f031d27d6c937d7c94f1dc93b', 'FALSE'),
(672, '{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}', 'WakeMee', 'WOL', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-10 19:05:45', '1.0.0.4', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'paypal.com', '', 'plugins/{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}/1.0.0.4/stable/WakeMee_1.0.0.4_Stable.mpp', '10972', '', '', '', 1000000004000000000, 0, 'For Command Module\n\nCommand to send  - "Send Custom Command"\n\nCustom command to send - "wakeme.wol"\n\nCustom parameters to send - "mac=XX:XX:XX:XX:XX:XX,file=\\\\Server\\FileOnServer.xxx"\n\nThe file is a file on your server to check to see if it''s awake\nmac = the mac address of the server.\n\nThis setup allows you to have multiple command modules to wake up different servers.  This setup doesn''t follow the mac addresses you enter in the full-time plugins settings\n\nFor the plugin settings - enter as the Server|Mac address - it has to be entered "SERVER|MAC" - for the server name - don''t put any "\\" - just the name', 'WakeMee', 'http://www.meedios.com/forum/viewtopic.php?t=1415', '', '', '', '0', '1', 57, 2404, 0, 0, 0, 0, '96aca8e878c9c96f58f47a2cb1909d13', 'FALSE'),
(673, '{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}', 'OpenMAID', 'An alternative, free, and open Add-in Directory', '', 'Module', 'None', 'Freeware', 'Stable', '2007-09-10 20:08:55', '1.5.3', 'binary64', 'slug@skyforge.net', 'binary64', '2006 binary64', '', 'plugins/{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}/1.5.3/stable/OpenMAID_1.5.3_Stable.mpp', '235846', '', '', '', 1005003000000000000, 0, 'Changes:\n\n1.5.3 (11.Sep.07)\n* Stop fatal crash if a database is down.\n* Handle all databases being download friendily (keep retrying).\n* Now handles the EXIT command, and exits the module. Before, only BACK seemed to worked.\n\n1.5.2.2 (31.May.07)\n* Avoided the problem where updates to plugin option defaults do not happen on upgrade.\n* Changed MeediOS'' OpenMAID URL to the v2 site.\n\n1.5.2.1 (13.Apr.07)\n* Downloads now done on own thread.\n* Made the shopping basket refer by guid only\n* Fix crash when exiting prematurely\n* Allow closing of screen whilst downloading. Downloads will continue and when finished, Meedio will restart ubruptly.\n* Fixed some other bugs\n\n1.5.2 (13.Apr.07)\n* Added new config to enter multiple database locations (in order of download preference)\n* Fixed a crash on exit\n* Progress as plugins are downloaded\n* Fixed timeout issue\n* Merge databases now also merges missing meta tags to show more info\n* Now OpenMAID v2 compatible (using v2''s simple/backcompat api only)\n\n1.5.1 (17.Mar.07)\n* Plugins are now downloaded locally before installing (progress bar is now possible)\n* Support manual rollback; Old versions are now archived in [MEEDIO-DATA]\\OpenMAID\\plugins\\{guid} name (type)\\date time version (state).mpp\n* After installation, Meedio.bat gets executed instead of the .exe (so you can put custom commands in the .bat)\n* If Meedio.bat does not exist, a default one is created (runs Meedio.exe)\n\n1.5.0.1 (15.Mar.07)\n* Small bug fixes\n\n1.5 (15.Mar.07)\n* Changed from using IMeedioItem+List to C# Generics\n* Improved the threading\n* Save Defaults now saves the main view filter (actions in the openmaid.screen have changed)\n\n1.4.0.1 (10.Mar.07)\n* Fixed the assumption that Meedio was installed to C:. Location is now read from registry.\n* You can now jump to a plugin in the list by tapping the first few letters of its Name.\n* Fixed 2 Sort-by-Downloads bugs\n\n1.4 (09.Mar.07)\n* Added 2 caching layers for the views\n* Made startup text ''animated'' as it progresses\n* Added a new view: "Lost" which are plugins you have installed, that aren''t on MAID''s\n* Added a space inbetween version and state\n* Fixed error window showing when exiting module quickly\n* You can now directly Install from the list, without having to enter the Review page\n* Fixed bug if \\images folder didn''t exist\n\n1.3.3.4 (08.Mar.07)\n* Added a new view: "Older" which show plugins on MAID that are older than your installed version. An author uploads a lower version, and it will appear in this view.\n\n1.3.3.3 (08.Mar.07)\n* New and better version parsing Thanks to Darkmoor\n	  \n1.3.3.2 (08.Mar.07)\n* Fixed debug msgbox from popping up\n* Fixed small bug with alpha parsing\n	  \n1.3.3.1 (07.Mar.07)\n* Parse versions with alpha chars (thanks Darkmoor)', 'OpenMAID', '', '', '', '', '0', '1', 503, 4359, 0, 0, 0, 0, '62ec617e0c08b2d409f981ef406a85f8', 'FALSE'),
(674, '{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}', 'WakeMee', 'WOL', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-10 21:38:33', '1.0.0.5', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'paypal.com', '', 'plugins/{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}/1.0.0.5/stable/WakeMee_1.0.0.5_Stable.mpp', '10828', '', '', '', 1000000005000000000, 0, 'For Command Module\n\nCommand to send  - "Send Custom Command"\n\nCustom command to send - "wakeme.wol"\n\nCustom parameters to send - "mac=XX:XX:XX:XX:XX:XX,file=\\\\Server\\FileOnServer.xxx"\n\nThe file is a file on your server to check to see if it''s awake\nmac = the mac address of the server.\n\nThis setup allows you to have multiple command modules to wake up different servers.  This setup doesn''t follow the mac addresses you enter in the full-time plugins settings\n\nFor the plugin settings - enter as the Server|Mac address - it has to be entered "SERVER|MAC" - for the server name - don''t put any "\\" - just the name', 'WakeMee', 'http://www.meedios.com/forum/viewtopic.php?t=1415', '', '', '', '0', '1', 77, 2404, 0, 0, 0, 0, '9ac3bd52e048510d0604e7699ec4de4a', 'FALSE'),
