(1079, '{D5A18D59-C886-4978-B065-DF98EB96C083}', 'SystemCheck', 'A community-driven plugin to help keep your HTPC up to date and in check', '', 'Module', 'None', 'Freeware', 'Beta', '2008-03-08 12:30:52', '0.4.0.2', 'binary64', 'slug@skyforge.net', 'binary64', '2007 MeediOS', '', 'plugins/{D5A18D59-C886-4978-B065-DF98EB96C083}/0.4.0.2/beta/SystemCheck_0.4.0.2_Beta.mpp', '105496', '', '', '', 4000002000000000, 1, 'It is advised to run this module at least once after every time SystemCheck plugin is updated and installed on your system.\n\nTo suggest extra checks/tests/functions, head over to http://www.meedios.com/forum/viewtopic.php?t=662', 'SystemCheck', '', '', '', '', '0', '1', 800, 1696, 0, 0, 0, 0, '3f6225bf59e347b29c2184cc16d35209', 'FALSE'),
(686, '{698A4C72-00C7-4FFB-9817-FD1CA1B9A880}', 'SilenceMee', 'SilenceMee will pause/resume the Meedio music player when you launch selected executables via the Program Module or launch the internal video player.  New feature allows you to restore the music play-state when restarting Meedio.', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-22 07:17:35', '5.8', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{698A4C72-00C7-4FFB-9817-FD1CA1B9A880}/5.8/stable/SilenceMee_5.8_Stable.mpp', '43406', '', '', '', 5008000000000000000, 1, 'SilenceMee will pause/resume the Meedio music player when you use the internal video player or launch any executable via the Program Module (as long as the name of the executable is in the property list).  You do not need to add the path, just the simple name "program.exe" followed by the optional "|#" where # can be 0 (don''t pause music), 1 (pause music before starting program), or 2 (pause music before and resume after).  If you don''t include the optional setting, then it defaults to "2".  List one name per line.\n\nExample:\n\nprogram1.exe|0\nprogram2.com|2\nprogram3.bat|1\nprogram4.exe\n\nNOTE: Program Modules must check off "Wait until program completes" to support resuming of music.\n\nNew to v3.0:\n-You can now choose the Action to perform (pause/stop/clear playlist).\n-SilenceMee can restore the music play-state when restarting Meedio.  Listen to music while playing with themes!\n\nNew to v3.2:\n\n-other plugins can utilize SilenceMee with the following messages, as long as "program" is contained in the SilenceMee list.\n\nsilencemee.activate\n     "program" = value: specifies the program to look for in the SilenceMee list\n\nsilencemee.deactivate   (performs restore action)\n     "program"=value: optional value (not used at this time)\n\n\n\nSilenceMee now shuts down the music player instead of just pausing it.  This should fix problems with audio when using external programs. You must not use the Video Screen setting "Shutdown the music player" if you want to use the resume feature.\n\nNew to v5.0: SilenceMee now uses the internal Meedio save/load playlist commands to store the current music queue in the "SilenceMee.playlist" file (located in the default playlist folder).  The SilenceMee.ini file is now stored in the SilenceMee data directory.\n\nNew to v5.3: added "silencemee.rating" datafeed that can be used to rate songs on any screen with global actions.  See the forum support thread for more info.', 'SilenceMee', '', '', '1.30', '', '0', '1', 3228, 3531, 0, 0, 0, 0, '57bc235142d8cdbf77be5bfe61bdd2b0', 'FALSE'),
(687, '{5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC}', 'ControlMee', 'ControlMee allows you to use your Meedio remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.  Supports a keyboard hook and numeric keyboard.', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-22 07:21:37', '2.4.1', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2007 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{5226DD5F-FFFA-4FBA-ACA8-179CE7445CCC}/2.4.1/stable/ControlMee_2.4.1_Stable.mpp', '210132', '', '', 'readme.html', 2004001000000000000, 1, 'ControlMee allows you to use your Meedio remote to control external applications via key mappings.  Supports import/export of program key maps to make it easy to share.\n\nDirections at: http://controlmee.hargraveusa.com/\n\n*New for v2.1: Added support for a numeric keyboard.  Use the number keys (2...9) to type letters like on your cell phone.  The max delay setting determines how long the plugin will wait between key presses before resetting the key to its initial numeric value.', 'ControlMee', 'http://controlmee.hargraveusa.com/', '', '1.41', '', '0', '1', 1474, 1733, 0, 0, 0, 0, '638a79b7bd5fac090f44086d126cce03', 'FALSE'),
(688, '{266D0793-8D46-4F8F-8851-E35C7F63C783}', 'PlayMee', 'PlayMee is a video player enhancer. It plays media based on user-defined conditions in Meedio or external players. Includes: off-line media support with prompts; auto-play of DVD, SVCD, VCD, any file-type; automatic mounting of images; Intro/Trailer suppo', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-22 07:25:34', '1.6.2', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{266D0793-8D46-4F8F-8851-E35C7F63C783}/1.6.2/stable/PlayMee_1.6.2_Stable.mpp', '1584526', '', '', 'readme.html', 1006002000000000000, 0, 'Directions at http://playmee.hargraveusa.com\n\nPlayMee is a Meedio video player enhancer. It will play media based on user-defined conditions (e.g. file extension or library fields) in any configured player (Meedio internal player or external player). It provides: off-line media support with user-configurable prompts and automatic disc ID recording and validation; auto-play of DVD, SVCD, VCD and any user-defined file-type; automatic mounting and playing of image files using Daemon Tools, Alcohol 120%, or other image mounting software; Intro and Trailer support. \n\nPlayMee allows you to easily use an external video player with Meedio, while using the default Media.Movie.screen file.', 'PlayMee', 'http://playmee.hargraveusa.com/', '', '1.41', '', '0', '1', 4484, 6842, 0, 0, 0, 0, '977697b00cfcbb2c856a6e912945773e', 'FALSE');
