(689, '{CB617265-D200-42C6-A953-64419B470D3A}', 'Respond', 'Respond is an event driven plugin that offers functionality similar to a lite scripting language.  The plugin will listen for user-defined events (such as a video starting to play) and answer with user-defined responses.', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-22 07:27:35', '1.6', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{CB617265-D200-42C6-A953-64419B470D3A}/1.6/stable/Respond_1.6_Stable.mpp', '288771', '', '', '', 1006000000000000000, 1, 'Respond is an event driven plugin that offers functionality similar to a lite scripting language.  The plugin will listen for user-defined events (such as a video starting to play) and answer with user-defined responses.\n\nIncludes two example scripts.  One as a basic replacement for SilenceMee and the other demonstrating volume control within Meedio (lower volume for music and raise volume for video).', 'Respond', 'http://respond.hargraveusa.com/', '', '1.15.31', '', '0', '1', 1069, 1206, 0, 0, 0, 0, '5bc5f43994739473607da73f8ca2f888', 'FALSE'),
(690, '{5B86F572-B15D-4DE1-8589-A900490ED4C8}', 'RS232', 'Control devices via RS232.  You can send a single command or a macro containing many commands.', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-22 07:28:18', '1.2', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2007 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{5B86F572-B15D-4DE1-8589-A900490ED4C8}/1.2/stable/RS232_1.2_Stable.mpp', '296854', '', '', 'readme.html', 1002000000000000000, 1, 'Control devices via RS232.  You can send a single command or a macro containing many commands.\n\nSee http://rs232.hargraveusa.com for directions.', 'RS232', 'http://rs232.hargraveusa.com/', '', '1.15.24', '', '0', '1', 982, 1105, 0, 0, 0, 0, 'f9056070ebbbdba0a9cc2f2dd5e355b1', 'FALSE'),
(691, '{BA67452D-89B5-4A73-B202-18E9BAFA1319}', 'Screensaver+', 'Screensaver+ is a screensaver and slideshow enhancer (randomize it!).  Screensavers can be picture slideshows, datafeed screen files, music visualizations, or external programs.  Automatic slideshows with any media insertion!', '', 'General', 'None', 'Donationware', 'Stable', '2007-09-22 07:29:18', '5.7', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2007 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{BA67452D-89B5-4A73-B202-18E9BAFA1319}/5.7/stable/Screensaver~_5.7_Stable.mpp', '481897', '', '', '', 5007000000000000000, 0, '***If you were using SaveMee, then you need to delete that folder from the plugins/general folder before installing this new version.  Also, you should reselect the screen file folders.***\n\nScreensaver+ is a screensaver and slideshow enhancer (it fully randomizes the slideshow).  Screensavers can be picture slideshows, rotating datafeed screen files, music visualizations, or external programs.  You can cycle or randomize between them.    Automatic slideshows with any media insertion!  Simply insert any type of media (USB key, compact flash card, CD/DVD, etc) and Screensaver+ will start a slideshow if any image files are found on the media.  Automatically run imports with the screensaver.  Set the system screensaver to 1 minute longer than Screensaver+ to provide out-of-Meedio protection.  Run an external program before and/or after the screensaver, or AS the screensaver.\n\nYou can enable/disable Screensaver+ using the Meedio messages:\n\nscreensaver.enable and screensaver.disable\n\nYou can also activate/deactivate Screensaver+ using the Meedio messages:\n\nscreensaver.activate and screensaver.deactivate\n\nscreensaver.full-screen to launch the music visualization in full screen\n\nscreensaver.randomize with random=true,false,toggle to change the current manual picture slideshow mode.\n\nThere is also a screensaver.randomize datafeed that will send two values- order and random.  Use these values to show the currect setting in screen files.\n\nBig thanks to Mattman (-= M@ =-) for the Movies, MoviesWeatherNews, and Showtimes screen file sets!\n\nBig thanks to Dee for the Info screen file set (and 3D flash clock)!\n\nBig thanks to MisterMoonlight for the MovieTimes VBNET screen file set!\n\nYou can make your own .screen files for the screen saver.  Just place them in a separate folder and modify the appropriate "Screen File Folder" property.\n\nExample of using the External Screensaver Program Settings:\n\n1). 3D Flash Clock screensaver played by ZoomPlayer\nProgram: C:\\Program Files\\Zoom Player\\zplayer.exe\nParameters: /F /Q /LOCKFS "{screensaver+}3DClock\\3dc.swf"\n\n2). Windows screensaver\nProgram: C:\\WINDOWS\\system32\\scrnsave.scr\nParameters:\n\n3). Play random music videos (make sure to set the Library Section to the correct location)\nProgram: C:\\Program Files\\Zoom Player\\zplayer.exe\nParameters:/F /Q /LOCKFS "{item_location}"\nThis will cause one random music video to be queued and played.  When Zoom Player finishes playing it and closes, another random music video will be picked and played.  This cycle will continue until the screensaver is deactivated.\n\nIf "Run before screensaver activation?" is checked, then the Program will NOT be used as a screensaver.  It will be used as a pre-screensaver program.\n\nEnable "Run imports while screensaver is active?" if you would like your imports to run when the screensaver activates.  All imports that are scheduled will be run (regardless of how they are scheduled).  All imports set to "Never" will be ignored.  By scheduling your imports to run only during off-hours, you can prevent being disrupted by imports while actively using the system, and still have imports run regularly during "idle" time.', 'Screensaver+', '', '', '1.30', '', '0', '1', 134, 2046, 0, 0, 0, 0, 'e4414b17d6af2a3031e64ed4d02d4784', 'FALSE'),
(692, '{97970EDE-15CE-4C95-9171-37D7F9850EF9}', 'USB-UIRT', 'Use the USB-UIRT with Meedio.  Supports receive only at this time.', '', 'Input', 'None', 'Donationware', 'Stable', '2007-09-22 07:30:21', '4.0', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{97970EDE-15CE-4C95-9171-37D7F9850EF9}/4.0/stable/USB-UIRT_4.0_Stable.mpp', '42027', '', '', '', 4000000000000000000, 1, 'Set the delay and buffer, and then use the Learn button (in Configuration...Input) to map IR codes to Meedio commands.', 'USB-UIRT', '', '', '1.0', '', '0', '1', 871, 1171, 0, 0, 0, 0, 'db14ac0349a9cfe55fc32ba24ff06648', 'FALSE'),
