(702, '{0DD6C935-7FB1-44D3-9F04-3642D0FD909D}', 'J River Importer', 'Importer for J River Media Center', '', 'Import', 'None', 'Freeware', 'Alpha', '2007-09-25 22:56:45', '1.0.2.0', 'stottle', 'stottle@qadas.com', 'stottle', 'Copyright Â© 2006-2007', '', 'plugins/{0DD6C935-7FB1-44D3-9F04-3642D0FD909D}/1.0.2.0/alpha/J_River_Importer_1.0.2.0_Alpha.mpp', '73177', '', '', 'TBD', 1000002000000000000, 0, '1.0 Alpha version of an importer for J River Media Center.\n\nDoes not have the capabilities of JRMC Importer (yet) but it is free!', 'J River Importer', 'http://www.meedios.com/forum/viewtopic.php?t=1443', 'http://www.meedios.com/forum/viewtopic.php?t=1443', '', '', '0', '1', 98, 1073, 0, 0, 0, 0, 'e4fb6915468a0e1e91002f41166e0497', 'FALSE'),
(703, '{43F58163-F0BB-4139-B05F-AB2145F746D6}', 'J River General', 'Catches messages to update J River Media Center database', '', 'General', 'None', 'Freeware', 'Beta', '2007-09-25 23:11:32', '0.0.0.1', 'stottle', 'stottle@qadas.com', 'stottle', 'Copyright Â© 2006-2007', '', 'plugins/{43F58163-F0BB-4139-B05F-AB2145F746D6}/0.0.0.1/beta/J_River_General_0.0.0.1_Beta.mpp', '29992', '', '', 'TBD', 1000000000, 1, '0.0.0.1 Beta', 'J River General', 'TBD', 'TBD', '', '', '0', '1', 364, 851, 0, 0, 0, 0, '0f20926dbfe39a3ff6bfcb7c3874ed96', 'FALSE'),
(704, '{43F58163-F0BB-4139-B05F-AB2145F746D6}', 'J River General', 'Catches messages to update J River Media Center database', '', 'General', 'None', 'Freeware', 'Alpha', '2007-09-25 23:26:56', '1.0.0.0', 'stottle', 'stottle@qadas.com', 'stottle', 'Copyright Â© 2006-2007', '', 'plugins/{43F58163-F0BB-4139-B05F-AB2145F746D6}/1.0.0.0/alpha/J_River_General_1.0.0.0_Alpha.mpp', '15497', '', '', 'TBD', 1000000000000000000, 0, '0.1.0.0 Alpha Version.\n\nThis is a very simple general plugin for use with J River Media Center. \n\nA feature request in the J River Import thread was to enable setting the rating tag (in MC) from Meedio. This is only possible from a general plugin (not an import). So that is what this plugin does. \n\nInstructions: Enable J River General plugin in full-time plugins. Set the library to your MC library (it uses the external ID tag set by the J River Import, so the library must be created by J River Import). When Meedio is running and you are on a screen that sends the "media-module.change-tag" message (the library must be included as a tag), it will update both the Meedio library and the MC library.', 'J River General', 'http://www.meedios.com/forum/viewtopic.php?t=1473', 'http://www.meedios.com/forum/viewtopic.php?t=1473', '', '', '0', '1', 487, 851, 0, 0, 0, 0, 'bd8304abc599f3f322edd59ff39210e4', 'FALSE'),
