(736, '{26C39235-BDCF-4AF9-96F4-8B3CA4493071}', 'meedioVintage', 'Back to the 60''s', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-10-22 13:52:33', '1.5', 'crni', 'N/A', 'crn', '2007', '', 'plugins/{26C39235-BDCF-4AF9-96F4-8B3CA4493071}/1.5/beta/meedioVintage_1.5_Beta.mpp', '9342696', '', '', 'Version.txt', 1005000000000000000, 0, 'Install, set your screen aspect ratio and enjoy !\n\nv1.5 beta\n--------------------------------------------\n- option to change main font - tahoma | arial\n- new music nowplaying screen(s)\n- new nowplaying Fullscreen and FullScreen-popup\n- changing cover image will also change icon in fullscreen and fullscreen-popup\n- meeLyrics support\n- option to show news ticker on main screen \n- option to change ticker skin - globe,rss,vinyl,film\n  recomended color settings for news ticker full-time plugin:\n   font			(white)	255 255 255\n   background	(black)	0 0 0\n   channel		(green)	196 230 115\n   separator	(green)	196 230 115\n- fixed bugs \n- optimized code\n\n1.4 beta  \n--------------------------------------------\n- 12/24h time option\n- option to show weather feed on main screen\n- new nowplaying FullScreen-popup\n- new games screen (set subgroup module to ''games'')\n- alternate media details screen (set movie details to ''movieALT'')\n- added few extra icons\n- fixed bugs \n- optimized code\n\nv1.3 beta  \n--------------------------------------------\n- new media module screen\n- new movie details screen\n- added filmstrip view in media screen\n- added option for 16:10 widescreen monitors\n- added customized splash screen\n- fixed bugs \n- optimized code\n\nv1.2 beta  \n--------------------------------------------\n- fixed bugs \n- optimized code\n- experimental movieNight support (widescreen only)\n\nv1.1 beta  \n--------------------------------------------\n- added new main menu type (list)\n- added new submenu options\n- added Night module support\n- optimized code\n\nv1.0 beta\n--------------------------------------------\ninitial release', 'meedioVintage', 'http://www.meedios.com/forum/viewtopic.php?t=1477', '', '', '', '0', '0', 189, 15783, 0, 0, 0, 0, 'af974b2abfe005e48fc584f6e5978420', 'FALSE'),
(737, '{E455249E-732A-4DB0-B3C9-23F255696C1B}', 'MeeLyrics', 'A Meedio plugin that grabs lyrics from multiple lyrics sites', '', 'General', 'None', 'Donationware', 'Stable', '2007-10-22 21:21:30', '1.0.0.3', 'UFGrayMatter', 'UFGrayMatter@gmail.com', 'UFGrayMatter', 'paypal me! :)', '', 'plugins/{E455249E-732A-4DB0-B3C9-23F255696C1B}/1.0.0.3/stable/MeeLyrics_1.0.0.3_Stable.mpp', '114847', '', '', '', 1000000003000000000, 0, 'Theme Designers:\nSend Message: meelyrics.nextsite to search a different lyric site\nSend Message: meelyrics.savelyrics to save the lyrics to the library', 'MeeLyrics', '', '', '', '', '0', '1', 98, 5435, 0, 0, 0, 0, '3925dab95eb2d91b424b4abdec106ce6', 'FALSE');
