(739, '{AF6CC3BD-8DB6-47FE-B8EC-8B9C0C78706B}', 'Audio Tag Importer', 'Import FLAC, M4A, MPC, OGG, WMA, MP3 and many other audio format tags.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-10-24 09:21:18', '1.2.2.020a', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{AF6CC3BD-8DB6-47FE-B8EC-8B9C0C78706B}/1.2.2.020a/stable/Audio_Tag_Importer_1.2.2.020a_Stable.mpp', '125905', '', '', '', 1002002020000001000, 1, 'Installation Instructions: \nâ€¢ Download and run AudioTagImporter.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the Imports tab for the library you wish to populate \nâ€¢ Add a new import \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select Audio Tag Importer in Choose the plugin to perform the import \nâ€¢ Add one or more folders to scan for audio files to Root folders \nâ€¢ (optional) Configure other options \nâ€¢ (optional) Select a time to run Audio Tag Importer automatically in Schedule this import to run automatically', 'AudioTagImporter', 'http://www.meedios.com/forum/viewtopic.php?t=542', 'http://www.meedios.com/maid/dl.php?plugin={AF6CC3BD-8DB6-47FE-B8EC-8B9C0C78706B}', '', '', '0', '1', 2436, 3715, 0, 0, 0, 0, '8f7ed0f3d9539d3f85033295a5ac4933', 'FALSE'),
