(752, '{01E9E9C3-A55F-4B01-B454-CB49B07E7679}', 'Smart Series Sorter', 'Smartly parses your TV episodes from your largely-unsorted archive; ready for meeTvShows.', '', 'Import', 'None', 'Donationware', 'Beta', '2007-10-27 19:33:17', '3.0.6', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64', '', 'plugins/{01E9E9C3-A55F-4B01-B454-CB49B07E7679}/3.0.6/beta/Smart_Series_Sorter_3.0.6_Beta.mpp', '94112', '', '', '', 3000006000000000000, 0, '1. Use this importer instead of your Tag File Importer or similar.\n			2. Add some sorted directories.\n\n			So if you add "O:\\MySeries", you should also have the following sub-directories\n			in it:\n\n			O:\\MySeries\\Lost\\\n			O:\\MySeries\\4400, The\\\n			etc\n\n			This adds ''Lost'' and ''4400, The'' as your "sorted" or "authorised" series. This will rename episodes such as "the.4400" into "4400, The" for example.\n\n			Hint: the first sorted directory will get all unauthorised series dumped into it (if that option is on.. read on).\n\n			3. Add some dump dirs.\n\n			These directories will contain a whole heap of files - named in radically different formats. All files in dump dirs should be finished downloading.\n\n			4. Perform Moves : NOT IMPLEMENTED. Use the upcoming win32 v2.0 for this for now.\n\n			5. Only import sorted series : if enabled, only series which you have defined by creating a sub-dir inside a sorted dir, will be added to the current section. If disabled, the SeriesName''s generally become erratic and un-uniform.\n\n			6. File exensions : These are files that get parsed, so it will ignore your files such as *.zip in your dump dirs..\n\n			That''s it! I included some delays before and after disk I/O in the hope that it doesn''t interuppt your Meedio viewing experiance.', 'SmartSeriesImporter', 'http://www.skyforge.net/~slug/', '', '', '', '0', '1', 538, 3847, 0, 0, 0, 0, 'eb4d75b8b784825cd06de3eebb1d8905', 'FALSE'),
(753, '{296588A6-6044-4208-BE2A-75CF5E24A2AE}', 'MovieNight', 'Best Movie Module In Town!', '', 'Module', 'None', 'Donationware', 'Stable', '2007-10-27 21:33:43', '2.0.3.0', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'Please PayPal Me :) - Even a couple bucks is great!', '', 'plugins/{296588A6-6044-4208-BE2A-75CF5E24A2AE}/2.0.3.0/stable/MovieNight_2.0.3.0_Stable.mpp', '6367929', '', '', '', 2000003000000000000, 0, 'If you have the old movienight - you need to remove the folder "Meedio\\...\\general\\Movienight"', 'MovieNight', 'http://www.meedios.com/forum/viewtopic.php?p=13937', '', '', '', '0', '1', 369, 15780, 0, 0, 0, 0, '1df5d4b2c246bed58b6f9b2fa9ac5666', 'FALSE'),
