(756, '{798F4DB0-7642-4669-AFED-4379CA7B5546}', 'Webscheduler Captures Importer', 'Imports Webscheduler Video Captures XML info.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-10-28 01:28:58', '2.3', 'John Calvi', 'jcalvi at lewis dot com dot au', 'Calvi', 'John Calvi, 2006/7', '', 'plugins/{798F4DB0-7642-4669-AFED-4379CA7B5546}/2.3/stable/Webscheduler_Captures_Importer_2.3_Stable.mpp', '349698', '', '', 'readme.txt', 2003000000000000000, 0, 'Webscheduler Captures Importer, by John Calvi, Copyright 2006/7.\n\nThis plug-in checks for xml files generated by Webscheduler and if they exist writes the tags into the Meedio Library. This importer should be chained after a standard importer, eg. Task Mask Importer.\nNo special rules are required for the Tag Mask importer and you can still use images etc. All options in the WS Captures importer complement those in the Task Mask importer.\n\n\nRefer Readme.txt File', 'WSCaptures', 'http://mail.lewis.com.au/public/meedio', '', '', '', '0', '0', 212, 851, 0, 0, 0, 0, 'af66d7b43a841319e4f1f35775b07b20', 'FALSE'),
(757, '{B286D9C4-270B-4280-B134-45CECEFD7B69}', 'MetaMeedia', 'Add video and audio information for videofiles', '', 'Import', 'None', 'Donationware', 'Beta', '2007-10-28 04:00:47', '1.5', 'binary64', 'binary64@MeediOS.com', 'binary64', '(c) 2006 binary64 @ MeediOS. Please donate! For commerical usage contact author.', '', 'plugins/{B286D9C4-270B-4280-B134-45CECEFD7B69}/1.5/beta/MetaMeedia_1.5_Beta.mpp', '698898', '', '', '', 1005000000000000000, 0, 'Requires .NET 2.0 and Mencoder installed.\n\n			Currently grabs the following tags for video files that mencoder recognises:-\n\n			video_Codec (string)\n			video_Resolution (pixels)\n			video_ColorDepth (bpp)\n			video_FrameRate (fps)\n			video_DataRate (kbps)\n			audio_Codec (string)\n			audio_SampleRate (hz)\n			audio_Channels (double)\n			audio_Profile (string)\n			audio_DataRate (kbps)\n\n			Currently grabs the following tags for audio files:-\n			NONE YET', 'MetaMeedia', 'http://www.MeediOS.com/', '', '', '', '0', '1', 375, 1588, 0, 0, 0, 0, 'dc08661680bf83a7371dab3808441a62', 'FALSE'),
(758, '{26C39235-BDCF-4AF9-96F4-8B3CA4493071}', 'meedioVintage', 'Back to the 60''s', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-10-28 19:27:54', '1.6', 'crni', 'N/A', 'crn', '2007', '', 'plugins/{26C39235-BDCF-4AF9-96F4-8B3CA4493071}/1.6/beta/meedioVintage_1.6_Beta.mpp', '9699962', '', '', 'Version.txt', 1006000000000000000, 0, 'Install, set your screen aspect ratio and enjoy !\n\nv1.6 beta\n--------------------------------------------\n- new media module screen \n- new movie details screen\n- new music library screens\n- new pictures screens\n- option to toggle albums captions in music library module\n- option to toggle pics captions in pictures module\n- updated movieNight screen\n- fixed translations in most of the screens\n- fixed bugs \n- optimized code\n\nv1.5 beta\n--------------------------------------------\n- option to change main font (tahoma , arial)\n- new music nowplaying screen(s)\n- new music fullscreen and fullScreen-popup\n- meeLyrics support\n- option to show news ticker on main screen\n- option to adjust ticker position for different screen resolutions \n- option to change ticker skin - globe,rss,vinyl,film\n- fixed bugs \n- optimized code\n- changing cover image will also change icon in fullscreen and fullscreen-popup\n- recomended RGB color settings for news ticker full-time plugin\n  font (white) - 255 255 255\n  background (black) - 0 0 0\n  channel (vintage green) - 196 230 115\n  separator (vintage green) - 196 230 115\n\n1.4 beta  \n--------------------------------------------\n- 12/24h time option\n- option to show weather feed on main screen\n- new nowplaying FullScreen-popup\n- new games screen (set subgroup module to ''games'')\n- alternate media details screen (set movie details to ''movieALT'')\n- added few extra icons\n- fixed bugs \n- optimized code\n\nv1.3 beta  \n--------------------------------------------\n- new media module screen\n- new movie details screen\n- added filmstrip view in media screen\n- added option for 16:10 widescreen monitors\n- added customized splash screen\n- fixed bugs \n- optimized code\n\nv1.2 beta  \n--------------------------------------------\n- fixed bugs \n- optimized code\n- experimental movieNight support (widescreen only)\n\nv1.1 beta  \n--------------------------------------------\n- added new main menu type (list)\n- added new submenu options\n- added Night module support\n- optimized code\n\nv1.0 beta\n--------------------------------------------\ninitial release', 'meedioVintage', 'http://www.meedios.com/forum/viewtopic.php?t=1477', '', '', '', '0', '0', 192, 15783, 0, 0, 0, 0, 'ac589d111d3998bb45ed9491b5a9edaa', 'FALSE'),
