(775, '{CB23072B-8C5B-4987-AA71-F6CD8A38C8EA}', 'meeMusicVideosII', 'A media module for playing music videos.', '', 'Module', 'None', 'Freeware', 'Beta', '2007-11-04 10:18:36', '2.0.2', 'dncenter', 'support@meedios.com', 'dncenter', 'None', '', 'plugins/{CB23072B-8C5B-4987-AA71-F6CD8A38C8EA}/2.0.2/beta/meeMusicVideosII_2.0.2_Beta.mpp', '209428', '', '', 'meeMusicVideosII.rtf', 2000002000000000000, 0, 'This module plugin allows you to create, play, save, and load playlists for video files.  Also included are functions to generate a playlist of random videos, etc.', 'meeMusicVideosII', 'http://www.meedios.com/forum/viewtopic.php?t=1157&highlight=official+thread+meemusicvideosii', '', '', '', '0', '1', 362, 2199, 0, 0, 0, 0, '1776bb3e5f07721e83b49e0a2a9e0d17', 'FALSE'),
