(793, '{26C39235-BDCF-4AF9-96F4-8B3CA4493071}', 'meedioVintage', 'Back to the 60''s', '', 'Theme', 'None', 'Freeware', 'Beta', '2007-11-12 13:03:57', '1.8', 'crni', 'N/A', 'crn', '2007', '', 'plugins/{26C39235-BDCF-4AF9-96F4-8B3CA4493071}/1.8/beta/meedioVintage_1.8_Beta.mpp', '13619414', '', '', 'Version.txt', 1008000000000000000, 0, 'Install, set your screen aspect ratio and enjoy !\n\nv1.8 beta\n--------------------------------------------\n- e-mail notification on main screen \n- more icons\n- more toolbar icons\n- redesigned ticker\n- added toggle ticker switch on main screen\n- recomended RGB color settings for news ticker full-time plugin\n	font (white) - 255 255 255\n	background1  - 0 0 0 \n	background2  - 54 62 64 (list)\n	background2  - 17 26 27 (dock)\n	channel (vintage green) - 196 230 115\n	separator (vintage green) - 196 230 115\n\n- my Movies support\n- weathered support\n- speech control support (SpeechCommand plugin)\n- RSS news module support \n- E-mail module support\n- meedio Internet browser support\n\n- new commands for nowplaying fullscreen\n	up, channelUP - prev vis\n	down, channelDOWN - next vis\n	select, info, display - toggle nowplaying info\n	\n- fixed bugs \n- optimized code\n\nv1.7 beta\n--------------------------------------------\n- new backgrounds (1920x1080)\n- icon manager support for backgrounds\n- option to set dock size (small, medium, large)\n- options to set subgroup using ''alternate screen'' option in configuration panel\n	subgroup\n	subgroup-grid\n	subgroup-dock\n\n- IMDb support in media screens	\n- added watched button in media screens\n- Enhanced Media Module (EMM) support \n	EnhancedMedia \n	EnhancedMovie\n	\n- options to toggle buttons in EMM module\n	play all\n	play next\n	play random\n	update library\n	delete item\n	\n- fixed Media and enhancedMedia screens to support multiple views\n- changed MOVIESMAX to MOVIES\n- available views in media library :\n	view\n	index\n	movies (ex moviesmax)\n	large-movies\n	movie-details\n	\n- available views in music library :\n	list\n	view\n	index\n	images\n	list-tracks\n	album-tracks\n\n- fixed bugs \n- optimized code\n\nv1.6 beta\n--------------------------------------------\n- new media module screen \n- new movie details screen\n- new music library screens\n- new pictures screens\n- option to toggle albums captions in music library module\n- option to toggle pics captions in pictures module\n- updated movieNight screen\n- fixed translations in most of the screens\n- fixed bugs \n- optimized code\n\nv1.5 beta\n--------------------------------------------\n- option to change main font (tahoma , arial)\n- new music nowplaying screen(s)\n- new music fullscreen and fullScreen-popup\n- meeLyrics support\n- option to show news ticker on main screen\n- option to adjust ticker position for different screen resolutions \n- option to change ticker skin - globe,rss,vinyl,film\n- fixed bugs \n- optimized code\n- changing cover image will also change icon in fullscreen and fullscreen-popup\n- recomended RGB color settings for news ticker full-time plugin\n  font (white) - 255 255 255\n  background1  - 0 0 0 \n  background2  - 54 62 64 (list)\n  background2  - 17 26 27 (dock)\n  channel (vintage green) - 196 230 115\n  separator (vintage green) - 196 230 115\n\n1.4 beta  \n--------------------------------------------\n- 12/24h time option\n- option to show weather feed on main screen\n- new nowplaying FullScreen-popup\n- new games screen (set subgroup module to ''games'')\n- alternate media details screen (set movie details to ''movieALT'')\n- added few extra icons\n- fixed bugs \n- optimized code\n\nv1.3 beta  \n--------------------------------------------\n- new media module screen\n- new movie details screen\n- added filmstrip view in media screen\n- added option for 16:10 widescreen monitors\n- added customized splash screen\n- fixed bugs \n- optimized code\n\nv1.2 beta  \n--------------------------------------------\n- fixed bugs \n- optimized code\n- experimental movieNight support (widescreen only)\n\nv1.1 beta  \n--------------------------------------------\n- added new main menu type (list)\n- added new submenu options\n- added Night module support\n- optimized code\n\nv1.0 beta\n--------------------------------------------\ninitial release', 'meedioVintage', 'http://www.meedios.com/forum/viewtopic.php?t=1477', '', '', '', '0', '0', 468, 15783, 0, 0, 0, 0, 'ed2a84c20a14141a39215f174c153d1c', 'FALSE'),
