(843, '{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}', 'WakeMee', 'WOL', '', 'General', 'None', 'Donationware', 'Stable', '2007-12-10 18:15:32', '1.0.1.1', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'paypal.com', '', 'plugins/{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}/1.0.1.1/stable/WakeMee_1.0.1.1_Stable.mpp', '13839', '', '', '', 1000001001000000000, 0, 'For Command Module\n\nCommand to send  - "Send Custom Command"\n\nCustom command to send - "wakeme.wol"\n\nCustom parameters to send - "mac=XX:XX:XX:XX:XX:XX,file=\\\\Server\\FileOnServer.xxx"\n\nThe file is a file on your server to check to see if it''s awake\nmac = the mac address of the server.\n\nThis setup allows you to have multiple command modules to wake up different servers.  This setup doesn''t follow the mac addresses you enter in the full-time plugins settings\n\nFor the plugin settings - enter as the Server|Mac address - it has to be entered "SERVER|MAC" - for the server name - don''t put any "\\" - just the name', 'WakeMee', 'http://www.meedios.com/forum/viewtopic.php?t=1415', '', '', '', '0', '1', 208, 2404, 0, 0, 0, 0, '0d8d4707b3cce2fbe8d95345b2b571a5', 'FALSE'),
