(872, '{A0D49F1C-BC9B-4593-A0DA-009F3853E2D4}', 'TVNight Importer', 'Download series, season, and episode information and banners from http://thetvdb.com/.', '', 'Import', 'None', 'Freeware', 'Stable', '2007-12-19 09:21:23', '1.0.0.3', 'Darkmoor', 'ger@ger.dhs.org', 'Darkmoor', 'Copyright Â© 2006-2007', '', 'plugins/{A0D49F1C-BC9B-4593-A0DA-009F3853E2D4}/1.0.0.3/stable/TVNight_Importer_1.0.0.3_Stable.mpp', '85303', '', '', '', 1000000003000000000, 0, 'Installation Instructions: \nDownload and Installation \nâ€¢ Download and run TVNight_Importer.mpp \nâ€¢ In the Media Library tab of the Meedio Configuration window, select the Imports tab for the library you wish to populate \nâ€¢ Add a new import \nConfiguration \nGeneric Import Settings \nâ€¢ (optional) Rename your import in Enter a name for this import \nâ€¢ Select TVNight Importer in Choose the plugin to perform the import \nTV ''Series'' Library Settings \nâ€¢ Select the library in which you wish to store series details in Series Information Library (Never set this to the library from which you are running the importer) \nTV ''Archive'' Library Settings \nâ€¢ Type the name of the tag containing series names in Series name tag (Never set this to meeTVshows-Series or Name) \nâ€¢ Type the name of the tag containing episode numbers in Episode number tag (Never set this to Name) \nâ€¢ Type the name of the tag containing season numbers in Season number tag (Never set this to Name) \nâ€¢ (optional) Type the name of the tag containing episode names in Episode name tag (Never set this to EpisodeNameAKA or Name) \nâ€¢ (optional) Type the name of the tag containing absolute episode numbers in Absolute (anime) episode number tag (For use with anime-style episode numbering) (Never set this to Name) \nâ€¢ (optional) Type the name of the tag containing original air dates in Original broadcast date tag (Never set this to FirstAired or Name) \nImage Settings \nâ€¢ Select the folder in which you''d like to store series banners in Banner Storage Folder \nâ€¢ Select the folder in which you''d like to store season images in Season Image Storage Folder \nâ€¢ (optional) Select the folder in which you''d like to store episode thumbnails in Episode Thumbnail Storage Folder \nAdvanced Settings \nâ€¢ (optional) To configure advanced settings click the â€¦ button in Advanced Configuration Options \nAdvanced Configuration Options \nTV ''Archive'' Library Settings \nâ€¢ (optional) Type an episode number delimiter character in Single Episode Delimiter (This character is used to denote more than one single episode number, e.g. 1,3) \nâ€¢ (optional) Type an episode number delimiter character in Episode Range Delimiter (This character is used to denote an inclusive range of episode numbers, e.g. 5-7) \nSeries And Episode Import Settings \nâ€¢ (optional) Select a series import method in Series import method \nâ€¢ (optional) Select the first method to try when attempting to locate an episode''s TVdbID in First TVdbID method \nâ€¢ (optional) Select the second method to try when attempting to locate an episode''s TVdbID in Second TVdbID method \nâ€¢ (optional) Select the third method to try when attempting to locate an episode''s TVdbID in Third TVdbID method \nâ€¢ (optional) Select the fourth method to try when attempting to locate an episode''s TVdbID in Fourth TVdbID method \nSeries Banner Download Settings \nâ€¢ (optional) Select a series banner import method in Series banner import method \nâ€¢ (optional) Exclude blank-type series banners by checking Exclude blank series banners \nâ€¢ (optional) Exclude graphical-type series banners by checking Exclude graphical series banners \nâ€¢ (optional) Exclude text-type series banners by checking Exclude text series banners \nSeason Image Download Settings \nâ€¢ (optional) Select a season image import method in Season image import method \nâ€¢ (optional) Exclude DVD cover-type season images by clicking Exclude DVD cover season images? \nâ€¢ (optional) Exclude wide-type season images by clicking Exclude wide season images? \nItem Name Settings \nâ€¢ (optional) Enable Rename library item "Name"? and type a renaming mask in Library item "Name" naming convention (e.g. {SeriesName}: {EpisodeName}) \nâ€¢ (optional) Type one or more Find|Replace pairs in Library item "Name" find|replace (e.g. .hack__|.hack//) \nRetry, Timeout, and Reimport Settings \nâ€¢ (optional) Type a number of times to retry failed connections to tvdb.zsori.com in Timeout Retries \nâ€¢ (optional) Type a number of seconds to display each selection popup window in Seconds for Prompt Display (Setting this option to 0 will automatically select the default option without user intervention) \nâ€¢ (optional) Type a number of days to wait between attempts at updating existing episode information in Days Between Episode Reimport (Setting this option to -1 will disable episode information updates, 0 will attempt to update episode information every time the importer runs, 1+ will wait the specified number of days between update attempts; N.b. new items will always be updated, regardless of what this option is set to--this option only applies to attempts to find changed episode information) \nSeries / Archive Library Relationship Settings \nâ€¢ (optional) Select a rebuild method in Rebuild series library? to rebuild your series identification tags (No: no action will be taken; Verify: blank tags will be populated; Overwrite: All tags will be reset and populated) \nâ€¢ (optional) Select a rebuild method in Rebuild series linkages? to rebuild your episode-to-series linking tags (No: no action will be taken; Verify: blank tags will be populated; Overwrite: All tags will be reset and populated) \nDebugging \nâ€¢ (optional) Enable logging by checking Write debug log? (This is only recommended if you are having a problem with the importer, as the log files can become very large, very quickly)', 'TVNight_Importer', 'http://www.meedios.com/forum/viewtopic.php?t=627', 'http://www.meedios.com/maid/dl.php?plugin_id={A0D49F1C-BC9B-4593-A0DA-009F3853E2D4}', '', '', '0', '1', 203, 11585, 0, 0, 0, 0, '6834341cf45b23a68789d16d3a10458c', 'FALSE'),
