(977, '{ADA0235A-4DD7-4656-B0A9-C01ED61CDDC4}', 'CoverMee', 'Download coverart from diffrent sites', '', 'Module', 'None', 'Donationware', 'Stable', '2008-01-03 17:19:01', '1.6.8', 'Anders Malmgren', 'anders.malmgren@dac.se', 'CyberVillain', '2006 Dac Ltd', '', 'plugins/{ADA0235A-4DD7-4656-B0A9-C01ED61CDDC4}/1.6.8/stable/CoverMee_1.6.8_Stable.mpp', '859745', '', '', '', 1006008000000000000, 0, 'Download coverart from diffrent sites. Includes Amazon,google, ImpAwards,BoxCovers and MovieCovers plugins. Also includes doc''s on howto create your own .Net Plugin.', 'CoverMee', '', '', '', '', '0', '1', 1550, 4609, 0, 0, 0, 0, '45148133b3e29a186fbcde2ebacfc40c', 'FALSE'),
(978, '{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}', 'WakeMee', 'WOL', '', 'General', 'None', 'Donationware', 'Stable', '2008-01-05 23:34:04', '1.0.1.2', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'paypal.com', '', 'plugins/{9C1AEE03-0114-437C-9B44-0AC60E92BA2E}/1.0.1.2/stable/WakeMee_1.0.1.2_Stable.mpp', '14105', '', '', '', 1000001002000000000, 1, 'For Command Module\n\nCommand to send  - "Send Custom Command"\n\nCustom command to send - "wakeme.wol"\n\nCustom parameters to send - "mac=XX:XX:XX:XX:XX:XX,file=\\\\Server\\FileOnServer.xxx"\n\nThe file is a file on your server to check to see if it''s awake\nmac = the mac address of the server.\n\nThis setup allows you to have multiple command modules to wake up different servers.  This setup doesn''t follow the mac addresses you enter in the full-time plugins settings\n\nFor the plugin settings - enter as the Server|Mac address - it has to be entered "SERVER|MAC" - for the server name - don''t put any "\\" - just the name', 'WakeMee', 'http://www.meedios.com/forum/viewtopic.php?t=1415', '', '', '', '0', '1', 1102, 2404, 0, 0, 0, 0, 'd907885759c7333e61ce9557d71fe8bd', 'FALSE'),
(979, '{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', 'Perception', 'Theme based on the Sunrise/Dawn theme included with Meedio.  This is just the beginning.', '', 'Theme', '', 'Freeware', 'Beta', '2008-01-07 13:14:15', '1.0', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}/1.0/beta/Perception_1.0_Beta.mpp', '16494457', '', '', '', 1000000000000000000, 0, 'This is just a really clean theme.  It doesn''t have all the extra bells and whistles as others do.  It is not tested with all modules.\n\n.04 Updates as of 01/07/08\n-add desktop wallpaper in Perception/Wallpaper folder (standard and widescreen)\n-changed color of background just a little (took the purple out)\n-added higher resolution background\n-added icons\n\nI would like to thank Freeman from Deviatart for his wallpaper. http://iamfreeman.deviantart.com/art/The-Abyss-38670535\n-changed movienight thumbnail view\n-add movienight.screen\n-fixed group screen code\n-updated weather icons\n-fixed weather screen again\n-updated navigation sounds', 'Perception', 'http://www.meedios.com/forum/viewtopic.php?t=1939', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 100, 4144, 0, 0, 0, 0, '95b8db70e2514e0fab8c2bf54e802d47', 'FALSE');
