(980, '{FF3A8AF4-D426-43A4-8E99-4A735D468FFA}', 'LaunchVideosSearch', 'Searches Yahoo Launch Videos', '', 'Module', 'None', 'Freeware', 'Beta', '2008-01-07 17:08:30', '2.0.4', 'dncneter', 'support@meedios.com', 'dncenter', 'None', '', 'plugins/{FF3A8AF4-D426-43A4-8E99-4A735D468FFA}/2.0.4/beta/LaunchVideosSearch_2.0.4_Beta.mpp', '540351', '', '', 'LaunchVideoSearch.rtf', 2000004000000000000, 1, 'Searches the Yahoo Launch Videos web site.\nPlay the videos or add it to a library.', 'LaunchVideoSearch', 'http://www.meedios.com/forum/viewtopic.php?t=1156&highlight=official+thread+launchvideosearch', '', '', '', '0', '1', 4811, 7925, 0, 0, 0, 0, '7f1fa8f5ebd6988a680273182103ddfe', 'FALSE'),
