(982, '{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', 'Perception', 'Theme based on the Sunrise/Dawn theme included with Meedio.  This is just the beginning.', '', 'Theme', '', 'Freeware', 'Beta', '2008-01-11 14:29:12', '1.1', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}/1.1/beta/Perception_1.1_Beta.mpp', '16491042', '', '', '', 1001000000000000000, 0, '1.1\n-changed main font color to white\n-added weather on group.screen\n-added album cover to group.screen\n-changed selection bar color\n\n\n1.0\n-add desktop wallpaper in Perception/Wallpaper folder (standard and widescreen)\n-changed color of background just a little (took the purple out)\n-added higher resolution background\n-added icons\n-changed movienight thumbnail view\n-add movienight.screen\n-fixed group screen code\n-updated weather icons\n-fixed weather screen again\n-updated navigation sounds\n\nI would like to thank Freeman from Deviatart for his wallpaper. http://iamfreeman.deviantart.com/art/The-Abyss-38670535\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in  your Meedio Configuration.  Select datafeeds server and make sure both boxes are checked. Open "datafeeds edittor" and add "Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save as "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your full-time plug-ins. Enjoy!', 'Perception', 'http://www.meedios.com/forum/viewtopic.php?t=1939', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 75, 4144, 0, 0, 0, 0, 'f4966b2c78e63d72c6da28a3c7405b25', 'FALSE'),
(983, '{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', 'Perception', 'Theme based on the Sunrise/Dawn theme included with Meedio.  This is just the beginning.', '', 'Theme', '', 'Freeware', 'Beta', '2008-01-11 15:41:25', '1.2', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}/1.2/beta/Perception_1.2_Beta.mpp', '16348645', '', '', '', 1002000000000000000, 0, '1.2\n-fixed theme settings page\n\n1.1\n-changed main font color to white\n-added weather on group.screen\n-added album cover to group.screen\n-changed selection bar color\n-changed flood weather icon\n\n\n1.0\n-add desktop wallpaper in Perception/Wallpaper folder (standard and widescreen)\n-changed color of background just a little (took the purple out)\n-added higher resolution background\n-added icons\n-changed movienight thumbnail view\n-add movienight.screen\n-fixed group screen code\n-updated weather icons\n-fixed weather screen again\n-updated navigation sounds\n\nI would like to thank Freeman from Deviatart for his wallpaper. http://iamfreeman.deviantart.com/art/The-Abyss-38670535\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in  your Meedio Configuration.  Select datafeeds server and make sure both boxes are checked. Open "datafeeds edittor" and add "Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save as "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your full-time plug-ins. Enjoy!', 'Perception', 'http://www.meedios.com/forum/viewtopic.php?t=1939', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 89, 4144, 0, 0, 0, 0, 'fbe1f6e6de24870f9cc46d636dccca4c', 'FALSE'),
(984, '{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', 'Perception', 'Theme based on the Sunrise/Dawn theme included with Meedio.  This is just the beginning.', '', 'Theme', '', 'Freeware', 'Beta', '2008-01-12 12:42:29', '1.3', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}/1.3/beta/Perception_1.3_Beta.mpp', '16347570', '', '', '', 1003000000000000000, 0, '1.3\n-fixed black-fill problem in 1.2\n\n1.2\n-fixed theme settings page\n\n1.1\n-changed main font color to white\n-added weather on group.screen\n-added album cover to group.screen\n-changed selection bar color\n-changed flood weather icon\n\n\n1.0\n-add desktop wallpaper in Perception/Wallpaper folder (standard and widescreen)\n-changed color of background just a little (took the purple out)\n-added higher resolution background\n-added icons\n-changed movienight thumbnail view\n-add movienight.screen\n-fixed group screen code\n-updated weather icons\n-fixed weather screen again\n-updated navigation sounds\n\nI would like to thank Freeman from Deviatart for his wallpaper. http://iamfreeman.deviantart.com/art/The-Abyss-38670535\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in  your Meedio Configuration.  Select datafeeds server and make sure both boxes are checked. Open "datafeeds edittor" and add "Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save as "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your full-time plug-ins. Enjoy!\n\nVisit http://www.meedios.com/forum/viewtopic.php?t=1939 for discussion and pictures of this theme.  Also report any problems to the forum.  Thanks.', 'Perception', 'http://www.meedios.com/forum/viewtopic.php?t=1939', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 100, 4144, 0, 0, 0, 0, 'c6ff6ae2fefe26d0e4f195dce2626ded', 'FALSE'