(985, '{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', 'Perception', 'Theme based on the Sunrise/Dawn theme included with Meedio.  This is just the beginning.', '', 'Theme', '', 'Freeware', 'Beta', '2008-01-13 00:31:32', '1.4', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}/1.4/beta/Perception_1.4_Beta.mpp', '16355722', '', '', '', 1004000000000000000, 0, '1.4\n-fixed theme settings page again (not sure why it was messed up)\n-fixed text in Pictures view\n\n1.3\n-fixed black-fill problem in 1.2\n\n1.2\n-fixed theme settings page\n\n1.1\n-changed main font color to white\n-added weather on group.screen\n-added album cover to group.screen\n-changed selection bar color\n-changed flood weather icon\n\n\n1.0\n-add desktop wallpaper in Perception/Wallpaper folder (standard and widescreen)\n-changed color of background just a little (took the purple out)\n-added higher resolution background\n-added icons\n-changed movienight thumbnail view\n-add movienight.screen\n-fixed group screen code\n-updated weather icons\n-fixed weather screen again\n-updated navigation sounds\n\nI would like to thank Freeman from Deviatart for his wallpaper. \n\nhttp://iamfreeman.deviantart.com/art/The-Abyss-38670535\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in  your Meedio Configuration.  \n\nSelect datafeeds server and make sure both boxes are checked. Open "datafeeds edittor" and add \n\n"Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save \n\nas "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your \n\nfull-time plug-ins. Enjoy!\n\nVisit http://www.meedios.com/forum/viewtopic.php?t=1939 for discussion and pictures of this theme.  Also \n\nreport any problems to the forum.  Thanks.', 'Perception', 'http://www.meedios.com/forum/viewtopic.php?t=1939', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 188, 4144, 0, 0, 0, 0, 'cee4a8cfcf6b1b5b275d3fe358486997', 'FALSE'),
(986, '{296588A6-6044-4208-BE2A-75CF5E24A2AE}', 'MovieNight', 'Best Movie Module In Town!', '', 'Module', 'None', 'Donationware', 'Stable', '2008-01-14 20:42:43', '2.0.4.8', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'Please PayPal Me :) - Even a couple bucks is great!', '', 'plugins/{296588A6-6044-4208-BE2A-75CF5E24A2AE}/2.0.4.8/stable/MovieNight_2.0.4.8_Stable.mpp', '4763776', '', '', '', 2000004008000000000, 0, 'If you have the old movienight - you need to remove the folder "Meedio\\...\\general\\Movienight"', 'MovieNight', 'http://www.meedios.com/forum/viewtopic.php?p=13937', '', '', '', '0', '1', 310, 15780, 0, 0, 0, 0, '1af6758bac53582df4a3f2c568e2f7d0', 'FALSE'),
(987, '{26C39235-BDCF-4AF9-96F4-8B3CA4493071}', 'meedioVintage', 'Back to the 60''s', '', 'Theme', '', 'Freeware', 'Beta', '2008-01-16 07:46:28', '1.9.6', 'crni', 'N/A', 'crn', '2007', '', 'plugins/{26C39235-BDCF-4AF9-96F4-8B3CA4493071}/1.9.6/beta/meedioVintage_1.9.6_Beta.mpp', '13000810', '', '', 'Version.txt', 1009006000000000000, 0, 'Install, set your screen aspect ratio and enjoy !\n\nv1.9.6 beta\n--------------------------------------------\n- updated MovieNight (support for actors pics)\n- added option to remove ticker ON/OFF button from main screen\n- fixed list view in pictures screen\n- fixed visualization menu in nowplaying screen\n- adjusted default font size to improve readability\n\nv1.9.5 beta\n--------------------------------------------\n- support for ratings in music library\n- support for ratings in nowplaying screen\n- use 0-5 buttons on the remote to set ratings\n\n   0 = clear rating\n   1 = poor\n   2 = fair\n   3 = good\n   4 = very good\n   5 = excellent\n   \n- optimized code\n- fixed bugs\n\nv1.9.4 beta\n--------------------------------------------\n- tagedit support\n- fixed ''low res'' bug in MN and TVN screens\n- optimized code\n- fixed bugs\n\nv1.9.3 beta\n--------------------------------------------\n- fixed translations (tnx to paatus)\n- updated media and EMM movie details screens\n- updated file browser and music file browser screens\n- redid myMovies screens\n- optimized code\n- fixed bugs \n\nv1.9.2 beta\n--------------------------------------------\n- fixed toolbars in MovieNight and TVNight\n- updated meeTV Shows screen\n- optimized code\n- fixed bugs \n\nv1.9.1 beta\n--------------------------------------------\n- bug fix release\n\nv1.9 beta\n--------------------------------------------\n- redesigned MovieNight and TVNight screens\n- redesigned nowplaying screen\n- redesigned meeMusic Jukebox screen\n- redesigned meeTVshows screen\n- redesigned Video player screen\n\n- option to toggle e-mail notification on main screen \n- pop3-feed plugin no more needed for mail notification	\n  (email notification based on E-mail library)\n\n- more toolbar buttons  \n- toolbar button caption in subtitle\n- added small-movies mode in media screens\n- option to set favorites in movies library\n- option to choose default browser \n- Launch Videos support\n- Meedi-YouTube support\n- EPG and TV screens by AdamSmith\n- movietimesVBNet screen by AdamSmith\n\n- fixed bugs \n- optimized code\n\nv1.8 beta\n--------------------------------------------\n- e-mail notification on main screen \n- more icons\n- more toolbar icons\n- redesigned ticker\n- added toggle ticker switch on main screen\n- recomended RGB color settings for news ticker full-time plugin\n	font (white) - 255 255 255\n	background1  - 0 0 0 \n	background2  - 54 62 64 (list)\n	background2  - 17 26 27 (dock)\n	channel (vintage green) - 196 230 115\n	separator (vintage green) - 196 230 115\n\n- my Movies support\n- weathered support\n- speech control support (SpeechCommand plugin)\n- RSS news module support \n- E-mail module support\n- meedio Internet browser support\n\n- new commands for nowplaying fullscreen\n	up, channelUP - prev vis\n	down, channelDOWN - next vis\n	select, info, display - toggle nowplaying info\n	\n- fixed bugs \n- optimized code\n\nv1.7 beta\n--------------------------------------------\n- new backgrounds (1920x1080)\n- icon manager support for backgrounds\n- option to set dock size (small, medium, large)\n- options to set subgroup using ''alternate screen'' option in configuration panel\n	subgroup\n	subgroup-grid\n	subgroup-dock\n\n- IMDb support in media screens	\n- added watched button in media screens\n- Enhanced Media Module (EMM) support \n	EnhancedMedia \n	EnhancedMovie\n	\n- options to toggle buttons in EMM module\n	play all\n	play next\n	play random\n	update library\n	delete item\n	\n- fixed Media and enhancedMedia screens to support multiple views\n- changed MOVIESMAX to MOVIES\n- available views in media library :\n	view\n	index\n	movies (ex moviesmax)\n	large-movies\n	movie-details\n	\n- available views in music library :\n	list\n	view\n	index\n	images\n	list-tracks\n	album-tracks\n\n- fixed bugs \n- optimized code\n\nv1.6 beta\n--------------------------------------------\n- new media module screen \n- new movie details screen\n- new music library screens\n- new pictures screens\n- option to toggle albums captions in music library module\n- option to toggle pics captions in pictures module\n- updated movieNight screen\n- fixed translations in most of the screens\n- fixed bugs \n- optimized code\n\nv1.5 beta\n--------------------------------------------\n- option to change main font (tahoma , arial)\n- new music nowplaying screen(s)\n- new music fullscreen and fullScreen-popup\n- meeLyrics support\n- option to show news ticker on main screen\n- option to adjust ticker position for different screen resolutions \n- option to change ticker skin - globe,rss,vinyl,film\n- fixed bugs \n- optimized code\n- changing cover image will also change icon in fullscreen and fullscreen-popup\n- recomended RGB color settings for news ticker full-time plugin\n  font (white) - 255 255 255\n  background1  - 0 0 0 \n  background2  - 54 62 64 (list)\n  background2  - 17 26 27 (dock)\n  channel (vintage green) - 196 230 115\n  separator (vintage green) - 196 230 115\n\n1.4 beta  \n--------------------------------------------\n- 12/24h time option\n- option to show weather feed on main screen\n- new nowplaying FullScreen-popup\n- new games screen (set subgroup module to ''games'')\n- alternate media details screen (set movie details to ''movieALT'')\n- added few extra icons\n- fixed bugs \n- optimized code\n\nv1.3 beta  \n--------------------------------------------\n- new media module screen\n- new movie details screen\n- added filmstrip view in media screen\n- added option for 16:10 widescreen monitors\n- added customized splash screen\n- fixed bugs \n- optimized code\n\nv1.2 beta  \n--------------------------------------------\n- fixed bugs \n- optimized code\n- experimental movieNight support (widescreen only)\n\nv1.1 beta  \n--------------------------------------------\n- added new main menu type (list)\n- added new submenu options\n- added Night module support\n- optimized code\n\nv1.0 beta\n--------------------------------------------\ninitial release', 'meedioVintage', 'http://www.meedios.com/forum/viewtopic.php?t=1477', '', '', '', '0', '0', 262, 15783, 0, 0, 0, 0, '57701a076f1863f88d016c55efe9c042', 'FALSE'),
(988, '{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', 'Perception', 'Theme based on the Sunrise/Dawn theme included with Meedio.  This is just the beginning.', '', 'Theme', '', 'Freeware', 'Beta', '2008-01-17 16:35:53', '1.5', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}/1.5/beta/Perception_1.5_Beta.mpp', '16030910', '', '', '', 1005000000000000000, 0, '1.5\n-now there is an alternate music library (MusicLibraryAlt)\n-took "Now" off the main screen and added the units\n-took sunrise, sunset off the weather screen (left the screen file for people that still want it.  It''s \n\ncalled "WeatherWithSunMoonInfo". You can rename it to weather if you want to use it.\n-changed selection (easier to see what''s selected)\n-fixed movies view\n\n1.4\n-fixed theme settings page again (not sure why it was messed up)\n-fixed text in Pictures view\n\n1.3\n-fixed black-fill problem in 1.2\n\n1.2\n-fixed theme settings page\n\n1.1\n-changed main font color to white\n-added weather on group.screen\n-added album cover to group.screen\n-changed selection bar color\n-changed flood weather icon\n\n\n1.0\n-add desktop wallpaper in Perception/Wallpaper folder (standard and widescreen)\n-changed color of background just a little (took the purple out)\n-added higher resolution background\n-added icons\n-changed movienight thumbnail view\n-add movienight.screen\n-fixed group screen code\n-updated weather icons\n-fixed weather screen again\n-updated navigation sounds\n\nI would like to thank Freeman from Deviatart for his wallpaper. \n\nhttp://iamfreeman.deviantart.com/art/The-Abyss-38670535\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in  your Meedio Configuration.  \n\nSelect datafeeds server and make sure both boxes are checked. Open "datafeeds edittor" and add \n\n"Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save \n\nas "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your \n\nfull-time plug-ins. Enjoy!\n\nVisit http://www.meedios.com/forum/viewtopic.php?t=1939 for discussion and pictures of this theme.  Setup \n\ninstructions are located in forum for music and movie views. Report any problems to the forum.  Thanks.', 'Perception', 'http://www.meedios.com/forum/viewtopic.php?t=1939', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 208, 4144, 0, 0, 0, 0, 'ce5f506876fa0908bd89f379dfe1b321', 'FALSE'),
(989, '{296588A6-6044-4208-BE2A-75CF5E24A2AE}', 'MovieNight', 'Best Movie Module In Town!', '', 'Module', 'None', 'Donationware', 'Stable', '2008-01-20 18:40:34', '2.0.4.9', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'Please PayPal Me :) - Even a couple bucks is great!', '', 'plugins/{296588A6-6044-4208-BE2A-75CF5E24A2AE}/2.0.4.9/stable/MovieNight_2.0.4.9_Stable.mpp', '4766344', '', '', '', 2000004009000000000, 0, 'If you have the old movienight - you need to remove the folder "Meedio\\...\\general\\Movienight"', 'MovieNight', 'http://www.meedios.com/forum/viewtopic.php?p=13937', '', '', '', '0', '1', 2556, 15780, 0, 0, 0, 0, 'fa46be6e9e492818c0d64ea04b67caed', 'FALSE'),
