(991, '{26C39235-BDCF-4AF9-96F4-8B3CA4493071}', 'meedioVintage', 'Back to the 60''s', '', 'Theme', '', 'Freeware', 'Beta', '2008-01-21 17:32:52', '1.9.7', 'crni', 'N/A', 'crn', '2007', '', 'plugins/{26C39235-BDCF-4AF9-96F4-8B3CA4493071}/1.9.7/beta/meedioVintage_1.9.7_Beta.mpp', '13018691', '', '', 'Version.txt', 1009007000000000000, 0, 'Install, set your screen aspect ratio and enjoy !\n\nv1.9.7 beta\n--------------------------------------------\n- added views menu in media modules\n- added option to hide or show tabs in movies details screen\n- added option to choose between ticker or regular news feed on main screen\n- redid movie-details view in media libraries\n- added option to use Segoe UI as main font\n- added option to have glow under dock icons\n- fixed font scaling \n  using default font values should scale properly\n  for all different resolutions\n  \n- optimized code\n- fixed bugs\n\n\nv1.9.6 beta\n--------------------------------------------\n- updated MovieNight (support for actors pics)\n- added option to remove ticker ON/OFF button from main screen\n- fixed list view in pictures screen\n- fixed visualization menu in nowplaying screen\n- adjusted default font size to improve readability\n- optimized code\n- fixed bugs\n\nv1.9.5 beta\n--------------------------------------------\n- support for ratings in music library\n- support for ratings in nowplaying screen\n- use 0-5 buttons on the remote to set ratings\n\n   0 = clear rating\n   1 = poor\n   2 = fair\n   3 = good\n   4 = very good\n   5 = excellent\n   \n- optimized code\n- fixed bugs\n\nv1.9.4 beta\n--------------------------------------------\n- tagedit support\n- fixed ''low res'' bug in MN and TVN screens\n- optimized code\n- fixed bugs\n\nv1.9.3 beta\n--------------------------------------------\n- fixed translations (tnx to paatus)\n- updated media and EMM movie details screens\n- updated file browser and music file browser screens\n- redid myMovies screens\n- optimized code\n- fixed bugs \n\nv1.9.2 beta\n--------------------------------------------\n- fixed toolbars in MovieNight and TVNight\n- updated meeTV Shows screen\n- optimized code\n- fixed bugs \n\nv1.9.1 beta\n--------------------------------------------\n- bug fix release\n\nv1.9 beta\n--------------------------------------------\n- redesigned MovieNight and TVNight screens\n- redesigned nowplaying screen\n- redesigned meeMusic Jukebox screen\n- redesigned meeTVshows screen\n- redesigned Video player screen\n\n- option to toggle e-mail notification on main screen \n- pop3-feed plugin no more needed for mail notification	\n  (email notification based on E-mail library)\n\n- more toolbar buttons  \n- toolbar button caption in subtitle\n- added small-movies mode in media screens\n- option to set favorites in movies library\n- option to choose default browser \n- Launch Videos support\n- Meedi-YouTube support\n- EPG and TV screens by AdamSmith\n- movietimesVBNet screen by AdamSmith\n\n- fixed bugs \n- optimized code\n\nv1.8 beta\n--------------------------------------------\n- e-mail notification on main screen \n- more icons\n- more toolbar icons\n- redesigned ticker\n- added toggle ticker switch on main screen\n- recomended RGB color settings for news ticker full-time plugin\n	font (white) - 255 255 255\n	background1  - 0 0 0 \n	background2  - 54 62 64 (list)\n	background2  - 17 26 27 (dock)\n	channel (vintage green) - 196 230 115\n	separator (vintage green) - 196 230 115\n\n- my Movies support\n- weathered support\n- speech control support (SpeechCommand plugin)\n- RSS news module support \n- E-mail module support\n- meedio Internet browser support\n\n- new commands for nowplaying fullscreen\n	up, channelUP - prev vis\n	down, channelDOWN - next vis\n	select, info, display - toggle nowplaying info\n	\n- fixed bugs \n- optimized code\n\nv1.7 beta\n--------------------------------------------\n- new backgrounds (1920x1080)\n- icon manager support for backgrounds\n- option to set dock size (small, medium, large)\n- options to set subgroup using ''alternate screen'' option in configuration panel\n	subgroup\n	subgroup-grid\n	subgroup-dock\n\n- IMDb support in media screens	\n- added watched button in media screens\n- Enhanced Media Module (EMM) support \n	EnhancedMedia \n	EnhancedMovie\n	\n- options to toggle buttons in EMM module\n	play all\n	play next\n	play random\n	update library\n	delete item\n	\n- fixed Media and enhancedMedia screens to support multiple views\n- changed MOVIESMAX to MOVIES\n- available views in media library :\n	view\n	index\n	movies (ex moviesmax)\n	large-movies\n	movie-details\n	\n- available views in music library :\n	list\n	view\n	index\n	images\n	list-tracks\n	album-tracks\n\n- fixed bugs \n- optimized code\n\nv1.6 beta\n--------------------------------------------\n- new media module screen \n- new movie details screen\n- new music library screens\n- new pictures screens\n- option to toggle albums captions in music library module\n- option to toggle pics captions in pictures module\n- updated movieNight screen\n- fixed translations in most of the screens\n- fixed bugs \n- optimized code\n\nv1.5 beta\n--------------------------------------------\n- option to change main font (tahoma , arial)\n- new music nowplaying screen(s)\n- new music fullscreen and fullScreen-popup\n- meeLyrics support\n- option to show news ticker on main screen\n- option to adjust ticker position for different screen resolutions \n- option to change ticker skin - globe,rss,vinyl,film\n- fixed bugs \n- optimized code\n- changing cover image will also change icon in fullscreen and fullscreen-popup\n- recomended RGB color settings for news ticker full-time plugin\n  font (white) - 255 255 255\n  background1  - 0 0 0 \n  background2  - 54 62 64 (list)\n  background2  - 17 26 27 (dock)\n  channel (vintage green) - 196 230 115\n  separator (vintage green) - 196 230 115\n\n1.4 beta  \n--------------------------------------------\n- 12/24h time option\n- option to show weather feed on main screen\n- new nowplaying FullScreen-popup\n- new games screen (set subgroup module to ''games'')\n- alternate media details screen (set movie details to ''movieALT'')\n- added few extra icons\n- fixed bugs \n- optimized code\n\nv1.3 beta  \n--------------------------------------------\n- new media module screen\n- new movie details screen\n- added filmstrip view in media screen\n- added option for 16:10 widescreen monitors\n- added customized splash screen\n- fixed bugs \n- optimized code\n\nv1.2 beta  \n--------------------------------------------\n- fixed bugs \n- optimized code\n- experimental movieNight support (widescreen only)\n\nv1.1 beta  \n--------------------------------------------\n- added new main menu type (list)\n- added new submenu options\n- added Night module support\n- optimized code\n\nv1.0 beta\n--------------------------------------------\ninitial release', 'meedioVintage', 'http://www.meedios.com/forum/viewtopic.php?t=1477', '', '', '', '0', '0', 420, 15783, 0, 0, 0, 0, '97b5dfd8a7cc0fda2e50d59c152b41fd', 'FALSE'),
