(1043, '{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', 'Perception', 'Vista meets Apple TV. Enjoy the theme.', '', 'Theme', 'None', 'Freeware', 'Beta', '2008-02-24 13:31:22', '1.7', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}/1.7/beta/Perception_1.7_Beta.mpp', '16413418', '', '', '', 1007000000000000000, 0, '1.7\n-added horz-group.screen\n-added media2.screen\n-added meeTVshows_without_back.screen\n-made some adjustments to meeTVshows screen\n-added new MediaAlt2.screen. \n-added netflix icon (thanks crn)\n-added blockbuster icon\n-added info for musiclibraryAlt.screen\n-enlarged weather and cd image and re-arranged group.screen\n-added music info to group.screen (rotates artist, album and time)\n-added play w/out Trailer\n-made some adjustments to media.movie.screen\n\n1.6\n-changed star colors to silver (looks better with the blue)\n-made new movie rating images (easier to read and color coded)\n-added new movieALT.screen with hidden menu\n-fixed font colors on movie details screen\n-fixed movienight-new.screen (looks better)\n-added hidden menu to media.screen\n-added a couple new views\n-change watched icon on details screen (matched movienight)\n-added title and subtitle of video on media and mediaALT screens\n-added media.movie.screen file and updated "year" \n-added media.movie1.screen (doesn''t play movies and trailers that are enabled with playmee), play trailer button removed, this is good for tv series or other video\n-added media.movie2.screen (mostly for personal reason) shows banner, title, watched and overview\n-added Trailer button\n-added Toggle Watched button\n-added movie.template (used for media.screen and mediaAlt.screen)\n-other various small changes\n\n1.5\n-now there is an alternate music library (MusicLibraryAlt)\n-took "Now" off the main screen and added the units\n-took sunrise, sunset off the weather screen (left the screen file for people that still want it.  It''s called "WeatherWithSunMoonInfo". You can rename it to weather if you want to use it.\n-changed selection (easier to see what''s selected)\n-fixed movies view\n\n1.4\n-fixed theme settings page again (not sure why it was messed up)\n-fixed text in Pictures view\n\n1.3\n-fixed black-fill problem in 1.2\n\n1.2\n-fixed theme settings page\n\n1.1\n-changed main font color to white\n-added weather on group.screen\n-added album cover to group.screen\n-changed selection bar color\n-changed flood weather icon\n\n\n1.0\n-add desktop wallpaper in Perception/Wallpaper folder (standard and widescreen)\n-changed color of background just a little (took the purple out)\n-added higher resolution background\n-added icons\n-changed movienight thumbnail view\n-add movienight.screen\n-fixed group screen code\n-updated weather icons\n-fixed weather screen again\n-updated navigation sounds\n\nI would like to thank Freeman from Deviantart for his wallpaper. http://iamfreeman.deviantart.com/art/The-Abyss-38670535\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in your Meedio Configuration.  Select datafeeds server and make sure both boxes are checked. Open "datafeeds editor" and add "Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save as "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your full-time plug-ins. Enjoy!\n\nVisit http://www.meedios.com/forum/viewtopic.php?t=1939 for discussion and pictures of this theme.  Setup instructions are located in forum for music and movie views. Report any problems to the forum.  Thanks.', 'Perception', 'http://www.meedios.com/forum/viewtopic.php?t=1939', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 325, 4144, 0, 0, 0, 0, '359fd7dfca34b0a11e8705882432f74f', 'FALSE'),
