(1073, '{D25292F8-83C0-4F5D-ACCC-1EEAB1D4BE42}', 'FlowMediaModule', 'Media Module that uses a coverflow like menu.', '', 'Module', 'None', 'Freeware', 'Beta', '2008-03-06 16:55:42', '0.46', 'menu by stottle | module by reverson1', 'stottle@qadas.com|richardeverson@hotmail.com', 'reverson1', 'Copyright Â© 2008', '', 'plugins/{D25292F8-83C0-4F5D-ACCC-1EEAB1D4BE42}/0.46/beta/FlowMediaModule_0.46_Beta.mpp', '563819', '', '', 'TBD', 46000000000000000, 1, '.46 - \nShould close the left menu when not at the bottom of the view\n\nAdded code to prevent the flow menu from reloading when going back from a meedio view\n\nCorrected a problem where the spacing multiplier was ignored\n\nAdded some more logging code\n\nFixed a problem where the items from a previous load were still visible when the menu was loading an additional step', 'FlowMediaModule', 'http://www.meedios.com/forum/viewtopic.php?t=2208&highlight=', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id={D25292F8-83C0-4F5D-ACCC-1EEAB1D4BE42}', '', '', '0', '1', 2079, 2267, 0, 0, 0, 0, '79ba35fe3d1a0cfa4ff88d2e56418db2', 'FALSE'),
