(1082, '{AB3510BC-D89D-4245-A6A9-7C9FE8C373F6}', 'Google Calendar Importer', 'Imports Google Calendar events into a Meedio Library.', '', 'Import', 'None', 'Freeware', 'Beta', '2008-03-09 14:01:33', '1.1', 'NeverMind', 'support@meedio.com', 'NeverMind', '', '', 'plugins/{AB3510BC-D89D-4245-A6A9-7C9FE8C373F6}/1.1/beta/Google_Calendar_Importer_1.1_beta.mpp', '365035', '', '', '', 1001000000000000000, 1, 'Imports calendar events from google calendars into a Meedio library.\r\n\r\nI have provided a screen file that contains a view called "calendar-events". Set the mode of your view of the library to this in Meedio Configuration''s Media Library tab. Add a media module to your menu and set the media library section to your imported calendar library, then set the alternate screen to point at the googlecalendar.screen file.\r\n\r\nIf you want images to appear along side each calendar entry then place an image file ( *.jpg,*.gif,*.png ) in this plugins images directory. The screen file looks for any images with the same name as the calendar.\r\n\r\nIt''s not very pretty but it does the job. :o)', 'GoogleCalendarImporter', 'http://www.meedio.com/maid', '', '1.0', '', '0', '1', 842, 980, 0, 0, 0, 0, '4472486301eab859baa922e9c43446b9', 'FALSE'),
