(1115, '{B286D9C4-270B-4280-B134-45CECEFD7B69}', 'MetaMeedia', 'Add video and audio information for videofiles', '', 'Import', 'None', 'Donationware', 'Beta', '2008-03-23 11:11:16', '1.6', 'binary64', 'binary64@MeediOS.com', 'binary64', '(c) 2006-2007 binary64 @ MeediOS. Please donate :)', '', 'plugins/{B286D9C4-270B-4280-B134-45CECEFD7B69}/1.6/beta/MetaMeedia_1.6_Beta.mpp', '592592', '', '', '', 1006000000000000000, 0, 'Requires .NET 2.0.\n\n      Currently grabs the following tags for video files that MediaInfo 0.7.6.1 from http://mediainfo.sourceforge.net/ recognises:-\n      video_Codec (string)\n      video_Resolution (pixels)\n      video_ColorDepth (bpp)\n      video_FrameRate (fps)\n      video_DataRate (kbps)\n      audio_Codec (string)\n      audio_SampleRate (hz)\n      audio_Channels (double)\n      audio_Profile (string)\n      audio_DataRate (kbps)\n      ...and more\n\n      Currently grabs the following tags for audio files:-\n      NONE KNOWN / NOT SUPPORTED\n\n      Currently grabs the following tags for picture files:-\n      NONE KNOWN / NOT SUPPORTED', 'MetaMeedia', 'http://www.MeediOS.com/', '', '', '', '0', '1', 350, 1588, 0, 0, 0, 0, '8283fb590e9a162e562d3cd35447d3f4', 'FALSE'),
(1116, '{798F4DB0-7642-4669-AFED-4379CA7B5546}', 'Webscheduler Captures Importer', 'Imports Webscheduler Video Captures XML info.', '', 'Import', 'None', 'Freeware', 'Stable', '2008-03-25 07:01:54', '2.4', 'John Calvi', 'jcalvi at lewis dot com dot au', 'Calvi', 'John Calvi, 2006/7', '', 'plugins/{798F4DB0-7642-4669-AFED-4379CA7B5546}/2.4/stable/Webscheduler_Captures_Importer_2.4_Stable.mpp', '354086', '', '', 'readme.txt', 2004000000000000000, 1, 'Webscheduler Captures Importer, by John Calvi, Copyright 2006/7.\n\nThis plug-in checks for xml files generated by Webscheduler and if they exist writes the tags into the Meedio Library. This importer should be chained after a standard importer, eg. Task Mask Importer.\nNo special rules are required for the Tag Mask importer and you can still use images etc. All options in the WS Captures importer complement those in the Task Mask importer.\n\n\nRefer Readme.txt File', 'WSCaptures', 'http://mail.lewis.com.au/public/meedio', '', '', '', '0', '0', 422, 851, 0, 0, 0, 0, 'cd48779e49e10aa12e45cc38357a2ec0', 'FALSE'),
