(1123, '{B39F5A62-C149-4D8B-8A99-893A954D9A08}', 'meeTVshowsModule', 'Watch TV Shows', '', 'Module', 'None', 'Freeware', 'Stable', '2008-03-31 14:16:07', '4.0', 'walts81', 'joshwalters@gmail.com', 'walts81', '2006', '', 'plugins/{B39F5A62-C149-4D8B-8A99-893A954D9A08}/4.0/stable/meeTVshowsModule_4.0_Stable.mpp', '457752', '', '', '', 4000000000000000000, 0, '1) Add module to menu in Meedio config\n\n2) Set episodes section\n\n3) Set Field Names (according to your episodes section field names)\n\n4) Set screen preferences', 'meeTVshowsModule', 'http://www.meedios.com/maid', '', '', '', '0', '1', 365, 8909, 0, 0, 0, 0, '74622434f79a09f22c4bf8db23c72a83', 'FALSE'),
(1124, '{B6D3B945-A708-45E8-8022-F82D9D1130E8}', 'meeTVshowsImporter', 'Import TV Series and Episode Information', '', 'Import', 'None', 'Freeware', 'Stable', '2008-03-31 14:24:51', '4.0', 'walts81', 'joshwalters@gmail.com', 'walts81', '2008', '', 'plugins/{B6D3B945-A708-45E8-8022-F82D9D1130E8}/4.0/stable/meeTVshowsImporter_4.0_Stable.mpp', '797788', '', '', '', 4000000000000000000, 0, '1) Add importer to your TV Shows library\n\n2) Set custom settings\n\n3) Run the importer\n\n**NOTE**----------------------------------------------------------------------------------------------------------------\nThis plugin creates 1 new library, "meeTVshows-Series" \nIf running this importer for the first time, this new library will NOT appear until Meedio Config has been closed and re-started. All Episode data will be added to the library that this import is run from.', 'meeTVshowsImporter', 'http://www.meedios.com/OpenMAID', '', '1.41', '1.41', '0', '1', 303, 9128, 0, 0, 0, 0, 'e5302c59e92352d25461c9c516f36b2e', 'FALSE'),
(1125, '{26C39235-BDCF-4AF9-96F4-8B3CA4493071}', 'meedioVintage', 'Back to the 60''s', '', 'Theme', 'None', 'Freeware', 'Stable', '2008-03-31 15:13:44', '2.0.0', 'crni', 'N/A', 'crn', '2008', '', 'plugins/{26C39235-BDCF-4AF9-96F4-8B3CA4493071}/2.0.0/stable/meedioVintage_2.0.0_Stable.mpp', '17641151', '', '', 'Version.txt', 2000000000000000000, 0, 'Install, set your screen aspect ratio and enjoy !\n\nv2 stable\n--------------------------------------------\n- added fanart support in meeTVShows Module\n- added mediainfo support in meeTVShows Module\n- added mediainfo support in MyMovies module\n\n- added option to show/hide browser navigation button\n- added option to hot-track mouse cursor\n- added clear playlist button in meeMusic Jukebox\n- added music player controls in meeMusic Jukebox\n- adjusted list view in meeMusic Jukebox\n- adjusted MovieNight for 4:3 aspect ratio\n- fixed albums and pictures captions\n- fixed time on main screen\n- redesigned MovieMee screen\n\n- updated TV screens by Adam Smith:\n  EPG\n  tv-info\n  tv-miniepg\n  tv-miniguide\n  tv-timeshift\n  \n- created few more icons\n- created new shadowed toolbar buttons\n- created new filmstrip glass sel button (500x500)\n- created new selection buttons (500x500)\n- created DVD, HD-DVD and BR cases\n- created mediainfo logos\n\n- fixed Icon Manager backgrounds support \n- added Carbon and Rebel backgrounds\n- added option to change default backgrounds with one click:\n  * Vintage 	(default green)\n  * Carbon		(carbon fiber)\n  * Rebel		(brown)\n  * Black 		(black)\n  \n- added option to set tag color\n- added option to set Title to use tag-color\n  * In media modules only\n  * Always\n  \n- changing tag-color will change glow-color under dock and arrows-color\n- available tag colors:\n  * green\n  * gold\n  * silver\n  * blue\n  * purple\n  * red\n  \n- added option to set buttons color\n- available buttons colors:\n  * black 		(default)\n  * asparagus	(green)\n  * denim 		(blue)\n  * amber 		(orange)\n  * rust 		(red)\n  * amethyst 	(purple)\n  * glass 		(glass)\n  \n\n- rewritten code\n- fixed bugs\n\n\nv1.9.9 beta\n--------------------------------------------\n- experimental flowMee support\n- redid theme settings screen\n- added option to use pop3 plugin for e-mail feed\n- changed ratings control in nowplaying screen\n- added option to use windows default browser as meedio default (Kricker)\n- fixed left/right behaviour in slideshow screen (Jong)\n- fixed global play/pause music control (Jong)\n\n- optimized code\n- fixed bugs\n\n\nv1.9.8 beta\n--------------------------------------------\n- added overscan compensation for news ticker\n- fixed EMM and Media details screens\n- added option to use left arrow as back button\n- fixed transparency in video screen\n- added option for description font type and size\n- 4:3 aspect ratio adjustements\n \n- optimized code\n- fixed bugs\n\nv1.9.7 beta\n--------------------------------------------\n- added views menu in media modules\n- added option to hide or show tabs in movies details screen\n- added option to choose between ticker or regular news feed on main screen\n- redid movie-details view in media libraries\n- added option to use Segoe UI as main font\n- added option to have glow under dock icons\n- fixed font scaling \n  using default font values should scale properly\n  for all different resolutions\n  \n- optimized code\n- fixed bugs\n\n\nv1.9.6 beta\n--------------------------------------------\n- updated MovieNight (support for actors pics)\n- added option to remove ticker ON/OFF button from main screen\n- fixed list view in pictures screen\n- fixed visualization menu in nowplaying screen\n- adjusted default font size to improve readability\n- optimized code\n- fixed bugs\n\nv1.9.5 beta\n--------------------------------------------\n- support for ratings in music library\n- support for ratings in nowplaying screen\n- use 0-5 buttons on the remote to set ratings\n\n   0 = clear rating\n   1 = poor\n   2 = fair\n   3 = good\n   4 = very good\n   5 = excellent\n   \n- optimized code\n- fixed bugs\n\nv1.9.4 beta\n--------------------------------------------\n- tagedit support\n- fixed ''low res'' bug in MN and TVN screens\n- optimized code\n- fixed bugs\n\nv1.9.3 beta\n--------------------------------------------\n- fixed translations (tnx to paatus)\n- updated media and EMM movie details screens\n- updated file browser and music file browser screens\n- redid myMovies screens\n- optimized code\n- fixed bugs \n\nv1.9.2 beta\n--------------------------------------------\n- fixed toolbars in MovieNight and TVNight\n- updated meeTV Shows screen\n- optimized code\n- fixed bugs \n\nv1.9.1 beta\n--------------------------------------------\n- bug fix release\n\nv1.9 beta\n--------------------------------------------\n- redesigned MovieNight and TVNight screens\n- redesigned nowplaying screen\n- redesigned meeMusic Jukebox screen\n- redesigned meeTVshows screen\n- redesigned Video player screen\n\n- option to toggle e-mail notification on main screen \n- pop3-feed plugin no more needed for mail notification	\n  (email notification based on E-mail library)\n\n- more toolbar buttons  \n- toolbar button caption in subtitle\n- added small-movies mode in media screens\n- option to set favorites in movies library\n- option to choose default browser \n- Launch Videos support\n- Meedi-YouTube support\n- EPG and TV screens by AdamSmith\n- movietimesVBNet screen by AdamSmith\n\n- fixed bugs \n- optimized code\n\nv1.8 beta\n--------------------------------------------\n- e-mail notification on main screen \n- more icons\n- more toolbar icons\n- redesigned ticker\n- added toggle ticker switch on main screen\n- recomended RGB color settings for news ticker full-time plugin\n	font (white) - 255 255 255\n	background1  - 0 0 0 \n	background2  - 54 62 64 (list)\n	background2  - 17 26 27 (dock)\n	channel (vintage green) - 196 230 115\n	separator (vintage green) - 196 230 115\n\n- my Movies support\n- weathered support\n- speech control support (SpeechCommand plugin)\n- RSS news module support \n- E-mail module support\n- meedio Internet browser support\n\n- new commands for nowplaying fullscreen\n	up, channelUP - prev vis\n	down, channelDOWN - next vis\n	select, info, display - toggle nowplaying info\n	\n- fixed bugs \n- optimized code\n\nv1.7 beta\n--------------------------------------------\n- new backgrounds (1920x1080)\n- icon manager support for backgrounds\n- option to set dock size (small, medium, large)\n- options to set subgroup using ''alternate screen'' option in configuration panel\n	subgroup\n	subgroup-grid\n	subgroup-dock\n\n- IMDb support in media screens	\n- added watched button in media screens\n- Enhanced Media Module (EMM) support \n	EnhancedMedia \n	EnhancedMovie\n	\n- options to toggle buttons in EMM module\n	play all\n	play next\n	play random\n	update library\n	delete item\n	\n- fixed Media and enhancedMedia screens to support multiple views\n- changed MOVIESMAX to MOVIES\n- available views in media library :\n	view\n	index\n	movies (ex moviesmax)\n	large-movies\n	movie-details\n	\n- available views in music library :\n	list\n	view\n	index\n	images\n	list-tracks\n	album-tracks\n\n- fixed bugs \n- optimized code\n\nv1.6 beta\n--------------------------------------------\n- new media module screen \n- new movie details screen\n- new music library screens\n- new pictures screens\n- option to toggle albums captions in music library module\n- option to toggle pics captions in pictures module\n- updated movieNight screen\n- fixed translations in most of the screens\n- fixed bugs \n- optimized code\n\nv1.5 beta\n--------------------------------------------\n- option to change main font (tahoma , arial)\n- new music nowplaying screen(s)\n- new music fullscreen and fullScreen-popup\n- meeLyrics support\n- option to show news ticker on main screen\n- option to adjust ticker position for different screen resolutions \n- option to change ticker skin - globe,rss,vinyl,film\n- fixed bugs \n- optimized code\n- changing cover image will also change icon in fullscreen and fullscreen-popup\n- recomended RGB color settings for news ticker full-time plugin\n  font (white) - 255 255 255\n  background1  - 0 0 0 \n  background2  - 54 62 64 (list)\n  background2  - 17 26 27 (dock)\n  channel (vintage green) - 196 230 115\n  separator (vintage green) - 196 230 115\n\n1.4 beta  \n--------------------------------------------\n- 12/24h time option\n- option to show weather feed on main screen\n- new nowplaying FullScreen-popup\n- new games screen (set subgroup module to ''games'')\n- alternate media details screen (set movie details to ''movieALT'')\n- added few extra icons\n- fixed bugs \n- optimized code\n\nv1.3 beta  \n--------------------------------------------\n- new media module screen\n- new movie details screen\n- added filmstrip view in media screen\n- added option for 16:10 widescreen monitors\n- added customized splash screen\n- fixed bugs \n- optimized code\n\nv1.2 beta  \n--------------------------------------------\n- fixed bugs \n- optimized code\n- experimental movieNight support (widescreen only)\n\nv1.1 beta  \n--------------------------------------------\n- added new main menu type (list)\n- added new submenu options\n- added Night module support\n- optimized code\n\nv1.0 beta\n--------------------------------------------\ninitial release', 'meedioVintage', 'http://www.meedios.com/forum/viewtopic.php?t=1477', '', '', '', '0', '0', 1070, 15783, 0, 0, 0, 0, '9caa7edc34e7f803e43ec5ef029033aa', 'FALSE'),
