(1134, '{650892FB-399E-4B3F-AD92-727A91C80B65}', 'CamCapture', 'Live webcam video within Meedio with screen capture', '', 'Module', 'None', 'Freeware', 'Stable', '2008-04-04 16:25:49', '1.3', 'Michael Martinez', 'martinez@angelisa.net', 'jetblack', '2007 Michael Martinez', '', 'plugins/{650892FB-399E-4B3F-AD92-727A91C80B65}/1.3/stable/CamCapture_1.3_Stable.mpp', '12259', '', '', '', 1003000000000000000, 1, 'Creates a live video feed from a usb webcam within a Meedio module.  \nAbility to save screen captures to specified folder.  Includes a timer function to capture automatically on a timer.\n\nRequires .NET 1.1', 'CamCapture', 'http://www.meedios.com/forum/viewtopic.php?p=35873', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={650892FB-399E-4B3F-AD92-727A91C80B65}', '', '', '0', '1', 1084, 1703, 0, 0, 0, 0, 'd168ac871b3eef51992e1c64d6221216', 'FALSE'),
(1135, '{351688B0-25D2-48AB-997B-3E5B03B8D060}', 'GPS', 'Publish data feed with GPS latitude, longitude, speed and heading', '', 'General', 'None', 'Donationware', 'Stable', '2008-04-04 16:48:57', '1.2', 'Michael Martinez', 'martinez@angelisa.net', 'jetblack', 'Michael Martinez', '', 'plugins/{351688B0-25D2-48AB-997B-3E5B03B8D060}/1.2/stable/GPS_1.2_Stable.mpp', '16430', '', '', '', 1002000000000000000, 1, 'Requires a GPS receiver connected on a COM port.\n\nPublishes the GPS data to a datafeed.\n\ngps.lat => Latitude\ngps.lon => Longitude\ngps.spd => Speed\ngps.hdg => Heading (N, NE, E, SE,S, SW, W, NW)', 'GPS', 'http://www.meedios.com/forum/viewtopic.php?p=35877', '', '', '', '0', '1', 671, 671, 0, 0, 0, 0, 'f1f003ddf40e4036a2d1840b5ff9e100', 'FALSE'),
(1136, '{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', 'Perception', 'Vista meets Apple TV. Enjoy the theme.', '', 'Theme', 'None', 'Freeware', 'Beta', '2008-04-05 16:25:45', '1.8', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}/1.8/beta/Perception_1.8_Beta.mpp', '16986527', '', '', '', 1008000000000000000, 1, '1.8 \n-meeLyrics working \n-MovieTimes VBNET screen \n-couple background options\n-added writer to media.movie.screen \n-changed rating to silver stars on media.movie.screen \n-added new meeTVshows screen (fixes subtitle size issue)\n-added date and time\n\n1.7\n-added horz-group.screen\n-added media2.screen\n-added meeTVshows_without_back.screen\n-made some adjustments to meeTVshows screen\n-added new MediaAlt2.screen. \n-added netflix icon (thanks crn)\n-added blockbuster icon\n-added info for musiclibraryAlt.screen\n-enlarged weather and cd image and re-arranged group.screen\n-added music info to group.screen (rotates artist, album and time)\n-added play w/out Trailer\n-made some adjustments to media.movie.screen\n\n1.6\n-changed star colors to silver (looks better with the blue)\n-made new movie rating images (easier to read and color coded)\n-added new movieALT.screen with hidden menu\n-fixed font colors on movie details screen\n-fixed movienight-new.screen (looks better)\n-added hidden menu to media.screen\n-added a couple new views\n-change watched icon on details screen (matched movienight)\n-added title and subtitle of video on media and mediaALT screens\n-added media.movie.screen file and updated "year" \n-added media.movie1.screen (doesn''t play movies and trailers that are enabled with playmee), play trailer button removed, this is good for tv series or other video\n-added media.movie2.screen (mostly for personal reason) shows banner, title, watched and overview\n-added Trailer button\n-added Toggle Watched button\n-added movie.template (used for media.screen and mediaAlt.screen)\n-other various small changes\n\n1.5\n-now there is an alternate music library (MusicLibraryAlt)\n-took "Now" off the main screen and added the units\n-took sunrise, sunset off the weather screen (left the screen file for people that still want it.  It''s called "WeatherWithSunMoonInfo". You can rename it to weather if you want to use it.\n-changed selection (easier to see what''s selected)\n-fixed movies view\n\n1.4\n-fixed theme settings page again (not sure why it was messed up)\n-fixed text in Pictures view\n\n1.3\n-fixed black-fill problem in 1.2\n\n1.2\n-fixed theme settings page\n\n1.1\n-changed main font color to white\n-added weather on group.screen\n-added album cover to group.screen\n-changed selection bar color\n-changed flood weather icon\n\n\n1.0\n-add desktop wallpaper in Perception/Wallpaper folder (standard and widescreen)\n-changed color of background just a little (took the purple out)\n-added higher resolution background\n-added icons\n-changed movienight thumbnail view\n-add movienight.screen\n-fixed group screen code\n-updated weather icons\n-fixed weather screen again\n-updated navigation sounds\n\nI would like to thank Freeman from Deviantart for his wallpaper. http://iamfreeman.deviantart.com/art/The-Abyss-38670535\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in your Meedio Configuration.  Select datafeeds server and make sure both boxes are checked. Open "datafeeds editor" and add "Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save as "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your full-time plug-ins. Enjoy!\n\nVisit http://www.meedios.com/forum/viewtopic.php?t=1939 for discussion and pictures of this theme.  Setup instructions are located in forum for music and movie views. Report any problems to the forum.  Thanks.', 'Perception', 'http://www.meedios.com/forum/viewtopic.php?t=1939', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 2493, 4144, 0, 0, 0, 0, '6a3c181a3c554621806b21869bf319fc', 'FALSE'),
(1137, '{7FF481D3-DB89-4FB8-86C4-64FBCF9D7632}', 'NetworkPipe', 'A bi-directional network bridge for Meedio Messages', '', 'General', 'None', 'Donationware', 'Beta', '2008-04-06 11:35:55', '0.3', 'binary64', 'slug@skyforge.net', 'binary64', '2007', '', 'plugins/{7FF481D3-DB89-4FB8-86C4-64FBCF9D7632}/0.3/beta/NetworkPipe_0.3_Beta.mpp', '26006', '', '', '', 3000000000000000, 1, 'Config format: [send|receive]|[host[:port]]|[meedio.message.mask[.*]]\n\n			Examples:\n\n			send|htpc|lastfm.play\n			receive|htpc|music.playing\n			send|htpc|imports.*\n			receive|htpc|meedio-helper.*', 'NetworkPipe', '', '', '', '', '0', '1', 587, 1236, 0, 0, 0, 0, '62fd518d34257fbe7dbf24a91b419730', 'FALSE'),
