(1141, '{A44E43FE-3822-4CE1-99DA-220DC0BA89F0}', 'SmartMovieSorter', 'Filters out unneccessary garbage in movie file names ready for imdbmee', '', 'Import', 'None', 'Donationware', 'Alpha', '2008-04-06 11:37:25', '3.1', 'binary64', 'slug@skyforge.net', 'binary64', '(c) 2006 binary64. Commerical usage requires prior authorization.', '', 'plugins/{A44E43FE-3822-4CE1-99DA-220DC0BA89F0}/3.1/alpha/SmartMovieSorter_3.1_Alpha.mpp', '189607', '', '', '', 3001000000000000000, 0, 'This importer is for the lazy man.\n    \n    Setup:\n    1. Download, install this plugin.\n    2. Open Meedio Configuration.\n    3. Add a new Section "Movies"\n    4. Add a new importer, Tag Mask importer or Enhanced Tag Mask importer with any mask\n    5. Add this importer\n    6. Run the Tag mask importer\n    7. Run the SMS importer\n    8. Now run IMDB/etc importers.', 'SmartMovieSorter', 'http://www.MeediOS.com/', '', '', '', '0', '1', 356, 4005, 0, 0, 0, 0, '99fb818343cdb4bf3f2a45d2e364aa72', 'FALSE'),
(1198, '{2A78C80D-0CDE-4BFF-9DF9-5BA1DD480B91}', 'DynamicMenus', 'Helps automatically configure some Meedio settings dynamically.', '', 'General', 'None', 'Freeware', 'Beta', '2008-04-30 05:19:50', '1.9.3.2', 'binary64', 'slug@skyforge.net', 'binary64', '2007', '', 'plugins/{2A78C80D-0CDE-4BFF-9DF9-5BA1DD480B91}/1.9.3.2/beta/DynamicMenus_1.9.3.2_Beta.mpp', '283955', '', '', '', 1009003002000000000, 0, 'This plugin is for advanced systems integrators only. Config has intellisense enabled :P', 'DynamicMenus', 'www.MeediOS.com', '', '', '', '0', '1', 147, 5981, 0, 0, 0, 0, 'cddc16fb37be95d91f6689d84d0d944a', 'FALSE'),
(1142, '{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}', 'WebBrowser', 'This is a replacement for Meedio''s Web Browser', '', 'General', 'None', 'Donationware', 'Alpha', '2008-04-06 17:06:00', '0.0.1.2', 'ALThack', 'althackston@gmail.com', 'ALThack', '2008', '', 'plugins/{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}/0.0.1.2/alpha/WebBrowser_0.0.1.2_Alpha.mpp', '28410', '', '', '', 1002000000000, 0, 'This is a replacement for Meedio''s Internet Browser plugin.\n\nTo set it up: \n(it''s the the same as the old one so if you already have the old one set up just uncheck "Internet Browser" and check this one ("WebBrowser") in the Full Time Plugin tab) \n\n1.) Open up Meedio Configuration, then on the Menu tab, make sure the second Meedio in the treeview is highlighted. Click the Add button \nand select the ''Command module'' to add it to your menu structure. Name it whatever you like. \n2.) On the Module properties tab with it selected, for Command to Send, select ''Send custom command''. \nFor the Custom command to send box, type: webbrowser.url \n\nCustom parameters are optional, if not set it will go to whatever you selected as your default site in the settings \nFor the Custom parameters to send, type: url=www.meedios.com (or whatever url you want instead of meedios.com)', 'WebBrowser', '', '', '', '', '0', '1', 132, 6599, 0, 0, 0, 0, '4d10237124a46da3730aef8adc7e74cc', 'FALSE'),
(1143, '{F4442312-D7C6-4DC1-9FF0-A94AE3275D98}', 'ScriptMee Importer', 'Run .NET scripts (cs, vb, js) to manipualte the data in your libraries.', '', 'Import', 'None', 'Freeware', 'Alpha', '2008-04-07 14:59:48', '1.0.0.0', 'DocZoidberg', 'Goldrush@web.de', 'DocZoidberg', 'MeediOS 2008', '', 'plugins/{F4442312-D7C6-4DC1-9FF0-A94AE3275D98}/1.0.0.0/alpha/ScriptMee_Importer_1.0.0.0_Alpha.mpp', '97009', '', '', '', 1000000000000000000, 1, 'N/A', 'ScriptMeeImporter', 'http://www.michaelwisniewski.mynetcologne.de/', '', '', '', '0', '1', 558, 558, 0, 0, 0, 0, '6a2d3d8e476d4430f4ceaedb371a55f7', 'FALSE'),
(1144, '{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}', 'WebBrowser', 'Browse the internet', '', 'General', 'None', 'Donationware', 'Beta', '2008-04-08 13:27:50', '0.0.2.0', 'ALThack', 'althackston@gmail.com', 'ALThack', '2008', '', 'plugins/{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}/0.0.2.0/beta/WebBrowser_0.0.2.0_Beta.mpp', '29696', '', '', '', 2000000000000, 0, 'This is a replacement for Meedio''s Internet Browser plugin.\n\nTo set it up: \n(it''s the the same as the old one so if you already have the old one set up just uncheck "Internet Browser" and check this one ("WebBrowser") in the Full Time Plugin tab) \n\n1.) Open up Meedio Configuration, then on the Menu tab, make sure the second Meedio in the treeview is highlighted. Click the Add button \nand select the ''Command module'' to add it to your menu structure. Name it whatever you like. \n2.) On the Module properties tab with it selected, for Command to Send, select ''Send custom command''. \nFor the Custom command to send box, type: webbrowser.url \n\nCustom parameters are optional, if not set it will go to whatever you selected as your default site in the settings\n url=www.meedios.com (or whatever url you want instead of meedios.com) \n\n\n screen=MeedioBrowser (or another screen)', 'WebBrowser', '', '', '', '', '0', '1', 88, 6599, 0, 0, 0, 0, '4e22982405f8ecd0e4339c7908b745b0', 'FALSE'),
