(1149, '{B6D3B945-A708-45E8-8022-F82D9D1130E8}', 'meeTVshowsImporter', 'Import TV Series and Episode Information', '', 'Import', 'None', 'Freeware', 'Stable', '2008-04-09 09:07:50', '4.0.0.1', 'walts81', 'joshwalters@gmail.com', 'walts81', '2008', '', 'plugins/{B6D3B945-A708-45E8-8022-F82D9D1130E8}/4.0.0.1/stable/meeTVshowsImporter_4.0.0.1_Stable.mpp', '813262', '', '', '', 4000000001000000000, 0, '1) Add importer to your TV Shows library\n\n2) Set custom settings\n\n3) Run the importer\n\n**NOTE**----------------------------------------------------------------------------------------------------------------\nThis plugin creates 1 new library, "meeTVshows-Series" \nIf running this importer for the first time, this new library will NOT appear until Meedio Config has been closed and re-started. All Episode data will be added to the library that this import is run from.', 'meeTVshowsImporter', 'http://www.meedios.com/OpenMAID', '', '1.41', '1.41', '0', '1', 142, 9128, 0, 0, 0, 0, 'ce0e29fbd56e68c29c4f136c64d1c477', 'FALSE'),
