(1166, '{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}', 'T-Minus Delete', 'This importer will delete files after a specified number of days.', '', 'Import', 'None', 'Freeware', 'Alpha', '2008-04-14 21:52:19', '0.1.2', 'ccrocker', 'cbcrocker@cox.net', 'ccrocker', 'Copyright Â© 2008', '', 'plugins/{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}/0.1.2/alpha/T-Minus_Delete_0.1.2_Alpha.mpp', '29537', '', '', '', 1002000000000000, 0, 'This importer will delete a file after a specified number of days.  This Importer will create tag named "ArchivePreference" .  This tag should be populated as either "Temporary" or "Permanent"  either manually or via another importer.  Temporary files are subject to deletion after a user selected number of days.  Permanent files are not deleted.  The tag DaysUntilDeletion will count down days each time the importer is run.  When this amount is less than 1, the related file and library item will be deleted.  \n\nUsing .net 2.0', 'T-Minus Delete', 'http://www.meedios.com/forum/viewtopic.php?t=2702', '', '', '', '0', '1', 61, 1441, 0, 0, 0, 0, '9aecdd8f42a2f5ceed10ee95d02527d4', 'FALSE'),
(1167, '{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}', 'T-Minus Delete', 'This importer will delete files after a specified number of days.', '', 'Import', 'None', 'Freeware', 'Alpha', '2008-04-15 00:12:09', '0.1.3', 'ccrocker', 'cbcrocker@cox.net', 'ccrocker', 'Copyright Â© 2008', '', 'plugins/{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}/0.1.3/alpha/T-Minus_Delete_0.1.3_Alpha.mpp', '30121', '', '', '', 1003000000000000, 0, 'This importer will delete a file after a specified number of days.  This Importer will create tag named "ArchivePreference" .  This tag should be populated as either "Temporary" or "Permanent"  either manually or via another importer.  Temporary files are subject to deletion after a user selected number of days.  Permanent files are not deleted.  The tag DaysUntilDeletion will count down days each time the importer is run.  When this amount is less than 1, the related file and library item will be deleted.  \n\nCan also be set to delete "Temporary" files after watched.\n\nUsing .net 2.0', 'T-Minus Delete', 'http://www.meedios.com/forum/viewtopic.php?t=2702', '', '', '', '0', '1', 55, 1441, 0, 0, 0, 0, '9b07447f685281c21fe035b1cb9ec457', 'FALSE'),
