(1173, '{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}', 'T-Minus Delete', 'This importer will delete files after a specified number of days.', '', 'Import', 'None', 'Freeware', 'Alpha', '2008-04-16 23:58:20', '0.1.5', 'ccrocker', 'cbcrocker@cox.net', 'ccrocker', 'Copyright Â© 2008', '', 'plugins/{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}/0.1.5/alpha/T-Minus_Delete_0.1.5_Alpha.mpp', '30590', '', '', '', 1005000000000000, 0, 'This importer will delete a file after a specified number of days.  This Importer will create tag named "ArchivePreference" .  This tag should be populated as either "Temporary" or "Permanent"  either manually or via another importer.  Temporary files are subject to deletion after a user selected number of days.  Permanent files are not deleted.  The tag DaysUntilDeletion will count down days each time the importer is run.  When this amount is less than 1, the related file and library item will be deleted.  \n\nCan also be set to delete "Temporary" files after watched.\n\nUsing .net 2.0', 'T-Minus Delete', 'http://www.meedios.com/forum/viewtopic.php?t=2702', '', '', '', '0', '1', 68, 1441, 0, 0, 0, 0, '4c5399d5167b862739ac8445bfd575a2', 'FALSE'),
