(1191, '{3AE280F7-417F-46C1-91A7-904A94A0CF86}', 'Vinci M', 'Vinci M is based on the xbmc Vinci theme. Enjoy.', '', 'Theme', 'None', 'Freeware', 'Beta', '2008-04-27 19:06:29', '0.1', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{3AE280F7-417F-46C1-91A7-904A94A0CF86}/0.1/beta/Vinci_M_0.1_Beta.mpp', '15456999', '', '', '', 1000000000000000, 0, 'Vinci M is based on the xbmc Vinci theme. http://users.edpnet.be/desertstorm/\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in your Meedio Configuration.  Select datafeeds server and make sure both boxes are checked. Open "datafeeds editor" and add "Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save as "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your full-time plug-ins. Enjoy!\n\nVisit http://www.meedios.com/forum/viewtopic.php?t=2794 for discussion and pictures of this theme.  Setup instructions are located in forum for music and movie views. Report any problems to the forum.  Thanks.', 'Vinci M', 'http://www.meedios.com/forum/viewtopic.php?t=2794', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 302, 2407, 0, 0, 0, 0, 'ef283494ad4686579cc682b8d1012fb1', 'FALSE'),
