(1203, '{8A3F60A8-43B1-45B9-BEB2-F0E588562282}', 'meeRunImporters', 'This importer can run multiple importers defined for a section in order', '', 'Import', 'None', 'Freeware', 'Beta', '2008-05-01 01:00:46', '0.16.1', 'Kosh', 'tamyk@online.no', '', 'Kosh', '', 'plugins/{8A3F60A8-43B1-45B9-BEB2-F0E588562282}/0.16.1/beta/meeRunImporters_0.16.1_Beta.mpp', '5728', '', '', '', 16001000000000000, 1, 'This importer can run multiple importers defined for a section in order. If the importer is configured to run the importers with ID 15,16,18 it will run these in the order defined. If one of the importers fails, the following ones will not be run.\n\n      Useful if you got importers which are dependant on another importer successfully update the library first and for importers like the meeTVShows importer.\n\n      Configure it by giving it a list of the ID of the importers to run.', 'meeRunImporters', 'www.meedio.com', '', '', '', '0', '1', 958, 1479, 0, 0, 0, 0, '2d12c63fd8d2b1038747aefafdeb29c1', 'FALSE'),
