(1238, '{3AE280F7-417F-46C1-91A7-904A94A0CF86}', 'Vinci M', 'Vinci M is based on the xbmc Vinci theme. Enjoy.', '', 'Theme', 'None', 'Freeware', 'Beta', '2008-05-17 15:14:54', '0.2', 'dhrandy', 'dhrandy@gmail.com', 'dhrandy', '2004 Meedio, LLC', '', 'plugins/{3AE280F7-417F-46C1-91A7-904A94A0CF86}/0.2/beta/Vinci_M_0.2_Beta.mpp', '17602616', '', '', '', 2000000000000000, 1, 'Vinci M is based on the xbmc Vinci theme. http://users.edpnet.be/desertstorm/\n\nTo get the weather to work on the main screen, open "Full-time-plugins" in your Meedio Configuration.  Select datafeeds server and make sure both boxes are checked. Open "datafeeds editor" and add "Name=Weather", "Section=Weather", "Starting ID=0", "Interval=30" and select "Cycle between Values".  Save as "feeds" in "General/Plug-ins/Datafeeds Server" directory. Make sure datafeed server is checked in your full-time plug-ins. Enjoy!\n\nVisit http://www.meedios.com/forum/viewtopic.php?t=2794 for discussion and pictures of this theme.  Setup instructions are located in forum for music and movie views. Report any problems to the forum.  Thanks.\n\n.02 Updates\n\n-fixed meetvshows subtitle position\n-replaced todays hi with humidity on weather.screen\n-added numbers to meetvshows\n-changed play images\n-updated icons\n-fixed meetvshows series color\n-added media.comics\n-added tv show background\n-changed media.movie (looks better)\n-added unchecked image\n-added left toolbar to media.movie\n-added time to meetvshows module\n-added left toolbar to media.comics\n-added left toolbar to Media.MovieTimesVBNET\n-made meetvshows info easier to read\n-fixed FullScreen-popup image\n-added left toolbar to nowplaying\n-improved music view on group and subgroup screen\n-added nocoverart.png for group music view if no cover art is available\n-added mymovies.screen with more views\n-multiple fixes and improvements in NowPlaying.screen\n-updated mymovies.move.screen\n-meesicip integration and icons\n-other small updates', 'Vinci M', 'http://www.meedios.com/forum/viewtopic.php?t=2794', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={CD1DDBE7-0929-4179-A0DD-DB1CD69CC7C9}', '1.41', '', '0', '0', 2105, 2407, 0, 0, 0, 0, '0dc7d891cce27eecaaf03c375468859b', 'FALSE'),
