(1269, '{B6D3B945-A708-45E8-8022-F82D9D1130E8}', 'meeTVshowsImporter', 'Import TV Series and Episode Information', '', 'Import', 'None', 'Freeware', 'Stable', '2008-05-31 10:46:54', '4.0.0.4', 'walts81', 'joshwalters@gmail.com', 'walts81', '2008', '', 'plugins/{B6D3B945-A708-45E8-8022-F82D9D1130E8}/4.0.0.4/stable/meeTVshowsImporter_4.0.0.4_Stable.mpp', '814359', '', '', '', 4000000004000000000, 0, '1) Add importer to your TV Shows library\n\n2) Set custom settings\n\n3) Run the importer\n\n**NOTE**----------------------------------------------------------------------------------------------------------------\nThis plugin creates 1 new library, "meeTVshows-Series" \nIf running this importer for the first time, this new library will NOT appear until Meedio Config has been closed and re-started. All Episode data will be added to the library that this import is run from.', 'meeTVshowsImporter', 'http://www.meedios.com/OpenMAID', '', '1.41', '1.41', '0', '1', 869, 9128, 0, 0, 0, 0, 'dd0e27520f20cdd166952f280bd0db62', 'FALSE'),
