(1273, '{8A234EA8-B789-4533-A9DB-90A861CD351D}', 'My Movies', 'Browse Movie Collection', '', 'Module', 'None', 'Freeware', 'Stable', '2008-05-31 10:59:39', '1.0.3.1', 'walts81', 'joshwalters@gmail.com', 'walts81', '2007', '', 'plugins/{8A234EA8-B789-4533-A9DB-90A861CD351D}/1.0.3.1/stable/My_Movies_1.0.3.1_Stable.mpp', '1392583', '', '', '', 1000003001000000000, 0, 'No Documentation.', 'MyMovies', 'http://www.meedios.com/OpenMAID', '', '1.41', '1.41', '0', '1', 890, 13752, 0, 0, 0, 0, 'dc54a730f3096e0474cd2872f6aa9620', 'FALSE'),
(1274, '{26C39235-BDCF-4AF9-96F4-8B3CA4493071}', 'meedioVintage', 'Back to the 60''s', '', 'Theme', 'None', 'Freeware', 'Stable', '2008-05-31 13:53:42', '2.1.1', 'crni', 'N/A', 'crn', '2008', '', 'plugins/{26C39235-BDCF-4AF9-96F4-8B3CA4493071}/2.1.1/stable/meedioVintage_2.1.1_Stable.mpp', '19457629', '', '', 'Version.txt', 2001001000000000000, 0, 'Install, set your screen aspect ratio and enjoy !\n\nv2.1.1 stable\n--------------------------------------------\n- added ZUNE menu mod \n- added zune-subgroup\n- added Aeon horizontal-menu\n- added support for more menu names in AEON and ZUNE main menu\n- full list of available names:\n      movies\n      music\n      videos\n      clips\n      pictures\n      photos\n      weather\n      internet\n      news\n      e-mail\n      toons\n      cartoons\n      kids\n      games\n      tv\n      tv shows\n      tv night\n      shows\n      anime\n      settings\n      tools\n      config\n      watch\n      listen\n      misc\n      \n- added fanart support in MyMovies module\n- added coverflow support in MyMovies module\n- added mediainfo support in TVN3\n- added support for regular series-grid menu in meeTVshows (aka Classic mode)\n     set fanart to Fullscreen if using meeTVshows-Classic mode\n     set fanart to Performance if using meeTVshows-Fanart mod\n  \n- optimized code\n- fixed bugs\n\n\n\nv2.1.0 stable\n--------------------------------------------\n- AEON mod main menu\n- support for new web browser by althack\n- support for TVNight3\n- added performance mode for meeTVshows and TVN3 fanart\n- added option to choose shutdown mode:\nmeedio\nwindows\n\n- optimized code\n- fixed bugs\n\n\n\nv2 stable\n--------------------------------------------\n- added fanart support in meeTVShows Module\n- added mediainfo support in meeTVShows Module\n- added mediainfo support in MyMovies module\n\n- added option to show/hide browser navigation button\n- added option to hot-track mouse cursor\n- added clear playlist button in meeMusic Jukebox\n- added music player controls in meeMusic Jukebox\n- adjusted list view in meeMusic Jukebox\n- adjusted MovieNight for 4:3 aspect ratio\n- fixed albums and pictures captions\n- fixed time on main screen\n- redesigned MovieMee screen\n\n- updated TV screens by Adam Smith:\n  EPG\n  tv-info\n  tv-miniepg\n  tv-miniguide\n  tv-timeshift\n  \n- created few more icons\n- created new shadowed toolbar buttons\n- created new filmstrip glass sel button (500x500)\n- created new selection buttons (500x500)\n- created DVD, HD-DVD and BR cases\n- created mediainfo logos\n\n- fixed Icon Manager backgrounds support \n- added Carbon and Rebel backgrounds\n- added option to change default backgrounds with one click:\n  * Vintage 	(default green)\n  * Carbon		(carbon fiber)\n  * Rebel		(brown)\n  * Black 		(black)\n  \n- added option to set tag color\n- added option to set Title to use tag-color\n  * In media modules only\n  * Always\n  \n- changing tag-color will change glow-color under dock and arrows-color\n- available tag colors:\n  * green\n  * gold\n  * silver\n  * blue\n  * purple\n  * red\n  \n- added option to set buttons color\n- available buttons colors:\n  * black 		(default)\n  * asparagus	(green)\n  * denim 		(blue)\n  * amber 		(orange)\n  * rust 		(red)\n  * amethyst 	(purple)\n  * glass 		(glass)\n  \n\n- rewritten code\n- fixed bugs', 'meedioVintage', 'http://www.meedios.com/forum/viewtopic.php?t=1477', '', '', '', '0', '0', 1369, 15783, 0, 0, 0, 0, '284aeaf88eb4271a535903f7c266da92', 'FALSE'),
(1275, '{90D972C1-E7D3-4B41-BF65-81EC65D7ECDD}', 'USB-HID', 'Generic USB-HID input', '', 'Input', 'None', 'Donationware', 'Beta', '2008-06-02 15:03:22', '1.0', 'reverson1', '.', 'reverson1', '2008', '', 'plugins/{90D972C1-E7D3-4B41-BF65-81EC65D7ECDD}/1.0/beta/USB-HID_1.0_Beta.mpp', '16113', '', '', '', 1000000000000000000, 1, 'Notes:\n- Meedio does not have to have focus for this plugin to work.\n\n- If you are using this with a MCE Remote, it is strongly recommended that you\nonly configure the keys that Meedio doesn''t natively detect (Play, Pause, Record, etc).\n      \n- Currently, this plugin doesn''t support automatic repeating of a pressed key.\n\n- This plugin is preconfigured for the MCE Remote v2.\n\n****************************************************\nFor any other device you will need to the Product ID and Vendor ID of the device.\n\nTo find these #s in Windows XP:\nRight click My Computer\nClick Properties\nClick Hardware\nClick Device Manager\n\nFind your device\nDouble click it\nClick Details\nIn the bottom box, the device id will be listed:\nex: USB\\VID_0471&PID_0815\\PH00U9J6\n\nVendor ID = 0471, the #s after VID_\nProduct ID = 0815, the #s after PID_', 'USB-HID', 'http://www.meedios.com/forum/viewtopic.php?p=41074#41074', '', '', '', '0', '1', 838, 838, 0, 0, 0, 0, '4f5cf020b2774e90f971d90f91235a96', 'FALSE'),
(1276, '{BEBF8500-E655-4988-B4E7-21CA9A9F87B6}', 'Rom Importer', 'Imports roms in to meedio', '', 'Import', 'None', 'Freeware', 'Beta', '2008-06-02 19:14:52', '1.02', 'reverson1', '..', 'reverson1', '2008.', '', 'plugins/{BEBF8500-E655-4988-B4E7-21CA9A9F87B6}/1.02/beta/Rom_Importer_1.02_Beta.mpp', '4258053', '', '', '', 1002000000000000000, 0, 'Just adds roms and basic info to library.\n\nMAME is listed but not tested at this time...\n\n1.02 - adds the files for mame\nThis isn''t perfect and the files (especially cc.xml) may need to be edit manually to properly detect the country codes.', 'GameImporter', '..', '', '', '', '0', '1', 184, 1429, 0, 0, 0, 0, '49f542612276c129d6f9663f3b1e5d3e', 'FALSE'),
