(1304, '{119DDCEA-AAF0-49F9-9E74-4D26FE702753}', 'NetFlixWMP', 'NetFlixWMP - MeeFlix Helper', '', 'General', 'None', 'Freeware', 'Beta', '2008-06-16 11:40:33', '0.13', 'reverson1', 'richardeverson@hotmail.com', 'reverson1', '2008', '', 'plugins/{119DDCEA-AAF0-49F9-9E74-4D26FE702753}/0.13/beta/NetFlixWMP_0.13_Beta.mpp', '131129', '', '', '', 13000000000000000, 1, 'Requirements\r\n      -------------------------------------------------------------------------------------\r\n      WMP 11\r\n      MeeFlix\r\n      NetFlix Account (duh!)\r\n\r\n\r\n      To Watch Previews\r\n      -------------------------------------------------------------------------------------\r\n      FLV Splitter\r\n      FFDShow\r\n\r\n\r\n      Setup\r\n      -------------------------------------------------------------------------------------\r\n      Setup MeeFlix\r\n      Check to enable MeeFlix -> Send Play Message\r\n      Check to enable NetFlixWMP\r\n\r\n\r\n      History\r\n      -------------------------------------------------------------------------------------\r\n      .13   - Added On Screen Display \r\n                For now, title of video will be Netflix Watch Now Video\r\n                Show current time, position, duration, and estimated end time of video\r\n                Display progress in text and progress bar form\r\n            - Added volume actions to all of the screens\r\n            - Merged Althack''s invoke changes\r\n            - Added wait and osd screen size settings\r\n            - Will now ignore system.jump messages while playing a video\r\n\r\n      .12   - Added volume actions to screen (thanks jkm78)\r\n            - Fixed plugin file\r\n\r\n      .11   - Should fix focus issue when stopping a video\r\n            - Should fix problem where video was being played after exiting player\r\n            - Added screen for OSD (not currently used)\r\n\r\n      .1    - Initial Release', 'NetFlixWMP', 'http://www.meedios.com/forum/viewtopic.php?t=3127&start=0', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id=119DDCEA-AAF0-49F9-9E74-4D26FE702753', '', '', '0', '1', 514, 800, 0, 0, 0, 0, '9d0e97cb3c37fce725801a3826bed56b', 'FALSE'),
(1284, '{3343CFCF-FC96-4F16-B543-980FC8B411C3}', 'BTVImporter for BTV 4.8.1+', 'Import show information from BeyondTV (v4.8.1+) library into Meedio', '', 'Import', 'None', 'Freeware', 'Beta', '2008-06-08 14:04:24', '2.1', 'Artfulfox', 'katieking99@gmail.com', 'artfulfox', '(c) 2008 Artfulfox Software, (c) 2005 Ian Coggins', '', 'plugins/{3343CFCF-FC96-4F16-B543-980FC8B411C3}/2.1/beta/BTVImporter_for_BTV_4.8.1~_2.1_Beta.mpp', '1205615', '', '', 'Docs\\BTVImporter2_Readme.txt', 2001000000000000000, 1, 'This version of BTVImporter is compatible with BeyondTV versions 4.8.1 and higher. \nIt has not been tested with older versions of BTV but since BeyondTV Login API changed in version 4.8.1, I''m pretty sure it will *not* work.\n\nNote that the "defer login" flag no longer works in this version. I encountered problems with it and do not have time to figure out if it''s the new API or something I did. I''ve disabled it in the UI.\n\nThis version of the BTVImporter has a Debug switch. The Debug switch when enabled will create a new log file every day. It will append debug information to the same log file if the date has not changed. Please note that there is a very large amount of debug information written to the log files so they can take up a lot of disk space. Enable this only if you are having problems.\n\nThe log files should be located in the Meedio data directory under the Logs sub-directory (usually at "C:\\Documents and Settings\\All Users\\Application Data\\Meedio\\Logs)". You can find where this directory is on your machine by looking at the "data" value under the "HKEY_LOCAL_MACHINE\\SOFTWARE\\Meedio\\Meedio Essentials" registry key.\n\nThis version of BTVImporter is based on the original version by HTPCTools/Ian Coggins. It is used in the same way. You can find documentation about how to use the BTVImporter plugin by going to http://www.htpctools.com/btvimporter/ or by reading his BTV Importer-Install Guide.pdf in the docs directory under the importer.', 'BTVImporter2', 'http://www.meedios.com/forum/viewtopic.php?t=3095', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id={3343CFCF-FC96-4F16-B543-980FC8B411C3}', '', '', '0', '1', 787, 787, 0, 0, 0, 0, 'e86f9e28fa8d3a6990bdbfe338687a02', 'FALSE'),
(1290, '{2A78C80D-0CDE-4BFF-9DF9-5BA1DD480B91}', 'DynamicMenus', 'Helps automatically configure some Meedio settings dynamically.', '', 'General', 'None', 'Freeware', 'Beta', '2008-06-10 17:35:14', '1.9.3.6', 'binary64', 'slug@skyforge.net', 'binary64', '2007', '', 'plugins/{2A78C80D-0CDE-4BFF-9DF9-5BA1DD480B91}/1.9.3.6/beta/DynamicMenus_1.9.3.6_Beta.mpp', '597709', '', '', '', 1009003006000000000, 1, 'This plugin is for advanced systems integrators only. Config has intellisense enabled :P', 'DynamicMenus', 'www.MeediOS.com', '', '', '', '0', '1', 2327, 5981, 0, 0, 0, 0, '12e1cf9af4f5c98c984bdb70d54c6a35', 'FALSE'),
(1291, '{119DDCEA-AAF0-49F9-9E74-4D26FE702753}', 'NetFlixWMP', 'NetFlixWMP - MeeFlix Helper', '', 'General', 'None', 'Freeware', 'Beta', '2008-06-13 15:15:13', '0.1', 'reverson1', 'richardeverson@hotmail.com', 'reverson1', 'PayPal Me!!!', '', 'plugins/{119DDCEA-AAF0-49F9-9E74-4D26FE702753}/0.1/beta/NetFlixWMP_0.1_Beta.mpp', '126467', '', '', '', 1000000000000000, 0, 'Thanks AlThack!\n\nSetup MeeFlix\nCheck to enable MeeFlix -> Send Play Message \n\nCheck to enable NetFlixWMP\n\n\nNote:\nCurrently on my system, I am unable to play the Preview videos. They also don''t play in wmp either....', 'NetFlixWMP', '', '', '1.41', '', '0', '1', 94, 800, 0, 0, 0, 0, '0e3dad3e4b97cf01b387f05fee2c21f5', 'FALSE'),
