(1294, '{119DDCEA-AAF0-49F9-9E74-4D26FE702753}', 'NetFlixWMP', 'NetFlixWMP - MeeFlix Helper', '', 'General', 'None', 'Freeware', 'Beta', '2008-06-14 00:33:54', '0.11', 'reverson1', 'richardeverson@hotmail.com', 'reverson1', 'PayPal Me!!!', '', 'plugins/{119DDCEA-AAF0-49F9-9E74-4D26FE702753}/0.11/beta/NetFlixWMP_0.11_Beta.mpp', '128030', '', '', '', 11000000000000000, 0, 'Requirements\n-------------------------------------------------------------------------------------\nWMP 11 \nMeeFlix \nNetFlix Account (duh!)\n\n\nSetup\n-------------------------------------------------------------------------------------\nSetup MeeFlix \nCheck to enable MeeFlix -> Send Play Message \nCheck to enable NetFlixWMP\n\n\nHistory\n-------------------------------------------------------------------------------------\n.11 -  Should fix focus issue when stopping a video\n      -  Should fix problem where video was being played after exiting player\n      -  added screen for OSD (not currently used)\n\n.1 - Initial Release\n\n\nNotes\n-------------------------------------------------------------------------------------\nPreview videos are currently not supported. Sorry.', 'NetFlixWMP', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id=119DDCEA-AAF0-49F9-9E74-4D26FE702753', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id=119DDCEA-AAF0-49F9-9E74-4D26FE702753', '1.41', '', '0', '1', 91, 800, 0, 0, 0, 0, 'f8472988808ae99e9479f832e61edd78', 'FALSE'),
(1295, '{119DDCEA-AAF0-49F9-9E74-4D26FE702753}', 'NetFlixWMP', 'NetFlixWMP - MeeFlix Helper', '', 'General', 'None', 'Freeware', 'Beta', '2008-06-14 00:42:13', '0.12', 'reverson1', 'richardeverson@hotmail.com', 'reverson1', 'PayPal Me!!!', '', 'plugins/{119DDCEA-AAF0-49F9-9E74-4D26FE702753}/0.12/beta/NetFlixWMP_0.12_Beta.mpp', '128148', '', '', '', 12000000000000000, 0, 'Requirements\n-------------------------------------------------------------------------------------\n  WMP 11 \n  MeeFlix \n  NetFlix Account (duh!)\n\n\nSetup\n-------------------------------------------------------------------------------------\n  Setup MeeFlix \n  Check to enable MeeFlix -> Send Play Message\n  Check to enable NetFlixWMP\n\n\nHistory\n-------------------------------------------------------------------------------------\n  .12   - Added volume actions to screen (thanks jkm78)\n        - Fixed plugin file\n\n  .11   - Should fix focus issue when stopping a video\n        - Should fix problem where video was being played after exiting player\n        - Added screen for OSD (not currently used)\n\n  .1    - Initial Release\n\n\nNotes\n-------------------------------------------------------------------------------------\n  Preview videos are currently not supported. Sorry.', 'NetFlixWMP', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id=119DDCEA-AAF0-49F9-9E74-4D26FE702753', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id=119DDCEA-AAF0-49F9-9E74-4D26FE702753', '1.41', '', '0', '1', 101, 800, 0, 0, 0, 0, '9f4b351bdd285afcbd1523ce240a8464', 'FALSE'),
(1296, '{01E9E9C3-A55F-4B01-B454-CB49B07E7679}', 'Smart Series Sorter', 'Smartly parses your TV episodes from your largely-unsorted archive; ready for meeTvShows.', '', 'Import', 'None', 'Donationware', 'Beta', '2008-06-14 00:46:00', '3.1', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64', '', 'plugins/{01E9E9C3-A55F-4B01-B454-CB49B07E7679}/3.1/beta/Smart_Series_Sorter_3.1_Beta.mpp', '210791', '', '', '', 3001000000000000000, 0, '1. Use this importer instead of your Tag File Importer or similar.\n			2. Add some sorted directories.\n\n			So if you add "O:\\MySeries", you should also have the following sub-directories\n			in it:\n\n			O:\\MySeries\\Lost\\\n			O:\\MySeries\\4400, The\\\n			etc\n\n			This adds ''Lost'' and ''4400, The'' as your "sorted" or "authorised" series. This will rename episodes such as "the.4400" into "4400, The" for example.\n\n			Hint: the first sorted directory will get all unauthorised series dumped into it (if that option is on.. read on).\n\n			3. Add some dump dirs.\n\n			These directories will contain a whole heap of files - named in radically different formats. All files in dump dirs should be finished downloading.\n\n			4. Perform Moves : NOT IMPLEMENTED. Use the upcoming win32 v2.0 for this for now.\n\n			5. Only import sorted series : if enabled, only series which you have defined by creating a sub-dir inside a sorted dir, will be added to the current section. If disabled, the SeriesName''s generally become erratic and un-uniform.\n\n			6. File exensions : These are files that get parsed, so it will ignore your files such as *.zip in your dump dirs..\n\n			That''s it! I included some delays before and after disk I/O in the hope that it doesn''t interuppt your Meedio viewing experiance.', 'SmartSeriesImporter', 'http://www.skyforge.net/~slug/', '', '', '', '0', '1', 48, 3847, 0, 0, 0, 0, '20ee3f0accc1abf27eb885f8bf559bc0', 'FALSE'),
