(1348, '{C2FE6241-6A6E-4396-8979-913DF68B465B}', 'PushPop', 'Filter/hide rows from an individual importer', '', 'Import', 'None', 'Donationware', 'Alpha', '2008-07-12 16:30:18', '1.1', 'binary64', 'slug@skyforge.net', 'binary64', '2008', '', 'plugins/{C2FE6241-6A6E-4396-8979-913DF68B465B}/1.1/alpha/PushPop_1.1_Alpha.mpp', '9712', '', '', '', 1001000000000000000, 0, 'A good combo for using this plugin is: my Seed plugin + this plugin + Darkmoor''s meeFileRenamer with this filter: "(coming soon)"', 'PushPop', 'http://www.meedios.com/forum/viewtopic.php?t=2647', '', '', '', '0', '1', 115, 912, 0, 0, 0, 0, '3b933a5733385e28bf238fcd61eceaf8', 'FALSE'),
(1352, '{1960511A-8316-4C05-8367-14733BFCD814}', 'Enhanced Group Module', 'Allows you to add modules to the menu with dynamic backgrounds.', '', 'Module', 'None', 'Freeware', 'Alpha', '2008-07-14 11:07:48', '0.2.2', 'stealth82', 'volpatos@libero.it', 'stealth82', '', '', 'plugins/{1960511A-8316-4C05-8367-14733BFCD814}/0.2.2/alpha/Enhanced_Group_Module_0.2.2_Alpha.mpp', '9735', '', '', '', 2002000000000000, 0, '', 'EnhancedGroup', '', '', '', '', '0', '1', 73, 5259, 0, 0, 0, 0, '2ecd412e6aa38ca9959691648f61b098', 'FALSE'),
(1353, '{1960511A-8316-4C05-8367-14733BFCD814}', 'Enhanced Group Module', 'Allows you to add modules with optional dynamic backgrounds to the menu.', '', 'Module', 'None', 'Freeware', 'Alpha', '2008-07-14 13:08:20', '0.2.3', 'stealth82', 'volpatos@libero.it', 'stealth82', '', '', 'plugins/{1960511A-8316-4C05-8367-14733BFCD814}/0.2.3/alpha/Enhanced_Group_Module_0.2.3_Alpha.mpp', '10161', '', '', '', 2003000000000000, 0, 'Furthermore what the Group Module is capable of, this plugin allows you to load screen backgrounds dinamically.\n\nThe pick is made by matching some screen variables with any valid tag name library item designed for it - normally {category}.\n\nTherefore, it requires a section library that contains valid references to whatever image path in your system. It requires, also, a valid group screen in order to use the published variables as a background image.\n\nIf there''s a match between the sesction library and the current {selected-caption}, or the current {module-caption}, some new variables are send to screen:\n\n{selected-background}\n{module-background}\n\nYoy can also send some commands to interact with the cycle:\n\nCycle all backgrounds: egm.background-cycle\nCycle only current background (previous image): egm.background-prev\nCycle only current background (next image): egm.background-next', 'EnhancedGroup', '', '', '', '', '0', '1', 111, 5259, 0, 0, 0, 0, '1454017e3385b1393cdff9d59611d67b', 'FALSE'),
(1354, '{1960511A-8316-4C05-8367-14733BFCD814}', 'Enhanced Group Module', 'Allows you to add modules with optional dynamic backgrounds to the menu.', '', 'Module', 'None', 'Freeware', 'Alpha', '2008-07-15 11:39:53', '0.2.4', 'stealth82', 'volpatos@libero.it', 'stealth82', '', '', 'plugins/{1960511A-8316-4C05-8367-14733BFCD814}/0.2.4/alpha/Enhanced_Group_Module_0.2.4_Alpha.mpp', '10428', '', '', '', 2004000000000000, 0, 'Furthermore what the Group Module is capable of, this plugin allows you to load screen backgrounds dinamically.\n\n\n\nThe pick is made by matching some screen variables with any valid tag name library item designed for it - usually {category}.\n\n\n\nTherefore, it requires a section library that contains valid references to whatever image path in your system. It requires, also, a valid group screen in order to use the published variables as a background image.\n\n\n\nIf there''s a match between the section library and the current {selected-caption}, or the current {module-caption}, some new variables are send to screen:\n\n\n\n{selected-background}\n\n{module-background}\n\n\n\nYoy can also send some commands to interact with the cycle:\n\n\n\nCycle all backgrounds: egm.background-cycle\n\nCycle only current background (previous image): egm.background-prev\n\nCycle only current background (next image): egm.background-next', 'EnhancedGroup', '', '', '', '', '0', '1', 137, 5259, 0, 0, 0, 0, 'ef4a1baa004083fb436dcb73684e9f45', 'FALSE'),
(1355, '{1960511A-8316-4C05-8367-14733BFCD814}', 'Enhanced Group Module', 'Allows you to add modules with optional dynamic backgrounds to the menu.', '', 'Module', 'None', 'Freeware', 'Alpha', '2008-07-17 08:36:47', '0.2.5', 'stealth82', 'volpatos@libero.it', 'stealth82', '', '', 'plugins/{1960511A-8316-4C05-8367-14733BFCD814}/0.2.5/alpha/Enhanced_Group_Module_0.2.5_Alpha.mpp', '10467', '', '', '', 2005000000000000, 0, 'Furthermore what the Group Module is capable of, this plugin allows you to load screen backgrounds dinamically.\n\n\n\nThe pick is made by matching some screen variables with any valid tag name library item designed for it - usually {category}.\n\n\n\nTherefore, it requires a section library that contains valid references to whatever image path in your system. It requires, also, a valid group screen in order to use the published variables as a background image.\n\n\n\nIf there''s a match between the section library and the current {selected-caption}, or the current {module-caption}, some new variables are send to screen:\n\n\n\n{selected-background}\n\n{module-background}\n\n\n\nYoy can also send some commands to interact with the cycle:\n\n\n\nCycle all backgrounds: egm.background-cycle\n\nCycle only current background (previous image): egm.background-prev\n\nCycle only current background (next image): egm.background-next', 'EnhancedGroup', 'http://www.meedios.com/forum/viewtopic.php?t=3310', '', '', '', '0', '1', 186, 5259, 0, 0, 0, 0, '15907e3d7178def5de0cce5103c9eb84', 'FALSE'),
(1356, '{46179E35-A6D3-4BC1-A357-D6017992F572}', 'MeeFlix', 'NetFlix - Meedio Style', '', 'Module', 'None', 'Freeware', 'Stable', '2008-07-17 12:11:23', '1.0.1.0', 'UFGrayMatter', 'ufgraymatter@gmail.com', 'UFGrayMatter', 'PayPal Me!!!', '', 'plugins/{46179E35-A6D3-4BC1-A357-D6017992F572}/1.0.1.0/stable/MeeFlix_1.0.1.0_Stable.mpp', '971190', '', '', '', 1000001000000000000, 0, '', 'MeeFlix', 'http://www.meedios.com/forum/viewtopic.php?t=2140', '', '1.41', '1.41', '0', '1', 381, 5492, 0, 0, 0, 0, '5ff851eb831a81e43c7ca55c4f182190', 'FALSE'),
(1357, '{26C39235-BDCF-4AF9-96F4-8B3CA4493071}', 'meedioVintage', 'Back to the 60''s', '', 'Theme', 'None', 'Freeware', 'Stable', '2008-07-17 13:51:07', '2.1.2', 'crni', 'N/A', '', '2008', '', 'plugins/{26C39235-BDCF-4AF9-96F4-8B3CA4493071}/2.1.2/stable/meedioVintage_2.1.2_Stable.mpp', '19560369', '', '', 'Version.txt', 2001002000000000000, 1, 'Install, set your screen aspect ratio and enjoy !\n\nv2.1.2 stable\n--------------------------------------------\n- redid lyrics and coverart pages in nowplaying screen\n- added support for Enhanced Group Module\n\n- new fanart library mode (requires fanart libray and Enhanced Group Module)\n- new fanart folder mode \n\n- added theme options to choose fanart mode:\n	use fanart library \n	Use fanart folder\n	\n- added theme option to set menu mode:\n	Directional\n	Horizontal\n\n- optimized code\n- fixed bugs\n\nv2.1.1 stable\n--------------------------------------------\n- added ZUNE menu mod \n- added zune-subgroup\n- added Aeon horizontal-menu\n- added support for more menu names in AEON and ZUNE main menu\n- full list of available names:\n      movies\n      music\n      videos\n      clips\n      pictures\n      photos\n      weather\n      internet\n      news\n      e-mail\n      toons\n      cartoons\n      kids\n      games\n      tv\n      tv shows\n      tv night\n      shows\n      anime\n      settings\n      tools\n      config\n      watch\n      listen\n      misc\n      \n- added fanart support in MyMovies module\n- added coverflow support in MyMovies module\n- added mediainfo support in TVN3\n- added support for regular series-grid menu in meeTVshows (aka Classic mode)\n	set fanart to Fullscreen if using meeTVshows-Classic mode\n	set fanart to Performance if using meeTVshows-Fanart mod\n  \n- optimized code\n- fixed bugs\n\n\n\nv2.1.0 stable\n--------------------------------------------\n- AEON mod main menu\n- support for new web browser by althack\n- support for TVNight3\n- added performance mode for meeTVshows and TVN3 fanart\n- added option to choose shutdown mode:\nmeedio\nwindows\n\n- optimized code\n- fixed bugs\n\n\n\nv2 stable\n--------------------------------------------\n- added fanart support in meeTVShows Module\n- added mediainfo support in meeTVShows Module\n- added mediainfo support in MyMovies module\n\n- added option to show/hide browser navigation button\n- added option to hot-track mouse cursor\n- added clear playlist button in meeMusic Jukebox\n- added music player controls in meeMusic Jukebox\n- adjusted list view in meeMusic Jukebox\n- adjusted MovieNight for 4:3 aspect ratio\n- fixed albums and pictures captions\n- fixed time on main screen\n- redesigned MovieMee screen\n\n- updated TV screens by Adam Smith:\n  EPG\n  tv-info\n  tv-miniepg\n  tv-miniguide\n  tv-timeshift\n  \n- created few more icons\n- created new shadowed toolbar buttons\n- created new filmstrip glass sel button (500x500)\n- created new selection buttons (500x500)\n- created DVD, HD-DVD and BR cases\n- created mediainfo logos\n\n- fixed Icon Manager backgrounds support \n- added Carbon and Rebel backgrounds\n- added option to change default backgrounds with one click:\n  * Vintage 	(default green)\n  * Carbon		(carbon fiber)\n  * Rebel		(brown)\n  * Black 		(black)\n  \n- added option to set tag color\n- added option to set Title to use tag-color\n  * In media modules only\n  * Always\n  \n- changing tag-color will change glow-color under dock and arrows-color\n- available tag colors:\n  * green\n  * gold\n  * silver\n  * blue\n  * purple\n  * red\n  \n- added option to set buttons color\n- available buttons colors:\n  * black 		(default)\n  * asparagus	(green)\n  * denim 		(blue)\n  * amber 		(orange)\n  * rust 		(red)\n  * amethyst 	(purple)\n  * glass 		(glass)\n  \n\n- rewritten code\n- fixed bugs', 'meedioVintage', 'http://www.meedios.com/forum/viewtopic.php?t=1477', '', '', '', '0', '0', 6622, 15783, 0, 0, 0, 0, '79db1839585967c20aef0752d1d0e186', 'FALSE'),
(1358, '{1740815E-B698-4330-A38B-64CE13953085}', 'meedioVintage Ultimate Edition Icons', 'meedioVintage icons (420x420) - Ultimate Edition', '', 'Icon', 'None', 'Freeware', 'Stable', '2008-07-17 15:46:26', '1.0.1', 'crni, jkm78', 'N/A', 'jkm78', '2007', '', 'plugins/{1740815E-B698-4330-A38B-64CE13953085}/1.0.1/stable/meedioVintage_Ultimate_Edition_Icons_1.0.1_Stable.mpp', '16348310', '', '', '', 1000001000000000000, 1, 'This Icon set is designed for Meedio Ultimate and is not an Official meedioVintage Icon Set. jkm78\n\nThese icons are part of meedioVintage theme and they are available ONLY for personal use.\nDo NOT modify or redistribute them under any condition.\nIf you want to use them in your projects please contact me via email.\ncrni@hi.htnet.hr', '..\\images\\icons\\meedioVintage-UE', '', '', '', '', '0', '0', 1752, 2399, 0, 0, 0, 0, 'c9554db3f2fa00fb7f9537f7d65050c0', 'FALSE'),
(1359, '{91CD8948-7F65-4533-BDB1-0572059E76EE}', 'Vision-Icons-LT', 'Icons for the Vison 2 Theme, Or any theme you want ;)', '', 'Icon', 'None', 'Freeware', 'Stable', '2008-07-17 15:53:39', '1.01', 'jkm78', 'N/A', 'jkm78', '2007', '', 'plugins/{91CD8948-7F65-4533-BDB1-0572059E76EE}/1.01/stable/Vision-Icons-LT_1.01_Stable.mpp', '14478472', '', '', '', 1001000000000000000, 1, 'Light version of Vision Icons used with Meedio Ultimate.\nDesigned to by used with the Vision 2 theme.\nInstall and enjoy!, New High-Res Set. Now with Thinner Border.', '..\\images\\icons\\Vision-Icons-LT', '', '', '', '', '0', '0', 1007, 1356, 0, 0, 0, 0, '265c3b790a3d91e9852a5a1473229207', 'FALSE'),
