(1361, '{1960511A-8316-4C05-8367-14733BFCD814}', 'Enhanced Group Module', 'Allows you to add modules with optional dynamic backgrounds to the menu.', '', 'Module', 'None', 'Freeware', 'Alpha', '2008-07-20 08:08:28', '0.2.6', 'stealth82', 'volpatos@libero.it', 'stealth82', '', '', 'plugins/{1960511A-8316-4C05-8367-14733BFCD814}/0.2.6/alpha/Enhanced_Group_Module_0.2.6_Alpha.mpp', '10709', '', '', '', 2006000000000000, 0, 'Furthermore what the Group Module is capable of, this plugin allows you to load screen backgrounds dinamically.\n\nThe pick is made by matching some screen variables with any valid tag name library item designed for it - usually {category}. Therefore, it requires a section library that contains valid references to whatever image path in your system. It requires, also, a valid group screen in order to use the published variables as a background image.\n\nIf there''s a match between the section library and the current {selected-caption}, or the current {module-caption}, some new variables are send to screen:\n\n{selected-background}\n{module-background}\n\nYoy can also send some commands to interact with the cycle:\n\nCycle all backgrounds: egm.background-cycle\nCycle only current background (previous image): egm.background-prev\nCycle only current background (next image): egm.background-next', 'EnhancedGroup', 'http://www.meedios.com/forum/viewtopic.php?t=3310', '', '', '', '0', '1', 195, 5259, 0, 0, 0, 0, 'db1ad7441a717cfd7d5f41ce52f98486', 'FALSE'),
