(1365, '{A44E43FE-3822-4CE1-99DA-220DC0BA89F0}', 'SmartMovieSorter', 'Filters out unneccessary garbage in movie file names ready for imdbmee', '', 'Import', 'None', 'Donationware', 'Alpha', '2008-07-22 07:50:18', '3.1.1.1', 'binary64', 'slug@skyforge.net', 'binary64', '(c) 2006 binary64. Commerical usage requires prior authorization.', '', 'plugins/{A44E43FE-3822-4CE1-99DA-220DC0BA89F0}/3.1.1.1/alpha/SmartMovieSorter_3.1.1.1_Alpha.mpp', '198624', '', '', '', 3001001001000000000, 0, 'This importer is for the lazy man.\n    \n    Setup:\n    1. Download, install this plugin.\n    2. Open Meedio Configuration.\n    3. Add a new Section "Movies"\n    4. Add a new importer, Tag Mask importer or Enhanced Tag Mask importer with any mask\n    5. Add this importer\n    6. Run the Tag mask importer\n    7. Run the SMS importer\n    8. Now run IMDB/etc importers.', 'SmartMovieSorter', 'http://www.MeediOS.com/', '', '', '', '0', '1', 360, 4005, 0, 0, 0, 0, '974ee26e871969d649d14a04cdd90a4a', 'FALSE'),
