(1376, '{E455249E-732A-4DB0-B3C9-23F255696C1B}', 'MeeLyrics', 'A Meedio plugin that grabs lyrics from multiple lyrics sites', '', 'General', 'None', 'Donationware', 'Stable', '2008-08-01 17:21:57', '1.0.1.4', 'UFGrayMatter', 'UFGrayMatter@gmail.com', 'UFGrayMatter', 'paypal me! :)', '', 'plugins/{E455249E-732A-4DB0-B3C9-23F255696C1B}/1.0.1.4/stable/MeeLyrics_1.0.1.4_Stable.mpp', '195485', '', '', '', 1000001004000000000, 1, 'Theme Designers:\nSend Message: meelyrics.nextsite to search a different lyric site\nSend Message: meelyrics.savelyrics to save the lyrics to the library', 'MeeLyrics', '', '', '', '', '0', '1', 1399, 5435, 0, 0, 0, 0, 'c887037f9c507148c6c8732cdcf64262', 'FALSE'),
(1377, '{BEBF8500-E655-4988-B4E7-21CA9A9F87B6}', 'Rom Importer', 'Imports roms in to meedio', '', 'Import', 'None', 'Freeware', 'Beta', '2008-08-04 14:48:46', '1.03', 'reverson1', '..', 'reverson1', '2008.', '', 'plugins/{BEBF8500-E655-4988-B4E7-21CA9A9F87B6}/1.03/beta/Rom_Importer_1.03_Beta.mpp', '4258291', '', '', '', 1003000000000000000, 0, 'Just adds roms and basic info to library.\n\nMAME is listed but not tested at this time...\n\n1.02 - adds the files for mame\nThis isn''t perfect and the files (especially cc.xml) may need to be edit manually to properly detect the country codes.\n\n1.03 \nFixed problem with multiple image types not being used properly\nFixed problem where an error would occur if the image folder wasn''t specified', 'GameImporter', '..', '', '', '', '0', '1', 588, 1429, 0, 0, 0, 0, 'e356444d4628cade60232f0cbd6dcf4e', 'FALSE'),
