(1405, '{A5CC9EAF-D107-42D4-A70E-DF5537F16333}', 'meedioChrome', 'meedioChrome v1.1 beta', '', 'Theme', 'None', 'Freeware', 'Beta', '2008-09-03 07:27:30', '1.1', 'crni', '---', 'crn', '2008', '', 'plugins/{A5CC9EAF-D107-42D4-A70E-DF5537F16333}/1.1/beta/meedioChrome_1.1_Beta.mpp', '25070859', '', '', '', 1001000000000000000, 1, 'meedioChrome v1.1 beta\n--------------------------------------------\n\n- added REBEL theme mode\n- added GRID (aka ''Racedriver GRID'') theme mode\n- added GRID main menu mode\n- added experimental filmstrip mode to MyMovies screen\n- added option to position Chrome menu bottom / center\n- added option to show toolbar description in TV shows module(s)\n- added support for updated weathered module (1.7.x)\n- added option to show/hide weather location on main screen\n- added option to show album cover in lyrics now playing screen\n- added director/writer menu in MyMovies\n- added moviestimesVBNET.screen (by AdamSmith)\n- added support for Sleeptimer plugin (by AdamSmith)\n- added basic TV / EPG screens by AdamSmith (not yet finished)\n- added Empty Bin in file browser (by Kricker)\n- added support for icons set using Icon Manager (by Kricker)\n- added artist fanart image in music library albums and tracks screen\n- added main menu font size option\n- added log off button\n- added aspect ratio button to video player controls\n- added comics screen\n\n- fixed weather location screen \n- fixed support for genres fanart images in music library\n- fixed thumbs and posters placeholders\n- fixed text selections\n- fixed news screens\n- fixed default media screens\n- fixed search in media screens and music library\n- fixed windows shutdown mode\n- fixed PIN screen\n- fixed ticker time cell size\n- fixed myMovies title and subtitle\n\n\n- fixed bugs\n- optimized code\n\n- go to the Plugin Web Site for release details\n- go to the Plugin WIKI page for setup instructions :!:', 'meedioChrome', 'http://www.meedios.com/forum/viewtopic.php?t=3387', 'http://www.meedios.com/forum/viewtopic.php?t=3387', '1.41', '', '0', '0', 3143, 3966, 0, 0, 0, 0, 'dc28e857fc95e08cb6c56ba12d578673', 'FALSE'),
