(1420, '{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}', 'T-Minus Delete', 'This importer will delete files after a specified number of days.', '', 'Import', 'None', 'Freeware', 'Beta', '2008-09-13 19:17:51', '0.1.9', 'ccrocker', 'cbcrocker@cox.net', 'ccrocker', 'Copyright Â© 2008', '', 'plugins/{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}/0.1.9/beta/T-Minus_Delete_0.1.9_Beta.mpp', '6273', '', '', '', 1009000000000000, 0, 'This importer will delete a file after a specified number of days.  This Importer will create tag named "ArchivePreference" .  This tag should be populated as either "Temporary" or "Permanent"  either manually or via another importer.  Temporary files are subject to deletion after a user selected number of days.  Permanent files are not deleted.  The tag DaysUntilDeletion will count down days each time the importer is run.  When this amount is less than 1, the related file and library item will be deleted.  \n\nCan also be set to delete "Temporary" files after watched.\n\nUsing .net 2.0', 'T-Minus Delete', 'http://www.meedios.com/forum/viewtopic.php?t=2702', '', '', '', '0', '1', 101, 1441, 0, 0, 0, 0, '4a8450865ff2a562f9f74dc375042cc2', 'FALSE'),
