(1423, '{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}', 'T-Minus Delete', 'This importer will delete files after a specified number of days.', '', 'Import', 'None', 'Freeware', 'Beta', '2008-09-14 21:48:53', '0.2.2', 'ccrocker', 'cbcrocker@cox.net', 'ccrocker', 'Copyright Â© 2008', '', 'plugins/{B3FAED9C-56FE-4E53-888C-EEE8AD141F97}/0.2.2/beta/T-Minus_Delete_0.2.2_Beta.mpp', '6632', '', '', '', 2002000000000000, 0, 'This importer will delete a file after a specified number of days.  This Importer will create tag named "ArchivePreference" .  This tag should be populated as either "Temporary" or "Permanent"  either manually or via another importer.  Temporary files are subject to deletion after a user selected number of days.  Permanent files are not deleted.  The tag DaysUntilDeletion will count down days each time the importer is run.  When this amount is less than 1, the related file and library item will be deleted.  \n\nCan also be set to delete "Temporary" files after watched.\n\nUsing .net 2.0', 'T-Minus Delete', 'http://www.meedios.com/forum/viewtopic.php?t=2702', '', '', '', '0', '1', 146, 1441, 0, 0, 0, 0, '2cc9d4b801e67b579da2bac58cfbaa4e', 'FALSE'),
(1424, '{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}', 'OpenMAID', 'An alternative, free, and open Add-in Directory', '', 'Module', 'None', 'Freeware', 'Stable', '2008-09-15 00:16:38', '1.5.4.1', 'binary64', 'slug@skyforge.net', 'binary64', '2006 binary64', '', 'plugins/{0CF982B9-7D1B-4E7C-A189-1AAEC43CA062}/1.5.4.1/stable/OpenMAID_1.5.4.1_Stable.mpp', '224772', '', '', '', 1005004001000000000, 1, 'Changes:\n\n1.5.4.1 (15.Sep.08)\n* Failed downloads get re-tried at the end, 3 times max.\n* If they fail 3 times it doesn''t update that plugin (before the .mus produced a msgbox error).\n\n1.5.4 (??)\n* ??\n\n1.5.3.1 (30.Nov.07)\n* Fixed a few Meedio threading crashes\n\n1.5.3 (11.Sep.07)\n* Stop fatal crash if a database is down.\n* Handle all databases being download friendily (keep retrying).\n* Now handles the EXIT command, and exits the module. Before, only BACK seemed to worked.\n\n1.5.2.2 (31.May.07)\n* Avoided the problem where updates to plugin option defaults do not happen on upgrade.\n* Changed MeediOS'' OpenMAID URL to the v2 site.\n\n1.5.2.1 (13.Apr.07)\n* Downloads now done on own thread.\n* Made the shopping basket refer by guid only\n* Fix crash when exiting prematurely\n* Allow closing of screen whilst downloading. Downloads will continue and when finished, Meedio will restart ubruptly.\n* Fixed some other bugs\n\n1.5.2 (13.Apr.07)\n* Added new config to enter multiple database locations (in order of download preference)\n* Fixed a crash on exit\n* Progress as plugins are downloaded\n* Fixed timeout issue\n* Merge databases now also merges missing meta tags to show more info\n* Now OpenMAID v2 compatible (using v2''s simple/backcompat api only)\n\n1.5.1 (17.Mar.07)\n* Plugins are now downloaded locally before installing (progress bar is now possible)\n* Support manual rollback; Old versions are now archived in [MEEDIO-DATA]\\OpenMAID\\plugins\\{guid} name (type)\\date time version (state).mpp\n* After installation, Meedio.bat gets executed instead of the .exe (so you can put custom commands in the .bat)\n* If Meedio.bat does not exist, a default one is created (runs Meedio.exe)\n\n1.5.0.1 (15.Mar.07)\n* Small bug fixes\n\n1.5 (15.Mar.07)\n* Changed from using IMeedioItem+List to C# Generics\n* Improved the threading\n* Save Defaults now saves the main view filter (actions in the openmaid.screen have changed)\n\n1.4.0.1 (10.Mar.07)\n* Fixed the assumption that Meedio was installed to C:. Location is now read from registry.\n* You can now jump to a plugin in the list by tapping the first few letters of its Name.\n* Fixed 2 Sort-by-Downloads bugs\n\n1.4 (09.Mar.07)\n* Added 2 caching layers for the views\n* Made startup text ''animated'' as it progresses\n* Added a new view: "Lost" which are plugins you have installed, that aren''t on MAID''s\n* Added a space inbetween version and state\n* Fixed error window showing when exiting module quickly\n* You can now directly Install from the list, without having to enter the Review page\n* Fixed bug if \\images folder didn''t exist\n\n1.3.3.4 (08.Mar.07)\n* Added a new view: "Older" which show plugins on MAID that are older than your installed version. An author uploads a lower version, and it will appear in this view.\n\n1.3.3.3 (08.Mar.07)\n* New and better version parsing Thanks to Darkmoor\n	  \n1.3.3.2 (08.Mar.07)\n* Fixed debug msgbox from popping up\n* Fixed small bug with alpha parsing\n	  \n1.3.3.1 (07.Mar.07)\n* Parse versions with alpha chars (thanks Darkmoor)', 'OpenMAID', '', '', '', '', '0', '1', 1625, 4359, 0, 0, 0, 0, '1ff5765d719df5020df4a2aa4b9d80ee', 'FALSE'),
(1425, '{A44E43FE-3822-4CE1-99DA-220DC0BA89F0}', 'SmartMovieSorter', 'Filters out unneccessary garbage in movie file names ready for imdbmee', '', 'Import', 'None', 'Donationware', 'Alpha', '2008-09-20 04:42:11', '3.2', 'binary64', 'slug@skyforge.net', 'binary64', '(c) 2006 binary64. Commerical usage requires prior authorization.', '', 'plugins/{A44E43FE-3822-4CE1-99DA-220DC0BA89F0}/3.2/alpha/SmartMovieSorter_3.2_Alpha.mpp', '211653', '', '', '', 3002000000000000000, 0, 'This importer is for the lazy man.\n    \n    Setup:\n    1. Download, install this plugin.\n    2. Open Meedio Configuration.\n    3. Add a new Section "Movies"\n    4. Add a new importer, Tag Mask importer or Enhanced Tag Mask importer with any mask\n    5. Add this importer\n    6. Run the Tag mask importer\n    7. Run the SMS importer\n    8. Now run IMDB/etc importers.', 'SmartMovieSorter', 'http://www.MeediOS.com/', '', '', '', '0', '1', 744, 4005, 0, 0, 0, 0, '5543ec35389af4608c7eaa3026f40ada', 'FALSE'),
