(1430, '{1960511A-8316-4C05-8367-14733BFCD814}', 'Enhanced Group Module', 'Allows you to add modules with optional dynamic backgrounds to the menu.', '', 'Module', 'None', 'Freeware', 'Beta', '2008-09-22 13:44:18', '0.9', 'stealth82', 'volpatos@libero.it', 'stealth82', '2008', '', 'plugins/{1960511A-8316-4C05-8367-14733BFCD814}/0.9/beta/Enhanced_Group_Module_0.9_Beta.mpp', '10859', '', '', '', 9000000000000000, 0, 'Furthermore what the Group Module is capable of, this plugin allows you to load screen backgrounds dinamically.\n\nThe pick is made by matching some screen variables with any valid tag name library item designed for it - usually {category}. Therefore, it requires a section library that contains valid references to whatever image path in your system. It requires, also, a valid group screen in order to use the published variables as a background image.\n\nIf there''s a match between the section library and the current {selected-caption}, or the current {module-caption}, some new variables are send to screen:\n\n{selected-background}\n{module-background}\n\nYoy can also send some commands to interact with the cycle:\n\nCycle all backgrounds: egm.background-cycle\nCycle only current background (previous image): egm.background-prev\nCycle only current background (next image): egm.background-next', 'EnhancedGroup', 'http://www.meedios.com/forum/viewtopic.php?t=3310', 'http://www.meedios.com/maid/detail.php?plugin_id={1960511A-8316-4C05-8367-14733BFCD814}', '1.41', '1.41', '0', '1', 1356, 5259, 0, 0, 0, 0, 'c1140a94794b8e90eb7ed26abe1ad32b', 'FALSE'),
