(1449, '{01E9E9C3-A55F-4B01-B454-CB49B07E7679}', 'Smart Series Sorter', 'Smartly parses your TV episodes from your largely-unsorted archive; ready for meeTvShows.', '', 'Import', 'None', 'Donationware', 'Beta', '2008-10-06 15:53:33', '3.1.0.7', 'binary64', 'slug@skyforge.net', 'binary64', 'binary64', '', 'plugins/{01E9E9C3-A55F-4B01-B454-CB49B07E7679}/3.1.0.7/beta/Smart_Series_Sorter_3.1.0.7_Beta.mpp', '199266', '', '', '', 3001000007000000000, 0, '1. Use this importer instead of your Tag File Importer or similar.\r\n			2. Add some sorted directories.\r\n\r\n			So if you add \\"O:\\\\MySeries\\", you should also have the following sub-directories\r\n			in it:\r\n\r\n			O:\\\\MySeries\\\\Lost\\\\\r\n			O:\\\\MySeries\\\\4400, The\\\\\r\n			etc\r\n\r\n			This adds \\''Lost\\'' and \\''4400, The\\'' as your \\"sorted\\" or \\"authorised\\" series. This will rename episodes such as \\"the.4400\\" into \\"4400, The\\" for example.\r\n\r\n			Hint: the first sorted directory will get all unauthorised series dumped into it (if that option is on.. read on).\r\n\r\n			3. Add some dump dirs.\r\n\r\n			These directories will contain a whole heap of files - named in radically different formats. All files in dump dirs should be finished downloading.\r\n\r\n			4. Perform Moves : NOT IMPLEMENTED. Use the upcoming win32 v2.0 for this for now.\r\n\r\n			5. Only import sorted series : if enabled, only series which you have defined by creating a sub-dir inside a sorted dir, will be added to the current section. If disabled, the SeriesName\\''s generally become erratic and un-uniform.\r\n\r\n			6. File exensions : These are files that get parsed, so it will ignore your files such as *.zip in your dump dirs..\r\n\r\n			That\\''s it! I included some delays before and after disk I/O in the hope that it doesn\\''t interuppt your Meedio viewing experiance.', 'SmartSeriesImporter', 'http://www.skyforge.net/~slug/', '', '', '', '0', '1', 799, 3847, 0, 0, 0, 0, 'e1b4a7cea2c2cdce4af53d0b871b4ff9', 'FALSE'),
(1450, '{6CE6C4D0-554F-40EC-BDB6-72BF50910BBD}', 'WatchedTagImporter', 'Imports True Watched tags to TV Show library', '', 'Import', 'None', 'Freeware', 'Beta', '2008-10-07 09:22:38', '0.3', 'banderson1311', 'banderson1311@gmail.com', 'banderson1311', '', '', 'plugins/{6CE6C4D0-554F-40EC-BDB6-72BF50910BBD}/0.3/beta/WatchedTagImporter_0.3_Beta.mpp', '7124', '', '', '', 3000000000000000, 0, 'This plugin should be used to import True Watched tags to the TV Show library.  It can be used to keep watched tags on multiple clients in synch by only updated watched shows and not importing False tags. \n\nThe plugin will import xml files created by WatchedTagImporter and XMLImportExport.\n\nAs of version 0.2, it will also export a library''s ID, Location, and Watched tags to an xml file.', 'WatchedTagImporter', '', '', '', '', '0', '1', 264, 876, 0, 0, 0, 0, 'f8a77bc54e779b6e51ee97c9f18960ec', 'FALSE'),
