(1540, '{1960511A-8316-4C05-8367-14733BFCD814}', 'Enhanced Group Module', 'Allows you to add modules with optional dynamic backgrounds to the menu.', '', 'Module', 'None', 'Freeware', 'Stable', '2009-01-06 04:34:39', '1.0', 'stealth82', 'volpatos@libero.it', 'stealth82', '2008', '', 'plugins/{1960511A-8316-4C05-8367-14733BFCD814}/1.0/stable/Enhanced_Group_Module_1.0_Stable.mpp', '10835', '', '', '', 1000000000000000000, 1, 'Furthermore what the Group Module is capable of, this plugin allows you to load screen backgrounds dinamically.\n\nThe pick is made by matching some screen variables with any valid tag name library item designed for it - usually {category}. Therefore, it requires a section library that contains valid references to whatever image path in your system. It requires, also, a valid group screen in order to use the published variables as a background image.\n\nIf there''s a match between the section library and the current {selected-caption}, or the current {module-caption}, some new variables are send to screen:\n\n{selected-background}\n{module-background}\n\nYoy can also send some commands to interact with the cycle:\n\nCycle all backgrounds: egm.background-cycle\nCycle only current background (previous image): egm.background-prev\nCycle only current background (next image): egm.background-next', 'EnhancedGroup', 'http://www.meedios.com/forum/viewtopic.php?t=3310', 'http://www.meedios.com/maid/detail.php?plugin_id={1960511A-8316-4C05-8367-14733BFCD814}', '1.41', '1.41', '0', '1', 1997, 5259, 0, 0, 0, 0, '468c08307e58a06c3b85b723ada2c2bd', 'FALSE'),
