(1551, '{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}', 'WebBrowser (General)', 'Browse the internet', '', 'General', 'None', 'Donationware', 'Stable', '2009-01-11 06:05:14', '0.1.0', 'ALThack', 'althackston@gmail.com', 'ALThack', '2008', '', 'plugins/{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}/0.1.0/stable/WebBrowser_(General)_0.1.0_Stable.mpp', '301959', '', '', '', 1000000000000000, 1, 'This is a replacement for Meedio''s Internet Browser plugin.\n\n      To set it up:\n      (it''s the the same as the old one so if you already have the old one set up just uncheck "Internet Browser" and check this one ("WebBrowser") in the Full Time Plugin tab)\n\n      1.) Open up Meedio Configuration, then on the Menu tab, make sure the second Meedio in the treeview is highlighted. Click the Add button\n      and select the ''Command module'' to add it to your menu structure. Name it whatever you like.\n      2.) On the Module properties tab with it selected, for Command to Send, select ''Send custom command''.\n      For the Custom command to send box, type: webbrowser.url\n\n      Custom parameters are optional, if not set it will go to whatever you selected as your default site in the settings\n      url=www.meedios.com (or whatever url you want instead of meedios.com)\n      screen=MeedioBrowser (or another screen)\n    \nzoom=100 (in percentage)  scrollbars=true (or false) startx=0 (in pixels) starty=0 (in pixels)', 'WebBrowser', 'http://www.meedios.com/forum/viewtopic.php?p=35988#35988', '', '', '', '0', '1', 1260, 6599, 0, 0, 0, 0, 'b37225db15b08a504234fdc48656525f', 'FALSE'),
(1552, '{A4BD6811-9FF2-4803-AC8C-892449EC444A}', 'meeEarth', 'Google Earth in Meedio', '', 'Module', 'None', 'Donationware', 'Alpha', '2009-01-12 11:01:52', '3', 'Michael Martinez', 'martinez@angelisa.net', 'jetblack', '2009 Michael Martinez', '', 'plugins/{A4BD6811-9FF2-4803-AC8C-892449EC444A}/3/alpha/meeEarth_3_Alpha.mpp', '27760', '', '', '', 3000000000000000000, 1, 'Requirements\n\n.Net 2.0 or higher\nGoogle Earth fully installed and configured\n\nAdd module to your menu in Configuration.\nSettings are pretty basic:\n\nWidth Adjustment (integer) - Used to expand/contract the Google Earth view to fit the screen width. Value is in pixels.\n\nHeight Adjustment (integer) - Used to expand/contract the Google Earth view to fit the screen height. Value is in pixels.\n\nEnter an optional screen file (string) - Leave as default (meeEarth)\n\nWidth of Favorites Menu (double) - Favorite locations can be stored and retrieved by the plugin (they are stored in the Meedio Library, not Google Earth.  This setting allows you to control the width of the panel that pops up to show your saved Favorites.  The value can be a percentage (0.2 = 20%) or a pixel value (100).\n\nTitles of Features to enable (stringlist) - This is a list of the LAYERS options in Google Earth (ie Roads, 3D Buildings, etc) that you can turn on and off in the plugin.  The names need to be EXACTLY as show in GE or they will not work.  \n\nNote: The settings are not saved if they are changed in meeEarth, (though possible for future updates).', 'meeEarth', 'http://www.meedios.com/forum/viewtopic.php?p=57899#57899', '', '', '', '0', '1', 713, 713, 0, 0, 0, 0, '148fe3851ad55106e20b783a89b65c57', 'FALSE'),
