(1561, '{266D0793-8D46-4F8F-8851-E35C7F63C783}', 'PlayMee', 'PlayMee is a video player enhancer. It plays media based on user-defined conditions in Meedio or external players. Includes: off-line media support with prompts; auto-play of DVD, SVCD, VCD, any file-type; automatic mounting of images; Intro/Trailer suppo', '', 'General', 'None', 'Donationware', 'Stable', '2009-01-28 10:14:44', '1.6.5', 'Stewart Hargrave', 'enemywithin@hargraveusa.com', 'EnemyWithin', '2004 ©Stewart Hargrave *commercial use requires licensing', '', 'plugins/{266D0793-8D46-4F8F-8851-E35C7F63C783}/1.6.5/stable/PlayMee_1.6.5_Stable.mpp', '1584770', '', '', 'readme.html', 1006005000000000000, 1, 'Directions at http://playmee.hargraveusa.com\n\nPlayMee is a Meedio video player enhancer. It will play media based on user-defined conditions (e.g. file extension or library fields) in any configured player (Meedio internal player or external player). It provides: off-line media support with user-configurable prompts and automatic disc ID recording and validation; auto-play of DVD, SVCD, VCD and any user-defined file-type; automatic mounting and playing of image files using Daemon Tools, Alcohol 120%, or other image mounting software; Intro and Trailer support. \n\nPlayMee allows you to easily use an external video player with Meedio, while using the default Media.Movie.screen file.', 'PlayMee', 'http://playmee.hargraveusa.com/', '', '1.41', '', '0', '1', 1652, 6842, 0, 0, 0, 0, '0a5240641abdabe33ae5cf98815628b9', 'FALSE'),
