(1566, '{6CE6C4D0-554F-40EC-BDB6-72BF50910BBD}', 'WatchedTagImporter', 'Imports True Watched tags to TV Show library', '', 'Import', 'None', 'Freeware', 'Beta', '2009-02-10 19:09:08', '0.4', 'banderson1311', 'banderson1311@gmail.com', 'banderson1311', '', '', 'plugins/{6CE6C4D0-554F-40EC-BDB6-72BF50910BBD}/0.4/beta/WatchedTagImporter_0.4_Beta.mpp', '6679', '', '', '', 4000000000000000, 0, 'This plugin should be used to import True Watched tags to the TV Show library.  It can be used to keep watched tags on multiple clients in synch by only updated watched shows and not importing False tags. \n\nThe plugin will import xml files created by WatchedTagImporter and XMLImportExport.\n\nAs of version 0.2, it will also export a library''s ID, Location, and Watched tags to an xml file.', 'WatchedTagImporter', '', '', '', '', '0', '1', 131, 876, 0, 0, 0, 0, 'fc0bcaa1b802aa187e89a790b8414f5a', 'FALSE'),
