(1582, '{A559C2A3-7A51-404D-8C0A-FE3468C7A6AE}', 'seeSharp', 'Script quick n easy imports using C# 2.0 w/ helper library', '', 'Import', 'None', 'Freeware', 'Beta', '2009-03-08 17:07:28', '1.3', 'binary64', 'slug@skyforge.net', 'UL By:smf007', '2007', '', 'plugins/{A559C2A3-7A51-404D-8C0A-FE3468C7A6AE}/1.3/beta/seeSharp_1.3_Beta.mpp', '210610', '', '', '', 1003000000000000000, 1, 'Changelog:\n1.3 (8.March.2009(\n* Removed pop-up when using GUI option\n* Added Precleanup of old imports\n\n1.2 (14.Dec.07)\n* Added custom script editor IDE\n* Added option to compile-and-execute on a seperate GUI thread\n\n1.1.2 (11.Dec.07)\n* Fixed Interop.Meedio.dll reference error (thanks smf007)\n\n1.1.1 (09.Dec.07)\n* Stopped the dos box window flashing on every import\n* Added aliases for "items": Items, rows and Rows\n* Now uses relative locations for referenced dll''s (before, it wouldn''t work if Meedio wasn''t in %ProgramFiles%\\Meedio\\Meedio Essentials\\...)\n* Added Row.Delete() function\n\n1.1\n* Initial release', 'seeSharp', '', '', '', '', '0', '1', 297, 1606, 0, 0, 0, 0, '40fecec460524f4a1d6338f90138d9a4', 'FALSE'),
