(1594, '{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}', 'WebBrowser (General)', 'Browse the internet', '', 'General', 'None', 'Donationware', 'Beta', '2009-04-11 00:02:35', '0.1.5', 'ALThack', 'althackston@gmail.com', 'ALThack', '2008', '', 'plugins/{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}/0.1.5/beta/WebBrowser_(General)_0.1.5_Beta.mpp', '454824', '', '', '', 1005000000000000, 0, 'This is a replacement for Meedio''s Internet Browser plugin.\n\n      To set it up:\n      (it''s the the same as the old one so if you already have the old one set up just uncheck "Internet Browser" and check this one ("WebBrowser") in the Full Time Plugin tab)\n\n      1.) Open up Meedio Configuration, then on the Menu tab, make sure the second Meedio in the treeview is highlighted. Click the Add button\n      and select the ''Command module'' to add it to your menu structure. Name it whatever you like.\n      2.) On the Module properties tab with it selected, for Command to Send, select ''Send custom command''.\n      For the Custom command to send box, type: webbrowser.url\n\n      Custom parameters are optional, if not set it will go to whatever you selected as your default site in the settings\n      url=www.meedios.com (or whatever url you want instead of meedios.com)\n      screen=MeedioBrowser (or another screen)\n      zoom=100 (in percentage)\n      scrollbars=true (or false)\n      startx=0 (in pixels)\n      starty=0 (in pixels)', 'WebBrowser', 'http://www.meedios.com/forum/viewtopic.php?p=35988#35988', '', '', '', '0', '1', 358, 6599, 0, 0, 0, 0, '4a7075ef4c89e4996ea51429a06c7c58', 'FALSE'),
