(1617, '{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', 'NexLyrics Importer', 'Import Lyrics from Lyrics website and save it in lyrics tags or lyrics .txt files', '', 'Import', 'None', 'Freeware', 'Beta', '2009-05-26 09:54:51', '1.0.0.6', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone May 2009', '', 'plugins/{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}/1.0.0.6/beta/NexLyrics_Importer_1.0.0.6_Beta.mpp', '158092', '', '', '', 1000000006000000000, 0, 'Browse your Music Library and Import Lyrics from Lyrics websites :\nfr.lyrics-copy.com\nyricwiki.org\nSave the lyrics in lyrics tags or lyrics .txt files.\n\nUse the same tags as Meelyrics importer : MDI-Lastsearch, Lyrics, Lyrics-Processed.\nYou can only processed  the non processed files, specifing how much you want (all , 25, 50, 100, 500 , 1000) to be processed, or re-processed  the already processed files. \nYou can specified the day between imports : when a song is processed and not found on the website, the tag MDI-Lastsearch is updated. So you can re-processed the non found lyrics older than the "day between imports"\n\nYou can import .txt files containing the lyrics (format : <tackname> - <artist>) in the Lyrics tags. \nYou can export the lyrics tags in .txt files  (format : <tackname> - <artist>)\nThis two choices  update the MDI-Lastsearch and Lyrics-Processed tags.\n\nYou can empty the lyrics tags (if you want to force meelyrics plugin to read the .txt files)\nUpdate : 1.0.0.6 :Export Embed Mp3 Lyrics to Tag or File. Delete Missing.  Some bugs corrected. taglib-sharp.dll upgraded to 2.0.3.0 to correct bugs.No More DLL conflicts bugs\nUpdate : 1.0.0.5 :Switch from Audiogenie2 to Taglib-sharp librray. Add the Lyrics-Lastchecked tags like in meelyrics importer.\nUpdate : 1.0.0.4 :Embed lyrics in MP3, Speed Up, and Bugs corrections\nUpdate : 1.0.0.3 :Bugs with the ALL options corrected.\nUpdate : 1.0.0.2 :Create a report file for all songs without lyrics Add detection of some German Chars.\nUpdate : 1.0.0.1 :Process songs with bad characters in lyrics tags :  Processed lyrics in library wich contains bad characters in lyrics tags.', 'NexLyrics', 'http://www.meedios.com/forum/viewtopic.php?t=4683', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id={FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', '1.0.0.0', '1.0.0.6', '0', '1', 108, 1494, 0, 0, 0, 0, 'b449740211f68868f9e8db302c7c34ea', 'FALSE'),
(1618, '{F43D3875-DC4B-49A9-ABC4-85426BA2AEEE}', 'MovieTimes', 'Import Movie Showtimes and Trailers', '', 'Import', 'None', 'Freeware', 'Beta', '2009-05-31 16:37:22', '0.2', 'banderson1311', 'banderson1311@gmail.com', 'banderson1311', '', '', 'plugins/{F43D3875-DC4B-49A9-ABC4-85426BA2AEEE}/0.2/beta/MovieTimes_0.2_Beta.mpp', '17391', '', '', '', 2000000000000000, 0, 'Import Movie Showtimes and Trailers', 'MovieTimes', '', '', '', '', '0', '1', 70, 1332, 0, 0, 0, 0, '6bcaa511ca4d40e5c6d106213a7afb90', 'FALSE'),
