(1639, '{B47E9A77-8A14-4B37-B285-549AA11DCEDC}', 'NexTagGenre', 'Attempt to retrieve song Genre on the net', '', 'Import', 'None', 'Freeware', 'Stable', '2009-06-16 13:59:36', '1.0.0.4', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone June 2009', '', 'plugins/{B47E9A77-8A14-4B37-B285-549AA11DCEDC}/1.0.0.4/stable/NexTagGenre_1.0.0.4_Stable.mpp', '140063', '', '', '', 1000000004000000000, 0, 'NexTagGenre is a import plugin for meedio.\n\nMost of the time, audiofile genre tag is badly filled or even leaved blank. \nSo it makes the Genre filter useless.\n\nSo NexTagGenre attempts to retrieve on the net the Genre of songs.\n\nBy Default, NexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist (Faster), \nbecause songs of an Artist are, most of the time, of the same genre. But you can specify to Search for Song Genre too (Slower).\n\nUpdate : 1.0.0.4 : corrections of some bug when selecting genre song\nUpdate : 1.0.0.3 : Split project in two plugins : NexTagGenre (this one) & NexArtistBiography (to retrieve Biography & Thumbnails of artist)\nUpdate : 1.0.0.2 : Add Save Artist Image option\nUpdate : 1.0.0.1 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedio plugins\n\n\nDetail of the options :\n\nOptions:\n--------\n\n- Don''t process already tagged Genre : Songs processed by NexTagGenre have a GenreProcessed tag filled with "---processed---". \nSo you can bypass the already processed songs in the next import.\n\n- Keep genre of Artist already in database : If an Artist song has already been processed (GenreProcessed = "---processed---") , \nyou can reuse the same genre (and bio) for all the songs of this artist.\n\n- Search for Song Genre (slowdown) : By Default, NexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist.\nSongs of an Artist are, most of the time, of the same genre. But you can specify to Search for Song Genre too. This slows down a bit the process.\nCaution : Name of the Artist, Album and Song have to be correctly filled for this to work. If genre is not found or fields incorrectly filled,  \nthe Artist Genre will be used for the song.\n\n- Days Between recheck : Number of days between attempts to check genre for non already processed Genre (GenreProcessed <> "---processed---")\n\n\n\n\nAudiofile genre tagging :\n-------------------------\n\n- Write new genre in the audio file : You can write in the audio file genre tag the new genre found by NexTagGenre.\nI recommend to tick this options, otherwise, on the next import the audiofile genre will overwrite the genre found by NexTagGenre\n\n\nBackup : \n--------\n\n- Save old Genre in GenreSaveOriginal tag : If you not trust NexTagGenre, a save of the old Genre tag can be done before processing. \nThe old genre tag is copied in GenreSaveOriginal tag\n\n\nBackup (Disable other choices) :\n--------------------------------\n\n- Restore GenreSaveOriginal to Genre tag : if you''re not satisfy by the work accomplish by NexTagGenre, you can restore the previous save genre. (see option below)\n\n- Retag audiofile with GenreSaveOriginal tag : Retag Audiofile Genre with the GenreSaveOriginal. To Used with the Options ''Restore GenreSaveOriginal'' above', 'NexTagGenre', '', '', '1.0.0.0', '1.0.0.4', '0', '1', 43, 1007, 0, 0, 0, 0, '6e2a29745cc712b6bdc5f02dcdfd8b0b', 'FALSE'),
(1640, '{B47E9A77-8A14-4B37-B285-549AA11DCEDC}', 'NexTagGenre', 'Attempt to retrieve song Genre on the net', '', 'Import', 'None', 'Freeware', 'Stable', '2009-06-17 01:33:56', '1.0.0.5', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone June 2009', '', 'plugins/{B47E9A77-8A14-4B37-B285-549AA11DCEDC}/1.0.0.5/stable/NexTagGenre_1.0.0.5_Stable.mpp', '140283', '', '', '', 1000000005000000000, 0, 'NexTagGenre is a import plugin for meedio.\n\nMost of the time, audiofile genre tag is badly filled or even leaved blank. \nSo it makes the Genre filter useless.\n\nSo NexTagGenre attempts to retrieve on the net the Genre of songs.\n\nBy Default, NexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist (Faster), \nbecause songs of an Artist are, most of the time, of the same genre. But you can specify to Search for Song Genre too (Slower).\n\nUpdate : 1.0.0.5 : corrections of some bugs\nUpdate : 1.0.0.4 : corrections of some bug when selecting genre song\nUpdate : 1.0.0.3 : Split project in two plugins : NexTagGenre (this one) & NexArtistBiography (to retrieve Biography & Thumbnails of artist)\nUpdate : 1.0.0.2 : Add Save Artist Image option\nUpdate : 1.0.0.1 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedio plugins\n\n\nDetail of the options :\n\nOptions:\n--------\n\n- Don''t process already tagged Genre : Songs processed by NexTagGenre have a GenreProcessed tag filled with "---processed---". \nSo you can bypass the already processed songs in the next import.\n\n- Keep genre of Artist already in database : If an Artist song has already been processed (GenreProcessed = "---processed---") , \nyou can reuse the same genre (and bio) for all the songs of this artist.\n\n- Search for Song Genre (slowdown) : By Default, NexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist.\nSongs of an Artist are, most of the time, of the same genre. But you can specify to Search for Song Genre too. This slows down a bit the process.\nCaution : Name of the Artist, Album and Song have to be correctly filled for this to work. If genre is not found or fields incorrectly filled,  \nthe Artist Genre will be used for the song.\n\n- Days Between recheck : Number of days between attempts to check genre for non already processed Genre (GenreProcessed <> "---processed---")\n\n\n\n\nAudiofile genre tagging :\n-------------------------\n\n- Write new genre in the audio file : You can write in the audio file genre tag the new genre found by NexTagGenre.\nI recommend to tick this options, otherwise, on the next import the audiofile genre will overwrite the genre found by NexTagGenre\n\n\nBackup : \n--------\n\n- Save old Genre in GenreSaveOriginal tag : If you not trust NexTagGenre, a save of the old Genre tag can be done before processing. \nThe old genre tag is copied in GenreSaveOriginal tag\nBe sure to tick this option once and untick after the first import to keep your original tag in GenreSaveOriginal.\n\n\nBackup (Disable other choices) :\n--------------------------------\n\n- Restore GenreSaveOriginal to Genre tag : if you''re not satisfy by the work accomplish by NexTagGenre, you can restore the previous save genre. (see option below)\n\n- Retag audiofile with GenreSaveOriginal tag : Retag Audiofile Genre with the GenreSaveOriginal. To Used with the Options ''Restore GenreSaveOriginal'' above', 'NexTagGenre', '', '', '1.0.0.0', '1.0.0.5', '0', '1', 51, 1007, 0, 0, 0, 0, '05606741190e54714359e8dab4982bcb', 'FALSE'),
(1641, '{0F8B7BD3-AD0E-4651-AFFA-3CF1F4D8EE79}', 'Nex Audio Importer', 'Import Audio File in library', '', 'Import', 'None', 'Freeware', 'Stable', '2009-06-18 12:43:50', '1.0.0.4', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone May 2009', '', 'plugins/{0F8B7BD3-AD0E-4651-AFFA-3CF1F4D8EE79}/1.0.0.4/stable/Nex_Audio_Importer_1.0.0.4_Stable.mpp', '279224', '', '', '', 1000000004000000000, 0, 'NexAudio import is a import plugin to Import audio files in library : \n\n\nUpdate 1.0.0.4 : Convert in meedio Artist Tag, Artist containing a Slash (/) into -  (AC/DC for example will be convert into AC-DC to avoid errors)\nDelete ArtistBio, BioLastChecked, BioProcessed and Thumbnails tags when the Artist name has changed when REimporting.\n\nUpdate 1.0.0.3 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedio plugins\nUpdate 1.0.0.2 : change select folder in folderlist. Bugs corrections with managing embed cover.\n\n\n- Can export embed Audio file Cover to folder.jpg\n- Can export embed Audio file Cover to  {artist} - {title}.jpg\n- Can export embed Audio file Cover to  {artist}.jpg\n- Can import folder.jpg in Audio File (embed)\n- Can import in meedio image tag : folder.jpg \n- Can import in meedio image tag : folder.jpg or  {artist}.jpg or {artist} - {title}.jpg (search in this order)\n\n- if no folder.jpg can export embed audiofile cover in meedio image tag : {artist}.jpg or {artist} - {title}.jpg\n\n- Can import existing lyrics {title} - {artist}.txt or {artist} - {title}.txt in meedio lyrics tag (see NexLyrics plugin for more powerfull functions)\n- Can import Embed Audio File lyric in meedio lyrics tag\n- Can create a listing of incomplete tagged songs : songs with no artist and/or no title.\n- Songs with no title, which are not imported, are listed in the not_imported_songs.txt\n- Songs with artist, are listed in incompleted_tagged_songs.txt\n- Can create a listing (meedio_incomplete_tagged_songs.txt) of incomplete tagged songs in meedio library : songs with no artist and/or no title.\n- Can delete record in library when the audio file is missing\n- Can normalize Artist, Title, Album name, Composer name, Genre when importing : Capitalize first letter of each word, lower others. Correct bad chars in all this names\n- Can normalize Artist, Title, Album name, Composer name, Genre of the meedio library without importing  : Capitalize first letter of each word, lower others. Correct bad chars in all this names\n- Add a Tag : {DateAdded} : on the firt im1port of a song this tag is updated with the date of the day\n- Add a Tag : {DateAddedTicks} : Time in Unix Timestamp foramt : second since 01/01/1970', 'NexAudioImport', 'http://www.meedios.com/forum/viewtopic.php?t=4728', '', '1.0.0.0', '1.0.0.3', '0', '1', 137, 976, 0, 0, 0, 0, 'f86c13f823a038ee5da4dd5fc2de3c4e', 'FALSE'),
(1642, '{B47E9A77-8A14-4B37-B285-549AA11DCEDC}', 'NexTagGenre', 'Attempt to retrieve song Genre on the net', '', 'Import', 'None', 'Freeware', 'Stable', '2009-06-19 01:41:23', '1.0.0.6', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone June 2009', '', 'plugins/{B47E9A77-8A14-4B37-B285-549AA11DCEDC}/1.0.0.6/stable/NexTagGenre_1.0.0.6_Stable.mpp', '140601', '', '', '', 1000000006000000000, 0, 'NexTagGenre is a import plugin for meedio.\n\nMost of the time, audiofile genre tag is badly filled or even leaved blank. \nSo it makes the Genre filter useless.\n\nSo NexTagGenre attempts to retrieve on the net the Genre of songs.\n\nBy Default, NexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist (Faster), \nbecause songs of an Artist are, most of the time, of the same genre. But you can specify to Search for Song Genre too (Slower).\n\nUpdate : 1.0.0.6 : when a tag genre is not a valid tag genre, it will be replaced by a blank, and the mp3 file will be updated so.\nCorrection of bug when asking to process all the songs.\nUpdate : 1.0.0.5 : corrections of some bugs\nUpdate : 1.0.0.4 : corrections of some bug when selecting genre song\nUpdate : 1.0.0.3 : Split project in two plugins : NexTagGenre (this one) & NexArtistBiography (to retrieve Biography & Thumbnails of artist)\nUpdate : 1.0.0.2 : Add Save Artist Image option\nUpdate : 1.0.0.1 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedio plugins\n\n\nDetail of the options :\n\nOptions:\n--------\n\n- Don''t process already tagged Genre : Songs processed by NexTagGenre have a GenreProcessed tag filled with "---processed---". \nSo you can bypass the already processed songs in the next import.\n\n- Keep genre of Artist already in database : If an Artist song has already been processed (GenreProcessed = "---processed---") , \nyou can reuse the same genre (and bio) for all the songs of this artist.\n\n- Search for Song Genre (slowdown) : By Default, NexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist.\nSongs of an Artist are, most of the time, of the same genre. But you can specify to Search for Song Genre too. This slows down a bit the process.\nCaution : Name of the Artist, Album and Song have to be correctly filled for this to work. If genre is not found or fields incorrectly filled,  \nthe Artist Genre will be used for the song.\n\n- Days Between recheck : Number of days between attempts to check genre for non already processed Genre (GenreProcessed <> "---processed---")\n\n\n\n\nAudiofile genre tagging :\n-------------------------\n\n- Write new genre in the audio file : You can write in the audio file genre tag the new genre found by NexTagGenre.\nI recommend to tick this options, otherwise, on the next import the audiofile genre will overwrite the genre found by NexTagGenre\n\n\nBackup : \n--------\n\n- Save old Genre in GenreSaveOriginal tag : If you not trust NexTagGenre, a save of the old Genre tag can be done before processing. \nThe old genre tag is copied in GenreSaveOriginal tag\nBe sure to tick this option once and untick after the first import to keep your original tag in GenreSaveOriginal.\n\n\nBackup (Disable other choices) :\n--------------------------------\n\n- Restore GenreSaveOriginal to Genre tag : if you''re not satisfy by the work accomplish by NexTagGenre, you can restore the previous save genre. (see option below)\n\n- Retag audiofile with GenreSaveOriginal tag : Retag Audiofile Genre with the GenreSaveOriginal. To Used with the Options ''Restore GenreSaveOriginal'' above', 'NexTagGenre', '', '', '1.0.0.0', '1.0.0.5', '0', '1', 108, 1007, 0, 0, 0, 0, '0a1e3237dea0882773c79a8d39166df0', 'FALSE'),
