(1687, '{B47E9A77-8A14-4B37-B285-549AA11DCEDC}', 'NexTagGenre', 'Attempt to retrieve song Genre on the net', '', 'Import', 'None', 'Freeware', 'Stable', '2009-08-08 01:31:01', '1.0.1.0', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone June 2009', '', 'plugins/{B47E9A77-8A14-4B37-B285-549AA11DCEDC}/1.0.1.0/stable/NexTagGenre_1.0.1.0_Stable.mpp', '118563', '', '', '', 1000001000000000000, 1, 'NexTagGenre is a import plugin for meedio.\n\nMost of the time, audiofile genre tag is badly filled or even leaved blank. \nSo it makes the Genre filter useless.\n\nSo NexTagGenre attempts to retrieve on the net the Genre of songs.\n\nBy Default, NexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist (Faster), \nbecause songs of an Artist are, most of the time, of the same genre. But you can specify to Search for Song Genre too (Slower).\n\nSee my audio import plugin : NexAudioImport to import Audio without overwritten already processed Tag Genres.\n \nUpdate : 1.0.1.0 : Manage artistname  with "feat, feat., ft., ft, with, and , avec , et" in artist name to increase chance of finding genre\nUpdate : 1.0.0.9 : Add multi-genre management. Don''t process song with good genre was removed. Genre are not writen in audiofile tag anymore.\nYou can add your own genre in the "List of authorized genres" stringlist .\nUpdate : 1.0.0.8 : Bugs corrected : Don''t blanked audiofile genre if the genre is not valid AND you don''t asked to write the genre in audiofile.\nUpdate : 1.0.0.7 : Add option : Don''t process song with good genre\nUpdate : 1.0.0.6 : when a tag genre is not a valid tag genre, it will be replaced by a blank, and the mp3 file will be updated so.\nCorrection of bug when asking to process all the songs.\nUpdate : 1.0.0.5 : corrections of some bugs\nUpdate : 1.0.0.4 : corrections of some bug when selecting genre song\nUpdate : 1.0.0.3 : Split project in two plugins : NexTagGenre (this one) & NexArtistBiography (to retrieve Biography & Thumbnails of artist)\nUpdate : 1.0.0.2 : Add Save Artist Image option\nUpdate : 1.0.0.1 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedio plugins\n\n\nDetail of the options :\n\nOptions:\n--------\n\n- Process ALL Songs : Processed all songs even songs already processed. Days between recheck is not used with this option\n\n- Don''t process already tagged Genre : Songs processed by NexTagGenre have a GenreProcessed tag filled with "---processed---". \nSo you can bypass the already processed songs in the next import.\n\n- Keep genre of Artist already in database : If an Artist song has already been processed (GenreProcessed = "---processed---") , \nyou can reuse the same genre (and bio) for all the songs of this artist.\n\n- Search for Song Genre (slowdown) : By Default, NexTagGenre retrieve the Genre of the artist, and apply this genre to all the songs of this artist.\nSongs of an Artist are, most of the time, of the same genre. But you can specify to Search for Song Genre too. This slows down a bit the process.\nCaution : Name of the Artist, Album and Song have to be correctly filled for this to work. If genre is not found or fields incorrectly filled,  \nthe Artist Genre will be used for the song.\n\n- Use Multi-Genre : You can tag Meedio Genre tag with multi genres (genre are separated with a  pipe) . If not ticked, retrieve one genre only.\n\n- Days Between recheck : Number of days between attempts to check genre for non already processed Genre (GenreProcessed <> "---processed---")\n\n- Add actual genre to new found genre : If meedio tag genre contains genres, they will be add to new found genre.\n\n\nAudiofile genre tagging :\n-------------------------\n\n- Write new genre in the audio file : You can write in the audio file genre tag the new genre found by NexTagGenre.\nI recommend to tick this options, otherwise, on the next import the audiofile genre will overwrite the genre found by NexTagGenre\n\n\nBackup : \n--------\n\n- Save old Genre in GenreSaveOriginal tag : If you not trust NexTagGenre, a save of the old Genre tag can be done before processing. \nThe old genre tag is copied in GenreSaveOriginal tag\nBe sure to tick this option once and untick after the first import to keep your original tag in GenreSaveOriginal.\n\n\nBackup (Disable other choices) :\n--------------------------------\n\n- Restore GenreSaveOriginal to Genre tag : if you''re not satisfy by the work accomplish by NexTagGenre, you can restore the previous save genre. (see option below)\n\n- Retag audiofile with GenreSaveOriginal tag : Retag Audiofile Genre with the GenreSaveOriginal. To Used with the Options ''Restore GenreSaveOriginal'' above\n\n\nGenres List\n-----------\n\nList of authorized genres : List of authorized genres. You can add your own genres here. Only genres present in this list are used for tagging genre.', 'NexTagGenre', '', '', '1.0.0.0', '1.0.1.0', '0', '1', 310, 1007, 0, 0, 0, 0, 'a0a1ca7a77dfdaffc2b7bf60db10447a', 'FALSE'),
(1688, '{FF02D979-6159-473E-8B2F-76D09C254E39}', 'NexArtistBiography', 'Attempt to retrieve Artist Biography & Thumbnails image', '', 'Import', 'None', 'Freeware', 'Stable', '2009-08-08 01:33:59', '1.0.0.8', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone June 2009', '', 'plugins/{FF02D979-6159-473E-8B2F-76D09C254E39}/1.0.0.8/stable/NexArtistBiography_1.0.0.8_Stable.mpp', '13354', '', '', '', 1000000008000000000, 0, 'NexArtistBiography is a import plugin for meedio.\n\nNexArtistBiography attempts to retrieve on the net the Biography of the Artist and store it in "ArtistBio" Tag.\nHe can retrieve  and store an Artist Image and store it on a folder , and filled the "Thumbnails" Tag with the path of the image file.\n\nMaybe usefull for Theme Maker, if they want to include on Nowplaying.screen , the Artist Biography (ArtistBio) & Artist Image (Thumbnails) . \nThumbnails tag contains  the path to the Artist Image file.\n\nupdate 1.0.0.8 : Manage artistname  with "feat, feat., ft., ft, with, and , avec , et" in artist name to increase chance of finding bio & Image\nupdate 1.0.0.7 : Option : Save only square format image Thumbnails\nupdate 1.0.0.6 : Thumbnails are now saved in meediodata\\music\\fanarts\\thumbnails like this artistname.jpg\nupdate 1.0.0.5 : correction of bugs : Bugs with artist Bio & thumbnail.\nupdate 1.0.0.4 : correction of bugs : Bugs with artist thumbnail.\nupdate 1.0.0.3 : correction of bugs : disable update of already existing thumbnails.\n\n\nDetail of the options :\n\nOptions:\n--------\n\n- Skip processed Artist Biography : Songs processed by NexArtistBiography have a "BioProcessed" tag filled with ''---processed ---'' .\nSo you can bypass the already processed songs in the next import.\n\n\n- Days Between recheck : Number of days between attempts to check Biography for non already processed Bio (BioProcessed <> "---processed---")\n\n\n\nArtist Image : \n--------------\n\n- Save Artist Image : Save Artist Image in meedio tag: ArtistImage\n- Save only square format image : Only square format image are saved, other format are skipped : Height/Width ratio must be between 1,2 and 0,8 to be considered as square.\n\n\n\nBiography :\n-----------\n\n- Langage for biography : Choose the display langage of the artist biography', 'NexArtistBiography', '', '', '1.0.0.0', '1.0.0.8', '0', '1', 191, 1112, 0, 0, 0, 0, '00fd00752fedfc5279e33b5fc6314489', 'FALSE'),
(1689, '{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', 'NexLyrics Importer', 'Import Lyrics from Lyrics website and save it in lyrics tags or lyrics .txt files', '', 'Import', 'None', 'Freeware', 'Stable', '2009-08-08 01:37:30', '1.0.0.9', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone May 2009', '', 'plugins/{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}/1.0.0.9/stable/NexLyrics_Importer_1.0.0.9_Stable.mpp', '121698', '', '', '', 1000000009000000000, 0, 'Browse your Music Library and Import Lyrics from Lyrics websites :\nfr.lyrics-copy.com\nlyricwiki.org\nSave the lyrics in lyrics tags or lyrics .txt files.\n\nTo import Audio file you can use NexAudioImport plugin.\n\nUse the same tags as Meelyrics importer : MDI-Lastsearch, Lyrics, Lyrics-Processed, Lyrics-Lastchecked.\nYou can only processed the non processed files, specifing how much you want (all , 25, 50, 100, 500 , 1000) to be processed, or re-processed the already processed files. \nYou can specified the day between imports : when a song is processed and not found on the website, the tag MDI-Lastsearch and Lyrics-Lastchecked is updated. So you can re-processed the non found lyrics older than the "day between imports"\n\nYou can import .txt files containing the lyrics (format : {title} - {artist}.txt) in the Lyrics tags. \nYou can export the lyrics tags in .txt files (format : {title} - {artist}.txt )\nThis two choices update the MDI-Lastsearch, Lyrics-Lastchecked and Lyrics-Processed tags.\n\nYou can empty the lyrics tags (if you want to force meelyrics plugin to read the .txt files)\n\nupdate : 1.0.0.9 : Manage artistname  with "feat, feat., ft., ft, with, and , avec , et" in artist name to increase chance of Lyrics\nUpdate : 1.0.0.8 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedios plugins\nUpdate : 1.0.0.7 :Add a readme.txt. Correct a bug when no title in a song. Correct badchar & in some lyrics. No more use of ILMerge, I put taglib-sharp.lib as assembly. If bug encoutered with assembly, please delete all reference of taglib-sharp*.dll in meedio\\assemblies directory and reinstall plugin. \nUpdate : 1.0.0.6 :Export Embed Mp3 Lyrics to Tag or File. Delete Missing option. taglib-sharp.dll upgraded to 2.0.3.1 to correct many bugs.\nUpdate : 1.0.0.5 :Switch from Audiogenie2 to Taglib-sharp librray. Add the Lyrics-Lastchecked tags like in meelyrics importer.\nUpdate : 1.0.0.4 :Embed lyrics in MP3, Speed Up, and Bugs corrections\nUpdate : 1.0.0.3 :Bugs with the ALL options corrected.\nUpdate : 1.0.0.2 :Create a report file for all songs without lyrics Add detection of some German Chars.\nUpdate : 1.0.0.1 :Process songs with bad characters in lyrics tags : Processed lyrics in library wich contains bad characters in lyrics tags.\n\n\nDetails of the menu : \n\n1 - Web Import Required :\n\n- Process all songs :  process all song even already processed song. You can specify a "Number max of lyrics to import" in the option.\n- Process song without lyrics : process song without lyrics processed or when the lastsearch is > of the "check Days Between Imports". You can specify a "Number max of lyrics to import" and "check Days Between Imports" in the option.\n- Process song with bad char in Lyric Tag : process song containing bad chars in meedio lyrics tag. You can specify a "Number max of lyrics to import" and "check Days Between Imports" in the option.\n\n\n\n2 - Options \n\n- Update/Create lyrics tag : Lyrics found are copied in the meedio Lyrics tag.\n- Update/Create .TXT lyrics files : Lyrics found are copied in a file called {title} - {artist}.txt in the same directory as the song.\n- Embed Lyrics in MP3 : Lyrics found are copied in the audio file.\n- Days Between Imports (-1 to reimport all) : Days before reimport lyrics for non processed files. Check the lyrics-Lastchecked. If today-lyrics-lastchecked > "Days Between Imports" then the file will be processed.\n- Number max of lyrics to import (0 for all) : Number of files you want to process at once.\n\n\n3 - No Web Import \nWhen you tick one of this choices, choices in menu #1 and #2 are disabled.\n\n- Only Erase Lyrics Tags content : browse your meedio library and erase the content of the meedio lyrics tag.\n- Only import .TXT in Tag : only import .TXT file in the meedio lyrics tag without searching on the web site. You can tick the "Embed lyrics in mp3" of menu 2 for this choice.\n- Only import Embed MP3 Lyric in Tag : browse your meedio library and copy Embed lyrics from the Audio file to the meedio lyrics tag.\n- Only export Tag in .TXT : browse your meedio library and export the meedio lyrics tag in a file called {title} - {artist}.txt\n\n\n4 - Embed MP3 Lyrics \nWhen you tick one of this choices, choices in menu #1 #2 and #3 are disabled.\n\n- write_ALL_lyrics_mp3 : browse the whole meedio library and Write lyrics in the MP3 file. NexLyrics search for lyrics in the mp3 file, correcting on the fly, if bad char are present, or in the meedio lyrics tag , and finally in the {title} - {artist}.txt file.\n- erase_ALL_lyrics_mp3 : browse the whole meedio library and erase the lyrics in the MP3 file.\n\n\n5 - Report \nWhen you tick one of this choices, choices in menu #1 #2 #3 and #4 are disabled.\n\n- List all songs with no lyrics in a file :  list in a file (lyrics_not_found.txt) the songs with no meedio lyrics tag, or with no {title} - {artist}.txt file\n\n\n\n6 - Delete Missing\nWhen you tick one of this choices, choices in menu #1 #2 #3 #4 and #5 are disabled.\n\n- Delete Missing : Browse your whole meedio music library and delete record when the corresponding audio file doesn''t exist anymore.', 'NexLyrics', 'http://www.meedios.com/forum/viewtopic.php?t=4683', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id={FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', '1.0.0.0', '1.0.0.9', '0', '1', 132, 1494, 0, 0, 0, 0, '38a51d74c3ef90e95370082bc69385c4', 'FALSE'),
(1690, '{ED760EAF-8521-463F-A72A-B03C1EA4C66D}', 'AmazeMee Importer', 'Import music, movie cover art from Amazon.com', '', 'Import', 'None', 'Freeware', 'Stable', '2009-08-09 19:25:56', '0.5.0', 'GameGod', 'game_programer@hotmail.com', 'GameGod', '', '', 'plugins/{ED760EAF-8521-463F-A72A-B03C1EA4C66D}/0.5.0/stable/AmazeMee_Importer_0.5.0_Stable.mpp', '15945', '', '', 'AmazeMee.txt', 5000000000000000, 1, '', 'AmazeMee', '', '', '1.37', '', '0', '1', 426, 2629, 0, 0, 0, 0, 'fb4989076bb1fb7226085b884f88726b', 'FALSE'),
(1691, '{D36A6FA5-6E60-4321-BE4C-67C6AAC34D7A}', 'File Importer', 'Imports files and file related info. Use tag masks or regular expressions to extract additional metadata from file and folder names.', '', 'Import', 'None', 'Freeware', 'Alpha', '2009-08-14 09:25:04', '2.0.24.626', 'DocZoidberg', 'Goldrush@web.de', 'DocZoidberg', 'Michael Wisniewski 2009', '', 'plugins/{D36A6FA5-6E60-4321-BE4C-67C6AAC34D7A}/2.0.24.626/alpha/File_Importer_2.0.24.626_Alpha.mpp', '493791', '', '', '', 2000024626000000000, 0, 'Requires .NET 3.5', 'FileImporter', 'http://www.michaelwisniewski.mynetcologne.de/', '', '', '', '0', '1', 436, 6574, 0, 0, 0, 0, 'a22819f53410146b68b3af109e73a955', 'FALSE'),
(1692, '{01E3628A-29AF-4C2A-8234-C5CB71849E16}', 'MediaFairy', 'An automated media importer and updater which aims to provide a complete solution for Meedio users to easily import and acquire meta-info for their media collections.', '', 'Import', 'None', 'Donationware', 'Beta', '2009-08-14 13:25:59', '0.4.8', 'Skamagkis Stavros', 'stavros_sk@ownmail.net', 'enthalpient', '2008 Skamagkis Stavros', '', 'plugins/{01E3628A-29AF-4C2A-8234-C5CB71849E16}/0.4.8/beta/MediaFairy_0.4.8_Beta.mpp', '5909411', '', '', '', 4008000000000000, 0, 'For release notes, usage instructions, bug reports or suggestions, please refer to the plugin''s thread on MeediOS forum:\n\nhttp://www.meedios.com/forum/viewtopic.php?t=3912', 'MediaFairy', 'http://meedios.com/OpenMAID/', 'http://meedios.com/OpenMAID/detail.php?plugin_id={01E3628A-29AF-4C2A-8234-C5CB71849E16}', '0.1', '1.0', '0', '1', 188, 3541, 0, 0, 0, 0, 'cdc33d0a24b8041541f9c2bb21fe6aef', 'FALSE'),
(1693, '{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}', 'WebBrowser (General)', 'Browse the internet', '', 'General', 'None', 'Donationware', 'Beta', '2009-08-19 00:04:01', '0.1.9', 'ALThack', 'althackston@gmail.com', 'ALThack', '2008', '', 'plugins/{8336AFF3-A40D-4EB3-AC28-E7A0F9ADA2DF}/0.1.9/beta/WebBrowser_(General)_0.1.9_Beta.mpp', '3976053', '', '', '', 1009000000000000, 0, 'This is a replacement for Meedio''s Internet Browser plugin.\n\n      To set it up:\n      (it''s the the same as the old one so if you already have the old one set up just uncheck "Internet Browser" and check this one ("WebBrowser") in the Full Time Plugin tab)\n\n      1.) Open up Meedio Configuration, then on the Menu tab, make sure the second Meedio in the treeview is highlighted. Click the Add button\n      and select the ''Command module'' to add it to your menu structure. Name it whatever you like.\n      2.) On the Module properties tab with it selected, for Command to Send, select ''Send custom command''.\n      For the Custom command to send box, type: webbrowser.url\n\n      Custom parameters are optional, if not set it will go to whatever you selected as your default site in the settings\n      url=www.meedios.com (or whatever url you want instead of meedios.com)\n      screen=MeedioBrowser (or another screen)\n      zoom=100 (in percentage)\n      scrollbars=true (or false)\n      startx=0 (in pixels)\n      starty=0 (in pixels)', 'WebBrowser', 'http://www.meedios.com/forum/viewtopic.php?p=35988#35988', '', '', '', '0', '1', 458, 6599, 0, 0, 0, 0, '8696daca5aa7c7be4db77e2a6214c0c3', 'FALSE'),
(1694, '{F43D3875-DC4B-49A9-ABC4-85426BA2AEEE}', 'MovieTimes', 'Import Movie Showtimes and Trailers', '', 'Import', 'None', 'Freeware', 'Beta', '2009-08-25 17:03:54', '0.5.0', 'banderson1311', 'banderson1311@gmail.com', 'banderson1311', '', '', 'plugins/{F43D3875-DC4B-49A9-ABC4-85426BA2AEEE}/0.5.0/beta/MovieTimes_0.5.0_Beta.mpp', '29304', '', '', '', 5000000000000000, 0, 'Import Movie Showtimes and Trailers', 'MovieTimes', '', '', '', '', '0', '1', 241, 1332, 0, 0, 0, 0, 'e8ba458c13b271d1bd2892eb9dcff0a5', 'FALSE'),
(1695, '{0F8B7BD3-AD0E-4651-AFFA-3CF1F4D8EE79}', 'Nex Audio Importer', 'Import Audio File in library, cover , and lyrics', '', 'Import', 'None', 'Freeware', 'Stable', '2009-08-27 01:50:57', '1.0.0.7', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone May 2009', '', 'plugins/{0F8B7BD3-AD0E-4651-AFFA-3CF1F4D8EE79}/1.0.0.7/stable/Nex_Audio_Importer_1.0.0.7_Stable.mpp', '282133', '', '', '', 1000000007000000000, 0, 'NexAudio import is a import plugin to Import audio files in library : \n\n\nupdate 1.0.0.7 : \n- add first found *.jpg for image tag\n- correct album year (no more 0 year)\n- add discnumber \n\nUpdate 1.0.0.5 : add option  :Don''t import Genre when updating : if you use NexTagGenre to tag your meedio songs genre , you don''t want NexAudioImport to overwite the tag genre, so tick it.\nUpdate 1.0.0.4 : Convert in meedio Artist Tag, Artist containing a Slash (/) into -  (AC/DC for example will be convert into AC-DC to avoid errors)\nDelete ArtistBio, BioLastChecked, BioProcessed and Thumbnails tags (if exist) when the Artist name has changed when REimporting.\nCorrection of some bugs.\n\n\nUpdate 1.0.0.3 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedio plugins\nUpdate 1.0.0.2 : change select folder in folderlist. Bugs corrections with managing embed cover.\n\n\n\n\nDetail of the options :\n\n1 Import Parameters :\n------------------------\n\n- Folders containing audio files : path to audiofiles\n- File mask to include : *.wma,*.mp3,*.mp2,*.wav,*.ape,*.ogg,*.flac,*.mpc,*.m4a\n- Can normalize Artist,Title,Album name,Composer name,Genre : Capitalize first letter of each word, lower others. Correct bad chars in all this names\n- Don''t Import Genre when Updating : tick this if you don''t want Genre found by NexTagGenre to be overwritten when updating. (NexTagGenre for Meedios will be released later)\n\n\n\n2 Cover Options : \n-----------------\n\n- Which Picture import in Image Tag : \n		\n		- none\n		- Embed : if audio file contains embed cover, Image Tag is filled with full path of audiofile\n		- First .jpg found in directory : look for a JPG file in the directory, the first found is taken.\n		- folder.jpg\n		- Embed or <artist> - <title>.jpg  or <artist>.jpg  or folder.jpg (searched in this order)\n		\n		\n- Managing Audio File Embed Cover :\n		\n		- Do noting with embed cover\n    - force the copy of existing embed audiofile cover to the song directory as folder.jpg (overwriting it if exists)\n    - Force the copy of the folder.jpg located in the song directory to the audiofile (overwriting it if exists)\n    - copy existing embed audiofile cover to the song directory with a name like this ''<artist> - <title>.jpg''\n    - copy existing embed audiofile cover to the song directory with a name like this ''<artist>.jpg''\n    - if no folder.jpg copy existing embed audiofile cover to the song directory with a name like this ''<artist> - <title>.jpg''\n    - if no folder.jpg copy existing embed audiofile cover to the song directory with a name like this ''<artist>.jpg''\n    \n\n\n\n3 - Lyrics options (No Web Search) :\n------------------------------------\n\n- Import Lyrics in tag ? :\n\n			- Import <title> - <artist>.txt to Meedio Lyric Tag\n      - Import Embed Audio file lyrics to Meedio Lyric Tag\n      - Import Embed Audio file lyrics OR <title> - <artist>.txt to Meedio Lyric Tag\n      - Just update LyricsPath tag with path to <title> - <artist>.txt file"\n\n\n  \n4 - ArtistBio options (No Web Search)\n-------------------------------------\n\n- Import Artist Biography\n\n		- none : do nothing with bio\n    - Import existing <artist>.txt containing bio to ArtistBio Tag & update ArtistBioPath\n    - Just update ArtistBioPath tag with path to existing <artist>.txt file containing bio\n\n\n\n5 - Report :\n------------\n\n- List incomplete tagged songs in a file : Tick this to create a file (incomplete_tagged_songs.txt, and not_imported_songs.txt) containing songs  with no artist name and/or no title (songs with no title are not imported)\n- Already imported incomplete tagged songs : Tick this to create a file (meedio_incomplete_tagged_songs.txt) containing songs in your meedio library (already imported) with no artist name and/or no title\n- Incomplete tagged songs listing folder : Select the folder you would like to store the incomplete_tagged_songs.txt, not_imported_songs.txt and meedio_incomplete_tagged_songs.txt\n\n\n\n6 - Normalize Library without importing (skip previous choices)\n---------------------------------------------------------------\n\n- Normalize name in library without importing : Tick this to normalize in meedio library Artist, Title, Album name, Composer name, Genre : Capitalize first letter of each word, lower others. Lower location. No import\n\n\n\n7 - Delete Missing (skip previous choices) \n-------------------------------------------\n\n- Delete Missing : Delete in library non existent audio files', 'NexAudioImport', 'http://www.meedios.com/forum/viewtopic.php?t=4728', '', '1.0.0.0', '1.0.0.7', '0', '1', 99, 976, 0, 0, 0, 0, '01263e4051ff34d4cd19043c6fa6dcb0', 'FALSE'),
(1696, '{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', 'NexLyrics Importer', 'Import Lyrics from Lyrics website and save it in lyrics tags or lyrics .txt files', '', 'Import', 'None', 'Freeware', 'Stable', '2009-08-27 01:55:46', '1.0.1.1', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone May 2009', '', 'plugins/{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}/1.0.1.1/stable/NexLyrics_Importer_1.0.1.1_Stable.mpp', '121943', '', '', '', 1000001001000000000, 0, 'Browse your Music Library and Import Lyrics from Lyrics websites :\nfr.lyrics-copy.com\nlyricwiki.org\nSave the lyrics in lyrics tags or lyrics .txt files.\n\nTo import Audio file you can use NexAudioImport plugin.\n\nUse the same tags as Meelyrics importer : MDI-Lastsearch, Lyrics, Lyrics-Processed, Lyrics-Lastchecked.\nYou can only processed the non processed files, specifing how much you want (all , 25, 50, 100, 500 , 1000) to be processed, or re-processed the already processed files. \nYou can specified the day between imports : when a song is processed and not found on the website, the tag MDI-Lastsearch and Lyrics-Lastchecked is updated. So you can re-processed the non found lyrics older than the "day between imports"\n\nYou can import .txt files containing the lyrics (format : {title} - {artist}.txt) in the Lyrics tags. \nYou can export the lyrics tags in .txt files (format : {title} - {artist}.txt )\nThis two choices update the MDI-Lastsearch, Lyrics-Lastchecked and Lyrics-Processed tags.\n\nYou can empty the lyrics tags (if you want to force meelyrics plugin to read the .txt files)\n\nupdate : 1.0.1.1 : bugs with only import TXT\nupdate : 1.0.0.9 : Manage artistname  with "feat, feat., ft., ft, with, and , avec , et" in artist name to increase chance of Lyrics\nUpdate : 1.0.0.8 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedios plugins\nUpdate : 1.0.0.7 :Add a readme.txt. Correct a bug when no title in a song. Correct badchar & in some lyrics. No more use of ILMerge, I put taglib-sharp.lib as assembly. If bug encoutered with assembly, please delete all reference of taglib-sharp*.dll in meedio\\assemblies directory and reinstall plugin. \nUpdate : 1.0.0.6 :Export Embed Mp3 Lyrics to Tag or File. Delete Missing option. taglib-sharp.dll upgraded to 2.0.3.1 to correct many bugs.\nUpdate : 1.0.0.5 :Switch from Audiogenie2 to Taglib-sharp librray. Add the Lyrics-Lastchecked tags like in meelyrics importer.\nUpdate : 1.0.0.4 :Embed lyrics in MP3, Speed Up, and Bugs corrections\nUpdate : 1.0.0.3 :Bugs with the ALL options corrected.\nUpdate : 1.0.0.2 :Create a report file for all songs without lyrics Add detection of some German Chars.\nUpdate : 1.0.0.1 :Process songs with bad characters in lyrics tags : Processed lyrics in library wich contains bad characters in lyrics tags.\n\n\nDetails of the menu : \n\n1 - Web Import Required :\n\n- Process all songs :  process all song even already processed song. You can specify a "Number max of lyrics to import" in the option.\n- Process song without lyrics : process song without lyrics processed or when the lastsearch is > of the "check Days Between Imports". You can specify a "Number max of lyrics to import" and "check Days Between Imports" in the option.\n- Process song with bad char in Lyric Tag : process song containing bad chars in meedio lyrics tag. You can specify a "Number max of lyrics to import" and "check Days Between Imports" in the option.\n\n\n\n2 - Options \n\n- Update/Create lyrics tag : Lyrics found are copied in the meedio Lyrics tag.\n- Update/Create .TXT lyrics files : Lyrics found are copied in a file called {title} - {artist}.txt in the same directory as the song.\n- Embed Lyrics in MP3 : Lyrics found are copied in the audio file.\n- Days Between Imports (-1 to reimport all) : Days before reimport lyrics for non processed files. Check the lyrics-Lastchecked. If today-lyrics-lastchecked > "Days Between Imports" then the file will be processed.\n- Number max of lyrics to import (0 for all) : Number of files you want to process at once.\n\n\n3 - No Web Import \nWhen you tick one of this choices, choices in menu #1 and #2 are disabled.\n\n- Only Erase Lyrics Tags content : browse your meedio library and erase the content of the meedio lyrics tag.\n- Only import .TXT in Tag : only import .TXT file in the meedio lyrics tag without searching on the web site. You can tick the "Embed lyrics in mp3" of menu 2 for this choice.\n- Only import Embed MP3 Lyric in Tag : browse your meedio library and copy Embed lyrics from the Audio file to the meedio lyrics tag.\n- Only export Tag in .TXT : browse your meedio library and export the meedio lyrics tag in a file called {title} - {artist}.txt\n\n\n4 - Embed MP3 Lyrics \nWhen you tick one of this choices, choices in menu #1 #2 and #3 are disabled.\n\n- write_ALL_lyrics_mp3 : browse the whole meedio library and Write lyrics in the MP3 file. NexLyrics search for lyrics in the mp3 file, correcting on the fly, if bad char are present, or in the meedio lyrics tag , and finally in the {title} - {artist}.txt file.\n- erase_ALL_lyrics_mp3 : browse the whole meedio library and erase the lyrics in the MP3 file.\n\n\n5 - Report \nWhen you tick one of this choices, choices in menu #1 #2 #3 and #4 are disabled.\n\n- List all songs with no lyrics in a file :  list in a file (lyrics_not_found.txt) the songs with no meedio lyrics tag, or with no {title} - {artist}.txt file\n\n\n\n6 - Delete Missing\nWhen you tick one of this choices, choices in menu #1 #2 #3 #4 and #5 are disabled.\n\n- Delete Missing : Browse your whole meedio music library and delete record when the corresponding audio file doesn''t exist anymore.', 'NexLyrics', 'http://www.meedios.com/forum/viewtopic.php?t=4683', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id={FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', '1.0.0.0', '1.0.1.0', '0', '1', 224, 1494, 0, 0, 0, 0, '0a58ba6cfe5d8d8374e764c8e9501939', 'FALSE');
INSERT INTO `plugins` (`plugin_key`, `plugin_ID`, `plugin_Name`, `plugin_ShortDescription`, `plugin_LongDescription`, `plugin_Type`, `plugin_ModuleType`, `plugin_Licence`, `plugin_State`, `plugin_Date`, `plugin_Version`, `plugin_Author`, `plugin_AuthorEmail`, `profil_id`, `plugin_Copyright`, `plugin_SupportLink`, `plugin_DownloadLink`, `plugin_DownloadSize`, `plugin_DonationLink`, `plugin_SourceLink`, `plugin_DocumentationFile`, `plugin_VersionValue`, `plugin_Current`, `plugin_DocumentText`, `plugin_DestinationFolder`, `plugin_Site`, `plugin_DirectDownloadURL`, `plugin_MinRequiredVersion`, `plugin_MaxRequiredVersion`, `plugin_IsDotNET`, `plugin_IsDotNETSimple`, `plugin_DownloadCount`, `plugin_DownloadCountTotal`, `plugin_VoteCount`, `plugin_VoteCountTotal`, `plugin_PopularityCount`, `plugin_PopularityCountTotal`, `plugin_hash`, `plugin_ReviewFlag`) VALUES
(1697, '{0F8B7BD3-AD0E-4651-AFFA-3CF1F4D8EE79}', 'Nex Audio Importer', 'Import Audio File in library, cover , and lyrics', '', 'Import', 'None', 'Freeware', 'Stable', '2009-08-28 12:56:13', '1.0.0.8', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone May 2009', '', 'plugins/{0F8B7BD3-AD0E-4651-AFFA-3CF1F4D8EE79}/1.0.0.8/stable/Nex_Audio_Importer_1.0.0.8_Stable.mpp', '284089', '', '', '', 1000000008000000000, 1, 'NexAudio import is a import plugin to Import audio files in library : \n\n\nupdate 1.0.0.8 :\n- Add AlbumArtist Tag\n- speed up new file checking : This way already existing files in library are not checked. Usefull for speeding up check of new file, when old files have not been modified. \n- add a debug.log option. \n- correct track (no more 0 track)\n- handle discnumber better\n- some minor bugs corrected\n\nupdate 1.0.0.7 : \n- add first found *.jpg for image tag\n- correct album year (no more 0 year)\n- add discnumber \n\nUpdate 1.0.0.5 : add option  :Don''t import Genre when updating : if you use NexTagGenre to tag your meedio songs genre , you don''t want NexAudioImport to overwite the tag genre, so tick it.\nUpdate 1.0.0.4 : Convert in meedio Artist Tag, Artist containing a Slash (/) into -  (AC/DC for example will be convert into AC-DC to avoid errors)\nDelete ArtistBio, BioLastChecked, BioProcessed and Thumbnails tags (if exist) when the Artist name has changed when REimporting.\nCorrection of some bugs.\n\n\nUpdate 1.0.0.3 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedio plugins\nUpdate 1.0.0.2 : change select folder in folderlist. Bugs corrections with managing embed cover.\n\n\n\n\nDetail of the options :\n\n1 Import Parameters :\n------------------------\n\n- Folders containing audio files : path to audiofiles\n- File mask to include : *.wma,*.mp3,*.mp2,*.wav,*.ape,*.ogg,*.flac,*.mpc,*.m4a\n- Can normalize Artist,Title,Album name,Composer name,Genre : Capitalize first letter of each word, lower others. Correct bad chars in all this names\n- Don''t Import Genre when Updating : tick this if you don''t want Genre found by NexTagGenre to be overwritten when updating. (NexTagGenre for Meedios will be released later)\n- Speed up new files checking : tick this to speed new files checking. This way already existing files in library are not checked anymore. Usefull for speeding up check of new file, when old files have not been modified. \n\n\n\n2 Cover Options : \n-----------------\n\n- Which Picture import in Image Tag : \n		\n		- none\n		- Embed : if audio file contains embed cover, Image Tag is filled with full path of audiofile\n		- First .jpg found in directory : look for a JPG file in the directory, the first found is taken.\n		- folder.jpg\n		- Embed or <artist> - <title>.jpg  or <artist>.jpg  or folder.jpg (searched in this order)\n		\n		\n- Managing Audio File Embed Cover :\n		\n		- Do noting with embed cover\n    - force the copy of existing embed audiofile cover to the song directory as folder.jpg (overwriting it if exists)\n    - Force the copy of the folder.jpg located in the song directory to the audiofile (overwriting it if exists)\n    - copy existing embed audiofile cover to the song directory with a name like this ''<artist> - <title>.jpg''\n    - copy existing embed audiofile cover to the song directory with a name like this ''<artist>.jpg''\n    - if no folder.jpg copy existing embed audiofile cover to the song directory with a name like this ''<artist> - <title>.jpg''\n    - if no folder.jpg copy existing embed audiofile cover to the song directory with a name like this ''<artist>.jpg''\n    \n\n\n\n3 - Lyrics options (No Web Search) :\n------------------------------------\n\n- Import Lyrics in tag ? :\n\n			- Import <title> - <artist>.txt to Meedio Lyric Tag\n      - Import Embed Audio file lyrics to Meedio Lyric Tag\n      - Import Embed Audio file lyrics OR <title> - <artist>.txt to Meedio Lyric Tag\n      - Just update LyricsPath tag with path to <title> - <artist>.txt file"\n\n\n  \n4 - ArtistBio options (No Web Search)\n-------------------------------------\n\n- Import Artist Biography\n\n		- none : do nothing with bio\n    - Import existing <artist>.txt containing bio to ArtistBio Tag & update ArtistBioPath\n    - Just update ArtistBioPath tag with path to existing <artist>.txt file containing bio\n\n\n\n5 - Report :\n------------\n\n- List incomplete tagged songs in a file : Tick this to create a file (incomplete_tagged_songs.txt, and not_imported_songs.txt) containing songs  with no artist name and/or no title (songs with no title are not imported)\n- Debug Log : Tick this to create a debug log (created in the ''Incomplete tagged songs listing folder''\n- Already imported incomplete tagged songs : Tick this to create a file (meedio_incomplete_tagged_songs.txt) containing songs in your meedio library (already imported) with no artist name and/or no title\n- Incomplete tagged songs listing or debug log folder : Select the folder you would like to store the incomplete_tagged_songs.txt, not_imported_songs.txt and meedio_incomplete_tagged_songs.txt. Used for storing debug.log too.\n\n\n\n6 - Normalize Library without importing (skip previous choices)\n---------------------------------------------------------------\n\n- Normalize name in library without importing : Tick this to normalize in meedio library Artist, Title, Album name, Composer name, Genre : Capitalize first letter of each word, lower others. Lower location. No import\n\n\n\n7 - Delete Missing (skip previous choices) \n-------------------------------------------\n\n- Delete Missing : Delete in library non existent audio files', 'NexAudioImport', 'http://www.meedios.com/forum/viewtopic.php?t=4728', '', '1.0.0.0', '1.0.0.8', '0', '1', 316, 976, 0, 0, 0, 0, 'e4514367f6e34cd5c2fe663b6b1a46ba', 'FALSE'),
(1698, '{01E3628A-29AF-4C2A-8234-C5CB71849E16}', 'MediaFairy', 'An automated media importer and updater which aims to provide a complete solution for Meedio users to easily import and acquire meta-info for their media collections.', '', 'Import', 'None', 'Donationware', 'Beta', '2009-08-30 16:29:04', '0.4.9', 'Skamagkis Stavros', 'stavros_sk@ownmail.net', 'enthalpient', '2008 Skamagkis Stavros', '', 'plugins/{01E3628A-29AF-4C2A-8234-C5CB71849E16}/0.4.9/beta/MediaFairy_0.4.9_Beta.mpp', '6081344', '', '', '', 4009000000000000, 1, 'For release notes, usage instructions, bug reports or suggestions, please refer to the plugin''s thread on MeediOS forum:\n\nhttp://www.meedios.com/forum/viewtopic.php?t=3912', 'MediaFairy', 'http://meedios.com/OpenMAID/', 'http://meedios.com/OpenMAID/detail.php?plugin_id={01E3628A-29AF-4C2A-8234-C5CB71849E16}', '0.1', '1.0', '0', '1', 732, 3541, 0, 0, 0, 0, 'cda56f6c0695c48d86b066d17cb5bf29', 'FALSE'),
(1699, '{DE06955B-A283-4123-873E-F1F6F2FDB5A6}', 'MeeScores', 'ESPN on Demand, Videos, News Scores!', '', 'Module', 'None', 'Donationware', 'Stable', '2009-09-07 18:35:27', '0.7.1.3', 'UFGrayMatter', 'banderson1311@gmail.com', 'banderson1311', 'paypal me!!', '', 'plugins/{DE06955B-A283-4123-873E-F1F6F2FDB5A6}/0.7.1.3/stable/MeeScores_0.7.1.3_Stable.mpp', '7720517', '', '', '', 7001003000000000, 0, '', 'MeeScores', 'http://www.meedios.com/forum/viewtopic.php?p=2399', '', '', '', '0', '1', 219, 3645, 0, 0, 0, 0, 'e4c57389a32ecb97c6142d596e7086e6', 'FALSE'),
(1700, '{FF02D979-6159-473E-8B2F-76D09C254E39}', 'NexArtistBiography', 'Attempt to retrieve Artist Biography & Thumbnails image', '', 'Import', 'None', 'Freeware', 'Stable', '2009-09-24 10:45:31', '1.0.0.9', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone June 2009', '', 'plugins/{FF02D979-6159-473E-8B2F-76D09C254E39}/1.0.0.9/stable/NexArtistBiography_1.0.0.9_Stable.mpp', '14066', '', '', '', 1000000009000000000, 1, 'NexArtistBiography is a import plugin for meedio.\n\nNexArtistBiography attempts to retrieve on the net the Biography of the Artist and store it in "ArtistBio" Tag.\nHe can retrieve  and store an Artist Image and store it on a folder , and filled the "Thumbnails" Tag with the path of the image file.\n\nMaybe usefull for Theme Maker, if they want to include on Nowplaying.screen , the Artist Biography (ArtistBio) & Artist Image (Thumbnails) . \nThumbnails tag contains  the path to the Artist Image file.\n\nupdate 1.0.0.9 : Add Deutsch, Espanol, Italiano bio language\nupdate 1.0.0.8 : Manage artistname  with "feat, feat., ft., ft, with, and , avec , et" in artist name to increase chance of finding bio & Image\nupdate 1.0.0.7 : Option : Save only square format image Thumbnails\nupdate 1.0.0.6 : Thumbnails are now saved in meediodata\\music\\fanarts\\thumbnails like this artistname.jpg\nupdate 1.0.0.5 : correction of bugs : Bugs with artist Bio & thumbnail.\nupdate 1.0.0.4 : correction of bugs : Bugs with artist thumbnail.\nupdate 1.0.0.3 : correction of bugs : disable update of already existing thumbnails.\n\n\nDetail of the options :\n\nOptions:\n--------\n\n- Skip processed Artist Biography : Songs processed by NexArtistBiography have a "BioProcessed" tag filled with ''---processed ---'' .\nSo you can bypass the already processed songs in the next import.\n\n\n- Days Between recheck : Number of days between attempts to check Biography for non already processed Bio (BioProcessed <> "---processed---")\n\n\n\nArtist Image : \n--------------\n\n- Save Artist Image : Save Artist Image in meedio tag: ArtistImage\n- Save only square format image : Only square format image are saved, other format are skipped : Height/Width ratio must be between 1,2 and 0,8 to be considered as square.\n\n\n\nBiography :\n-----------\n\n- Langage for biography : Choose the display langage of the artist biography\n- Show the line ''Biography of Artist'' : Choose if you want the line ''Biography of Artist'' in the first line of Artist Bio', 'NexArtistBiography', '', '', '1.0.0.0', '1.0.0.9', '0', '1', 311, 1112, 0, 0, 0, 0, '15ade81c9ad5a11576ff12785e63b86a', 'FALSE'),
(1701, '{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', 'NexLyrics Importer', 'Import Lyrics from Lyrics website and save it in lyrics tags or lyrics .txt files', '', 'Import', 'None', 'Freeware', 'Stable', '2009-11-19 10:28:08', '1.0.1.2', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone May 2009', '', 'plugins/{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}/1.0.1.2/stable/NexLyrics_Importer_1.0.1.2_Stable.mpp', '121833', '', '', '', 1000001002000000000, 0, 'Browse your Music Library and Import Lyrics from Lyrics websites :\nfr.lyrics-copy.com\nlyricwiki.org\nSave the lyrics in lyrics tags or lyrics .txt files.\n\nTo import Audio file you can use NexAudioImport plugin.\n\nUse the same tags as Meelyrics importer : MDI-Lastsearch, Lyrics, Lyrics-Processed, Lyrics-Lastchecked.\nYou can only processed the non processed files, specifing how much you want (all , 25, 50, 100, 500 , 1000) to be processed, or re-processed the already processed files. \nYou can specified the day between imports : when a song is processed and not found on the website, the tag MDI-Lastsearch and Lyrics-Lastchecked is updated. So you can re-processed the non found lyrics older than the "day between imports"\n\nYou can import .txt files containing the lyrics (format : {title} - {artist}.txt) in the Lyrics tags. \nYou can export the lyrics tags in .txt files (format : {title} - {artist}.txt )\nThis two choices update the MDI-Lastsearch, Lyrics-Lastchecked and Lyrics-Processed tags.\n\nYou can empty the lyrics tags (if you want to force meelyrics plugin to read the .txt files)\n\nupdate : 1.0.1.2 : take in charge new lyricwiki site format;  bypass characters between () in titlename \nupdate : 1.0.1.1 : bugs with only import TXT\nupdate : 1.0.0.9 : Manage artistname  with "feat, feat., ft., ft, with, and , avec , et" in artist name to increase chance of Lyrics\nUpdate : 1.0.0.8 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedios plugins\nUpdate : 1.0.0.7 :A