(1707, '{B6D3B945-A708-45E8-8022-F82D9D1130E8}', 'meeTVshowsImporter', 'Import TV Series and Episode Information', '', 'Import', 'None', 'Freeware', 'Stable', '2009-12-04 21:29:53', '4.0.2.0', 'walts81, additional changes from 4.0.2 by yardape8000', 'joshwalters@gmail.com', 'yardape8000', '2008 - 2009', '', 'plugins/{B6D3B945-A708-45E8-8022-F82D9D1130E8}/4.0.2.0/stable/meeTVshowsImporter_4.0.2.0_Stable.mpp', '167313', '', '', '', 4000002000000000000, 0, '1) Add importer to your TV Shows library\n2) Set custom settings\n3) Run the importer\n\n----------------------------------------\n\nThe following fields can be added to your TV library if needed.\n\nNeverImport  - put an ''x'' in this field if you never want this episode data updated.\n\nTVDB_seasonNum  - use to override the SeasonNumber field when importing data while leaving the SeasonNumber field as is.\n\nTVDB_epNum  - use to override the EpisodeNumber field when importing data while leaving the EpisodeNumber field as is.\n\n----------------------------------------\n\n**NOTE**\nThis plugin creates 2 new libraries\n\n"meeTVshows-Series" - If running this importer for the first time, this new library will NOT appear until Meedio Config has been closed and re-started. All Episode data will be added to the library that this import is run from.\n\n"meeTVshows-Seasons" - a temporary library that will always be emptied when this import is finished running.', 'meeTVshowsImporter', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id={B6D3B945-A708-45E8-8022-F82D9D1130E8}&search=MeeTVShows', 'http://www.meedios.com/OpenMAID/dl.php?plugin_id={B6D3B945-A708-45E8-8022-F82D9D1130E8}', '1.41', '1.41', '0', '1', 40, 9128, 0, 0, 0, 0, 'f5f515216fe0ef56401439cf106848d8', 'FALSE'),
