(1718, '{B6D3B945-A708-45E8-8022-F82D9D1130E8}', 'meeTVshowsImporter', 'Import TV Series and Episode Information', '', 'Import', 'None', 'Freeware', 'Stable', '2010-03-11 21:28:02', '4.0.2.4', 'walts81', 'joshwalters@gmail.com', 'yardape8000', '2008 - 2010', '', 'plugins/{B6D3B945-A708-45E8-8022-F82D9D1130E8}/4.0.2.4/stable/meeTVshowsImporter_4.0.2.4_Stable.mpp', '161299', '', '', '', 4000002004000000000, 1, '1) Add importer to your TV Shows library\n2) Set custom settings\n3) Run the importer\n\n----------------------------------------\n\nThe following fields can be added to your TV library if needed.\n\nNeverImport - put an ''x'' in this field if you never want this episode data updated.\n\nTVDB_seasonNum - use to override the SeasonNumber field when importing data while leaving the SeasonNumber field as is.\n\nTVDB_epNum - use to override the EpisodeNumber field when importing data while leaving the EpisodeNumber field as is.\n\n----------------------------------------\n\n**NOTE**\nThis plugin creates 2 new libraries\n\n"meeTVshows-Series" - If running this importer for the first time, this new library will NOT appear until Meedio Config has been closed and re-started. All Episode data will be added to the library that this import is run from.\n\n"meeTVshows-Seasons" - a temporary library that will always be emptied when this import is finished running.\n\nRead history.txt in the plugin directory for further info.', 'meeTVshowsImporter', 'http://www.meedios.com/OpenMAID', '', '1.41', '1.41', '0', '1', 210, 9128, 0, 0, 0, 0, '837f5c0f75d811c6682e697ffb403833', 'FALSE'),
(1719, '{B39F5A62-C149-4D8B-8A99-893A954D9A08}', 'meeTVshowsModule', 'Watch TV Shows', '', 'Module', 'None', 'Freeware', 'Stable', '2010-03-11 21:35:23', '4.0.2.3', 'walts81', 'joshwalters@gmail.com', 'yardape8000', '2008-2010', '', 'plugins/{B39F5A62-C149-4D8B-8A99-893A954D9A08}/4.0.2.3/stable/meeTVshowsModule_4.0.2.3_Stable.mpp', '402702', '', '', '', 4000002003000000000, 0, '1) Add module to menu in Meedio config\n\n2) Set episodes section\n\n3) Set Field Names (according to your episodes section field names)\n\n4) Set screen preferences\n\nRead history.txt in the plugin directory for further info.', 'meeTVshowsModule', 'http://www.meedios.com/OpenMAID', '', '1.41', '1.41', '0', '1', 54, 8909, 0, 0, 0, 0, '422e084bfe6c93f8f4ed72443f292830', 'FALSE'),
(1720, '{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', 'NexLyrics Importer', 'Import Lyrics from Lyrics website and save it in lyrics tags or lyrics .txt files', '', 'Import', 'None', 'Freeware', 'Stable', '2010-03-13 13:33:17', '1.0.1.6', 'Nexusone', 'nexusone@wanadoo.fr', 'nexusone', 'Nexusone May 2009', '', 'plugins/{FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}/1.0.1.6/stable/NexLyrics_Importer_1.0.1.6_Stable.mpp', '249358', '', '', '', 1000001006000000000, 1, 'Browse your Music Library and Import Lyrics from Lyrics websites :\nfr.lyrics-copy.com\nlyricwiki.org\nSave the lyrics in lyrics tags or lyrics .txt files.\n\nTo import Audio file you can use NexAudioImport plugin.\n\nUse the same tags as Meelyrics importer : MDI-Lastsearch, Lyrics, Lyrics-Processed, Lyrics-Lastchecked.\nYou can only processed the non processed files, specifing how much you want (all , 25, 50, 100, 500 , 1000) to be processed, or re-processed the already processed files. \nYou can specified the day between imports : when a song is processed and not found on the website, the tag MDI-Lastsearch and Lyrics-Lastchecked is updated. So you can re-processed the non found lyrics older than the "day between imports"\n\nYou can import .txt files containing the lyrics (format : {title} - {artist}.txt) in the Lyrics tags. \nYou can export the lyrics tags in .txt files (format : {title} - {artist}.txt )\nThis two choices update the MDI-Lastsearch, Lyrics-Lastchecked and Lyrics-Processed tags.\n\nYou can empty the lyrics tags (if you want to force meelyrics plugin to read the .txt files)\n\nupdate : 1.0.1.3 : bug with first character of song corrected\nupdate : 1.0.1.2 : take in charge new lyricwiki site format;  bypass characters between () in titlename \nupdate : 1.0.1.1 : bugs with only import TXT\nupdate : 1.0.0.9 : Manage artistname  with "feat, feat., ft., ft, with, and , avec , et" in artist name to increase chance of Lyrics\nUpdate : 1.0.0.8 : corrections of some bugs. Back to Taglib-sharp.dll ver 2.0.2.0 to avoid conflict with other meedios plugins\nUpdate : 1.0.0.7 :Add a readme.txt. Correct a bug when no title in a song. Correct badchar & in some lyrics. No more use of ILMerge, I put taglib-sharp.lib as assembly. If bug encoutered with assembly, please delete all reference of taglib-sharp*.dll in meedio\\assemblies directory and reinstall plugin. \nUpdate : 1.0.0.6 :Export Embed Mp3 Lyrics to Tag or File. Delete Missing option. taglib-sharp.dll upgraded to 2.0.3.1 to correct many bugs.\nUpdate : 1.0.0.5 :Switch from Audiogenie2 to Taglib-sharp librray. Add the Lyrics-Lastchecked tags like in meelyrics importer.\nUpdate : 1.0.0.4 :Embed lyrics in MP3, Speed Up, and Bugs corrections\nUpdate : 1.0.0.3 :Bugs with the ALL options corrected.\nUpdate : 1.0.0.2 :Create a report file for all songs without lyrics Add detection of some German Chars.\nUpdate : 1.0.0.1 :Process songs with bad characters in lyrics tags : Processed lyrics in library wich contains bad characters in lyrics tags.\n\n\nDetails of the menu : \n\n1 - Web Import Required :\n\n- Process all songs :  process all song even already processed song. You can specify a "Number max of lyrics to import" in the option.\n- Process song without lyrics : process song without lyrics processed or when the lastsearch is > of the "check Days Between Imports". You can specify a "Number max of lyrics to import" and "check Days Between Imports" in the option.\n- Process song with bad char in Lyric Tag : process song containing bad chars in meedio lyrics tag. You can specify a "Number max of lyrics to import" and "check Days Between Imports" in the option.\n\n\n\n2 - Options \n\n- Update/Create lyrics tag : Lyrics found are copied in the meedio Lyrics tag.\n- Update/Create .TXT lyrics files : Lyrics found are copied in a file called {title} - {artist}.txt in the same directory as the song.\n- Embed Lyrics in MP3 : Lyrics found are copied in the audio file.\n- Days Between Imports (-1 to reimport all) : Days before reimport lyrics for non processed files. Check the lyrics-Lastchecked. If today-lyrics-lastchecked > "Days Between Imports" then the file will be processed.\n- Number max of lyrics to import (0 for all) : Number of files you want to process at once.\n\n\n3 - No Web Import \nWhen you tick one of this choices, choices in menu #1 and #2 are disabled.\n\n- Only Erase Lyrics Tags content : browse your meedio library and erase the content of the meedio lyrics tag.\n- Only import .TXT in Tag : only import .TXT file in the meedio lyrics tag without searching on the web site. You can tick the "Embed lyrics in mp3" of menu 2 for this choice.\n- Only import Embed MP3 Lyric in Tag : browse your meedio library and copy Embed lyrics from the Audio file to the meedio lyrics tag.\n- Only export Tag in .TXT : browse your meedio library and export the meedio lyrics tag in a file called {title} - {artist}.txt\n\n\n4 - Embed MP3 Lyrics \nWhen you tick one of this choices, choices in menu #1 #2 and #3 are disabled.\n\n- write_ALL_lyrics_mp3 : browse the whole meedio library and Write lyrics in the MP3 file. NexLyrics search for lyrics in the mp3 file, correcting on the fly, if bad char are present, or in the meedio lyrics tag , and finally in the {title} - {artist}.txt file.\n- erase_ALL_lyrics_mp3 : browse the whole meedio library and erase the lyrics in the MP3 file.\n\n\n5 - Report \nWhen you tick one of this choices, choices in menu #1 #2 #3 and #4 are disabled.\n\n- List all songs with no lyrics in a file :  list in a file (lyrics_not_found.txt) the songs with no meedio lyrics tag, or with no {title} - {artist}.txt file\n\n\n\n6 - Delete Missing\nWhen you tick one of this choices, choices in menu #1 #2 #3 #4 and #5 are disabled.\n\n- Delete Missing : Browse your whole meedio music library and delete record when the corresponding audio file doesn''t exist anymore.', 'NexLyrics', 'http://www.meedios.com/forum/viewtopic.php?t=4683', 'http://www.meedios.com/OpenMAID/detail.php?plugin_id={FF2F65BE-3934-45A0-BA10-6945A9A3CDD2}', '1.0.0.0', '1.0.1.6', '0', '1', 120, 1494, 0, 0, 0, 0, '19a60fecc9216e68585c9f1adc80b1f0', 'FALSE'),
(1721, '{B39F5A62-C149-4D8B-8A99-893A954D9A08}', 'meeTVshowsModule', 'Watch TV Shows', '', 'Module', 'None', 'Freeware', 'Stable', '2010-03-28 17:26:15', '4.0.3.0', 'walts81', 'joshwalters@gmail.com', 'yardape8000', '2008-2010', '', 'plugins/{B39F5A62-C149-4D8B-8A99-893A954D9A08}/4.0.3.0/stable/meeTVshowsModule_4.0.3.0_Stable.mpp', '405111', '', '', '', 4000003000000000000, 1, '1) Add module to menu in Meedio config\n\n2) Set episodes section\n\n3) Set Field Names (according to your episodes section field names)\n\n4) Set screen preferences\n\nRead history.txt in the plugin directory for further info.', 'meeTVshowsModule', 'http://www.meedios.com/OpenMAID', '', '1.41', '1.41', '0', '1', 191, 8909, 0, 0, 0, 0, '0dde1dbb9b7e2abd739ac264dbb1ba8b', 'FALSE');
